INSERT INTO `events` VALUES (1,1,'14019','31998','Community Data Clinic','Community survey design','Jorge Rojas','jorgerojasa@gmail.com','1234567890','Free Food Packages From University Place Christian Church','Are you feeling bored at home? Support our local hospitals for making face masks from clothes pieces! We have lessons teaching you how to make useful masks from unwanted clothes. There will be five lectures in total and you can attend any one you want!','1','None','None','Every Tuesday and Thursday 6:00-8:00','/uploads/images/test1.png','4','2021-02-14 02:00:00','2020-02-14 04:00:00','0000-00-00 00:00:00',NULL),(3,3,'14019','31997','Community Data Clinic','Design Justice','Jorge Rojas','jorgerojasa@gmail.com','1234567890','Make Masks for Your Local Community Hospitals','test 3','1','None','None','Everyday 8pm-10pm','/uploads/images/test3.png','1,2,3','2020-12-22 04:00:00','2020-12-22 06:00:00','2020-12-04 06:50:29','2020-12-04 06:50:29'),(4,4,'2169','5252','Family Service of Champaign County','General Counseling Services','Dr. Peter L. Patton','ppatton@familyservicecc.org','217-352-0099 ext. 115','Mindfulness Training and Other Relaxation Techniques for Individuals and Self-Help Groups','This workshop is geared toward Self-Help Group Leaders and members, Health Care Workers, Counselors, Nurses, Social Workers, Clergy, Case Managers, and any other professional or community members interested in learning Mindfulness Training and other relaxation techniques to help their clients or groups. Mindfulness and other calming techniques can help clients and group members reduce their anxiety and stress levels. The workshop will cover such topics as Biofeedback, Mindfulness, Breathing, Simple Meditation, Guided Imagery, and EFT techniques. ','2170','RSVP required. We will send you an event link once you\'re registered.','None','2/20/2021 8:30 AM - 12:00 PM CST','/uploads/images/test4.jpg','263','2021-04-23 15:30:00','2021-04-23 18:00:00','2020-12-18 02:55:21','2020-12-18 02:55:21'),(5,5,'7418','14199','Cunningham Township Supervisor’s Office','General Relief',NULL,NULL,NULL,'Tienda Festiva Gratuita ¡Día de Regalo!','Tendremos abrigos, gorros, bufandas y guantes que se pueden llevar gratis para mantenerse caliente durante el invierno. Patrocinado por Bucket Brigade, Cunningham Township Supervisor\'s Office y Common Ground Food Coop.','14017','Ninguno. El lugar es detrás de Common Ground Food Co-op','Ninguno','2/20/2020 1:00 PM - 3:00 PM CST','/uploads/images/test5.jpg',NULL,'2020-02-20 20:00:00','2020-02-20 21:00:00','2020-12-18 03:26:10','2020-12-18 03:26:10'),(6,6,'10396',NULL,'Cunningham Children\'s Home',NULL,NULL,NULL,NULL,'Luminaries of Hope and Live Nativity','We celebrate and honor Judge Joseph and Mary Cunningham and are so thankful for their giving hearts and desire to provide a safe and nurturing environment for children in need. They are truly our lights of hope.\nHelp us celebrate them and bring the light of hope this Christmas season to the youth, adults and families we serve with a special event, Luminaries of Hope and Live Nativity!\nAlong with a live nativity, luminaries you purchase will be lit throughout our campus, from 6–8 p.m., December 5th, 12th and 19th. For a suggested donation of $5, the community is encouraged to drive through and enjoy this special event.\nWhen guests arrive, they will receive a program featuring the names of all who have purchased luminaries of hope and the names for whom they are honoring or memorializing.\nHelp us “light up” Cunningham’s campus with 777 Luminaries of Hope, representing each of the youth, adults and families we served this year.\nFor just $10, YOU CAN purchase a luminary, in honor or memory of someone special.\nPurchase your luminaries on our website at https://www.cunninghamhome.org/events/luminaries-hope or mail a check to P.O. Box 878, Urbana, IL 61803.\nSPECIAL THANKS TO OUR EVENT SPONSORS, THE AMBASSADORS OF HOPE: Area Wide Technologies; Commercial Builders, Inc; Davis Houk Mechanical; FastSigns; Mahomet Car Connection; Molina Healthcare; Napleton’s; Rector Construction; Target; UpClose Marketing','10397','None','None','2/19/2020 6:00 PM - 8:00 PM CST','/uploads/images/test6.jpg',NULL,'2020-02-20 02:00:00','2020-02-20 04:00:00','2020-12-18 03:55:50','2020-12-18 03:55:50'),(7,7,'7378','14040','Carle Foundation Hospital','Home Health Care','Four Osprey',NULL,'(217) 377-5358','Mobile Market - Mercado Móvil - Marché Mobile','A collaborative community service made possible by Carle and CU City Farms, the mobile market works to assess and fulfill food and educational needs in Champaign-Urbana’s most at-risk communities. Becoming an agency of the Eastern Illinois Foodbank in the summer of 2020, the CU City Farms Mobile Market will begin delivering donated food and products to communities with limited access to grocery stores and food pantries, while developing relationships in these communities to address other unmet needs. From neighborhoods to rural areas, the Mobile Market will help to alleviate food insecurity, particularly in this challenging world moment of COVID-19 pandemic. \r Mobile Market Sponsors: Community Foundation of East Central Illinois, Healthy Babies Bright Futures and the Mayors Innovation Project, Karin Maher Fund\r United Way of Champaign County. Image cortesy of https://www.fourosprey.org/mobile-market','14018','None','None','Every Thursday 9:00 AM - 1:00 PM CST','/uploads/images/test7.jpg','3','2021-04-30 16:00:00','2021-04-30 20:00:00','2020-12-18 04:34:08','2020-12-18 04:34:08'),(8,8,'7408','14165','Champaign County Regional Planning Commission','Comprehensive Job Assistance Centers','Career Educators','workNetservices@ccrpc.org','217-531-8282','Training and professional certifications available','Training and professional certifications are now available in several rewarding, high-growth fields. The RPC’s Workforce Development services are open to help you. Apply today at www.eciwork.net/apply or schedule an in-person appointment with one of our Career Educators','7409','Apply online at www.eciwork.net/apply','None','Anytime','/uploads/images/test8.png',NULL,'2020-12-17 18:00:00','2020-12-18 01:00:00','2020-12-18 05:06:10','2020-12-18 05:06:10'),(9,9,'833','31132','Rosecrance Central Illinois','Your Choice-Live Alcohol and Drug Awareness Program',NULL,NULL,NULL,'Wake Up Call: Virtual Event','The Wake Up Call presentation, a program of Your Choice, provides practical information on current drug trends, a walk-through of a teens\' bedroom with more than 50 red flags that could indicate substance abuse as well as proactive parenting strategies to keep your child substance free.\nThe presenters, both with lived experience, combine their personal stories, experience working with students and families, and things they wish they would\'ve known into an engaging, real and unique presentation. This presentation is a MUST SEE for parents, grandparents, teachers, community members and other adults who are influential in the lives of youth.\nRegister for this FREE virtual event at: \nhttps://us02web.zoom.us/.../731.../WN_Jk4Qd34yTKKh4GK8XgfFcQ\nThis event is hosted by Rosecrance and the McHenry County Mental Health Board.\nThis event will be a live virtual event that you can watch from the comfort of your own home. Attendees will remain anonymous during the event. No one except for the host will be able to see attendee name and the presentation platform does not allow attendees to turn on their cameras or microphones.',NULL,'Online: https://us02web.zoom.us/webinar/register/7316034029657/WN_Jk4Qd34yTKKh4GK8XgfFcQ','None','01/17/2021 7:00 PM - 8:30 PM','/uploads/images/test10.jpg',NULL,'0000-00-00 00:00:00','0000-00-00 00:00:00','2020-12-18 05:36:38','2020-12-18 05:36:38'),(12,12,'14014','32002','Community Data Clinic','information and referral * directory * human crisis','Champaign Resources Team','champaigncountyresources@gmail.com','Contact by email only','Info session Champaign County Resources','This is a new informative session about the Champaign County 2-1-1 Resources prototype. The session will focus on activate service provider\'s accounts, and modify their services on the database. This meeting is organized by Champaign County Mental Health and Developmental Disabilities Agencies Council.','1','Contact CCMHDDA','No fees',NULL,'/uploads/images/test13.png','1235612259797589','2021-04-27 16:00:00','2021-04-27 17:00:00','2021-04-03 08:00:03','2021-05-18 19:07:55'),(14,14,'14019','32002','Community Data Clinic','Champaign County Resources Website','Jorge Rojas-Alvarez','jorger3@illinois.edu','12174199645','NCSA Lighting Talk','Brief presentation about the year activities of Champaign County Resources','1','RSVP required','No fees',NULL,'/uploads/images/1618417795events_logo_15.jpg','','2021-04-15 18:00:00','2021-04-15 19:00:00','2021-04-14 23:29:55','2021-04-14 23:29:55'),(18,18,'7378','32002','Carle Foundation Hospital','information and referral * directory * human crisis','Four Osprey','patient.relations@carle.com','(217) 377-5358','Mobile Market - Mercado Móvil - Marché Mobile','A collaborative community service made possible by Carle and CU City Farms, the mobile market works to assess and fulfill food and educational needs in Champaign-Urbana’s most at-risk communities. Becoming an agency of the Eastern Illinois Foodbank in the summer of 2020, the CU City Farms Mobile Market will begin delivering donated food and products to communities with limited access to grocery stores and food pantries, while developing relationships in these communities to address other unmet needs. From neighborhoods to rural areas, the Mobile Market will help to alleviate food insecurity, particularly in this challenging world moment of COVID-19 pandemic.\r\nMobile Market Sponsors: Community Foundation of East Central Illinois, Healthy Babies Bright Futures and the Mayors Innovation Project, Karin Maher Fund\r\nUnited Way of Champaign County. Image corte