INSERT INTO `layouts` VALUES (1,'1594328932.png','CCR DEV',NULL,'<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Champaign County 2-1-1 Resources provides information about human services and service providers. The demo provides tools for increasing access to information (multilingual and smartphone friendly), fostering accountability of service’s information, and open presence of communities of users.\r\n\r\nThis demo is a research collaboration between </span></font></p><ul><li style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><a href=\"https://ccmhddbrds.org\" target=\"_blank\">Champaign County (Illinois) Mental Health Board (CCMHB) and Developmental Disabilities Board (CCDDB)</a></span></font></li><li style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><a href=\"https://www.communitydataclinic.com/\" target=\"_blank\">Community Data Clinic at iSchool and NCSA</a></span></font></li><li style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><a href=\"https://www.toi.org/township/champaign-county-cunningham-township/\" target=\"_blank\">Cunningham Township Supervisor’s Office</a></span></font></li><li style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><a href=\"https://www.pathcrisis.org/\" target=\"_blank\">PATH Crisis Center 2-1-1</a>.</span></font></li><li style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><a href=\"https://www.uwayhelps.org\" target=\"_blank\">United Way of Champaign County</a></span></font></li></ul><p style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">This demo implements <a href=\"https://openreferral.org/presenting-orservices-3-0-a-complete-laravel-based-open-referral-directory-solution/\" target=\"_blank\">Open Referral Services 3.0</a> open source initiative and meets Open Referral’s Human Service Data Standard (HSDS).</span></font><br></p>','<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The DC Community Resource Inventory is a project of the DC Community Resource Information Exchange (DC CoRIE) Initiative.&nbsp;</span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">Produced by the DCPCA, in partnership with the Open Referral Initiative, with technology development by Sarapis, this is a \'proof of concept\' of a functional Community Resource Inventory containing information about health, human, and social services available to DC residents in need.&nbsp;</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span id=\"docs-internal-guid-74dba194-7fff-5e13-40e1-13b1ea2fdb29\"><br></span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p>','/uploads/images/1595338162_part2.png','<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; text-align: center; white-space: pre-wrap;\">This website is a reference implementation for the underlying database. This database is also available via an Application Programming Interface, which can be accessed at our Developer Portal here.</span><br></p>','/uploads/images/1593798060_part3.png','<p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To suggest edits or additions to this directory, reach out to David Poms at the DCPCA.</span></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"text-align: left; margin-top: 0pt; margin-bottom: 0pt; color: rgb(117, 117, 117); font-family: Roboto, sans-serif; font-size: 14px; line-height: 1.38;\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To learn more about the Open Referral Initiative, reach out to <a href=\"mailto:Greg@openreferral.org\" target=\"_blank\">Greg Bloom</a>.</span></p>','/uploads/images/1593798060.png','Please register to manage the information of your organization',NULL,'Get help in Champaign County','Register','https://ccrdev.communitydataclinic.com/register','<p style=\"text-align: center; \"> CCR DEV | About this project</p>','1608227175_part1.jpg','CCR DEV','https://ccrdev.communitydataclinic.com','CCR DEV: https://ccrdev.communitydataclinic.com','0','1','0','#00bda7','#50aed3','#cc8b00','#ee2e31','#003db8','#cc8b00','#ffffff','#ffffff','#50c9ce',1,'South Dade Only','All Services','1577102338.png','1577102281.jpg','0','<p>Welcome! This is the login page.</p>','<p>Welcome! This is the register page. </p>',1,'Services (ex. larable-dev.sarapisorg)',0,0,0,0,0,NULL,'2021-06-22 06:13:35');
/*!40000 ALTER TABLE `layouts` ENABLE KEYS */;
