INSERT INTO `pages` VALUES (1,'Home','This is Home page','<p><br></p><p><br></p>','','0000-00-00 00:00:00','2019-12-23 15:20:00',NULL),(2,'About Champaign County 2-1-1 Resources','Champaign County 2-1-1 Resources','<div class=\"m_-1977661481779162877gmail-text-center\" style=\"text-align: center;\"><span id=\"docs-internal-guid-45367cd5-7fff-6623-79dd-1574b65bf19c\" style=\"\"><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><font face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Champaign County 2-1-1 Resources provides information about human services and service providers. The demo provides tools for increasing access to information (multilingual and smartphone friendly), fostering accountability of service’s information, and open presence of communities of users.\r\n\r\nThis demo is a research collaboration between the Champaign County Mental Health Board, Community Data Clinic at NCSA, Cunningham Township Supervisor’s Office, and PATH Crisis Center 2-1-1.\r\n\r\nThis demo implements Open Referral Services 3.0 open source initiative and meets Open Referral’s Human Service Data Standard (HSDS).</span></font><br></p></span></div>',NULL,'0000-00-00 00:00:00','2020-10-27 00:18:43',NULL),(3,'Feedback','This is Feedback page','<script src=\"https://static.airtable.com/js/embed/embed_snippet_v1.js\"></script><iframe class=\"airtable-embed airtable-dynamic-height\" src=\"https://airtable.com/embed/shrGardkjNsxKA6sO?backgroundColor=teal\" frameborder=\"0\" onmousewheel=\"\" width=\"100%\" height=\"1431\" style=\"background: transparent; border: 1px solid #ccc;\"></iframe>','','0000-00-00 00:00:00','0000-00-00 00:00:00',NULL),(4,'Google Analytics','This is Google Analytics Page','final','',NULL,'2020-07-15 17:29:30',NULL),(5,'Login/Register Page','This is Login/Register Page','<p style=\"text-align: center; \"><br class=\"Apple-interchange-newline\"></p>','','2019-10-15 19:35:22','2019-10-15 19:35:22',NULL);
