INSERT INTO `services` VALUES (1,21902,'Public Libraries','','10018','Public library serving the residents of Mahomet Township.','','','','',NULL,'','','','','','1','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(2,21904,'Recreational Activities/Sports','','10020','Parks and recreation department serving the residents of Rantoul.','','','','',NULL,'','','','','','2','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(3,21905,'Public Parks','','10020','Parks and recreation department serving the residents of Rantoul.','','','','',NULL,'','','','','','3','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(4,21907,'Home Rehabilitation Programs','','10022','Owner-Occupied Rehabilitation Programs and Grants:\r\n\r\nMinor Rehab Program - Under this program, a grant up to $6,000 is provided for code-related repairs.  Priority is given to violations that are of an emergency nature which threatens the health or safety of the occupants of the home.\r\n\r\nFull-Home Rehabilitation Program - Assistance up to $20,000 is available for major repair or renovation of homes which contain several code-related repairs or are in need of significant rehabilitation. The funds are placed in a 3-year forgivable mortgage on the home.\r\n\r\nRehabilitation work may also be completed to remove architectural barriers to the home.','','','','',NULL,'Call or walk-in for more information or for an application.','- Own home (rental properties are not eligible).\r\n- Home must be located within the Village of Rantoul.\r\n- Meet general requirements related to cost of construction, zoning, etc.\r\n- The sum of all liens and mortgages on home do not exceed 95% of home\'s value.\r\n- Priority will be given to households with a disabled family member and to households aged 62 and older.\r\n','','','1-person household: $38,950 per year; \r\n2-person: $44,500; \r\n3-person: $50,050; \r\n4-person: $55,600. \r\nCall for additional income guidelines for larger family sizes.','4','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(5,23773,'Home Maintenance and Minor Repair Services','','10022','Owner-Occupied Rehabilitation Programs and Grants:\r\n\r\nMinor Rehab Program - Under this program, a grant up to $6,000 is provided for code-related repairs.  Priority is given to violations that are of an emergency nature which threatens the health or safety of the occupants of the home.\r\n\r\nFull-Home Rehabilitation Program - Assistance up to $20,000 is available for major repair or renovation of homes which contain several code-related repairs or are in need of significant rehabilitation. The funds are placed in a 3-year forgivable mortgage on the home.\r\n\r\nRehabilitation work may also be completed to remove architectural barriers to the home.','','','','',NULL,'Call or walk-in for more information or for an application.','- Own home (rental properties are not eligible).\r\n- Home must be located within the Village of Rantoul.\r\n- Meet general requirements related to cost of construction, zoning, etc.\r\n- The sum of all liens and mortgages on home do not exceed 95% of home\'s value.\r\n- Priority will be given to households with a disabled family member and to households aged 62 and older.\r\n','','','1-person household: $38,950 per year; \r\n2-person: $44,500; \r\n3-person: $50,050; \r\n4-person: $55,600. \r\nCall for additional income guidelines for larger family sizes.','5','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(6,22138,'Extended Child Care','','10058','Afterschool program for school-aged children. Activities, food, and a computer lab are provided.','','','','',NULL,'By phone.','For persons under 18.','','','','6','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(7,22139,'Youth Enrichment Programs','','10058','Afterschool program for school-aged children. Activities, food, and a computer lab are provided.','','','','',NULL,'By phone.','For persons under 18.','','','','7','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(8,22140,'Food Pantries','Windsor Road Christian Church Food Pantry','10060','Food pantry is available. Can access once every 30 days.','','','','','832990803111047','Walk-in.','','','Photo ID.','','8','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(9,22168,'Colleges/Universities','','10063','State university located in Champaign-Urbana. Offers a range of programs at the bachelor, master, and doctoral levels.','','','','',NULL,'','','','','','9','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(10,22235,'Prescription Expense Assistance','MedAssist','10073','Staff assist low-income people of all ages to determine eligibility and assist in making application to patient assistance programs offered by pharmaceutical companies.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, Social Security card, Medicare card (if applicable), list of medications and dosages.','','10','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(11,22393,'Divorce Mediation','Divorce Mediation','10100','Mediators are trained in family dynamics, communication skills, and facilitative techniques to help family members resolve a dispute or decide important family issues.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','11','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(12,22394,'Court Ordered DUI Evaluations','DUI Evaluations/Risk Education','10100','DUI Evaluations and Risk Education classes are available.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','12','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(13,22395,'DUI Offender Programs','DUI Evaluations/Risk Education','10100','DUI Evaluations and Risk Education classes are available.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','13','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(14,22396,'Substance Use Disorder Treatment Programs','Substance Abuse Therapy','10100','Outpatient substance abuse therapy is available. A support group also meets on Tuesday evenings.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','14','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(16,22398,'General Counseling Services','Individual/Family Therapy','10100','CRCC is a multi-service community behavioral health center. Professionally trained therapists provide therapy and counseling for children, adolescents, and adults. Treatment interventions can be provided to individuals, families, or groups, based on the needs of those involved. Behavioral health issues treated include:\r\n- Depression.\r\n- Grief.\r\n- Anxiety.\r\n- Phobias.\r\n- Life stresses.\r\n- Marital issues.\r\n- Adjustment problems.\r\n- Parent-child issues.\r\n- ADHD.\r\n- Bipolar disorder.\r\n- Schizophrenia.\r\n- Domestic violence.\r\n- Sexual abuse.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','15','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(18,22400,'Psychiatric Disorder Counseling','Individual/Family Therapy','10100','CRCC is a multi-service community behavioral health center. Professionally trained therapists provide therapy and counseling for children, adolescents, and adults. Treatment interventions can be provided to individuals, families, or groups, based on the needs of those involved. Behavioral health issues treated include:\r\n- Depression.\r\n- Grief.\r\n- Anxiety.\r\n- Phobias.\r\n- Life stresses.\r\n- Marital issues.\r\n- Adjustment problems.\r\n- Parent-child issues.\r\n- ADHD.\r\n- Bipolar disorder.\r\n- Schizophrenia.\r\n- Domestic violence.\r\n- Sexual abuse.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','16','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(19,22401,'General Psychiatry','Psychiatric Services','10100','CRCC provides psychiatric services for children and adults with board-ceritified psychiatrists for individuals who may be in need of psychotropic medication or assistance in the evalutation and maintenance of their medication.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','17','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(20,22403,'Case/Care Management * Chronic/Severe Mental Illness','Community Support Services','10100','Community Support Services connects clients to support services to the community, such as assisting in obtaining resources for maintaining a stable and independent lifestyle.\r\n','','','','','968511154801619','By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','18','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(21,22404,'Support Groups * Substance Use Disorders','Substance Abuse Therapy','10100','Outpatient substance abuse therapy is available. A support group also meets on Tuesday evenings.','','','','',NULL,'By phone, walk-in, or appointment.','','','Proof of income, proof of residency.','$70,000 annual income.','19','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(22,22406,'Anger Management','Freedom to Choose','10100','Freedom to choose is a 16-week anger management program that offers group counseling to adults who have trouble managing their anger. The program teaches individuals to recognize their freedom to choose healthy approaches to anger, with practical application of living skills such as acceptance of responsibility, physical self-awareness, dynamics of control, assertive communication, stress reduction, conflict resolution, and responsible self-advocacy.','','','','',NULL,'Call the register for the group.','','','','','20','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(23,22407,'Co-Parenting Workshops','Children In Between','10100','CRCC offers a court approved education program for couples who are going through a divorce or separation. This class is designed to help parents learn how to put their children\'s needs first while going through this difficult time. This course includes the \"Children in the Middle\" parenting education curriculum and is held each month. The class meets one time for four hours. Call for times and registrion.','','','','',NULL,'By phone.','','','','','21','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(24,22408,'Parenting Skills Classes','Parenting Classes','10100','CRCC periodically offers parenting classes which are encouraged for any parent wishing to improve parenting skills.','','','','',NULL,'Call to register for the class.','','','','','22','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(25,22410,'Youth Enrichment Programs','After School Enrichment Program','10102','The Afterschool Enrichment Program serves scholars at several locations throughout Rantoul and Chicago. The program provides scholars one-to-one tutoring in the areas of math, science, technology, and language. Tap In staff and dedicated volunteers from the University of Illinois and Parkland College serve as mentor/tutors for the scholars. The curriculum is derived from Illinois State Standards, approved 4-H curriculum, and innovative S.T.E.A.M. (Science, Technology, Engineering, Art, and Mathematics) modules.','','','','',NULL,'Walk-in to register.','Students must be attending one of the following schools:\r\n- JW Eater Junior High School\r\n- Broadmeadow Elementary School.\r\n- Eastlawn Elementary School.\r\n- Northview Elementary School.\r\n- Pleasant Acres Elementary School.\r\n- Chicago Perspectives Schools','','','','23','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(26,22411,'Tutoring Services * Youth','After School Enrichment Program','10102','The Afterschool Enrichment Program serves scholars at several locations throughout Rantoul and Chicago. The program provides scholars one-to-one tutoring in the areas of math, science, technology, and language. Tap In staff and dedicated volunteers from the University of Illinois and Parkland College serve as mentor/tutors for the scholars. The curriculum is derived from Illinois State Standards, approved 4-H curriculum, and innovative S.T.E.A.M. (Science, Technology, Engineering, Art, and Mathematics) modules.','','','','',NULL,'Walk-in to register.','Students must be attending one of the following schools:\r\n- JW Eater Junior High School\r\n- Broadmeadow Elementary School.\r\n- Eastlawn Elementary School.\r\n- Northview Elementary School.\r\n- Pleasant Acres Elementary School.\r\n- Chicago Perspectives Schools','','','','24','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(27,22412,'Day Camps','Summer Enrichment Program','10102','Tap In Leadership Academy offers a relationship-centered, hands-on Summer Enrichment Program. Students embark on a multicultural journey, focusing on a different region of the world each week. Each enrichment activity is designed to expand on old skills, and develop new ones through creative, S.T.E.A.M. based activities. Students are given the opportunity to build new friendships, advance academic and literary achievement, release some energy outdoors, and incorporate leadership skills through the diverse, adventure-filled curriculum.','','','','',NULL,'Walk-in.','Students have to attend Rantoul schools or Arcola Junior High and High School.','','','','25','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(28,22413,'Preschools','Tap In Prep Academy (TIPA)','10102','Tap In Prep Academy is our Head Start School, specifically designed to serve the youngest members of our community, beginning at six weeks old. The goal of this program is to provide a solid foundation for academic success in kindergarten and beyond. TIPA provides educational foundations necessary for kindergarten readiness and incorporates Tap In’s style of culturally-relevant teaching to reflect the Tap In Way®: leadership development, cultural awareness, self-directed learning, tender loving care, and the Tap In tradition of a relationship-centered community.','','','','',NULL,'Walk-in.','Six weeks old through Pre-K.','','','','26','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(29,22579,'Free School Supplies','','10159','Teh Center is the hub of the Community School Initiative which brings a variety of services and resources to communities, including: health services, counseling, tutoring, after school programs, mentoring, and exposure to college and career opportunities. They work together to meet the identified needs of students, families and communities in a way that is well organized and responsible for results. Call to see if free school supplies are available.','','','','',NULL,'Call the Center or the child\'s home school.','','','','','27','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(30,22944,'Ex-Offender Reentry Programs','','10287','Services and program help reduce reoffending by equipping individuals and family through education, awareness, and prevention. Service includes U-Term offender reentry, 4Life Skills classes, and Ann\'s House transitional living for women on parole.','','','','',NULL,'By phone for appointment.','','','','','28','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(31,30304,'Transitional Housing/Shelter * Ex-Offenders','','10287','Services and program help reduce reoffending by equipping individuals and family through education, awareness, and prevention. Service includes U-Term offender reentry, 4Life Skills classes, and Ann\'s House transitional living for women on parole.','','','','','929094559121639','By phone for appointment.','','','','','29','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(32,22946,'Food Pantries','The Giving Place - Food Pantry','10289','Choice food pantry and clothing available once per month for families in Unit 7 School District.','','','','','832990803111047','Walk-in during scheduled hours.','Families may access once per month.','','Photo ID for residency confirmation.','150% of Federal Poverty Level.\r\n','30','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(33,30679,'Clothing','The Giving Place - Clothing Room','10289','Free distribution of mens, womens, and childrens clothing to clients who live in Unit 7 school district and have qualifying income on their monthly visit.','','','','',NULL,'Walk-in.','No restrictions.','','Proof of residency.','150% of the Federal Poverty Level.','31','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(34,24331,'Homeless Shelter','','10377','Overnight Men\'s Shelter will provide snacks and breakfast to go, but no meals. Showers and laundry are not available (but are available at the Phoenix Daytime Drop-In Center).','','','','',NULL,'Walk-in.','','','','','32','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(35,23218,'Children\'s/Adolescent Residential Treatment Facilities',NULL,'10396','Comprehensive services including residential treatment, special education, and community-based services. Our Intake/Admissions Coordinator for our residential program is available by phone at 217.367.3728, ext. 281 to answer questions about our agency and about the referral process.','','https://',NULL,NULL,'','By phone.','For youth and families dealing with serious emotional and behavioral challenges.',NULL,NULL,NULL,'1353,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-04-07 23:20:43'),(36,23219,'Vocational Rehabilitation','Vocational Options Program','10396','Career Exploration, Assessment, and Planning: An individual assessment of interest and skills; Counseling on vocational options and development of a vocational plan.\r\n\r\nSkill Development/Certificate: Skill development for work place employment through a nationally-recognized certificate that covers careers in the hospitality industry, 411 Disability Disclosure Training; and assistance to obtain Illinois Food Handler\'s Certificate\r\n\r\nJob Advocacy and Placement: Assistance advocating for any accommodations needed for success in employment; Job coaching is provided as needed; Job placement in unpaid internships, volunteer opportunities, subsidized employment, and independent employment and Business Partners are established in Champaign, Urbana, Rantoul, Mahomet, and throughout Champaign County where our youth and young adults live.','','','','',NULL,'By phone.','Youth and adults, ages 14 and up, who have emotional, behavioral, and mental health challenges.','','','','34','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(37,23222,'Independent Living Skills Instruction','ECHO Housing and Employment Support','10396','Provides intensive case management for adults and families who are experiencing homelessness or are at risk of homelessness. Program will assist clients with obtaining and retaining stable housing and employment while developing essential life skills.\r\n\r\nCunningham also provides transitional and independent living for DCFS referrals.','','','','',NULL,'By phone.','Adults and families experiencing homelessness or at risk of homelessness in Champaign County and who are willing to actively engage in intensive case management services.','','','','35','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(38,25000,'Case/Care Management * At Risk for Homelessness','ECHO Housing and Employment Support','10396','Provides intensive case management for adults and families who are experiencing homelessness or are at risk of homelessness. Program will assist clients with obtaining and retaining stable housing and employment while developing essential life skills.\r\n\r\nCunningham also provides transitional and independent living for DCFS referrals.','','','','',NULL,'By phone.','Adults and families experiencing homelessness or at risk of homelessness in Champaign County and who are willing to actively engage in intensive case management services.','','','','36','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(39,25001,'Case/Care Management * Homeless People','ECHO Housing and Employment Support','10396','Provides intensive case management for adults and families who are experiencing homelessness or are at risk of homelessness. Program will assist clients with obtaining and retaining stable housing and employment while developing essential life skills.\r\n\r\nCunningham also provides transitional and independent living for DCFS referrals.','','','','',NULL,'By phone.','Adults and families experiencing homelessness or at risk of homelessness in Champaign County and who are willing to actively engage in intensive case management services.','','','','37','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(40,25065,'Special Education','CIRCLE Academy','10396','CIRCLE Academy Therapeutic Day Schools operate both in Urbana (Champaign County) and Rossville (Vermillion County). Students with behavioral and emotional challenges which prevent them from being successful in a public school environment will live with their families in surrounding communities. Using a therapeutic education model, the individual needs and strengths of each student are identified and built upon, both academically and behaviorally.','','','','',NULL,'By phone.','Accepts students with any of the following disabilities:\r\n- Emotional Disability (ED).\r\n- Specific Learning Disability (SLD).\r\n- Intellectual Disability (ID).\r\n- Other Health Impairment (OHI).\r\n- Autism Spectrum Disorder (ASD).\r\n- Traumatic Brain Injury (TBI).\r\n- Developmental Delay (DD).','','','','38','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(41,25066,'Special Education * Autism Spectrum Disorder','CIRCLE Academy','10396','CIRCLE Academy Therapeutic Day Schools operate both in Urbana (Champaign County) and Rossville (Vermillion County). Students with behavioral and emotional challenges which prevent them from being successful in a public school environment will live with their families in surrounding communities. Using a therapeutic education model, the individual needs and strengths of each student are identified and built upon, both academically and behaviorally.','','','','',NULL,'By phone.','Accepts students with any of the following disabilities:\r\n- Emotional Disability (ED).\r\n- Specific Learning Disability (SLD).\r\n- Intellectual Disability (ID).\r\n- Other Health Impairment (OHI).\r\n- Autism Spectrum Disorder (ASD).\r\n- Traumatic Brain Injury (TBI).\r\n- Developmental Delay (DD).','','','','39','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(42,25067,'Special Education * Mental Illness/Emotional Disabilities','CIRCLE Academy','10396','CIRCLE Academy Therapeutic Day Schools operate both in Urbana (Champaign County) and Rossville (Vermillion County). Students with behavioral and emotional challenges which prevent them from being successful in a public school environment will live with their families in surrounding communities. Using a therapeutic education model, the individual needs and strengths of each student are identified and built upon, both academically and behaviorally.','','','','','968511154801619','By phone.','Accepts students with any of the following disabilities:\r\n- Emotional Disability (ED).\r\n- Specific Learning Disability (SLD).\r\n- Intellectual Disability (ID).\r\n- Other Health Impairment (OHI).\r\n- Autism Spectrum Disorder (ASD).\r\n- Traumatic Brain Injury (TBI).\r\n- Developmental Delay (DD).','','','','40','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(43,31184,'Runaway/Youth Shelters','Runaway and  Homeless Youth Services for Champaign County','10396','Provides outreach services, emergency shelter, and transitional living services for youth and young adults, age 14 to 24.','','https://',NULL,NULL,'','By phone.',NULL,NULL,NULL,NULL,'1352,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-04-07 23:03:44'),(44,31185,'Transitional Housing/Shelter * Young Adults * Youth','Runaway and  Homeless Youth Services for Champaign County','10396','Provides outreach services, emergency shelter, and transitional living services for youth and young adults, age 14 to 24.','','','','','929094559121639','By phone.','','','','','42','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(45,25002,'Adolescent/Youth Counseling * Attention Deficit/Hyperactivity Disorder','HopeSprings Counseling Services','10396','HopeSprings Counseling Services offers counseling and wellness services for youth, adults, and families in the community who are experiencing difficulty in relationships, socialization, physical or mental wellness and emotional concerns. Following the mission of Cunningham Children\'s Home to nourish hope through effective solutions, HopeSprings\' goal is not only to meet youth, adults, and families in an environment that leads to healing but, also, providing trauma-informed care that is focused on improving an individual\'s overall wellness rather than simply treating symptoms of mental health concerns.\r\n\r\nServices/ counseling types include: \r\n- Individual counseling.\r\n- Family counseling. \r\n- Group Sessions.\r\n- School-based Services.\r\n- Case Management.\r\n- Wellness Coaching Services.\r\n- ARC (attachment, self-regulation, and competency).\r\n- Attachment Disorders.\r\n- Attention Deficit Hyperactivity Disorder. \r\n- Child abuse, sex abuse, and neglect.\r\n- Collaborative Problem-Solving.\r\n- Domestic Violence and sexual assault. \r\n- Major depressive disorder, bi-polar disorder, and other mood disorders. \r\n- Neurosequential Model of Therapeutics (NMT). \r\n- Neurosequential Model of Education (NME).\r\n- Oppositional Defiant and other Behavioral Disorders. \r\n- Parent/child relational issues.\r\n- PTSD and other anxiety disorders.\r\n- PracticeWise MAP.\r\n- Chronic Stress. \r\n- Skills-streaming.\r\n- Trauma-Informed Care (TIC).\r\n- Trauma-Focused Cognitive Behavioral Therapy.','','https://www.cunninghamhome.org/hopesprings',NULL,NULL,'','By phone.','All clients are considere