ceWise MAP.\r\n- Chronic Stress. \r\n- Skills-streaming.\r\n- Trauma-Informed Care (TIC).\r\n- Trauma-Focused Cognitive Behavioral Therapy.','','','','',NULL,'By phone.','All clients are considered on case by case to determine eligibility for services. Call for more information.','','Photo ID, Proof of income, and insurance card will be needed at first appointment. Please note that a fee and client rights agreement will be signed at the date of first appointment.','','47','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(50,31221,'Continuing Care Retirement Communities','','10451','Clark-Lindsey is a not-for-profit life plan community, or continuing care retirement community, located on the edge of the beautiful University of Illinois campus.\r\n- The Village: Private apartments with amenities.\r\n- Meadowbrook Health Center: Short-term and residential nursing care.\r\n- Renewal Therapy Center: Rehabilitation, recovery and therapy services.\r\n- The Green House Homes: Assisted living memory care and skilled nursing care.','','http://www.clark-lindsey.com','','',NULL,'','','','','','48','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(51,23384,'Pregnancy Counseling','','10453','Counselors can be reached via text, email or phone, and can meet the client at the location of their choosing for free and confidential options counseling. Clients are helped by exploring each option to decide which feels right for them and their baby.','','http://www.holtsunnyridge.org','','',NULL,'By phone, walk-in, or appointment.','No eligibility requirements.','','Photo ID.','No income guidelines.','49','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(52,24445,'Adoption Services','','10453','Holt-Sunny Ridge is a licensed adoption agency with the Department of Children and Family Services; both domestic and international adoption programs are available for families wishing to adopt a child. Also offers therapy for adopted children, teens, adult adoptees, adoptive parents, birth parents, and families.','','','','',NULL,'By appointment.','','','Specific documents vary depending on adoption program.','','50','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(53,23401,'Breast Milk Banks','','10468','Women interested in becoming milk donors should call the Mothers\' Milk Bank to begin a screening process that includes a phone interview, application, check of medical records for the woman and her infant, and a blood test. Women who are approved are assigned a donor number and may donate containers of their frozen, pumped breast milk. From there, it is shipped to the Mothers\' Milk Bank where it is tested and, if approved, then sent to NICU\'s in Illinois and Wisconsin.\r\n\r\nMost of the donor milk that is distributed by the milk bank goes to premature or sick infants in a hospital setting. Women who need breast milk for their baby at home can also make a request, though it does require a prescription; these mothers should contact the Outreach Coordinator.','','','','',NULL,'By phone, email, or website.','','','','','51','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(54,14304,'Mentoring Programs','','1048','COVID-19:\r\nAll services are being done remotely. E-mail for more information. \r\n--------------------------------\r\n\r\nThe mission of Big Brothers Big Sisters is to create and support one-to-one mentoring relationships that ignite the power and promise of youth. There are two basic programs:\r\n- Community-Based Mentoring: The traditional Big Brothers Big Sisters relationship, focusing on one-on-one time spent with the volunteer and the young person doing things they enjoy, spending a few hours a several times a month filled with shared interests and activities.\r\n- School-Based Mentoring: Volunteers offer children individualized time and attention on a consistent basis, with the venue being the child\'s school rather than the community. Teachers identify those children who can most benefit from an extra caring adult in their lives. Volunteers and children meet regularly during the school year - typically each week, utilizing the resources available within the school.','','','h.peavler@bbbscil.org','',NULL,'By phone, walk-in.','Children between the ages of 5 and 12 are eligible to enroll for the community-based program. Families of Little Brothers and Little Sisters will also go through a training and screening process.','','','','52','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(55,14306,'Volunteer Opportunities','','1048','COVID-19:\r\nAll services are being done remotely. E-mail for more information. \r\n_______________________________________________________________________________\r\n\r\nThe volunteer\'s purpose is to provide quality mentoring services to children to help them achieve their highest potential.\r\nOpportunities include: \r\n- Community Based Mentoring - Spending time with a child on evenings and weekends. \r\n- School Based Mentoring - Spending one hour/week with a child on school property during school hours throughout the school year.','','','h.peavler@bbbscil.org','',NULL,'','Individuals who wish to become a volunteer Big Brother or Big Sister must be screened and trained prior to matching. A minimum of a one-year commitment is required for all programs. Volunteers must be at least 16 years of age and have their own transportation. Volunteers of all backgrounds are needed.','','','','53','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(56,23558,'Advocacy * Seasonal Workers','Free Legal Services for Immigrants','10527','COVID-19:\r\nThere may be some emergency funds available to help supplement lost wages. Will provide information and referral to the Latino low-income population in finding the appropriate service and provider; i.e., unemployment, food pantries, cash assitance, affordable health care, legal assistance, etc.\r\n-------------------------------\r\nThe mission of the Farmworker and Landscaper Advocacy Project (FLAP) -Proyecto de Ayuda para Trabajadores del Campo y Jardineros-  is to improve working conditions in Illinois for low-income landscapers, snow plowing workers, packinghouse workers, cannery workers, restaurant workers, farmworkers, nursery workers, greenhouse workers, meat and poultry workers and their households.\n\nFLAP carries out this mission through community outreach and education, litigation, community legal education, information and referrals and partnering with other organizations to fight human labor trafficking.','','','','','970915508638448','By phone, email, or USPS mail.','','','','','54','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(57,31796,'Information and Referral * Seasonal Workers','Free Legal Services for Immigrants','10527','COVID-19:\r\nThere may be some emergency funds available to help supplement lost wages. Will provide information and referral to the Latino low-income population in finding the appropriate service and provider; i.e., unemployment, food pantries, cash assitance, affordable health care, legal assistance, etc.\r\n-------------------------------\r\nThe mission of the Farmworker and Landscaper Advocacy Project (FLAP) -Proyecto de Ayuda para Trabajadores del Campo y Jardineros-  is to improve working conditions in Illinois for low-income landscapers, snow plowing workers, packinghouse workers, cannery workers, restaurant workers, farmworkers, nursery workers, greenhouse workers, meat and poultry workers and their households.\n\nFLAP carries out this mission through community outreach and education, litigation, community legal education, information and referrals and partnering with other organizations to fight human labor trafficking.','','','','',NULL,'By phone, email, or USPS mail.','','','','','55','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(58,31797,'Immigration/Naturalization Legal Services','Free Legal Services for Immigrants','10527','COVID-19:\r\nThere may be some emergency funds available to help supplement lost wages. Will provide information and referral to the Latino low-income population in finding the appropriate service and provider; i.e., unemployment, food pantries, cash assitance, affordable health care, legal assistance, etc.\r\n-------------------------------\r\nThe mission of the Farmworker and Landscaper Advocacy Project (FLAP) -Proyecto de Ayuda para Trabajadores del Campo y Jardineros-  is to improve working conditions in Illinois for low-income landscapers, snow plowing workers, packinghouse workers, cannery workers, restaurant workers, farmworkers, nursery workers, greenhouse workers, meat and poultry workers and their households.\n\nFLAP carries out this mission through community outreach and education, litigation, community legal education, information and referrals and partnering with other organizations to fight human labor trafficking.','','','','','917725171609009','By phone, email, or USPS mail.','','','','','56','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(59,31798,'Temporary Financial Assistance * Seasonal Workers','Free Legal Services for Immigrants','10527','COVID-19:\r\nThere may be some emergency funds available to help supplement lost wages. Will provide information and referral to the Latino low-income population in finding the appropriate service and provider; i.e., unemployment, food pantries, cash assitance, affordable health care, legal assistance, etc.\r\n-------------------------------\r\nThe mission of the Farmworker and Landscaper Advocacy Project (FLAP) -Proyecto de Ayuda para Trabajadores del Campo y Jardineros-  is to improve working conditions in Illinois for low-income landscapers, snow plowing workers, packinghouse workers, cannery workers, restaurant workers, farmworkers, nursery workers, greenhouse workers, meat and poultry workers and their households.\n\nFLAP carries out this mission through community outreach and education, litigation, community legal education, information and referrals and partnering with other organizations to fight human labor trafficking.','','','','','1077790582995406','By phone, email, or USPS mail.','','','','','57','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(60,23872,'General Counseling Services','','10724','An outpatient behavioral health clinic that provides psychiatric and psychotherapeutic services. Provides services to patients of varying ages that may have a wide range of behavioral health concerns, including (but not limited to) depression, anxiety, bipolar disorder, trauma, psychosis, and childhood disorders.','','','','',NULL,'Self and doctor referrals accepted. Once referral is received, demographic information is verified. Patient will be contacted to schedule an assessment for a Determination or Treatment.','','','Photo ID, insurance card (if applicable).','','58','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(61,23873,'General Psychiatry','','10724','An outpatient behavioral health clinic that provides psychiatric and psychotherapeutic services. Provides services to patients of varying ages that may have a wide range of behavioral health concerns, including (but not limited to) depression, anxiety, bipolar disorder, trauma, psychosis, and childhood disorders.','','','','',NULL,'Self and doctor referrals accepted. Once referral is received, demographic information is verified. Patient will be contacted to schedule an assessment for a Determination or Treatment.','','','Photo ID, insurance card (if applicable).','','59','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(62,23874,'Psychiatric Disorder Counseling','','10724','An outpatient behavioral health clinic that provides psychiatric and psychotherapeutic services. Provides services to patients of varying ages that may have a wide range of behavioral health concerns, including (but not limited to) depression, anxiety, bipolar disorder, trauma, psychosis, and childhood disorders.','','','','',NULL,'Self and doctor referrals accepted. Once referral is received, demographic information is verified. Patient will be contacted to schedule an assessment for a Determination or Treatment.','','','Photo ID, insurance card (if applicable).','','60','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(63,23876,'Geriatric Counseling','','10724','Geriatric Behavioral Services provides older adults with quality behavioral healthcare. Patients that utilize this program typically have Medicare Part B and a diagnosis such as Major Depressive Disorder and/or Generalized Anxiety Disorder. The staff utilizes a multidisciplinary treatment team including a Psychiatrist, a Therapist, and a Registered Nurse to develop an individualized plan of treatment for each patient. The goal is to provide a safe environment for patients to come and share feelings with others that are experiencing similar issues.','','','','',NULL,'Self and doctor referrals accepted. Once referral is received, demographic information is verified. Patient will be contacted to schedule an assessment for a Determination or Treatment.','','','Photo ID, insurance card.','','61','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(64,23877,'General Psychiatry * Older Adults','','10724','Geriatric Behavioral Services provides older adults with quality behavioral healthcare. Patients that utilize this program typically have Medicare Part B and a diagnosis such as Major Depressive Disorder and/or Generalized Anxiety Disorder. The staff utilizes a multidisciplinary treatment team including a Psychiatrist, a Therapist, and a Registered Nurse to develop an individualized plan of treatment for each patient. The goal is to provide a safe environment for patients to come and share feelings with others that are experiencing similar issues.','','','','',NULL,'Self and doctor referrals accepted. Once referral is received, demographic information is verified. Patient will be contacted to schedule an assessment for a Determination or Treatment.','','','Photo ID, insurance card.','','62','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(65,30887,'Information and Referral * Health Care','','10724','The social services coordinator at Gibson Area Hospital works with a variety of organizations and individuals to provide information to patients. The coordinator provides assistance with:\r\n- Medicare Swing Bed Program.\r\n- Nursing home placement.\r\n- Home health referrals.\r\n- Meals on wheels.\r\n- Advanced directives and organ donation.\r\n- County agency referrals.\r\n- Providing information about financial resources.\r\n- Lifeline installation.','','','','','941516382466411','By phone.','','','','','63','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(66,24050,'Free School Supplies','','10805','2019 Stop The Violence Project Street Festivals -- everything is FREE:\r\n- Fun & games.\r\n- Prizes.\r\n- Music and live entertainment.\r\n- Popcorn, snow cones, cotton candy, funnel cakes.\r\n- BBQ meal.\r\n- 500 Backpacks & school supplies (starter Kit) for all ages (K-college).\r\n- 500 Boxes of groceries (for registered attendees).','','','','',NULL,'','Must be registered to participate and receive prizes and backpacks.','','','','64','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(67,24074,'Low Income/Subsidized Rental Housing','','10810','Operates low income, subsidized residential properties across Illinois. Many properties have waiting lists. If interested in housing at a particular location, call that site directly.','','http://www.pacificmgt.net/','','','929094559121639','By phone.','','','','','65','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(68,102,'Constitutional/Civil Rights Groups','','1083','The ACLU of Illinois (ACLU), and its affiliated Roger Baldwin Foundation (RBF), are non-partisan, non-profit organizations dedicated to protecting the liberties guaranteed by the U.S. Constitution, the state Constitution, and state/federal human rights laws. The ACLU accomplishes its goals through litigating, lobbying, and educating the public on a broad array of civil liberties issues. Advocacy is provided in many areas including but not limited to racial justice, religious liberty, freedom of expression, the rights of children and people with disabilities, criminal justice reform, fairness for lesbian, gay, bisexual, transgender individuals, and reproductive justice.','','http://www.aclu-il.org','acluofillinois@aclu-il.org','',NULL,'Legal assistance request forms can be sent through the website, fax, or mail. The ACLU normally takes cases that affect a large number of people rather than those involving a dispute between individual parties. Call for more information.','','','','','66','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(69,24186,'General Counseling Services','','10864','Provides full range of outpatient mental health therapy for individuals, children, couples, and families. Strives to offer therapy services to as many people as possible, as quickly as possible with next day appointments and no wait lists. The agency has over 30 therapists with a wide range of skills and expertise in various modalities including play, EMDR, CBT, DBT, and more. Addresses all issues including addiction, anxiety, depression, severe mental illness, and relationships.','','','','',NULL,'By phone.','','','','','67','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(70,24189,'Psychiatric Disorder Counseling','','10864','Provides full range of outpatient mental health therapy for individuals, children, couples, and families. Strives to offer therapy services to as many people as possible, as quickly as possible with next day appointments and no wait lists. The agency has over 30 therapists with a wide range of skills and expertise in various modalities including play, EMDR, CBT, DBT, and more. Addresses all issues including addiction, anxiety, depression, severe mental illness, and relationships.','','','','',NULL,'By phone.','','','','','68','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(71,24187,'General Counseling Services','','10864','Provides full range of outpatient mental health therapy for individuals, children, couples, and families. Strives to offer therapy services to as many people as possible, as quickly as possible with next day appointments and no wait lists. The agency has over 30 therapists with a wide range of skills and expertise in various modalities including play, EMDR, CBT, DBT, and more. Addresses all issues including addiction, anxiety, depression, severe mental illness, and relationships.','','','','',NULL,'By phone.','','','','','69','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(72,24190,'Psychiatric Disorder Counseling','','10864','Provides full range of outpatient mental health therapy for individuals, children, couples, and families. Strives to offer therapy services to as many people as possible, as quickly as possible with next day appointments and no wait lists. The agency has over 30 therapists