es include assessment and consultation for the entire family. LSSI provides educational and support groups, as well as 24-hour crisis support. LSSI is the largest provider of these kinds of services in the state. The services are available in 25 counties, primarily in Central Illinois. For families residing elsewhere, LSSI will provide referral assistance to help families connect with the Adoption Preservation provider in their area.','','http://adoptionillinois.org','','',NULL,'','','','','','73','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(76,1874,'Foster Home Licensing','','1087','Provides placement and casework services for children who have been removed from their birth families because of abuse or neglect. LSSI provides training, licensing and services for foster families. Because the goal of foster care is returning the child back to his or her birth family if possible, LSSI asks its foster parents to support the child’s connection to his or her birth family by providing transportation to or hosting sibling visits, and visiting with birth parents when the child welfare team mutually agrees upon this.','','','','',NULL,'','','','','','74','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(77,1875,'Foster Home Placement','','1087','Provides placement and casework services for children who have been removed from their birth families because of abuse or neglect. LSSI provides training, licensing and services for foster families. Because the goal of foster care is returning the child back to his or her birth family if possible, LSSI asks its foster parents to support the child’s connection to his or her birth family by providing transportation to or hosting sibling visits, and visiting with birth parents when the child welfare team mutually agrees upon this.','','','','',NULL,'','','','','','75','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(79,24256,'Holiday Programs * Christmas Meals','','10893','Anyone is welcome to come to this FREE Christmas Dinner. No reservations needed. Hosted by the RTHS FCA. For questions, contact Trisha Freeman, 217-892-6035 or trishafreeman@rths193.org.','','','','',NULL,'','','','','','76','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(80,24285,'Support Groups * Veterans','','10902','A nonprofit organization that focuses on helping combat veterans and their families heal from the moral and spiritual wounds of war. This is accomplished by facilitating a 12-week combat trauma healing course that provides a unique blend of clinical insight and faith-based support.\r\n\r\nVeterans and family members learn skills that aid in their healing as well as help build community. REBOOT courses are free, safe, private, and mostly veteran-led. Childcare and meals are provided to help remove barriers to military families seeking help. We encourage the participation of spouses and affected family members, as trauma impacts the entire family.','','http://www.rebootrecovery.com','rebootbn@outlook.com','',NULL,'By phone, email.','','','','','77','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(81,24286,'Support Groups * Families of Veterans','','10902','A nonprofit organization that focuses on helping combat veterans and their families heal from the moral and spiritual wounds of war. This is accomplished by facilitating a 12-week combat trauma healing course that provides a unique blend of clinical insight and faith-based support.\r\n\r\nVeterans and family members learn skills that aid in their healing as well as help build community. REBOOT courses are free, safe, private, and mostly veteran-led. Childcare and meals are provided to help remove barriers to military families seeking help. We encourage the participation of spouses and affected family members, as trauma impacts the entire family.','','http://www.rebootrecovery.com','rebootbn@outlook.com','',NULL,'By phone, email.','','','','','78','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(82,24333,'Community Meals','','10920','St. Andrew\'s runs a free community meal every Wednesday followed by church activities.','','http://www.lutherancampuscenter.org','lutherancampuscenter@gmail.com','',NULL,'Walk-in, by phone.','','','None.','','79','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(83,24334,'Community Meals','The Jubilee Café','10922','Volunteers provide fresh, home-cooked meals to anyone who struggles with food insecurity.','','','','',NULL,'Walk-in.','Anyone.','','','','80','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(84,24336,'Animal Control','','10926','Provides animal control services to Champaign County.','','','','',NULL,'','','','','','81','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(85,24386,'Perinatal/Postpartum Depression Counseling','','10949','A free, confidential hotline staffed by licensed counselors who can help women find the information, support, and resources they need to feel better during pregnancy or after birth.','','','','',NULL,'By phone.','','','','','82','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(87,24391,'Parenting Helplines * Perinatal/Postpartum Depression','','10951','A non-profit organization helping Illinois women and their families access support and information about pregnancy and postpartum mood disorders.\r\n\r\nPPDIL support volunteers are all moms who have experienced either a pregnancy or postpartum mood disorder themselves. The can offer:\r\n- Mom-to-Mom support and encouragement, and to let you know you are not alone in feeling this way.\r\n- Information about the symptoms of pregnancy & postpartum mood and anxiety disorders.\r\n- Information on what helps women to feel well again.\r\n- Information on how to choose a healthcare provider who has experience in treating perinatal mood disorders if you need one.','','','','',NULL,'By phone only.','','','','','83','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(91,24494,'Moving Services * Older Adults','','10987','Beautiful Life Senior Relocation Services helps Seniors with the process of downsizing and moving. Initial consultation is free. The Beautiful Life team partners with seniors to sort, downsize, donate, pack, and unpack during the moving process.','','','','',NULL,'By phone.','Older adults with an ability to pay.','','','','84','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(98,24618,'General Counseling Services','Hope Counseling Inc.\n(Mental Health Services)','11045','Experienced therapists provide help for a wide range of emotional and behavioral problems and concerns, i.e., depression, grief, anxiety, anger control, addictions, relationship conflict, stage-of-life transitional issues, career concerns, parenting, and more. Therapists offer adult individual therapy, couples counseling, family therapy, and services for children ages 4 to 18.','','http://www.hopecounselinginc.com','','',NULL,'Phone for appointment.','','','','We have a program for clients with no insurance or high deductible amounts in combination with limited incomes.','85','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(99,11107,'General Legal Aid','','1106','Free legal assistance for low-income individuals and the elderly in civil matters involving basic needs (i.e., housing, family, consumer, education, public benefits, and health issues). The type of services they provide range from telephone advice or brief service, to representation in court or at administrative hearings.','','http://lincolnlegal.org','','','917725171609009','By phone. To apply for services, the person who needs legal help should call the Legal Advice and Referral Center.\r\n\r\nLARC takes calls on Mon-Thur, 9:00 am - 4:00 pm, Fri, 9:00 am - 1:30 pm. Victims of domestic violence and persons age 60 and over should call the regional office that serves their county.','','','','200% of the federal poverty level.','86','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(100,31706,'State Unemployment Insurance Appeals/Complaints','','1106','Free legal assistance for low-income individuals and the elderly in civil matters involving basic needs (i.e., housing, family, consumer, education, public benefits, and health issues). The type of services they provide range from telephone advice or brief service, to representation in court or at administrative hearings.','','http://lincolnlegal.org','','',NULL,'By phone. To apply for services, the person who needs legal help should call the Legal Advice and Referral Center.\r\n\r\nLARC takes calls on Mon-Thur, 9:00 am - 4:00 pm, Fri, 9:00 am - 1:30 pm. Victims of domestic violence and persons age 60 and over should call the regional office that serves their county.','','','','200% of the federal poverty level.','87','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(101,30927,'Immigration/Naturalization Legal Services','','1108','COVID-19:\r\nNo in-person services. Accepting new cases. Please call or email 309.829.8703 or info@immigrationproject.org \r\n______________________________________________________________________________\r\nAnswers immigration-related questions and counsels clients regarding proper forms, procedures, processing times, legal standards, supporting information, eligibility, and referral. Also provides information and seminars on immigration-related subjects to schools, churches, and community organizations. All informational meetings are provided free of charge.\r\n \r\nOffers assistance to prepare a variety of immigration applications (fees based on a sliding fee scale). Basic support includes visa petitions, TPS applications, legal permanent residency, renewal of \'green cards\', Violence Against Women Act visas, non-immigrant visas, and citizenship, among others (including Deferred Action for Childhood Arrivals or DACA).\r\n\r\nImmigration legal assistance is available -- mostly free of charge -- to immigrants who are victims of domestic violence or other crimes.','','','','','917725171609009','E-mail info@immigrationproject.org or call and leave a message to be added to the appointment waitlist.','','','Vary depending on services.','250% of the federal poverty level.','88','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(102,24750,'Sex Offender Counseling','','11082','Forensic Therapy is available for clients within the judicial system (i.e. courts, probation, parole) who are seeking therapy for the dysfunctional or deviant behaviors which have created consequence in their lives which has now lead to criminal prosecution. The goal of forensic therapy is to assist the client in a greater understanding of their dysfunctional behavior and methods by which they can alter their lifestyles to become productive in society once again. Forensic services include:\r\n\r\n- Forensic Mental Health and Substance Abuse Evaluations for the courts.\r\n- Sex Offender Specific Evaluations and Risk Assessments.\r\n- Violent Offender Specific Evaluations and Risk Assessments.\r\n- Individual Sessions.\r\n- Group Therapy.\r\n- Forensic Consultation.','','','','',NULL,'Therapy can be paid for through most insurance coverage plans, but also accepts private pay. There is a sliding scale for fees, adjusting the cost of the sessions based on the household income of the client.','','','','','89','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(103,24828,'Mentoring Programs','','11094','C-U One-to-One Mentoring is the school-based mentoring program of the Champaign Unit 4 and Urbana District #116 Schools. Mentors are matched one-on-one with a student when the student is in 3rd-7th grade. Mentors meet with their \'mentees\' for one hour a week during the school day on school grounds. They may read together, play games, go for a walk, workout in the gym, discuss current events, work on a school project, or just talk. Coordinators at each building help provide activity suggestions, training and support. Mentors commit for one year at a time. Students who stay in the program through high school graduation receive a scholarship for continuing education funded by our community partner, the Mentoring Scholarship Foundation.','','','','',NULL,'By phone, website, email.\r\n- Students may be referred by a parent, teacher, counselor, or they may request a mentor for themselves.\r\n- Potential mentors can fill out an application on-line on the website or contact the respective school districts\' main contacts.','- Students selected for mentoring are in late elementary (3rd-5th grad) or early middle school (6th or 7th grade) and just need a little extra support and encouragement to thrive. They may be under-achieving, have poor peer relationships, have attendance issues, or exhibit in other ways the need for a caring adult in their lives. \r\n- Mentors must be community residents who expect to stay in the community for at least the next 2-3 years. Other than that, adults can be mentors if the have a gunuine interest in youth, are flexible and patient, have good listening skills, and have the time to commit to meeting with their mentees.','','','','90','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(104,24829,'Volunteer Opportunities','','11094','C-U One-to-One Mentoring is the school-based mentoring program of the Champaign Unit 4 and Urbana District #116 Schools. Mentors are matched one-on-one with a student when the student is in 3rd-7th grade. Mentors meet with their \'mentees\' for one hour a week during the school day on school grounds. They may read together, play games, go for a walk, workout in the gym, discuss current events, work on a school project, or just talk. Coordinators at each building help provide activity suggestions, training and support. Mentors commit for one year at a time. Students who stay in the program through high school graduation receive a scholarship for continuing education funded by our community partner, the Mentoring Scholarship Foundation.','','','','',NULL,'By phone, website, email.\r\n- Students may be referred by a parent, teacher, counselor, or they may request a mentor for themselves.\r\n- Potential mentors can fill out an application on-line on the website or contact the respective school districts\' main contacts.','- Students selected for mentoring are in late elementary (3rd-5th grad) or early middle school (6th or 7th grade) and just need a little extra support and encouragement to thrive. They may be under-achieving, have poor peer relationships, have attendance issues, or exhibit in other ways the need for a caring adult in their lives. \r\n- Mentors must be community residents who expect to stay in the community for at least the next 2-3 years. Other than that, adults can be mentors if the have a gunuine interest in youth, are flexible and patient, have good listening skills, and have the time to commit to meeting with their mentees.','','','','91','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(107,24980,'Early Intervention for Mental Illness','First.IL','11156','A comprehensive, team-based treatment program aimed at improving the mental health and quality of life for individuals who have experienced a first episode of a psychotic illness.\r\n\r\nFIRST.IL Program Treatment Goals:\r\n- To reduce the symptoms of psychotic illnesses.\r\n- To improve individual and family functioning.\r\n- To reduce the chance of relapse.\r\n- To promote recovery and improve the long-term course of the illness.\r\n- To decrease the overall costs of treatment.\r\n\r\nFIRST.IL treatment is a team-based approach that uses 5 modalities:\r\n- Psychiatric Care.\r\n- Individual Resiliency Training.\r\n- Supported Employment/ Education.\r\n- Family Psychoeducation.\r\n- Case Management.','','','','','968511154801619','By phone. Calls to the dedicated FIRST.IL line will be returned within 24 hrs.','- Age 14-40.\r\n- Diagnosed with schizophrenia, schizoaffective disorder, schizophreniform disorder or other specified/unspecified schizophrenia spectrum and other psychotic disorder.\r\n- Experiencing no more than 18 months of psychotic symptoms, whether treated or untreated.\r\n- Willing to consent to participate in at least two of the five treatment modalities.','','','','92','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(108,25022,'General Legal Aid * Veteran/Military Personnel Issues','','11164','The Illinois Armed Forces Legal Aid Network (IL-AFLAN) provides civil legal services across Illinois for military personnel, veterans, and their families. Common areas of legal assistance include discharge upgrades, benefits appeals, and civil legal problems like Family, Housing, and Consumer issues. IL-AFLAN is a network comprised of over 10 legal aid organizations and law school clinics. When calling please be prepared to speak with an attorney. This means having any relevant documents in front of you and setting aside enough time to discuss your case. At current call-times most callers will speak to a lawyer in five minutes or less. Just pay attention to the phone prompts. If call volume is unusually high, the caller will be able to schedule a call-back after ten minutes of waiting.','','http://www.ilaflan.org','','','917725171609009','By phone call to hotline. The hotline will conduct an intake and legal triage by an attorney. If more services are needed, a referral will be made to a legal provider that is part of IL-AFLAN. There are 13 legal aid providers who are part of the network. They maintain dozens of sites and offices. Clients should call the hotline and the hotline will help them find a site if needed.','- Must be active duty military, veteran, retired military, national guard, reserves, or spouse or dependent of the preceding.\r\n- Clients do not need to be residing in Illinois, but their legal problem must have a connection to Illinois to receive services.\r\n- Spouse or dependent cannot take legal action adverse to veteran/active duty/reserve/guard/etc.','','Proof of military service.','80% of Chicago Area Median Income (applies statewide).','93','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(109,25091,'Clothing * Children\'s Clothing','','11184','Provides those in need with free or low cost clothing, household items, children\'s toys, and other donations. Also accepts donations of childen\'s clothing.','','','','',NULL,'By phone, walk-in.','','','','','94','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(110,25092,'Volunteer Opportunities','','11184','Provides those in need with free or low cost clothing, household items, children\'s toys, and other donations. Also accepts donations of childen\'s clothing.','','','','',NULL,'By phone, walk-in.','','','','','95','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(111,25158,'Children\'s Clothing Donation Programs','','11184','Provides those in need with free or low cost clothing, household items, children\'s toys, and other donations. Also accepts donations of childen\'s clothing.','','','','',NULL,'By phone, walk-in.','','','','','96','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(112,25216,'Adoption Services','','11212','Adoption Information Center of Illinois offers information and referral services for prospective parents wishing to adopt or to become foster parents. AICI can connect families or individuals wishing to adopt \"special needs\" children. Adoption counselors are also available help those looking to place a child for adoption. Some Illinois children are featured on the AICI website.','','http://adoptioncenterofillinois.org','','',NULL,'By phone, website.','','','','','97','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(113,25268,'Alcohol/Drug Impaired Driving Prevention','','11231','Alliance Against Intoxicated Motorists (AAIM) works to prevent deaths and injuries caused by intoxicated or distracted motorists in Illinois and to assist impaired driving crash victims and their families. To increase public awareness, the Speakers Bureau provides victims and offenders to speak on the devastation caused by drunk driving to educational, business, civic, professional and social groups. Programs are available in Spanish in Kane, Cook, DuPage, and Will counties. AAIM supports strict enforcement of the laws and appropriate legislation. AAIM supports victims and their families emotionally, financially and during court proceedings. The DrunkBuster program encourages the community to provide information that leads to arrests of intoxicated motorists.','','http://www.aaim1.org','info@aaim1.org','',NULL,'By phone, website.','','','','','98','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(115,1848,'Safe Havens for Abandoned Newborns','','1125','Illinois offers a safe option for a desperate parent in crisis. By handing your unharmed baby (30-days-old or younger) to personnel at any hospital, emergency medical facility, staffed fire station, or police station, you can walk away with no questions asked. The baby will be cared for and placed in a loving home for adoption. No attempt whatsoever will be made to contact you. No crime will have been committed. This is an absolutely safe process. This law was written to provide a safe alternative to abandonment for Illinois parents who feel they cannot cope with a newborn baby. It offers safe havens for newborns, and is extremely supportive in that you will be offered medical care and counseling.','','http://www.SaveAbandonedBabies.org','info@SaveAbandonedBabies.org','',NULL,'By phone, website, or walk-in (hospital, fire or police station, etc.)','','','','','99','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(116,25338,'Scholarships * Veterans','','11259','The AMVETS organization has many programs that are available to support Veterans and their families. These include grants, scholarships, awards and honors, and volunteer opportunities. To support its programs, AMVETS collects used items to sell. A truck will pick up donations from a home or other setting. They also have trailer sites for donation drop off.','','','','',NULL,'By phone, website, email.','Please call to inquire if your town is in the AMVETS service area and to determine if item is accepted for pickup.','','','','100','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(117,29726,'Advocacy * Veterans','','11259','The AMVETS organization has many programs that are available to support Veterans and their families. These include grants, scholarships, awards and honors, and volunteer opportunities. To support its programs, AMVETS collects used items to sell. A truck will pick up donations from a home or other setting. They also have trailer sites for donation drop off.','','','','','637158405241810','By phone, website, email.','Please call to inquire if your town is in the AMVETS service area and to determine if item is accepted for pickup.','','','','101','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(118,29727,'Veteran Benefits Assistance','','11259','The AMVETS organization has many programs that are available to support Veterans and their families. These include grants, scholarships, awards and honors, and volunteer opportunities. To support its programs, AMVETS collects used items to sell. A truck will pick up donations from a home or other setting. They also have trailer sites for donation drop off.','','','','',NULL,'By phone, website, email.','Please call to inquire if your town is in the AMVETS service area and to determine if item is accepted for pickup.','','','','102','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(119,25597,'Support Groups * Brain Injuries','Information & Resource Call Center','11347','Brain Injury Association of Illinois is a statewide non-profit organization providing programs & services to individuals who have sustained acquired/traumatic brain injury, their families/caregivers, professionals working in the field, and the community at large. The BIA of IL serves military service members who may have sustained a brain injury. Summer camp is available for adults, adolescents and children. Affiliated support groups are available throughout the state. Brain injury information & resources are available via the Brain Injury Resource Call Center. An annual statewide educational conference is held each fall.','','http://www.biail.com','info@biail.org','',NULL,'By phone, website, email.','Individuals who have sustained a brain injury, their family members, professionals, and the community at large as appropriate.','','','','103','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(120,25598,'Advocacy * Brain Injuries','Information & Resource Call Center','11347','Brain Injury Association of Illinois is a statewide non-profit organization providing programs & services to individuals who have sustained acquired/traumatic brain injury, their families/caregivers, professionals working in the field, and the community at large. The BIA of IL serves military service members who may have sustained a brain injury. Summer camp is available for adults, adolescents and children. Affiliated support groups are available throughout the state. Brain injury information & resources are available via the Brain Injury Resource Call Center. An annual statewide educational conference is held each fall.','','http://www.biail.com','info@biail.org','','637158405241810','By phone, website, email.','Individuals who have sustained a brain injury, their family members, professionals, and the community at large as appropriate.','','','','104','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(121,25599,'Disease/Disability Information * Brain Injuries','Information & Resource Call Center','11347','Brain Injury Association of Illinois is a statewide non-profit organization providing programs & services to individuals who have sustained acquired/traumatic brain injury, their families/caregivers, professionals working in the field, and the community at large. The BIA of IL serves military service members who may have sustained a brain injury. Summer camp is available for adults, adolescents and children. Affiliated support groups are available throughout the state. Brain injury information & resources are available via the Brain Injury Resource Call Center. An annual statewide educational conference is held each fall.','','http://www.biail.com','info@biail.org','',NULL,'By phone, website, email.','Individuals who have sustained a brain injury, their family members, professionals, and the community at large as appropriate.','','','','105','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(124,25638,'Dog Guides','','11366','Canine Companions for Independence provides highly-trained assistance dogs for children and adults with disabilities, free of charge, along with on-going support. Chicago Volunteer Group coordinates and recruits volunteers locally who raise puppies and raises funds to support the program.','','http://www.cci.org','','',NULL,'By phone, website.','People with physical or developmental disabilities, adults who are Deaf or hard of hearing.','','','','106','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(136,10421,'Information and Referral * Special Education Issues','','1141','Assists parents of children with disabilities to be informed participants in the special education process. Provides disability-related information, referral and linkage, parent trainings, lending of library materials, informational packets, and student educational record reviews.','','http://www.fmptic.org','info@fmptic.org','','789038541797078','By phone, email, or website.','Families must live in the 94-county service area and have a child with special education needs.','','','','107','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(137,30003,'Advocacy * Disabilities Issues','','11419','The Coalition of Citizens with Disabilities in Illinois is a not-for-profit advocacy organization for all people with all types of disabilities. CCDI works at the local, state and federal levels to inform for those with disabilities regarding public policy and advocate for their rights. CCDI accepts individuals and organizations as members.','','','','','637158405241810','By phone.','Any individual or organization interested in supporting equal rights for individuals with any type of disability.','','','','108','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(140,14313,'Clothing * Baby Clothing','','1153','Maternity clothes and baby clothes (infant to 24 months) are available. Can receive clothing once every 2 months.','','','','',NULL,'Mother will need be established as a client first before receiving maternity clothing.','','','','','109','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(141,14314,'Clothing * Maternity Clothing','','1153','Maternity clothes and baby clothes (infant to 24 months) are available. Can receive clothing once every 2 months.','','','','',NULL,'Mother will need be established as a client first before receiving maternity clothing.','','','','','110','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(142,14315,'Pregnancy Counseling','','1153','A non-profit, volunteer-staffed, pregnancy assistance service offering assistance and support to any girl or woman who finds herself distressed by pregnancy or the possibility of pregnancy. Birthright offers free, reliable pregnancy testing. All services are free and confidential. Referrals to other resources are also provided.','','','','',NULL,'By phone. Appointment preferred. No walk-ins, as hours vary.','','','','','111','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(143,14316,'Pregnancy Testing','','1153','A non-profit, volunteer-staffed, pregnancy assistance service offering assistance and support to any girl or woman who finds herself distressed by pregnancy or the possibility of pregnancy. Birthright offers free, reliable pregnancy testing. All services are free and confidential. Referrals to other resources are also provided.','','','','',NULL,'By phone. Appointment preferred. No walk-ins, as hours vary.','','','','','112','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(144,14317,'Diapers','','1153','Diapers are available for clients once per month.','','','','',NULL,'','','','','','113','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(145,14319,'Volunteer Opportunities','','1153','Birthright is always in need of compassionate volunteers who can give loving, non-judgmental help to the pregnant women who come to us. Extensive training is provided. Volunteers are asked to commit to 2 hours per week. Call or e-mail for more information.','','','','',NULL,'','','','','','114','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(146,21436,'Pre-Abortion Counseling','','1153','A non-profit, volunteer-staffed, pregnancy assistance service offering assistance and support to any girl or woman who finds herself distressed by pregnancy or the possibility of pregnancy. Birthright offers free, reliable pregnancy testing. All services are free and confidential. Referrals to other resources are also provided.','','','','',NULL,'By phone. Appointment preferred. No walk-ins, as hours vary.','','','','','115','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(151,26252,'Advocacy * Disabilities Issues','','11566','The Family Support Network provides for the unification of and advocacy for individuals with disabilities and their families.  FSN advocates for funding, services, and community resources. The website provides information on how to navigate the disability system in Illinois.','','http://www.familysupportnetwork.org','','','637158405241810','By phone or website.','Individuals with disabilities and their families.','','','','116','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(152,26474,'Organ and Tissue Banks','','11634','Gift of Hope coordinates organ and tissue donation while supporting families of donors in Illinois and portions of Indiana. Gift of Hope helps streamline the organ donation process and provide support to both donor and recipient families. Gift of Hope provides evaluation of donors, 24/7 referral coordination, education programs, registration, lab screenings and general help for patients and medical providers involved in the organ donation process, working closely with the hospital transplant centers.\r\n\r\nFederal regulations require hospitals to notify Gift of Hope each time a patient dies or is about to die to determine if they are a potential donor. Gift of Hope reviews the patient\'s medical condition and history to establish initial eligibility. \r\n\r\nGift of Hope staff are subject experts and reference local and national statistics on organ and tissue donation. Gift of Hope can offer information on the Illinois Organ/Tissue Donor Registry, Donate Life Illinois and the critical need for organs and tissue.','','http://www.giftofhope.org','info@giftofhope.org','',NULL,'By phone, website.','Individuals and families of those in need of transplants, as well as people interested in becoming living organ donors.','','','','117','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(155,30545,'Websites * Government Services Issues','','11643','Up-to-date information about Illinois departments and programs under the governor\'s jurisdiction. See www.illinois.gov/gov.','','http://www.illinois.gov/gov','governor@illinois.gov','',NULL,'Call or visit website for more information.','','','','','118','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(156,26697,'Support Groups * Huntington\'s Disease','','11701','The Huntington Disease Society of America Illinois Chapter works locally to fulfill the mission of the agency by promoting and supporting research to find a cure, helping people and families affected by the disease, and educating the public and health care professionals.','','http://illinois.hdsa.org','illinois@hdsavolunteer.org','',NULL,'By phone, email.','Individuals with or genetically at-risk for Huntington\'s Disease, their friends, family, and caregivers.','','','','119','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(157,26698,'Advocacy * Huntington\'s Disease','','11701','The Huntington Disease Society of America Illinois Chapter works locally to fulfill the mission of the agency by promoting and supporting research to find a cure, helping people and families affected by the disease, and educating the public and health care professionals.','','http://illinois.hdsa.org','illinois@hdsavolunteer.org','','637158405241810','By phone, email.','Individuals with or genetically at-risk for Huntington\'s Disease, their friends, family, and caregivers.','','','','120','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(158,30266,'Disease/Disability Information * Huntington\'s Disease','','11701','The Huntington Disease Society of America Illinois Chapter works locally to fulfill the mission of the agency by promoting and supporting research to find a cure, helping people and families affected by the disease, and educating the public and health care professionals.','','http://illinois.hdsa.org','illinois@hdsavolunteer.org','',NULL,'By phone, email.','Individuals with or genetically at-risk for Huntington\'s Disease, their friends, family, and caregivers.','','','','121','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(161,26744,'Planning/Coordinating/Advisory Groups * Sexual Assault Issues','','11713','The Illinois Coalition Against Sexual Assault (ICASA) is a non-profit organization of 30 community-based sexual assault crisis centers working together to end sexual violence. Each center provides 24-hour crisis intervention services, counseling and advocacy for victims of sexual assault and their significant others. Each center presents prevention education programs in Illinois schools and communities.\r\n\r\nIllinois Coalition Against Sexual Assault monitors and funds all approved Illinois Sexual Assault Programs, provides training and education, program development, site reviews, and sets standards for service.','','http://www.icasa.org','sblack@icasa.org','',NULL,'Professionals: By phone, email, website.\r\nSurvivors of Sexual Assault: By website to find nearest Rape Crisis Center.','','','','','122','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(162,26745,'Specialized Information and Referral * Sexual Assault Issues','','11713','The Illinois Coalition Against Sexual Assault (ICASA) is a non-profit organization of 30 community-based sexual assault crisis centers working together to end sexual violence. Each center provides 24-hour crisis intervention services, counseling and advocacy for victims of sexual assault and their significant others. Each center presents prevention education programs in Illinois schools and communities.\r\n\r\nIllinois Coalition Against Sexual Assault monitors and funds all approved Illinois Sexual Assault Programs, provides training and education, program development, site reviews, and sets standards for service.','','http://www.icasa.org','sblack@icasa.org','',NULL,'Professionals: By phone, email, website.\r\nSurvivors of Sexual Assault: By website to find nearest Rape Crisis Center.','','','','','123','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(163,30298,'Advocacy * Sexual Assault Issues','','11713','The Illinois Coalition Against Sexual Assault (ICASA) is a non-profit organization of 30 community-based sexual assault crisis centers working together to end sexual violence. Each center provides 24-hour crisis intervention services, counseling and advocacy for victims of sexual assault and their significant others. Each center presents prevention education programs in Illinois schools and communities.\r\n\r\nIllinois Coalition Against Sexual Assault monitors and funds all approved Illinois Sexual Assault Programs, provides training and education, program development, site reviews, and sets standards for service.','','http://www.icasa.org','sblack@icasa.org','','941516382466411','Professionals: By phone, email, website.\r\nSurvivors of Sexual Assault: By website to find nearest Rape Crisis Center.','','','','','124','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(164,30299,'Occupational/Professional Licensing and Certification * Sexual Assault Issues','','11713','The Illinois Coalition Against Sexual Assault (ICASA) is a non-profit organization of 30 community-based sexual assault crisis centers working together to end sexual violence. Each center provides 24-hour crisis intervention services, counseling and advocacy for victims of sexual assault and their significant others. Each center presents prevention education programs in Illinois schools and communities.\r\n\r\nIllinois Coalition Against Sexual Assault monitors and funds all approved Illinois Sexual Assault Programs, provides training and education, program development, site reviews, and sets standards for service.','','http://www.icasa.org','sblack@icasa.org','',NULL,'Professionals: By phone, email, website.\r\nSurvivors of Sexual Assault: By website to find nearest Rape Crisis Center.','','','','','125','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(165,30332,'Information and Referral * Immigrants','Family Support Network/Hotline','11714','The Illinois Coalition for Immigrant and Refugee Rights (ICIRR) promotes the rights of immigrants and refugees to full and equal participation in the civic, cultural, social and political life of this country. ICIRR works with other other agencies on a variety of immigrant and refugee issues.\r\n\r\nThe Family Support Network and Hotline provides assistance to families facing deportation and supports immigrant access to public benefits, connecting families with information, and referrals to legal, ministry, and social services.','','http://www.icirr.org','info@icirr.org','',NULL,'By phone or website.','Open to immigrants and refugees and to those who support them.','','','','126','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(166,26750,'Consumer Education','','11715','The Illinois Commerce Commission (ICC) investigates complaints against gas, electric, water and phone utilities and acts as a liaison between public utilities and commerce. It also provides consumer education in the areas of utilities and transportation, and works to support the development of retail businesses. The agency seeks an appropriate balance between the interest of consumers and both emerging and existing service providers in accordance with applicable statute and rules. The ICC staff provides technical and legal expertise in a professional environment that encourages initiative, respect, teamwork and commitment to public interest. Access the website or call for further information.','','','','','789038541797078','By phone, website.','All residents of Illinois.','','','','127','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(167,26751,'Utility Service Complaints','','11715','The Illinois Commerce Commission (ICC) investigates complaints against gas, electric, water and phone utilities and acts as a liaison between public utilities and commerce. It also provides consumer education in the areas of utilities and transportation, and works to support the development of retail businesses. The agency seeks an appropriate balance between the interest of consumers and both emerging and existing service providers in accordance with applicable statute and rules. The ICC staff provides technical and legal expertise in a professional environment that encourages initiative, respect, teamwork and commitment to public interest. Access the website or call for further information.','','','','',NULL,'By phone, website.','All residents of Illinois.','','','','128','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(168,30463,'Advocacy * Compulsive Gambling','','11716','The Illinois Council on Problem Gambling (ICPG) is the statewide resource in Illinois for awareness and education about problem gambling. Their mission is to increase public awareness about problem gambling, provide information and resources related to treatment for compulsive gamblers and their families, promote research, and develop and implement problem gambling education and problem gambling prevention programs in the State of Illinois. ICPG advocates for additional and widespread treatment counselors and for facilities, education and research and responsible legislation.  ICPG is the sole Illinois affiliate of the National Council on Problem Gambling.','','http://www.icpg.info','icpg1@aol.com','','637158405241810','By phone, website, email.','Open to individuals with gambling problems, their families, and anyone interested in the issues of problem gambling.','','','','129','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(169,30464,'Crisis Intervention Hotlines/Helplines * Compulsive Gambling','','11716','The Illinois Council on Problem Gambling (ICPG) is the statewide resource in Illinois for awareness and education about problem gambling. Their mission is to increase public awareness about problem gambling, provide information and resources related to treatment for compulsive gamblers and their families, promote research, and develop and implement problem gambling education and problem gambling prevention programs in the State of Illinois. ICPG advocates for additional and widespread treatment counselors and for facilities, education and research and responsible legislation.  ICPG is the sole Illinois affiliate of the National Council on Problem Gambling.','','http://www.icpg.info','icpg1@aol.com','',NULL,'By phone, website, email.','Open to individuals with gambling problems, their families, and anyone interested in the issues of problem gambling.','','','','130','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(170,26813,'Insurance Complaints','','11731','Responsible for the regulation of the insurance industry operating in Illinois. Their mission is to protect consumers by providing assistance and information, by efficiently regulating the insurance industry\'s market behavior and financial solvency, and by fostering a competitive insurance marketplace. They investigate consumer complaints, provide informational workshops, issue licenses to insurance companies, and issue licenses to individuals who self-insure.','','','','',NULL,'A consumer may phone in a complaint, file a complaint online at the website, or file a complaint by mail.','','','','','131','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(171,26814,'Insurance Fraud Reporting','','11731','Responsible for the regulation of the insurance industry operating in Illinois. Their mission is to protect consumers by providing assistance and information, by efficiently regulating the insurance industry\'s market behavior and financial solvency, and by fostering a competitive insurance marketplace. They investigate consumer complaints, provide informational workshops, issue licenses to insurance companies, and issue licenses to individuals who self-insure.','','','','',NULL,'A consumer may phone in a complaint, file a complaint online at the website, or file a complaint by mail.','','','','','132','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(172,26833,'Disease/Disability Information * Deafness * Hard of Hearing','','11736','Illinois Families for Hands & Voices is a parent-driven, non-profit organization dedicated to supporting families that have children who are deaf and hard-of-hearing. IFH&V provides advocacy, resources, and facilitates networking opportunities. Information and resources range from early intervention and assessment to support for students to age 21.','','http://ilhandsandvoices.org','ilhandsandvoices@gmail.com','',NULL,'By phone, email, or website.','Families that have children who are deaf and hard-of-hearing','','','','133','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(173,30339,'Mentoring Programs * Parents of People With Disabilities * Deafness','Illinois Guide By Your Side (GBYS)','11736','Illinois Guide By Your Side (GBYS) is a non-profit program supported by Illinois Hands & Voices. GBYS provides trained Parent Guides who are themselves parents of children with hearing loss. Parent Guides provide provide unbiased information and resources regarding communication, educational and technological choices, and navigating the services and systems available in Illinois.\r\n\r\nServices include:\r\n- One-on-One consultation via phone, email or home visits with a regional Parent Guide.\r\n- The opportunity to network with other families.\r\n- Notification of, and opportunities to participate in, local and statewide educational events.','','http://ilhandsandvoices.org','ilhandsandvoices@gmail.com','',NULL,'By phone or website.','Families that have children who are deaf and hard-of-hearing. Available to families at all stages of child/adolescent development, from the time a child is suspected to have hearing loss through age 21.','','','','134','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(174,30340,'Advocacy * Deafness','','11736','Illinois Families for Hands & Voices is a parent-driven, non-profit organization dedicated to supporting families that have children who are deaf and hard-of-hearing. IFH&V provides advocacy, resources, and facilitates networking opportunities. Information and resources range from early intervention and assessment to support for students to age 21.','','http://ilhandsandvoices.org','ilhandsandvoices@gmail.com','','637158405241810','By phone, email, or website.','Families that have children who are deaf and hard-of-hearing','','','','135','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(175,26839,'Home Care/Hospice Associations','','11739','Illinois Hospice and Palliative Care Organization (IL-HPCO) is committed to promoting and enhancing palliative and end-of-life care in the state of Illinois, through education, advocacy, strategic partnerships and technical and supportive services. Their mission is to expand access to exceptional hospice and palliative care for patients and families coping with the close of life experience.','','http://www.il-hpco.org','','',NULL,'By phone, website, or email.','Membership open to hospice professionals. Website provides consumer information on hospice and end-of-life resources, as well as a hospice locator.','','','','136','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(176,26841,'First Time Buyer Home Loans','','11740','Illinois Housing and Development Authority (IHDA) finances the creation and preservation of affordable housing throughout the state to increase the supply of decent and safe places for people of low or moderate means to live. Services include:\r\n- First-time homebuyer information.\r\n- Listing of apartment developments financed by IHDA.\r\n- Home purchase and loan assistance for eligible applicants.\r\n- Foreclosure Prevention Network provides free phone counseling to homeowners experiencing difficulty making mortgage payments.\r\n- Welcome Home Heroes Financing Program is open to all qualified Illinois veterans, active military personnel, reservists, and Illinois National Guard members.\r\n- A listing of agencies in Illinois that provide intensive counseling and budgeting assistance to homeowners and renters.','','http://www.ihda.org','','',NULL,'By phone or website.','Residents of Illinois.','','','','137','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(177,26844,'Mortgage Delinquency and Default Counseling','','11740','Illinois Housing and Development Authority (IHDA) finances the creation and preservation of affordable housing throughout the state to increase the supply of decent and safe places for people of low or moderate means to live. Services include:\r\n- First-time homebuyer information.\r\n- Listing of apartment developments financed by IHDA.\r\n- Home purchase and loan assistance for eligible applicants.\r\n- Foreclosure Prevention Network provides free phone counseling to homeowners experiencing difficulty making mortgage payments.\r\n- Welcome Home Heroes Financing Program is open to all qualified Illinois veterans, active military personnel, reservists, and Illinois National Guard members.\r\n- A listing of agencies in Illinois that provide intensive counseling and budgeting assistance to homeowners and renters.','','http://www.ihda.org','','',NULL,'By phone or website.','Residents of Illinois.','','','','138','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(183,30375,'Disease/Disability Information * Learning Disabilities','','11850','Learning Disabilities Association of Illinois (LDAIL) provides support to people with learning disabilities, as well as their parents, teachers, and other professionals. At the national, state and local levels, it provides information on learning disabilities, practical solutions, and a comprehensive network of resources. The goal is to assist those with learning disabilities to succeed in work, school, relationships and the community.','','http://ldaillinois.org','ldaofil@ameritech.net','',NULL,'Call, email, or visit the website for information','Parents, teachers, professionals, students, persons who have a learning disability, and friends of the learning disabilities community are all eligible.','','','','139','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(195,30292,'Support Groups * Multiple Sclerosis','','11932','National Multiple Sclerosis Society and its network of chapters nationwide promote research, educate, and advocate on critical issues related to multiple sclerosis (MS). They provide a wide range of programs, including support for the newly diagnosed and those living with multiple sclerosis over time.\r\n\r\nThe Greater Illinois Chapter sponsors support groups throughout the central and northern portions of the state. Peer support is also available. There is a support group locator on the website.','','http://www.nationalmssociety.org','','',NULL,'By phone or website.','Open to anyone with MS or interested in the topic.','','','','140','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(201,30016,'Perinatal/Postpartum Depression Counseling','','11993','- Runs workshops for pregnant and new moms on the importance of self-care in Northbrook.\r\n- Offers email and phone support to women across Illinois.\r\n- Website has lots of information about pregnancy and postpartum mood disorders; how to recognize symptoms, information about self-help strategies, and how to know if professional help is needed.','','http://www.ppdil.org','support@ppdil.org','',NULL,'By phone, website, email.','Open to anyone suffering from or concerned about postpartum depression.','','','','141','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(205,2199,'Case/Care Management * Brain Injuries','Brain Injury Case Management','1205','Brain Injury Home Services Program - The goal of the home services program is to maintain individuals in their homes to prevent institutionalization. Participants are provided with case management to assist in obtaining services to help increase their independence. The program can assist with getting personal support workers, adult day care, nursing care, therapies, home modifications, emergency response, and a variety of other services.','','','','',NULL,'Application and intake for this program is through applicant\'s local Division of Rehabilitation office.','','','','','142','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(206,27790,'Ex-Offender Employment Programs','','12051','Provides employment, educational, and supportive services for individuals with criminal records. Their mission is to support, through a full spectrum of services, the efforts of people with arrest & conviction records to become employed, law-abiding members of the community and, as a result, reduce recidivism.','','','','',NULL,'By phone or website.','People with criminal records who want to become fully employed, law-abiding members of the community.','','','','143','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(207,27791,'Ex-Offender Reentry Programs','','12051','Provides employment, educational, and supportive services for individuals with criminal records. Their mission is to support, through a full spectrum of services, the efforts of people with arrest & conviction records to become employed, law-abiding members of the community and, as a result, reduce recidivism.','','','','',NULL,'By phone or website.','People with criminal records who want to become fully employed, law-abiding members of the community.','','','','144','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(208,27939,'Environmental Improvement Groups','','12080','Sierra Club is a grassroots environmental organization throughout the country.  The club sponsors outdoor recreational activities, recycling efforts, trash cleanup, monitoring the rivers, and advocating for the environment. The goal of the organization is to enjoy, preserve and protect natural and wild places.','','http://www.sierraclub.org/illinois/','illinois.chapter@sierraclub.org','','637158405241810','By website; find a local group for meeting and event details.','','','','','145','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(209,29785,'Volunteer Opportunities','','12080','Sierra Club is a grassroots environmental organization throughout the country.  The club sponsors outdoor recreational activities, recycling efforts, trash cleanup, monitoring the rivers, and advocating for the environment. The goal of the organization is to enjoy, preserve and protect natural and wild places.','','http://www.sierraclub.org/illinois/','illinois.chapter@sierraclub.org','',NULL,'By website; find a local group for meeting and event details.','','','','','146','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(210,29786,'Recreational Activities/Sports','','12080','Sierra Club is a grassroots environmental organization throughout the country.  The club sponsors outdoor recreational activities, recycling efforts, trash cleanup, monitoring the rivers, and advocating for the environment. The goal of the organization is to enjoy, preserve and protect natural and wild places.','','http://www.sierraclub.org/illinois/','illinois.chapter@sierraclub.org','',NULL,'By website; find a local group for meeting and event details.','','','','','147','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(222,28419,'Social Services for Military Personnel','','12232','USO of Illinois Inc. Centers are available for walk-in service for military personnel. Program services include: Drop-in centers at O\'Hare and Midway airports, Rock Island and Navy Pier that offer a place to relax, refreshments, movies and Internet and email access; Illinois AMVETS emergency fund to help military families in need; troop entertainment; Discovery Kids programs for family of military including cultural and educational entertainment and holiday events; support for homecomings and deployments; and community information.','','','','',NULL,'Contact by phone, website, email.','Any active duty member of the Armed Forces, National Guard, or Reserves and their dependent family members.','','','','148','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(230,83,'Telecommunication Relay Services','','1267','Assists in conversations between text telephone users and hearing individuals who use a standard phone. Trained operators relay conversations by typing spoken words into a text telephone unit and speaking the typed words received from the text telephone caller. Also handles Telebraille calls for deaf and blind users and Speech to Speech calls for individuals whose speech is unintelligible (e.g., someone who has Lou Gehrig\'s disease).','','http://www.illinoisrelay711.com','sprint.trscustserv@mail.sprint.com','',NULL,'By phone.','','','','','149','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(231,21064,'State Police','','1273','The state agency that has responsibility for enforcing state laws, investigating crimes, providing laboratory analysis of criminal evidence, gathering and sharing criminal intelligence, and providing expertise and resources to other law enforcement agencies throughout the state.','','','','',NULL,'','','','','','150','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(232,930,'Support Groups * Leukemia * Lymphoma','','128','- Family Support Groups:  Available for patients, families, and caregivers. Groups are guided by two volunteer oncology health professionals.\r\n\r\n- First Connection: Links newly-diagnosed patients to a peer volunteer who has experienced a similar diagnosis. A trained patient-volunteer currently in remission phones the new patient to share information and support. \r\n\r\n- LLS website: Offers online chats and an online community.\r\n\r\nContact the Illinois Chapter for information about local support services and educational programs.','','http://www.lls.org/illinois','infocenter@lls.org','',NULL,'By phone, website.','','','','','151','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(242,30427,'Public Libraries','','13729','Public library serving the residents of Rantoul.','','http://www.rantoul.lib.il.us','rantoullib@gmail.com','',NULL,'','','','','','152','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(249,31837,'Expectant/New Parent Assistance','','14013','Healthy Beginnings is a Nurse Home Visiting service for expecting mothers to receive additional support throughout her pregnancy and during her child\'s first few years of life.  Our goal is help mothers achieve their goals and maintain healthy families.  We offer 1 on 1 support and guidance from your own free nurse that comes to your house.','','','Healthybeginningsreferral@carle.com','',NULL,'By phone, email.','','','','','153','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(250,31838,'Home Based Parenting Education','','14013','Healthy Beginnings is a Nurse Home Visiting service for expecting mothers to receive additional support throughout her pregnancy and during her child\'s first few years of life.  Our goal is help mothers achieve their goals and maintain healthy families.  We offer 1 on 1 support and guidance from your own free nurse that comes to your house.','','','Healthybeginningsreferral@carle.com','','789038541797078','By phone, email.','','','','','154','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(251,932,'Support Groups * Mental Illness/Emotional Disabilities',NULL,'1405','COVID-19:\r\nGroup meetings are being conducted by tele- and video-conferencing during the pandemic.\r\n-------------------------\r\nA not-for-profit corporation chartered in the State of Illinois and devoted to community mental health through a well-established program of self-help groups. GROW\'s program is based on support group meetings held weekly, as well as personal contact throughout the year. \r\n\r\nPeople come to GROW with diverse problems in living, such as mental health issues, emotional troubles, or difficulty coping with grief, loneliness, anxiety, or stress. Through leadership and community building, individuals attending weekly group meetings are given the tools and support to help them in their recovery and personal growth.\r\n\r\nAll services and groups are anonymous and confidential.','','https://www.growinamerica.org',NULL,NULL,'637158405241810,968511154801619','By phone or website.',NULL,NULL,NULL,NULL,'155,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-05-26 02:31:49'),(252,223,'State Units on Aging','','1454','The Illinois Department on Aging administers a comprehensive service delivery system to help older adults remain independent. The Department\'s Community Care Program (CCP) services include comprehensive care coordination, adult day, in-home care and emergency home response. The Department also administers the Benefit Access Program, which provides reduced priced license plates and Ride Free Transit Cards for eligible Illinois residents.\r\n\r\nIn addition, the Department works in partnership with designated Area Agencies on Aging to administer community-based programs funded through the federal Older Americans Act such as home-delivered meals, transportation, information and assistance, and caregiver support. The Adult Protective Services Program works to prevent the abuse of older adults and persons with disabilities ages 18-59 living in the community and the Long-Term Care Ombudsman Program promotes the rights and quality of life for people who live in long term care facilities.\r\n\r\nTo report suspected abuse, exploitation or neglect of an older person or an adult with disabilities, call the statewide, 24-hour Adult Protective Services Hotline: 1-866-800-1409, 1-888-206-1327 (TTY).','','http://www.illinois.gov/aging','aging.ilsenior@illinois.gov','',NULL,'By phone or website.','- To be eligible for CCP, an individual must be at least 60 years of age, have less than $17,500 in assets (home, car, and household furnishings are excluded), apply for medical benefits (Medicaid), and have an assessed need for long-term care.\r\n- To be eligible for the Benefit Access Program, an individual must be disabled or at least 65 years of age and meet income guidelines. \r\n- To be eligible for services funded through the Older Americans Act, an individual must be at least 60 years of age.','','','','156','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(253,10897,'Elder/Dependent Adult Abuse Reporting','Adult Protective Services (APS)','1454','The Illinois Department on Aging is charged with the responsibility of preventing abuse of older persons and adults (18-59) with disabilities who live in the community. \r\n\r\nThe Adult Protective Services Program is locally coordinated through 45 provider agencies, which are designated by the regional Area Agency on Aging and the Department on Aging. Caseworkers from these agencies conduct investigations and work with adults with disabilities and seniors in resolving abusive situations.\r\n','','http://www.illinois.gov/aging','aging.ilsenior@illinois.gov','',NULL,'','Either age 60 and older, or age 18 and older with a disability.','','','','157','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(254,10898,'Information and Referral * Older Adults','Senior Helpline','1454','The IDOA\'s Senior Helpline can:\r\n- Help you locate services in your community.\r\n- Evaluate your needs and answer questions.\r\n- Link you to local case management services.\r\n- Provide information, assistance, and literature.\r\n\r\nThe Senior Helpline provides information on Illinois\' programs and services and links persons 60 years of age and older and their caregivers to local services. Professional staff briefly assess needs, send literature, and write referrals for a range of services such as case management, the Long-Term Care Ombudsman program, legal services, Medicare, transportation, employment and nutrition services.','','http://www.illinois.gov/aging','aging.ilsenior@illinois.gov','',NULL,'By phone.','','','','','158','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(255,14389,'USDA Rural Home Purchase Loan Programs','','1478','USDA\'s Rural Housing Service offers a variety of programs to build or improve housing and essential community facilities in rural areas. The program offer loans, grants and loan guarantees for single- and multi-family housing, child care centers, fire and police stations, hospitals, libraries, nursing homes, schools, first responder vehicles and equipment, housing for farm laborers and much more. Programs available:\r\n\r\n- Single-Family Housing Programs: USDA\'s Single Family Housing Programs provide direct loans or loan guarantees to help low- and moderate-income rural Americans buy safe, affordable housing in rural areas. USDA also offers loans and grants to help rural residents make health and safety repairs to homes.\r\n\r\n- Multi-Family Housing Programs: USDA\'s Multi-Family Housing Programs offer loans to provide affordable rental housing for very-low-, low- and moderate-income residents, the elderly, and persons with disabilities. Funds also may be used to buy and improve land and to provide necessary facilities such as water and waste disposal systems. In addition, USDA offers rental assistance to help eligible rural residents with their monthly rental costs.\r\n\r\n-Rural Rental Housing Program: USDA Rural Development funds several apartment complexes in rural areas of Illinois. The apartment complexes are privately owned but receive funding from the program and may be rented at a reduced rate. Apartment complexes participating in the program may also be located online by visiting this website: rdmfhrentals.sc.egov.usda.gov.\r\n\r\n- Community Facilities Programs: USDA\'s Community Facilities Programs provide loans, grants and loan guarantees for essential community facilities in rural areas. Priority is given to health care, education and public safety projects. Typical projects are hospitals, health clinics, schools, fire houses, community centers, first responder vehicles and equipment and many other community-based initiatives.','','','','',NULL,'By phone.','Varies by program, call for more information.','','Photo ID, proof of income, and Social Security card.','','159','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(256,24410,'Low Income/Subsidized Rental Housing','','1478','USDA\'s Rural Housing Service offers a variety of programs to build or improve housing and essential community facilities in rural areas. The program offer loans, grants and loan guarantees for single- and multi-family housing, child care centers, fire and police stations, hospitals, libraries, nursing homes, schools, first responder vehicles and equipment, housing for farm laborers and much more. Programs available:\r\n\r\n- Single-Family Housing Programs: USDA\'s Single Family Housing Programs provide direct loans or loan guarantees to help low- and moderate-income rural Americans buy safe, affordable housing in rural areas. USDA also offers loans and grants to help rural residents make health and safety repairs to homes.\r\n\r\n- Multi-Family Housing Programs: USDA\'s Multi-Family Housing Programs offer loans to provide affordable rental housing for very-low-, low- and moderate-income residents, the elderly, and persons with disabilities. Funds also may be used to buy and improve land and to provide necessary facilities such as water and waste disposal systems. In addition, USDA offers rental assistance to help eligible rural residents with their monthly rental costs.\r\n\r\n-Rural Rental Housing Program: USDA Rural Development funds several apartment complexes in rural areas of Illinois. The apartment complexes are privately owned but receive funding from the program and may be rented at a reduced rate. Apartment complexes participating in the program may also be located online by visiting this website: rdmfhrentals.sc.egov.usda.gov.\r\n\r\n- Community Facilities Programs: USDA\'s Community Facilities Programs provide loans, grants and loan guarantees for essential community facilities in rural areas. Priority is given to health care, education and public safety projects. Typical projects are hospitals, health clinics, schools, fire houses, community centers, first responder vehicles and equipment and many other community-based initiatives.','','','','','929094559121639','By phone.','Varies by program, call for more information.','','Photo ID, proof of income, and Social Security card.','','160','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(257,5273,'Wish Foundations','','149','Make-A-Wish Illinois grants the wishes of children with life-threatening medical conditions to enrich their lives with hope, strength, and joy.','','','','',NULL,'Children can be referred by parents, family members or medical professionals familiar with the child\'s case. Details and referral information available at www.illinois.wish.org/refer.','To qualify for a wish, a child:\r\n- Must be older than 2 1/2 and younger than 18.\r\n- Must live in Illinois.\r\n- May not have had a wish granted previously by the Make-A-Wish Foundation or any other wish-granting organization.\r\n- Is diagnosed with a life-threatening medical condition at the time of referral. The child\'s treating physician makes the final determination of whether a child\'s medical condition qualifies him or her for a wish.','','','None.','161','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(258,455,'Crisis Intervention Hotlines/Helplines * AIDS/HIV * Sexually Transmitted Disease','AIDS/HIV & STD Hotline','1502','The free and anonymous State of Illinois AIDS/HIV & STD Hotline provides callers with the most up-to-date, medically-accurate information on AIDS/HIV and sexually-transmitted diseases (STDs), emotional support, and state-wide referrals for healthcare, free testing, and social services related to AIDS/HIV and STDs. The AIDS/HIV & STD Hotline, funded by the State of Illinois Department of Public Health, is run entirely by trained professionals who have undergone a comprehensive AIDS/HIV and STD instructional program.','','http://www.centeronhalsted.org','','',NULL,'By phone or website.','','','','','162','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(259,19786,'Nursing Facilities','','151','Heartland provides a wide range of comprehensive medical services including 24-hour nursing care and physical, occupational, and speech therapy to a broad spectrum of patients. In addition to the skilled nursing and rehabilitation services, the clinic offers therapeutic recreation and social activities. Both short-term and long-term nursing care is available.','','','','',NULL,'Walk-in or phone for appointment to tour facility.','','','','','163','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(260,784,'Non-Emergency Medical Transportation','NETSPAP/Non-Emergency Transportation Services Prior Approval Program','1529','DHS\' Medical Assistance (Medicaid) will pay for rides to and from non-emergency medical care appointments for individuals who have a current medical card, if the ride is approved by First Transit.\r\n\r\nFirst Transit is a screening and approval system that DHS uses to contract rides with independent transportation service providers. They make the decision as to whether the customer is eligible for rides. If approved, they will provide the client with the name and phone number of a company or person who will give them a ride. The client must call the company or person to schedule his or her ride.\r\n\r\nWhen they call First Transit, clients will be asked for the following information:\r\n- Name, address, and phone number of the person who needs a ride.\r\n- The person\'s RIN number from the medical or All Kids card.\r\n- Name of the doctor, dentist, clinic, or lab.\r\n- Address and phone number of the doctor, dentist, clinic, or lab.\r\n- Date, time, and reason for appointment.\r\n- Name of the particular company or person they want to give them a ride, if there is a preference.\r\n- If there are medical or non-medical reasons why client cannot use public or other transportation.\r\n- If client uses a walker, wheelchair, or cane; and if client can travel by his or herself.','','http://www.netspap.com','','','1232587316936391','','Individual must be covered by Medicaid (Medical Card) or All Kids.','','','','164','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(261,14405,'Federal Tax Collection Agencies','','1579','Call or visit the website to request tax information or tax forms.','','','','',NULL,'','','','','','165','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(262,17647,'Case/Care Management * Domestic Violence Issues','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','',NULL,'Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','166','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(263,6,'Blood Donor Stations','','160','American Red Cross helps to provide blood for persons in need through blood drives.','','http://www.redcross.org/csil','','',NULL,'By phone or website for more information or to schedule an appointment. Walk-ins accepted on scheduled donation days.','Donors must be age 17 or older. Donation by 16-year-olds is allowed with a signed parental consent form. Donors must weigh at least 110 pounds and be in good health.','','','','167','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(264,95,'Emergency Communications * Families of Military Personnel/Veterans','','160','The American Red Cross supports members of the military and their families pre-deployment, during deployment, and when they return home through emergency communication services, financial assistance programs, re-integration, and veteran services.\r\n\r\nRed Cross workers use advanced communications technologies to link service members with their families. The Emergency Communications Center quickly and efficiently obtains the required information and sends emergency communication messages to service members of every branch of service wherever in the world they happen to be.','','http://www.redcross.org/csil','','','878986697513222','By phone.','','','','','168','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(265,365,'First Aid Instruction','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','http://www.redcross.org/csil','','',NULL,'By phone or website to register.','','','','','169','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(266,369,'Disaster Relief Services','','160','The American Red Cross offers disaster services to clients who experience a verified disaster, including home fires, tornadoes, and floods. The Red Cross provides assistance to meet clients\' immediate needs, including for food, shelter, clothing, and health and mental health immediate needs, and helps clients begin their recovery. Amount of assistance is based on clients\' needs.','','http://www.redcross.org/csil','','',NULL,'By phone.','Client must have experienced a verified disaster.','','','','170','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(267,441,'Volunteer Opportunities','','160','Red Cross volunteers help people prevent, prepare, and respond to emergencies, and provide relief to victims of disasters.','','http://volunteerconnection.redcross.org','','',NULL,'By phone and website.','','','','','171','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(268,553,'Temporary Financial Assistance * Families of Military Personnel/Veterans','','160','Families of military personnel can apply for a financial grant for a wide range of needs including but not limited to utilities, medical, and car repair.','','http://www.redcross.org/csil','','','1077790582995406','An application will be taken and submitted to the military processing center and an answer will generally be received within 24 hours, not including weekends.','Must have a spouse in active military duty.','','','None.','172','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(269,23255,'Information and Referral * Active Military * Veterans','','160','The American Red Cross supports members of the military and their families pre-deployment, during deployment, and when they return home through emergency communication services, financial assistance programs, re-integration, and veteran services.\r\n\r\nRed Cross workers use advanced communications technologies to link service members with their families. The Emergency Communications Center quickly and efficiently obtains the required information and sends emergency communication messages to service members of every branch of service wherever in the world they happen to be.','','','','',NULL,'By phone.','','','','','173','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(270,23256,'Babysitting Instruction','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','','','',NULL,'By phone or website to register.','','','','','174','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(271,23257,'Community Disaster Education','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','','','','789038541797078','By phone or website to register.','','','','','175','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(272,23258,'First Aid Instruction','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','','','',NULL,'By phone or website to register.','','','','','176','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(273,23259,'Water Safety Education','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','','','',NULL,'By phone or website to register.','','','','','177','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(274,23260,'Volunteer Opportunities','','160','Red Cross volunteers help people prevent, prepare, and respond to emergencies, and provide relief to victims of disasters.','','','','',NULL,'By phone and website.','','','','','178','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(276,14331,'Thrift Shops','','1658','Goodwill stores feature gently used and new items that are bargains for shoppers. Items offered include jeans, business attire, infant and children\'s clothing, housewares, linens, furniture and more. Additionally, shopping is available from home on Goodwill\'s online auction site, www.shopgoodwill.com.','','','','',NULL,'','','','','','179','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(277,14333,'Comprehensive Job Assistance Centers','Career Services','1658','COVID-19: \r\nGoodwill Career Center office is still available virtually for your clients &  the communities needs by email or phone.\r\n217-220-9445 or email: ursula.loercher@llgi.org\r\n\r\nWe can still assist with resumes and employment information.  We are also available to help those with filing for unemployment. Our services are limited due to access since we do not work for IDES but will try to help those who need assistance.\r\n\r\nThis is the time to utilize our online training programs Skills To Succeed, www.s2sacademy.org & GCFLEARNFREE,  www.gcflearnfree.org.\r\n\r\nSkills to Succeed is an employability training program that can help you with interviewing & resume along with several other topics pertaining to employment.\r\n\r\ngcflearnfree , you can learn new computer skills or upgrade on programs that you might have not used for a while, along with many other topics.\r\n------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\r\nLand of Lincoln Goodwill Industries provides an array of employment opportunities, job training and counseling, and related career services to central Illinois residents through programs that embrace education, self-sufficiency, hope, and pride. For those with special needs or lacking employable skills, Goodwill provides programs that develop those skills, job search assistance, and personal improvement. Services include:\r\n- Resume writing and cover letters.\r\n- Interview skills.\r\n- Filling out employment applications.\r\n- Communication skills.\r\n- Career development and advancement.\r\n- Computer skills and training.\r\n\r\nLand of Lincoln Goodwill Industries has also developed a focused Veteran Employment Program aimed at helping vets achieve positive results in the workforce. Our program and services can help if you are a recently returning veteran or someone who served our county in the past and is looking for support.\r\n','','','','','970915508638448','By phone or appointment.','','','Photo ID.','','180','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(279,937,'Support Groups * Spina Bifida','','1807','ISBA is dedicated to improving the quality of life of children, adults, and families living with spina bifida. Programs include:\r\n- Camp Independence in association with the YMCA of Metro Chicago.\r\n- GoBabyGo workshops.\r\n- Financial assistance for emergencies and medical equipment.\r\n- Information and referral.\r\n- Play dates for families of children 0-10.\r\n- Chicago Adult Group.\r\n- ABLE Savers program.\r\n- College and camp scholarships.\r\n- Conferences and workshops.\r\n- Statewide groups.\r\n- Research awards.\r\n\r\nThe Illinois Spina Bifida Association\'s Community-Clinic Connection program serves children, adults, and families living with spina bifida. The program works to:\r\n-Identify resource needs of individuals/families and refer them to appropriate services.\r\n-Support and improve family resilience by increasing social connectedness and reducing stress and isolation.\r\n-Identify and support social functioning and skill development goals of individuals/families.\r\n\r\nThe Community-Clinic Connection program works to achieve these goals through three types of activities:\r\n-Outreach at outpatient spina bifida clinics.\r\n-Community events.\r\n-Individualized coaching and support.','','http://www.i-sba.org','info@i-sba.org','',NULL,'By phone.','','','','','181','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(280,9628,'Disease/Disability Information * Spina Bifida','','1807','ISBA is dedicated to improving the quality of life of children, adults, and families living with spina bifida. Programs include:\r\n- Camp Independence in association with the YMCA of Metro Chicago.\r\n- GoBabyGo workshops.\r\n- Financial assistance for emergencies and medical equipment.\r\n- Information and referral.\r\n- Play dates for families of children 0-10.\r\n- Chicago Adult Group.\r\n- ABLE Savers program.\r\n- College and camp scholarships.\r\n- Conferences and workshops.\r\n- Statewide groups.\r\n- Research awards.\r\n\r\nThe Illinois Spina Bifida Association\'s Community-Clinic Connection program serves children, adults, and families living with spina bifida. The program works to:\r\n-Identify resource needs of individuals/families and refer them to appropriate services.\r\n-Support and improve family resilience by increasing social connectedness and reducing stress and isolation.\r\n-Identify and support social functioning and skill development goals of individuals/families.\r\n\r\nThe Community-Clinic Connection program works to achieve these goals through three types of activities:\r\n-Outreach at outpatient spina bifida clinics.\r\n-Community events.\r\n-Individualized coaching and support.','','http://www.i-sba.org','info@i-sba.org','',NULL,'By phone.','','','','','182','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(281,24917,'Temporary Financial Assistance * Health Conditions','','1807','ISBA is dedicated to improving the quality of life of children, adults, and families living with spina bifida. Programs include:\r\n- Camp Independence in association with the YMCA of Metro Chicago.\r\n- GoBabyGo workshops.\r\n- Financial assistance for emergencies and medical equipment.\r\n- Information and referral.\r\n- Play dates for families of children 0-10.\r\n- Chicago Adult Group.\r\n- ABLE Savers program.\r\n- College and camp scholarships.\r\n- Conferences and workshops.\r\n- Statewide groups.\r\n- Research awards.\r\n\r\nThe Illinois Spina Bifida Association\'s Community-Clinic Connection program serves children, adults, and families living with spina bifida. The program works to:\r\n-Identify resource needs of individuals/families and refer them to appropriate services.\r\n-Support and improve family resilience by increasing social connectedness and reducing stress and isolation.\r\n-Identify and support social functioning and skill development goals of individuals/families.\r\n\r\nThe Community-Clinic Connection program works to achieve these goals through three types of activities:\r\n-Outreach at outpatient spina bifida clinics.\r\n-Community events.\r\n-Individualized coaching and support.','','http://www.i-sba.org','info@i-sba.org','','1077790582995406','By phone.','','','','','183','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(282,24918,'Scholarships','','1807','ISBA is dedicated to improving the quality of life of children, adults, and families living with spina bifida. Programs include:\r\n- Camp Independence in association with the YMCA of Metro Chicago.\r\n- GoBabyGo workshops.\r\n- Financial assistance for emergencies and medical equipment.\r\n- Information and referral.\r\n- Play dates for families of children 0-10.\r\n- Chicago Adult Group.\r\n- ABLE Savers program.\r\n- College and camp scholarships.\r\n- Conferences and workshops.\r\n- Statewide groups.\r\n- Research awards.\r\n\r\nThe Illinois Spina Bifida Association\'s Community-Clinic Connection program serves children, adults, and families living with spina bifida. The program works to:\r\n-Identify resource needs of individuals/families and refer them to appropriate services.\r\n-Support and improve family resilience by increasing social connectedness and reducing stress and isolation.\r\n-Identify and support social functioning and skill development goals of individuals/families.\r\n\r\nThe Community-Clinic Connection program works to achieve these goals through three types of activities:\r\n-Outreach at outpatient spina bifida clinics.\r\n-Community events.\r\n-Individualized coaching and support.','','http://www.i-sba.org','info@i-sba.org','',NULL,'By phone.','','','','','184','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(283,335,'Poison Control','','1824','The Illinois Poison Center provides the people of Illinois with access to comprehensive information and treatment advice on potentially harmful substances via a free, confidential 24-hour helpline. The helpline is staffed by specially trained medical experts, including doctors, nurses, and pharmacists.','','http://www.illinoispoisoncenter.org','','',NULL,'By phone or website.','','','','','185','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(284,23053,'Substance Use Disorder Treatment Programs * Rural Residents','TRACT - Treating Rural Adult Clients with Technology','1848','A speciailized treament program for adult residents of rural Central Illinois who suffer from Substance Use Disorder (such as alcohol, marijuana, cocaine, or opioid use). After clients are evaluated at the Chestnut Street location, the program uses phone contacts or a web-based community reinforcement approach.','','','','',NULL,'By phone.','Rural residents of Central Illinois who suffer from Substance Use Disorder. Clients cannot live within 6 miles of a treatment center or be in Drug Court or Recovery Court.','','','','186','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(285,1737,'Medical Care Expense Assistance * Leukemia * Lymphoma','LLS Co-Pay Assistance Program','128','Contact the Illinois Chapter of LLS to find out about possible local sources of financial assistance. LLS also offers a Co-Pay Assistance Program providing financial support toward the cost of insurance premiums and/or co-payments for certain treatments and prescription drugs. Patients must qualify both medically and financially for this program.','','http://www.lls.org/copay','copay@lls.org','',NULL,'By phone, email, or website.','Clients must:\r\n- Have a covered blood cancer diagnosis.\r\n- Have insurance with prescription coverage.\r\n- Meet financial guidelines.\r\n- Reside in the US or Puerto Rico.','','','','187','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(286,1738,'Disease/Disability Information * Leukemia * Lymphoma','','128','1) Information Resource Center - The IRC provides information and resources useful to blood cancer patients, their families, and health care professionals. It is staffed by master\'s level oncology social workers and health educators.\r\n2) Website - The Society\'s website (www.LLS.org) serves a wide variety of education and information needs and features a comprehensive overview of the Society\'s programs and services, Family Support Groups, information about the peer-to-peer program First Connection, and other programs.\r\n3) Teleconferences & Webcasts - For patients, caregivers, and health care professionals on leukemia, lymphoma, myeloma, and survivorship issues. \r\n4) Educational Materials - An extensive collection of educational materials is offered free-of-charge to patients and health care professionals.','','http://www.lls.org/illinois','infocenter@lls.org','',NULL,'By phone or e-mail.','','','','','188','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(287,25021,'Non-Emergency Medical Transportation * Leukemia * Lymphoma','Susan Lang Pay-It-Forward Patient Travel Assistance Program','128','When funding is available, eligible blood cancer patients are assisted financially with transportation to and from their doctors or treatment centers.  Approved expenses include ground transportation (gas, tolls, car rental, taxi, bus, train, ambulance services, etc.), air travel, and lodging related expenses.','','http://www.lls.org/travel','infocenter@lls.org','','1232587316936391','By phone or website.','Applicants must:\r\n- Have confirmed blood cancer diagnosis.\r\n- Be a US citizen or permanent resident.\r\n- Meet a income guidelines.','','','Generally at or below 500% of US Federal Poverty Guidelines and Cost of Living based on geographic location.','189','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(288,142,'Alternative Education','','132','Young people (ages 16-18) can volunteer to participate in the academy which provides a 17-month life skills program, with the first 5 1/2 months in residency at the Main Facility. Youth receive GED instruction, self-discipline, life-coping skills, and career counseling while living in a structured, military environment. During the remaining 12 months, they are assigned a mentor from their community. Youth must continue their education in a post-secondary institution or obtain employment. They may be eligible to receive a monetary stipend from the program to assist in education or employment costs. Youth may also receive scholarships to select post-secondary education institutions.\r\n\r\nThere are 8 core components of the Lincoln\'s ChalleNGe Academy program. Cadets must successfully complete all 8 components to graduate from the Academy. The core components are designed to educate and produce youth that will become productive members of the community upon graduation. The 8 core components are:\r\n- Academic excellence.\r\n- Life coping skills.\r\n- Job skills.\r\n- Health and hygiene.\r\n- Responsible citizenship.\r\n- Service to the community.\r\n- Leadership/Followership.\r\n- Physical fitness.','','http://www.lincolnschallenge.org','','','789038541797078','By phone.','The basic eligibility requirements for acceptance into the program are: applicants must be between the ages of 16-18 on class start date, free of illegal drugs, educationally at risk, mentally and physically capable to participate, Illinois resident, and not under indictment or convicted of a felony offense.','','If applying to the program, the individual will need to provide their ID/driver\'s license, Social Security number, birth certificate, immunization records, health insurance coverage, and school transcript.','None.','190','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(289,17622,'Alternative Education','','132','Young people (ages 16-18) can volunteer to participate in the academy which provides a 17-month life skills program, with the first 5 1/2 months in residency at the Main Facility. Youth receive GED instruction, self-discipline, life-coping skills, and career counseling while living in a structured, military environment. During the remaining 12 months, they are assigned a mentor from their community. Youth must continue their education in a post-secondary institution or obtain employment. They may be eligible to receive a monetary stipend from the program to assist in education or employment costs. Youth may also receive scholarships to select post-secondary education institutions.\r\n\r\nThere are 8 core components of the Lincoln\'s ChalleNGe Academy program. Cadets must successfully complete all 8 components to graduate from the Academy. The core components are designed to educate and produce youth that will become productive members of the community upon graduation. The 8 core components are:\r\n- Academic excellence.\r\n- Life coping skills.\r\n- Job skills.\r\n- Health and hygiene.\r\n- Responsible citizenship.\r\n- Service to the community.\r\n- Leadership/Followership.\r\n- Physical fitness.','','','','','789038541797078','By phone.','The basic eligibility requirements for acceptance into the program are: applicants must be between the ages of 16-18 on class start date, free of illegal drugs, educationally at risk, mentally and physically capable to participate, Illinois resident, and not under indictment or convicted of a felony offense.','','If applying to the program, the individual will need to provide their ID/driver\'s license, Social Security number, birth certificate, immunization records, health insurance coverage, and school transcript.','None.','191','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(292,13994,'Smoking/Vaping Cessation','','136','The Lung Helpline is available 7 days a week to answer lung health questions. Registered nurses, respiratory therapists, certified tobacco treatment specialists and counselors make up the helpline staff. Get detailed and accurate information about lung cancer, asthma, COPD, quitting tobacco and multiple other lung health topics.\r\n\r\nAreas of expertise include:\r\n- Lung health education.\r\n- (Smoking) tobacco cessation.\r\n- Respiratory therapy and pulmonary testing.\r\n- Respiratory nursing.\r\n- Respiratory home care.\r\n- Lung diseases.\r\n- Neonatal, pediatric, and adult respiratory intensive care.\r\n- Medication counseling.\r\n- Patient advocacy.\r\n- Nursing case management.\r\n- Physician search.','','','','',NULL,'By phone or website.','','','','','192','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(293,15142,'Information and Referral * Lung Disease','','136','The Lung Helpline is available 7 days a week to answer lung health questions. Registered nurses, respiratory therapists, certified tobacco treatment specialists and counselors make up the helpline staff. Get detailed and accurate information about lung cancer, asthma, COPD, quitting tobacco and multiple other lung health topics.\r\n\r\nAreas of expertise include:\r\n- Lung health education.\r\n- (Smoking) tobacco cessation.\r\n- Respiratory therapy and pulmonary testing.\r\n- Respiratory nursing.\r\n- Respiratory home care.\r\n- Lung diseases.\r\n- Neonatal, pediatric, and adult respiratory intensive care.\r\n- Medication counseling.\r\n- Patient advocacy.\r\n- Nursing case management.\r\n- Physician search.','','','','',NULL,'By phone or website.','','','','','193','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(294,212,'Child Abuse Hotlines','','1360','The state child abuse hotline is administered through DCFS and answered 24/7 for reporting suspected abuse or neglect of a child.\r\n\r\nChild abuse is defined as the mistreatment of a child under the age of 18 by a parent, caretaker, someone living in their home, or someone who works with or around children. The mistreatment must cause injury or put the child at risk of physical injury. Child abuse can be physical (such as burns or broken bones), sexual (such as fondling or incest), or mental (emotional injury or psychological illness). Neglect happens when a parent or responsible caretaker fails to provide adequate supervision, food, clothing, shelter, or other basics for a child.','','http://www.illinois.gov/dcfs','','',NULL,'By phone.','','','','','194','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(295,29658,'Holiday Programs * Thanksgiving Meals','Thanksgiving Day Dinner','13603','Offering a free, home cooked Thanksgiving dinner for the homeless, less fortunate, or those who do not have a family to share the holiday with. Although reservations are not necessary, an email is appreciated for food count; or, people can check the Rest-Oration Church\'s Facebook page under \"Events\" to indicate they are coming.','','','','',NULL,'Email preferred - biglargegreat@gmail.com.','Anyone is welcome.','','','','195','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(296,406,'Early Intervention for Children with Disabilities/Delays','Early Intervention Program','1362','Early Intervention is a statewide program that provides supports and services for families to help their children under age 3 meet developmental milestones.','','','','',NULL,'By phone and appointment only.','After a referral is made, families will meet with a team to help them assess their child\'s development and determine eligibility.','','Photo ID, birth certificate, proof of residency, proof of income, Social Security card, and immunization records.','','196','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(297,30136,'Low Income/Subsidized Rental Housing','','13678','Countrybrook Apartments is a 150-unit Section 8 Family / Section 42 property in Champaign. It is close to local schools and city parks. Shopping and dining is available within 5 minutes of the property and it is situated along a mass transit pick up point.','','http://www.ludwigco.com','','','929094559121639','By phone or website.','','','','','197','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(302,670,'Therapeutic Camps','\nCamp Lions','138','Camp Lions is for youth with visual or hearing impairments. Offers eligible youth a week of fun, challenging activities as well as the opportunity to make new friends with peers of similar abilities.','','http://www.lionsofillinoisfoundation.org','','',NULL,'','Persons must be between the ages of 7-17 years old, either be blind or have low vision or be deaf or hard of hearing. Campers must be:\r\n- Independent in all personal/hygiene care (one-to-one care is NOT provided by camp counselors or staff).\r\n- Independently ambulatory around the campsite and activity areas.\r\n- Cognitively capable of understanding and following instructions from staff.','','','','198','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(303,1459,'Hearing Screening','Social Services','138','Low-income individuals who are not eligible for eye exams, glasses, hearing tests, or hearing aids through other public benefit sources can apply for those services through their local club. Services include:\r\n- Used Eyeglasses Collection - Eyeglasses collected for distribution and reuse in poverty areas worldwide.\r\n- Diabetic Eye Screening - Travels the state to give free, basic screenings to adults with diabetes and adults over 55 years of age to detect diabetic retinopathy and macular degeneration.\r\n- Mobile Hearing Screening Unit - Travels the state to give free screenings to adults, detect possible hearing loss, and educate the public.\r\n- Used Hearing Aid Bank - Provides reconditioned hearing aids to persons who cannot afford them.','','http://www.lionsofillinoisfoundation.org','','',NULL,'A local Lions club in or near your community may sponsor a program that provides assistance for the purchase of eyeglasses or hearing aids; call for information.','','','','','199','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(304,1646,'Eye Care','Social Services','138','Low-income individuals who are not eligible for eye exams, glasses, hearing tests, or hearing aids through other public benefit sources can apply for those services through their local club. Services include:\r\n- Used Eyeglasses Collection - Eyeglasses collected for distribution and reuse in poverty areas worldwide.\r\n- Diabetic Eye Screening - Travels the state to give free, basic screenings to adults with diabetes and adults over 55 years of age to detect diabetic retinopathy and macular degeneration.\r\n- Mobile Hearing Screening Unit - Travels the state to give free screenings to adults, detect possible hearing loss, and educate the public.\r\n- Used Hearing Aid Bank - Provides reconditioned hearing aids to persons who cannot afford them.','','http://www.lionsofillinoisfoundation.org','','',NULL,'A local Lions club in or near your community may sponsor a program that provides assistance for the purchase of eyeglasses or hearing aids; call for information.','','','','','200','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(305,12627,'Glasses/Contact Lenses','Social Services','138','Low-income individuals who are not eligible for eye exams, glasses, hearing tests, or hearing aids through other public benefit sources can apply for those services through their local club. Services include:\r\n- Used Eyeglasses Collection - Eyeglasses collected for distribution and reuse in poverty areas worldwide.\r\n- Diabetic Eye Screening - Travels the state to give free, basic screenings to adults with diabetes and adults over 55 years of age to detect diabetic retinopathy and macular degeneration.\r\n- Mobile Hearing Screening Unit - Travels the state to give free screenings to adults, detect possible hearing loss, and educate the public.\r\n- Used Hearing Aid Bank - Provides reconditioned hearing aids to persons who cannot afford them.','','http://www.lionsofillinoisfoundation.org','','',NULL,'A local Lions club in or near your community may sponsor a program that provides assistance for the purchase of eyeglasses or hearing aids; call for information.','','','','','201','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(306,12628,'Hearing Aids','Social Services','138','Low-income individuals who are not eligible for eye exams, glasses, hearing tests, or hearing aids through other public benefit sources can apply for those services through their local club. Services include:\r\n- Used Eyeglasses Collection - Eyeglasses collected for distribution and reuse in poverty areas worldwide.\r\n- Diabetic Eye Screening - Travels the state to give free, basic screenings to adults with diabetes and adults over 55 years of age to detect diabetic retinopathy and macular degeneration.\r\n- Mobile Hearing Screening Unit - Travels the state to give free screenings to adults, detect possible hearing loss, and educate the public.\r\n- Used Hearing Aid Bank - Provides reconditioned hearing aids to persons who cannot afford them.','','http://www.lionsofillinoisfoundation.org','','',NULL,'A local Lions club in or near your community may sponsor a program that provides assistance for the purchase of eyeglasses or hearing aids; call for information.','','','','','202','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(307,30831,'Food Pantries','','13815','Food pantry available to area residents.','','','','','832990803111047','Walk-in during monthly distribution.','','','','','203','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(308,31307,'Support Groups * Families/Friends of Suicides','','13902','The purpose of this group is to come together to share a unique, yet common, experiences as people who have a common story: losing a loved one to suicide.','','https://afsp.org/','survivorsofsuicideloss.cu@gmail.com','',NULL,'By e-mail.','Adults, age 18 and older typically. Please contact group facilitator for some possible exceptions.','','','','204','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(309,13419,'Adult Protective Intervention/Investigation','Adult Protective Services (APS)','1454','The Illinois Department on Aging is charged with the responsibility of preventing abuse of older persons and adults (18-59) with disabilities who live in the community. \r\n\r\nThe Adult Protective Services Program is locally coordinated through 45 provider agencies, which are designated by the regional Area Agency on Aging and the Department on Aging. Caseworkers from these agencies conduct investigations and work with adults with disabilities and seniors in resolving abusive situations.\r\n','','http://www.illinois.gov/aging','aging.ilsenior@illinois.gov','',NULL,'','Either age 60 and older, or age 18 and older with a disability.','','','','205','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(314,14388,'Home Rehabilitation Programs','','1478','USDA\'s Rural Housing Service offers a variety of programs to build or improve housing and essential community facilities in rural areas. The program offer loans, grants and loan guarantees for single- and multi-family housing, child care centers, fire and police stations, hospitals, libraries, nursing homes, schools, first responder vehicles and equipment, housing for farm laborers and much more. Programs available:\r\n\r\n- Single-Family Housing Programs: USDA\'s Single Family Housing Programs provide direct loans or loan guarantees to help low- and moderate-income rural Americans buy safe, affordable housing in rural areas. USDA also offers loans and grants to help rural residents make health and safety repairs to homes.\r\n\r\n- Multi-Family Housing Programs: USDA\'s Multi-Family Housing Programs offer loans to provide affordable rental housing for very-low-, low- and moderate-income residents, the elderly, and persons with disabilities. Funds also may be used to buy and improve land and to provide necessary facilities such as water and waste disposal systems. In addition, USDA offers rental assistance to help eligible rural residents with their monthly rental costs.\r\n\r\n-Rural Rental Housing Program: USDA Rural Development funds several apartment complexes in rural areas of Illinois. The apartment complexes are privately owned but receive funding from the program and may be rented at a reduced rate. Apartment complexes participating in the program may also be located online by visiting this website: rdmfhrentals.sc.egov.usda.gov.\r\n\r\n- Community Facilities Programs: USDA\'s Community Facilities Programs provide loans, grants and loan guarantees for essential community facilities in rural areas. Priority is given to health care, education and public safety projects. Typical projects are hospitals, health clinics, schools, fire houses, community centers, first responder vehicles and equipment and many other community-based initiatives.','','','','',NULL,'By phone.','Varies by program, call for more information.','','Photo ID, proof of income, and Social Security card.','','206','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(315,264,'Transitional Housing/Shelter * Single Mothers','Homeless Services','1589','Offers transitional housing and supportive services to single women and women with children who are experiencing domestic violence. Services include: case management, referrals and linkage, children\'s programming, support group, parenting group, and an on-site Head Start Program. All services are for clients enrolled in the Transitional Housing Program.','','http://www.courageconnection.org','contact@courageconnection.org','','929094559121639','Phone intakes to be placed on the waiting list are taken 7 days per week, 12:00 pm - 7:00 pm.','','','Photo ID, birth certificate, proof of income, and Social Security card - can be obtained after entry with assistance from a case manager (if needed).','','207','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(316,13217,'Spouse/Intimate Partner Abuse Counseling','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','',NULL,'Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','208','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(317,13218,'Domestic Violence Hotlines','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','',NULL,'Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','209','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(318,13219,'Domestic Violence Shelters','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','',NULL,'Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','210','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(319,13220,'Advocacy * Domestic Violence Issues','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','','637158405241810','Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','211','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(320,13221,'Protective/Restraining Orders','Domestic Violence Services','1589','Provides the following services: 24/7 domestic violence hotline, emergency shelter, transitional housing, children\'s programming, counseling, legal advocacy, case management, referrals and linkage, parenting group, domestic violence education group, and career & financial empowerment groups.','','','','',NULL,'Phone, walk-in, or appointment.','All services are for domestic violence victims. For acceptance into emergency shelter, individuals must be fleeing a domestic violence situation.','','','','212','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(321,15199,'Transitional Housing/Shelter * Single Women','Homeless Services','1589','Offers transitional housing and supportive services to single women and women with children who are experiencing domestic violence. Services include: case management, referrals and linkage, children\'s programming, support group, parenting group, and an on-site Head Start Program. All services are for clients enrolled in the Transitional Housing Program.','','http://www.courageconnection.org','','','929094559121639','Phone intakes to be placed on the waiting list are taken 7 days per week, 12:00 pm - 7:00 pm.','','','Photo ID, birth certificate, proof of income, and Social Security card - can be obtained after entry with assistance from a case manager (if needed).','','213','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(322,866,'Babysitting Instruction','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','http://www.redcross.org/csil','','',NULL,'By phone or website to register.','','','','','214','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(323,1576,'Water Safety Education','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','http://www.redcross.org/csil','','',NULL,'By phone or website to register.','','','','','215','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(324,14253,'Information and Referral * Active Military * Veterans','','160','The American Red Cross supports members of the military and their families pre-deployment, during deployment, and when they return home through emergency communication services, financial assistance programs, re-integration, and veteran services.\r\n\r\nRed Cross workers use advanced communications technologies to link service members with their families. The Emergency Communications Center quickly and efficiently obtains the required information and sends emergency communication messages to service members of every branch of service wherever in the world they happen to be.','','','','',NULL,'By phone.','','','','','216','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(325,21716,'Community Disaster Education','','160','The American Red Cross trains residents in lifesaving skills through multi-language online, community, and workplace courses. Course include First Aid, CPR, disaster preparedness education, babysitter training, and water safety.','','','','','789038541797078','By phone or website to register.','','','','','217','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(326,23251,'Blood Donor Stations','','160','American Red Cross helps to provide blood for persons in need through blood drives.','','','','',NULL,'By phone or website for more information or to schedule an appointment. Walk-ins accepted on scheduled donation days.','Donors must be age 17 or older. Donation by 16-year-olds is allowed with a signed parental consent form. Donors must weigh at least 110 pounds and be in good health.','','','','218','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(327,23252,'Disaster Relief Services','','160','The American Red Cross offers disaster services to clients who experience a verified disaster, including home fires, tornadoes, and floods. The Red Cross provides assistance to meet clients\' immediate needs, including for food, shelter, clothing, and health and mental health immediate needs, and helps clients begin their recovery. Amount of assistance is based on clients\' needs.','','','','',NULL,'By phone.','Client must have experienced a verified disaster.','','','','219','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(328,23253,'Temporary Financial Assistance * Families of Military Personnel/Veterans','','160','Families of military personnel can apply for a financial grant for a wide range of needs including but not limited to utilities, medical, and car repair.','','','','','1077790582995406','An application will be taken and submitted to the military processing center and an answer will generally be received within 24 hours, not including weekends.','Must have a spouse in active military duty.','','','None.','220','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(329,23254,'Emergency Communications * Families of Military Personnel/Veterans','','160','The American Red Cross supports members of the military and their families pre-deployment, during deployment, and when they return home through emergency communication services, financial assistance programs, re-integration, and veteran services.\r\n\r\nRed Cross workers use advanced communications technologies to link service members with their families. The Emergency Communications Center quickly and efficiently obtains the required information and sends emergency communication messages to service members of every branch of service wherever in the world they happen to be.','','','','','878986697513222','By phone.','','','','','221','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(330,20878,'Thrift Shops','','1658','Goodwill stores feature gently used and new items that are bargains for shoppers. Items offered include jeans, business attire, infant and children\'s clothing, housewares, linens, furniture and more. Additionally, shopping is available from home on Goodwill\'s online auction site, www.shopgoodwill.com.','','','','',NULL,'','','','','','222','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(331,288,'Information Sources * Insurance Issues','','1676','Illinois consumers with insurance questions can get help from a statewide toll-free hotline. The Illinois Insurance Hotline is an industry-sponsored resource providing residents with access to unbiased information about a wide range of insurance topics.\r\n\r\nIllinois Insurance Hotline consultants are available to answer general insurance questions, distribute educational materials, and suggest resources available to those struggling with insurance issues. Hotline consultants do not recommend companies, agents, or types of coverage consumers should buy.','','http://www.illinoisinsurance.org','insurancehotline@illinoisinsurance.org','',NULL,'','','','','','223','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(332,384,'Women\'s Advocacy Groups','','1711','NOW is the largest, most comprehensive feminist advocacy group in the United States. lllinois NOW is an organization of chapters from every area in Illinois. NOW works to eliminate discrimination and harassment in the workplace, schools, the justice system, and all other sectors of society; secure abortion, birth control, and reproductive rights for all women; end all forms of violence against women; eradicate racism, sexism, and homophobia; and promote equality and justice in society.','','','','',NULL,'Visit website for more information.','','','','','224','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(335,304,'Occupational Health and Safety','','1725','OSHA Federal Office. The federal OSHA offices provide safety and health protections for all private sector workplaces; federal agencies; maritime employers (e.g., shipyards, marine terminals, longshoring); military facilities; Indian sovereignty workplaces; and the United States Postal Service.','','http://www.osha.gov','','','941516382466411','','','','','','225','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(336,308,'Support Groups * Sexual/Love Addiction','','1761','Sex Addicts Anonymous is a fellowship of men and women who share their experiences for the purpose of finding freedom from addictive sexual behavior and helping others recover from sex addiction. Local meetings offer an opportunity to share common struggles and learn how to apply the principles of the Twelve Steps. The only requirement for membership is a desire to stop addictive sexual behavior.\r\n\r\nMeeting formats include face-to-face, telephone, and web-based options.  SAA does NOT offer telephone counseling nor is it a hotline.  Interested parties will be referred to a meeting in his/her area or to a telephone/web-based meeting for assistance.','','http://www.saa-recovery.org','','',NULL,'By phone or website.','','','','','226','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(339,30703,'Home Based Parenting Education','Healthy Start Program','1874','- Free home visiting program to help parents in the role of being their child\'s first and most important teacher.\r\n- Provides information on child development, positive discipline techniques, parenting skills, and other topics parents may feel are helpful.\r\n- Link families with resources in the community. Services are provided in the home or a community location the family chooses.\r\n- Preventive focus program to assist families with building protective factors and decreasing rate of DCFS intervention.','','','','','789038541797078','By phone; parents can self-refer.','- Expecting parents under the age of 30.\r\n- Champaign County resident.','','','185% of Federal Poverty Level or lower.','227','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(341,206,'Special Libraries','Illinois State Library Talking Book and Braille Service','190','The Talking Book and Braille Service is a free mail order public library of audio books and Braille program for anyone who is unable to read standard print comfortably.\r\n\r\nAudio and Braille library materials, as well as audio playback equipment, are delivered as \"Free Matter\" through the United States Postal Service. Patrons also have the ability to download books and magazines from the Braille and Audio Reading Download website.','','http://www.ilbph.org','','',NULL,'An application for service is required. Applications can be obtained from the websites or requested by phone. Applications must be certified by a health care specialist.','Anyone who is unable to use regular print materials as a result of permanent or temporary visual or physical limitations.','','Certified application from health services professional, senior services center, case manager, or librarian.','','228','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(342,362,'Support Groups * Families/Friends of Individuals With an Alcohol Use Disorder','Al-Anon/Alateen','1907','Al-Anon is for family members and friends who are concerned about someone\'s drinking. Alateen is for teenagers are dealing someone\'s alcoholism, usually a parents\' drinking.','','http://www.al-anon.org','wso@al-anon.org','',NULL,'','Anyone affected by someone else\'s drinking problem.','','','','229','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(343,13754,'Support Groups * Families/Friends of Individuals With an Alcohol Use Disorder','Al-Anon/Alateen','1907','Al-Anon is for family members and friends who are concerned about someone\'s drinking. Alateen is for teenagers are dealing someone\'s alcoholism, usually a parents\' drinking.','','','','',NULL,'','Anyone affected by someone else\'s drinking problem.','','','','230','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(344,12872,'Agricultural Financing','','1922','FSA makes direct and guaranteed farm ownership and operating loans to family-size farmers and ranchers who cannot obtain commercial credit from a bank, Farm Credit System institution, or other lender. FSA loans can be used to purchase land, livestock, equipment, feed, seed, and supplies or to construct buildings or make farm improvements. The agency also targets a portion of its loan funds to small and beginning farmers and ranchers. \r\n\r\nMany FSA loan application forms are available on the website. Persons are also encouraged to contact their local office or USDA Service Center to learn more about programs and the information needed for a complete application.','','','','','1077790582995406','By phone, walk-in, email, or website.','Call for details.','','','','231','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(345,667,'Charities/Grantmaking Organizations * Breast Cancer','','1933','The mission of the Susan G. Komen is to eradicate breast cancer as a life-threatening disease by advancing research, education, screening, and treatment.\r\n\r\nProvides community educational programs, community health grants to non-profit organizations to provide breast cancer services, and volunteer opportunities at local events. Spanish language, age, gender, and race appropriate educational materials are available.','','http://www.komenmemorial.org','','',NULL,'By phone, email, website.','','','','','232','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(348,24143,'Foster Home Placement','','1993','Foster Care programs are designed to find safe, secure, and nurturing homes for children who have been separated from their biological families. Relative Foster Care serves children who are placed in foster care with maternal or paternal relatives. Specialized Foster Care supports physically, behaviorally, and emotionally challenged children as well as the foster families caring for them. Traditional Foster Care serves children who are placed in non-relative, licensed foster homes.','','','','',NULL,'','','','','','233','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(349,25007,'Doula Services','Healthy Families Illinois','1993','A voluntary home visiting program providing parent support and education to at-risk, young, first time parents beginning prenatally up until their child reaches the age of 5. Parents learn about positive play, child development, nutrition, wellness, and community resources. Provides access to social supports through mom and family groups.\r\n\r\nDoula Program provides prenatal information and emotional support, labor coaching, postpartum depression and breastfeeding support and assistance in the early weeks after childbirth. Doula services begin during the third trimester of pregnancy.','','','','',NULL,'By phone, fax, or email','- 18 years old and younger with any number pregnancy/child (first, second, etc.)\r\n- 19 to 25 years old (first time mom).\r\n- Must be identified prenatally or before the child is 2 weeks old.','','','','234','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(350,25008,'Home Based Parenting Education * New Parents','Healthy Families Illinois','1993','A voluntary home visiting program providing parent support and education to at-risk, young, first time parents beginning prenatally up until their child reaches the age of 5. Parents learn about positive play, child development, nutrition, wellness, and community resources. Provides access to social supports through mom and family groups.\r\n\r\nDoula Program provides prenatal information and emotional support, labor coaching, postpartum depression and breastfeeding support and assistance in the early weeks after childbirth. Doula services begin during the third trimester of pregnancy.','','','','','789038541797078','By phone, fax, or email','- 18 years old and younger with any number pregnancy/child (first, second, etc.)\r\n- 19 to 25 years old (first time mom).\r\n- Must be identified prenatally or before the child is 2 weeks old.','','','','235','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(351,30734,'Support Groups * Parents','The Bump Club','1993','The Bump Club and Bellies, Babies and Beyond are Prenatal and Mom support groups. Food and childcare are provided at meetings.','','','','',NULL,'By phone, walk-in.','','','','','236','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(353,765,'Support Groups * Cocaine Use Disorder','','2032','Cocaine Anonymous is a fellowship of men and women who share their experiences, strengths, and hopes with each other so that they may solve their common problems and help others to recover from their addictions. The only requirement for membership is a desire to stop using cocaine and all other mind-altering substances.','','http://illinoisareaca.org','','',NULL,'By phone.','','','','','237','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(354,13791,'Veteran Employment Programs','','21','Assists veterans in finding gainful employment. Eligible veterans can search for jobs online at IllinoisJobLink.com and should plan a visit to their local IDES office to obtain more information related to employment services and opportunities tailored specifically for veterans.','','http://www.ides.illinois.gov','','',NULL,'By phone.','','','DD-214.','','238','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(355,31085,'Comprehensive Job Assistance Centers','','21','Unemployment Insurance - Files claims and determines eligibility for unemployment benefits. The fastest way to access unemployment benefits is through the website. People can also file at the local IDES office.\r\n\r\nIllinoisJobLink.com is a website that connects skilled job seekers to employers in Illinois. Job seekers can build multiple resumes to emphasize different skills and experiences. Business owners can use keyword matching technology to search resumes and find the best candidate. IllinoisJobLink.com is free for workers and employers and can be accessed 24/7 online.','','','','','970915508638448','By phone and website.','','','','','239','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(356,16267,'Support Groups * Drug Use Disorders','','212','Narcotics Anonymous is a nonprofit fellowship of men and women of all ages for whom drugs had become a major problem. Members are recovering addicts who meet regularly to help each other stay clean. This is a program of complete abstinence from all drugs. The fellowship is concerned with the disease of addiction and recovery from that disease; the drug (or drugs) of choice is unimportant. There are no social, religious, economic, racial, ethnic, national, gender, or class-status membership restrictions.','','https://www.na.org/meetingsearch/','','',NULL,'By phone.','','','','','240','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(357,22419,'Substance Use Disorder Hotlines','','212','Narcotics Anonymous is a nonprofit fellowship of men and women of all ages for whom drugs had become a major problem. Members are recovering addicts who meet regularly to help each other stay clean. This is a program of complete abstinence from all drugs. The fellowship is concerned with the disease of addiction and recovery from that disease; the drug (or drugs) of choice is unimportant. There are no social, religious, economic, racial, ethnic, national, gender, or class-status membership restrictions.','','https://www.na.org/meetingsearch/','','',NULL,'By phone.','','','','','241','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(358,9641,'Personal Financial Counseling * Older Adults','Illinois Volunteer Money Management Program','2159','The CRIS Money Management Program utilizes volunteers to work with seniors on budgeting, sorting through mail, checkbook balancing, and bill paying. This program assists seniors 60 years of age and older who need assistance due to physical or mental disabilities, unpaid bills, inability to read or write, loss of home due to foreclosure, or threats of utility shut-off.','','http://www.agestrong.org','info@agestrong.org','','1077790582995406','','Cannot have Power of Attorney; must be a participant in Adult Protective Services or Care Coordination Unit.','','Bank statement.','','242','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(359,22823,'Medical Social Work * Older Adults','Bridge Care Transition Program','2159','The CRIS Healthy-Aging Center has partnered with local hospitals to assist qualified individuals in the transition from hospital to home. This program is provided at no cost to the participant. A Bridge coach will assist in many areas, including developing a personal health record, making/keeping doctor appointments, managing medications, and identifying additional community resources.','','','','',NULL,'Bridge coaches are located at three area hospitals: Presence United Samaritan\'s Medical Center in Danville, Presence Covenant Medical Center in Champaign, and Carle Foundation Hospital in Urbana.','For those age 60 and older that are being discharged from a participating hospital.','','','','243','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(361,1711,'Home Delivered Meals','Meals on Wheels','2169','Meals on Wheels provides a home-delivered hot lunch with an option to add a cold sack supper for seniors or others who need short- or long-term assistance meeting nutritional needs due to difficulties with shopping or cooking. Meals can be personalized to accommodate special diets such as diabetic, low sodium, low cholesterol, mechanical soft, or gluten-free. Delivery is available Monday through Friday in Champaign, Urbana, and Savoy. Staff are available to assist those living in other parts of Champaign County in locating meal delivery options for their community.','','http://www.famservcc.org','','',NULL,'Call the Senior Resource Center.','- Adults with long-term needs due to physical or mental challenges that make it difficult or unsafe to shop or cook.\r\n- Adults with short-term needs due to pregnancy, injury, vacation of a caregiver, etc.','','','','244','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(362,5256,'Support Group Clearinghouses','Self-Help Center','2169','The Self-Help Center is a clearinghouse for self-help and support groups. The program refers individuals to appropriate groups, helps new groups form, conducts workshops and courses for group leaders, provides consultation to existing groups, educates the public about self-help, and publishes the Support Group Directory as well as specialized lists of groups and the Self-Helper newsletter.','','http://www.famservcc.org','','',NULL,'Copies of the directory may be ordered and picked up at Family Service. Information is also available online.','','','','','245','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(363,13415,'Adult Protective Intervention/Investigation','Adult Protective Services (APS)','2169','Investigates allegations of abuse, neglect, exploitation, and self-neglect of older adults (ages 60 and older) as well as persons with disabilities (ages 18-59) who live in a domestic (non-institutional) setting. Appointed by the Illinois Department on Aging to investigate allegations of physical and emotional abuse, financial exploitation, confinement/neglect, deprivation of food or medication, sexual abuse, and self-neglect.\r\n\r\nThis program offers 24-hour intakes by phone. A caseworker will make a home visit to investigate any allegations of abuse and self neglect and offer assistance to victims. Interventions can include, but are not limited to, in-home, legal, medical, relocation, and counseling services.','','','','',NULL,'To make a confidential report of suspected abuse, or for assistance, call the Senior Resource Center or the 24-hour Abuse Hotline. Anonymous reports accepted.','Seniors (ages 60+) and people (ages 18-59) with disabilities and living in a home (non-institutional) setting.','','','','246','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(364,30423,'Volunteer Opportunities * Older Adults','RSVP','2169','As an RSVP member you may choose from among more than 100 local public and non-profit organizations to donate your skills and experience. You will be joining other older adults who volunteer their time to meet critical community needs at schools, food pantries, libraries, hospitals, etc. You may volunteer as little time as one hour per month to as much as 40 hours per week. Your membership benefits may include mileage reimbursement, supplemental auto insurance, volunteer recognition events and much more.\n\n','','http://www.famservcc.org','','',NULL,'By phone, walk-in, or appointment.','Older adults (ages 55 or older) who enjoy staying active and involved in their communities.','','','','247','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(365,30425,'Grocery Ordering/Delivery','Food for Seniors','2169','The Food for Seniors program provides groceries to seniors in Champaign and Urbana who are in need of food. Groceries are sacked and delivered by volunteers on the second and fourth Tuesday of each month.','','','','',NULL,'By phone.','Age 60 and older.','','','100% of the federal poverty level.','248','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(366,905,'Support Groups * Bereaved Parents','','2175','A self-help organization offering friendship and understanding to all bereaved parents who have lost a child at any age from any cause. The purpose is to promote and aid parents in the positive resolution of the grief experienced upon the death of their child and to foster the physical and emotional health of the bereaved parents and siblings.','','http://www.compassionatefriends.org','nationaloffice@compassionatefriends.org','',NULL,'Phone or e-mail the national office. When a person calls, TCF can put together, at no charge, a customized packet of bereavement materials specifically chosen to apply to a person\'s situation. Contact information to the nearest TCF chapter can also be provided where the whole family can gather with others bereaving the loss of a child.','','','','','249','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(369,10646,'Advocacy * Domestic Violence Issues','','218','The National Coalition Against Domestic Violence (NCADV) is the voice of victims and survivors. They work towards this mission of society having zero tolerance for domestic violence by effecting public policy, increasing understanding of the impact of domestic violence, and providing programs and education that drive that change.\n\n','','http://www.ilcadv.org','ilcadv@ilcadv.org','','637158405241810','','','','','','250','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(370,16749,'Disease/Disability Information * Alzheimer\'s Disease','','2258','24/7 Helpline: Consultants provide individuals with information and support. AA offers translation services in more than 170 languages. Individuals may also search for resources or submit an on-line request to the Helpline at the website.\r\n\r\nConsumer Education Programs: Offers a wide variety of community education programs designed to equip caregivers and people with dementia with the tools they will need while on their Alzheimer\'s journey. Visit the website or call the Helpline for a current listing of programs.','','http://www.alz.org/illinois','','',NULL,'','','','','','251','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(371,16750,'Information and Referral * Alzheimer\'s Disease','Care Navigation','2258','Professional staff are dedicated to helping people navigate through the difficult decisions and uncertainties people with Alzheimer\'s and their families face at every stage of the disease. Services can be provided to clients by telephone.','','http://www.alz.org/illinois','','',NULL,'','','','','','252','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(372,16751,'Emergency Alert','MedicAlert + Safe Return','2258','MedicAlert + Safe Return membership provides a specialized live 24/7 emergency response service for individuals with Alzheimer’s or related dementia who wander or have a medical emergency. Membership includes 24/7 caregiver consultation services.','','http://www.alz.org/illinois','','','878986697513222','','','','','','253','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(373,16752,'Support Groups * Alzheimer\'s Disease','','2258','Support groups are available for families, caregivers and those in the early stages of the disease. Support groups are designed to be a place where participants can share their stories and receive information and encouragement in a confidential environment.','','http://www.alz.org/illinois','','',NULL,'By phone or website.','','','','','254','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(374,16753,'Volunteer Opportunities','','2258','Purpose: To meet the needs of an ethnically and culturally diverse population by providing guidance and support for persons with dementia and their caregivers; educating and informing the community; advocating for improved public policy and promoting needed legislation; supporting research in to the cause, prevention, treatment, and cure for Alzheimer\'s Disease and related disorders.\r\n\r\nOpportunities: Volunteers needed to work on special fundraising projects throughout the year. Also to represent the chapter at health fairs, as advocates, and support group leaders.','','http://www.alz.org/illinois','','',NULL,'','','','','','255','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(377,122,'Child Abuse Reporting/Emergency Response','','2461','The Illinois Department of Children and Family Services (DCFS) has the primary responsibility of protecting children and strengthening families through the investigation and intervention of suspected child abuse or neglect by parents and other caregivers. \r\n\r\nDCFS links families with community services to address struggles families are having, offers preventative services to referred families in an attempt to keep family units together to address findings of abuse/neglect, and works with families who have children under the legal custody of DCFS while working to reunify families when possible or provide a permanent home for children.\r\n\r\nAs part of its duties, DCFS also licenses and monitors all Illinois child welfare agencies, domestic and international adoption providers and more than 14,000 day care centers, homes, group homes and day care agencies in the state.','','http://www.state.il.us/DCFS','','','878986697513222','By phone.','','','','','256','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(378,24622,'Family Preservation Programs','Norman Services','2461','DCFS has developed services, referred to as \"Norman Services,\" for families who have one or more children who are at risk of being placed in DCFS care or who have children who cannot be returned home and one of the reasons for this risk is:\r\n- lack of food\r\n- lack of shelter\r\n- lack of clothing\r\n- or lack of other item(s) that, if providing this service will keep the child in the family\'s care or, if the child is already in DCFS custody, will help the child return home.\r\n\r\nIf eligible, families may receive the following services:\r\n- Public Aid/TANF and other cash grants.\r\n- Housing Advocacy Program (HAP) - helping families obtain permanent housing.\r\n- Emergency Cash Assistance Program for basic needs. Not intended as ongoing subsidy, but only provided when it would prevent the removal of children by DCFS or allow the children to be returned home from DCFS placement.','','','','',NULL,'By phone.','','','','','257','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(379,1067,'Child Abuse Reporting/Emergency Response','','2461','The Illinois Department of Children and Family Services (DCFS) has the primary responsibility of protecting children and strengthening families through the investigation and intervention of suspected child abuse or neglect by parents and other caregivers. \r\n\r\nDCFS links families with community services to address struggles families are having, offers preventative services to referred families in an attempt to keep family units together to address findings of abuse/neglect, and works with families who have children under the legal custody of DCFS while working to reunify families when possible or provide a permanent home for children.\r\n\r\nAs part of its duties, DCFS also licenses and monitors all Illinois child welfare agencies, domestic and international adoption providers and more than 14,000 day care centers, homes, group homes and day care agencies in the state.','','http://www.illinois.gov/dcfs/','','','878986697513222','By phone.','','','','','258','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(380,24629,'Family Preservation Programs','Norman Services','2461','DCFS has developed services, referred to as \"Norman Services,\" for families who have one or more children who are at risk of being placed in DCFS care or who have children who cannot be returned home and one of the reasons for this risk is:\r\n- lack of food\r\n- lack of shelter\r\n- lack of clothing\r\n- or lack of other item(s) that, if providing this service will keep the child in the family\'s care or, if the child is already in DCFS custody, will help the child return home.\r\n\r\nIf eligible, families may receive the following services:\r\n- Public Aid/TANF and other cash grants.\r\n- Housing Advocacy Program (HAP) - helping families obtain permanent housing.\r\n- Emergency Cash Assistance Program for basic needs. Not intended as ongoing subsidy, but only provided when it would prevent the removal of children by DCFS or allow the children to be returned home from DCFS placement.','','','','',NULL,'By phone.','','','','','259','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(381,24837,'Child Guardianship Assistance','Extended Family Support Program','2461','EFSP can assist a relative caregiver who wants to obtain guardianship through probate court of a relative\'s child living in the home of the caregiver. This includes:\r\n- Educating and helping the caregiver negotiate the probate court system.\r\n- Assisting caregivers to obtain required documents.\r\n- Arranging for legal counsel in counties where legal counsel is necessary.\r\n\r\nEFSP caseworkers meet with the relative caregiver monthly until guardianship has been obtained or until other services have been provided. These services can include crisis intervention, applying for benefits, working with local schools for the child\'s enrollment, and referral to a range of needed services that the caregiver may have to help meet the basic needs of the family.','','','','',NULL,'By phone.','','','','','260','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(382,1178,'TANF','TANF - Temporary Assistance to Needy Families','2470','COVID19:\r\nAlthough many of the DHS offices are mostly closed and are not seeing customers face to face, people can still apply for SNAP, medical, and TANF benefits online and by phone:\r\ngo to ABE.illinois.gov or call the Help is Here Hotline at 833-2-FIND-HELP (833-234-6343). \r\nThere are NO public benefits that require face to face appointments in the office.\r\n-----------------------\r\n\r\nThe Temporary Assistance for Needy Families (TANF) program provides temporary financial assistance for pregnant women and families with one or more dependent children. TANF provides financial assistance to help pay for food, shelter, utilities, and expenses other than medical.','','http://www.idhslink.com','','',NULL,'By Phone, walk-in, website, or by appointment.','To qualify for TANF, a person must:\r\n- Be pregnant or have a child under age 19 who lives with them. A child who is 18 must be a full-time high school student. A pregnant woman (and her husband, if he lives with her) may qualify for help, even if they don\'t have any other children.\r\n- Live in Illinois. The family can be homeless and still qualify.\r\n- Be a U.S. citizen or meet certain immigration requirements.\r\n- Develop a plan for becoming self-sufficient and follow it.','','Photo ID, birth certificate, proof of income, proof of residency, and Social Security card.','','261','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(383,1179,'Food Stamps/SNAP','SNAP/Food Stamps','2470','COVID-19:\r\n\r\nNew! 5-21-20 - SNAP Electronic Benefit Transfer (EBT):\r\nBeginning June 2, 2020, SNAP recipients will be able to purchase food from participating grocery retailers online (Amazon & Walmart are on board and other retailers are likely to be soon). Access will be provided automatically to all existing Link card holders beginning June 2. Customers will not need to call or visit an office. Customers will use their SNAP Personal Identification Number (PIN) to order. All SNAP recipients in Illinois will be able to participate.\r\n\r\n4/22/20 - To increase food security during the coronavirus national emergency, SNAP households nationwide will receive emergency benefits representing a 40% increase in overall monthly SNAP benefits.\r\n\r\nDHS offices are closed and not seeing customers face to face, but people can still apply for SNAP, medical, and TANF benefits online and by phone:\r\ngo to ABE.illinois.gov or call the Help is Here Hotline at 833-2-FIND-HELP (833-234-6343). \r\nThere are NO public benefits that require face to face appointments in the office.\r\n-----------------------\r\n(Pre-COVID)\r\nProvides a supplement to the food budgets of low-income households. Recipients receive a \"link\" card to purchase groceries. SNAP for low income community college students is also available.\r\n\r\nSNAP/LINK benefits may now be used at restaurants. The SNAP Restaurant Meals Program goes into effect immediately for elderly, people with disabilities, or people experiencing homelessness.','','http://www.idhslink.com','','','832990803111047','May apply in the office or online.','','','Photo ID, birth certificate, proof of income, proof of residency, and social security card. College students must get a verification form signed by a school counselor or administrator and take a current copy of their transcript or class schedule to the appointment.','Household total gross monthly income must be 130% to 165% of the Federal Poverty Level, but also takes into consideration household size and expenses. Older adults and people with disabilities can have higher gross monthly income limits and qualify. The maximum gross monthly income for a household of one (not disabled or over age 60) is around $1,634. A “household” is anyone living together who regularly purchases and prepares meals together.','262','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(385,2314,'Children\'s/Adolescent Residential Treatment Facilities','BCH Residential Care','2500','At Baptist Children’s Home campus in Carmi, residential care is provided for children (ages 12-18) who are experiencing emotional or behavioral difficulties as well as children who have been victimized by abuse, neglect, or abandonment. Housing, education, counseling, and medical care provided.','','','bch@bch.com','',NULL,'By phone, fax, or e-mail.','- IQ 80+.\r\n- Ability to live in a small-group environment.\r\n- No danger to self or others.\r\n- Ability to attend public school.','','Photo ID, birth certificate, proof of income, proof of residency, Social Security card, and immunization records.','','263','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(386,10772,'Maternity Homes','Angel\'s Cove & Safe Families for Children','2500','- Angel\'s Cove: A group home for young women experiencing a crisis pregnancy providing housing, counseling, prenatal care, parent training, adoption, and foster care. Services may also be provided in a person\'s home.\r\n\r\n- Safe Families for Children: Provides a secure, temporary home for children whose parents are in a crisis situation using private homes as \"Safe Homes.\"','','','','',NULL,'','','','','','264','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(387,2338,'Cell Phones','','2510','Safelink Wireless is a cell phone program for income-eligible households. In order to participate, persons must meet certain eligibility requirements set by each state where the service is to be provided. These requirements are based on a person’s participation in state or federal support programs or by meeting the poverty level guidelines. By law, Safelink Wireless is only available for one phone per household.','','','','',NULL,'Apply by phone or website.','You qualify for Safelink Wireless in Illinois if you participate in one of the following assistance programs:\r\n- Medicaid.\r\n- Food Stamps/SNAP (Supplemental Nutrition Assistance Program).\r\n- Supplemental Security Income (SSI).\r\n- Temporary Assistance to Needy Families (TANF).\r\n- Low Income Home Energy Assistance Program (LIHEAP).\r\n- Federal Public Housing Assistance (Section 8).\r\n- The National School Lunch’s Free Lunch Program (NSLP).','','Proof of eligibility includes an eligible program card or statement of benefits.','If not participating in any of the above programs, income must be 135% of the poverty level or below.','265','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(388,11128,'Advocacy * Disabilities Issues','','26','Equip for Equality is an independent, private, not-for-profit organization designated by the Governor in 1985 to implement the federally mandated Protection and Advocacy (P&A) System in Illinois. The mission of Equip for Equality is to advance the human and civil rights of children and adults with disabilities in Illinois. It is the only statewide, cross-disability, comprehensive advocacy organization providing self-advocacy assistance, legal services, and disability rights education while also engaging in public policy and legislative advocacy and conducting abuse investigations and other oversight activities. Equip for Equality provides free legal services and self-advocacy assistance to people with disabilities in the areas of discrimination, assistive technology, special education, guardianship defense, abuse and neglect, and community integration. Equip for Equality provides self-advocacy training to people with disabilities and family members on topics including the Americans with Disabilities Act, employment, transportation, voting, Ticket to Work, special education and guardianship.','','','','','637158405241810','By phone (central intake).','People with disabilities who reside in Illinois.','','','','266','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(389,58,'Adoption Services','','294','1) Adoption Program Services identifies infant adoptions. Provides adoption home studies for domestic and international adoptions and facilitates foster licensing in a timely manner. Direct hospital placements are done whenever possible. Adoption seminars and support groups provided during the waiting period. ABC helps with Interstate Compact adoptive placements. They have flexible requirements for adoptive parents, e.g., age, length of marriage.\r\n2) Birth Parents Program Services offers a full range of social supports, e.g., housing, finances, medical, etc.  Counseling is available for unplanned pregnancies. Adoption planning is offered, which may include meetings between birth parents and adoptive parents. Facilitates networking of birth parents who can talk to clients considering adoption.','','http://www.abccounseling.org','','',NULL,'By phone.','','','','','267','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(390,14308,'Child Sexual Abuse Counseling','','294','Child Victims of Sexual Abuse and Sexually Reactive Children - Assessment, treatment, and comprehensive risk assessment to determine treatment need of child. Psycho-educational classes are available for parents of children affected by sexual abuse. \r\n\r\nAlso offers general counseling services, such as individual and group counseling.','','','','',NULL,'','','','Proof of income.','','268','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(391,14309,'Adolescent/Youth Counseling * Child/Adolescent Sex Offenders','Youth with Sexually Problematic Behaviors (YSPB) Program','294','Youth with Sexually Problematic Behaviors Program is available for adolescent sex offenders who meet certain criteria and may be served in a community-based treatment program. YSPB Program provides a comprehensive assessment and testing process to assist in determining placement and treatment needs. Specific treatment includes individual and group counseling for the offender and their parents or caretakers. Eligibility requires waiver of confidentiality.','','','','',NULL,'','','','','','269','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(392,14411,'Volunteer Opportunities','','3','Call for information on available volunteer positions.','','','','',NULL,'','','','','','270','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(393,31173,'Appearance Enhancement Consultation Programs',NULL,'3','The American Cancer Society is a nationwide, community-based voluntary health organization dedicated to eliminating cancer as a major health problem. Services include:\r\n\r\n1) Cancer information and referral: 24 hours a day, 365 days a year, including every holiday. The society answers questions about cancer. By calling the National 800 number or visiting www.cancer.org, clients will find:\r\n- Information about the nature of a patient\'s cancer and treatment options.\r\n- Assistance in locating financial aid resources and support services.\r\n- Assistance in securing free or low-cost lodging for patients receiving treatment away from home.\r\n- Information on a variety of ACS programs and services.\r\n2) Reach to Recovery: This program is for any person undergoing treatment for breast cancer. The program pairs a breast cancer survivor with a recently diagnosed patient who has similar issues. Contact may be either a personal visit, a phone call, or online based on location.\r\n3) Road to Recovery Program: This program provides free rides to cancer treatment appointments for any cancer patient.\r\n4) Look Good Feel Better: This is a program for any woman undergoing treatment for cancer. Sessions given by trained cosmetologists teach patients about skin care, nail care, and wig care or hair wraps. Each participant will receive a free cosmetic kit to take home. One-on-one salon consultations may be available for those who cannot attend the workshops, and at-home materials for both men and women are also available.\r\n5) Community and workplace education and wellness programs.\r\n6) Wig services: Affordable wigs, hats, turbans, or scarves to any woman diagnosed with cancer.\r\n7) Cancer Survivors Network: Online community to connect with others with cancer and their families.','','https://www.champaigncounty.org/list',NULL,NULL,'','By phone.','Older than 18 years old','No fees','None',NULL,'270,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2020-12-05 04:37:07'),(394,1071,'Orientation and Mobility Training','Bureau of Blind Services','322','COVID-19:\r\nAll DRS local offices are closed and staff has transitioned to remote telework. They continue to assist customers, vendors and other stakeholders with programs and services. Customers can use the new toll-free number to receive assistance regarding DRS programs and services: 1-877-581-3690\r\n------------------------------------\r\n\r\nOffers programs for adults with visual impairments to enable them to work and participate fully in family and community life.\r\n\r\nVocational Rehabilitation Program - BBS staff work with individuals with severe visual impairments to help them find jobs or get ready to go to work. They also recommend assistive technology to help people perform tasks on the job. \r\n\r\nCommunity-Based Instructional Program - BBS staff teach independent living skills to people in their homes, at school, in the work place, or at other community sites. Also serve individuals aged 55 and older who are blind and visually impaired through the Older Blind Program.','','http://www.dhs.state.il.us/page.aspx?item=29736','','',NULL,'','Illinois residents who are blind or visually impaired.','','','','272','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(395,1100,'Vocational Rehabilitation','Bureau of Field Services','322','COVID-19:\r\nAll DRS local offices are closed and staff has transitioned to remote telework. They continue to assist customers, vendors and other stakeholders with programs and services. Customers can use the new toll-free number to receive assistance regarding DRS programs and services: 1-877-581-3690\r\n-------------------------------------\r\n\r\nDRS staff talk to persons with disabilities about their employment needs and help them find a job or get ready to go to work. They also make sure that people have the supports they need to stay on the job.\r\n\r\nSpecialized vocational rehabilitation services for people who are:\r\n- Blind or visually impaired.\r\n- Deaf or hard of hearing.\r\n- Hispanic or Latino with disabilities.\r\n\r\nDRS help high school students who have disabilities plan for their futures after high school graduation.\r\n\r\nDRS Work Incentive Planning and Assistance Program helps people who receive SSDI/SSI benefits understand how working will affect their benefits.\r\n\r\nDRS Supported Employment Program (SEP) serves eligible people with significant disabilities who want to go to work and need on-going support services to succeed on the job.','','http://www.dhs.state.il.us/page.aspx?item=29736','','',NULL,'','Many people with disabilities of working age (16-64) are eligible for VR services. To be eligible, they need to have a significant physical or mental impairment that makes it difficult to go to work.','','','','273','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(396,1606,'In Home Assistance','','322','COVID-19:\r\nAll DRS local offices are closed and staff has transitioned to remote telework. They continue to assist customers, vendors and other stakeholders with programs and services. Customers can use the new toll-free number to receive assistance regarding DRS programs and services: 1-877-581-3690\r\n-----------------------------\r\n\r\nHome Services assists individuals with severe disabilities so they can remain in their homes and be as independent as possible. The program tries to prevent unnecessary nursing home placement by offering in-home care. Eligible customers may receive a wide range of services including personal caregivers, home health, home-delivered meals, assistive equipment, and respite services. Services are aimed at making the customer more independent in the home.\r\n\r\nSpecialized services are also available for persons with HIV/AIDS and/or traumatic brain injuries.','','http://www.dhs.state.il.us/page.aspx?item=29736','','',NULL,'','Serves people with severe disabilities under age 60 who need help with daily living activities in their homes. Many of these people are at risk of moving into a nursing home or other facility.\r\n\r\nFor those 60 and over, please contact the Illinois Department on Aging.','','','','274','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(397,15266,'Extreme Weather Shelters','Illinois Warming/Cooling Centers','322','Most DRS offices in the state are open as warming centers M-F, 8:30 am - 5:00 pm.','','','','',NULL,'','','','','','275','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(398,16245,'Independent Living Skills Instruction * Blindness','Bureau of Blind Services','322','COVID-19:\r\nAll DRS local offices are closed and staff has transitioned to remote telework. They continue to assist customers, vendors and other stakeholders with programs and services. Customers can use the new toll-free number to receive assistance regarding DRS programs and services: 1-877-581-3690\r\n------------------------------------\r\n\r\nOffers programs for adults with visual impairments to enable them to work and participate fully in family and community life.\r\n\r\nVocational Rehabilitation Program - BBS staff work with individuals with severe visual impairments to help them find jobs or get ready to go to work. They also recommend assistive technology to help people perform tasks on the job. \r\n\r\nCommunity-Based Instructional Program - BBS staff teach independent living skills to people in their homes, at school, in the work place, or at other community sites. Also serve individuals aged 55 and older who are blind and visually impaired through the Older Blind Program.','','','','',NULL,'','Illinois residents who are blind or visually impaired.','','','','276','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(399,401,'Support Groups * Compulsive Gambling','','36','Gamblers Anonymous is a fellowship of men and women who share their experience, strength, and hope with each other that they may solve their common problem and help others to recover from a gambling problem. The only requirement for membership is a desire to stop gambling.','','http://www.gamblersanonymous.org','isomain@gamblersanonymous.org','',NULL,'By phone.','','','','','277','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(401,5183,'Sexual Assault Hotlines',NULL,'3803','24-hour hotline for victims of sexual assault. Crisis counseling services, information & referral, and support can be accessed through calling the hotline.','',NULL,NULL,NULL,'1283643324173331','By phone.','Survivors and non-offending significant others of sexual violence; ages 3 and older.',NULL,NULL,NULL,'278,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-03-30 22:15:34'),(402,13061,'Sexual Assault Counseling',NULL,'3803','Individual, family, and child counseling is available for both victims/survivors ages 3 and older and their non-offending significant others.','',NULL,NULL,'Current wait list','1283643324173331','By phone','Survivors and non-offending significant others of sexual violence; ages 3 and older.',NULL,NULL,NULL,'278,1349,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-03-31 00:45:44'),(403,13062,'Sexual Assault Prevention Education',NULL,'3803','This program provides education and training about sexual assault, abuse, and harassment to a wide variety of audiences. It also provides education to children in public and private school districts, as well as specialized training to professional allies. All of these programs are:\r\n\r\nFree\r\nEvidence-informed\r\nAdhere to CDC Guidelines\r\nContain age-appropriate material\r\nMeet Erin’s law requirements\r\nMeets National Sexuality Education Standards\r\nMeets Illinois State Board of Education Physical Health & Health Performance Descriptors \r\nMeet Illinois State Board of Education Social Emotional Learning Performance Descriptors','','https://www.cu-races.org/education/','prevention@cu-races.org',NULL,'616851322165580,653908687612725,666635806773509,674731290697917,665301393676617,722235405163045,752843971156447,753694842989131,774081908539337,789038541797078,1086428834649414,1235612259797589,1283643324173331','By phone or email','All residents, schools & businesses are eligible','NONE',NULL,'Ford, Piatt, Douglas & Champaign county schools, businesses & residents','280,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-03-31 21:50:44'),(404,13063,'Medical Advocacy * Sexual Assault Issues',NULL,'3803','Trained advocates respond to local hospitals 24-hours a day. They can accompany a victim through the evidence collection and medical treatment process; provide support; give information about options and rights; and assist with safety planning.','',NULL,NULL,NULL,'941516382466411,1283643324173331',NULL,'Available to survivors and their non-offending significant others.','NONE',NULL,NULL,'278,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-03-30 22:13:29'),(405,19395,'Protective/Restraining Orders * Sexual Assault Issues',NULL,'3803','Legal advocates can assist clients with navigating the civil and criminal justice process. This includes assistance in filing for Civil No Contact and Stalking No Contact Orders. They can also help clients assert rights as a crime victim and accompany them to meetings with officials and court hearings.','',NULL,NULL,NULL,'877704388705793,1283643324173331','By phone.','Available to survivors 3 and older and their non-offending significant others.','NONE',NULL,NULL,'278,1349,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-03-30 22:07:16'),(406,5194,'Support Groups * Mental Illness/Emotional Disabilities','','3809','Emotions Anonymous is a twelve-step organization whose fellowship is composed of people coming together for the purpose of working toward recovery from emotional difficulties. EA members are from many walks of life and the only requirement for membership is a desire to become well emotionally. EA\'s program has been known to be helpful to many who suffer from problems as diverse as depression, anger, broken or strained relationships, grief, anxiety, low self-esteem, panic, abnormal fears, resentment, jealousy, guilt, loneliness, obsessive and negative thinking, compulsive behavior, and a variety of other emotional issues.','','','','','637158405241810','By phone.','','','','','283','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(407,650,'Reduced Cost Motor Vehicle Registration','License Plate Discount Program','2043','The Benefit Access Application program includes the Seniors Free Transit Ride, the Persons with Disabilities Free Transit Ride, and the License Plate Discount. To be determined eligible for these benefits, a person must submit a Benefit Access Application on the Internet. Paper applications are not available. Once application is approved, a certificate of eligibility can be printed to take to one\'s local transit authority or Secretary of State Office. The website can be checked at anytime to determine application status.','','http://www.state.il.us/aging','','',NULL,'Application available through website.','Persons age 65 and older, widow or widower who turned 63 before their spouse\'s death who was eligible, and persons with disabilities age 16 and older.','','','$33,562 for a household of one; \r\n$44,533 for a household of two; or \r\n$55,500 for a household of three.\r\n','284','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(408,9913,'Transportation Passes * Older Adults','Ride Free Transit Card','2043','The Benefit Access Application program includes the Seniors Free Transit Ride, the Persons with Disabilities Free Transit Ride, and the License Plate Discount. The Transit Ride Program only applies to metropolitan public transit in Illinois. To be determined eligible for these benefits, a person must submit a Benefit Access Application on the Internet. Paper applications are not available. Once application is approved, a certificate of eligibility can be printed to take to one\'s local transit authority or Secretary of State Office. The website can be checked at any time to determine application status.','','http://www.state.il.us/aging','','','1232587316936391','','Persons age 65 and older, widow or widower who turned 63 before their spouse\'s death who was eligible, and persons with disabilities age 16 and older.','','','$33,562 for a household of one; \r\n$44,533 for a household of two; or \r\n$55,500 for a household of three.','285','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(409,15373,'Transportation Passes * People With Disabilities/Health Conditions','Ride Free Transit Card','2043','The Benefit Access Application program includes the Seniors Free Transit Ride, the Persons with Disabilities Free Transit Ride, and the License Plate Discount. The Transit Ride Program only applies to metropolitan public transit in Illinois. To be determined eligible for these benefits, a person must submit a Benefit Access Application on the Internet. Paper applications are not available. Once application is approved, a certificate of eligibility can be printed to take to one\'s local transit authority or Secretary of State Office. The website can be checked at any time to determine application status.','','','','','1232587316936391','','Persons age 65 and older, widow or widower who turned 63 before their spouse\'s death who was eligible, and persons with disabilities age 16 and older.','','','$33,562 for a household of one; \r\n$44,533 for a household of two; or \r\n$55,500 for a household of three.','286','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(410,13284,'Day Labor','','2047','Specializes in day-to-day general labor.','','','','',NULL,'Jobs can be searched and applied for online. Applications are also accepted in person at any Labor Ready branch office.','','','To apply, must have photo ID in addition to a Social Security card or birth certificate.','','287','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(411,13789,'Unemployment Insurance','','21','Unemployment Insurance - Files claims and determines eligibility for unemployment benefits. The fastest way to access unemployment benefits is through the website. People can also file at the local IDES office.\r\n\r\nIllinoisJobLink.com is a website that connects skilled job seekers to employers in Illinois. Job seekers can build multiple resumes to emphasize different skills and experiences. Business owners can use keyword matching technology to search resumes and find the best candidate. IllinoisJobLink.com is free for workers and employers and can be accessed 24/7 online.','','http://www.ides.illinois.gov','','',NULL,'By phone and website.','','','','','288','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(412,13790,'Ex-Offender Reentry Programs','The Re-Entry Employment Service Program (RESP)','21','An employment program for formerly incarcerated or previously convicted individuals seeking assistance in finding a job. To apply for the program, call local IDES office to schedule an appointment with the RESP Liaison. The RESP Liaison will assist in a client\'s job readiness and work directly with employers on the client\'s behalf to improve his or her job chances. The IDES website provides lots of information and more details on this program.','','http://www.ides.illinois.gov','','',NULL,'In-person at any IDES office or call the RESP hotline at 312-793-1597.','','','','','289','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(413,1712,'Senior Ride Programs','Senior Transportation','2169','Senior Transportation provides one ride per week to any registered Champaign County resident (aged 60 or older) for medical appointments, financial errands, grocery shopping, or personal errands. Two rides may be provided for those receiving dialysis or other physician ordered therapies. Rides must be scheduled two days in advance.','','http://www.famservcc.org','','',NULL,'Call the Senior Resource Center.','Age 60 or older.','','','','290','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(414,2222,'In Home Assistance * Older Adults','HomeCare','2169','Help in the home with non-medical needs including assistance with personal care (bathing, grooming, dressing, etc.), meal preparation, shopping, errands, laundry, housework, and/or companionship. All HomeCare Assistants are pre-screened and receive extensive pre-service training. All have fingerprint background checks completed and are supervised by professional staff. Both Private Pay and State Supported Community Care Program services are available.','','http://www.famservcc.org','','',NULL,'Call for information or to schedule consultation or home visit.','Age 60 or older.','','','No income guidelines for private pay services. State supported services have asset requirements.','291','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(415,2224,'Geriatric Counseling','Senior Counseling and Advocacy','2169','Senior Counseling & Advocacy offers short- or long-term assistance to those (ages 60 and older) who have experienced loss, confusion, family issues, anxiety, depression, dementia, or other complications in their personal situations. Trained staff will meet with the senior in his/her home to discuss needs and options. Staff can also assist with accessing financial benefits and healthy aging programs.','','http://www.famservcc.org','','',NULL,'Call the Senior Resource Center.','Age 60 or older.','','','','292','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(416,2225,'Elder/Dependent Adult Abuse Reporting','Adult Protective Services (APS)','2169','Investigates allegations of abuse, neglect, exploitation, and self-neglect of older adults (ages 60 and older) as well as persons with disabilities (ages 18-59) who live in a domestic (non-institutional) setting. Appointed by the Illinois Department on Aging to investigate allegations of physical and emotional abuse, financial exploitation, confinement/neglect, deprivation of food or medication, sexual abuse, and self-neglect.\r\n\r\nThis program offers 24-hour intakes by phone. A caseworker will make a home visit to investigate any allegations of abuse and self neglect and offer assistance to victims. Interventions can include, but are not limited to, in-home, legal, medical, relocation, and counseling services.','','http://www.famservcc.org','','',NULL,'To make a confidential report of suspected abuse, or for assistance, call the Senior Resource Center or the 24-hour Abuse Hotline. Anonymous reports accepted.','Seniors (ages 60+) and people (ages 18-59) with disabilities and living in a home (non-institutional) setting.','','','','293','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(417,5252,'General Counseling Services','Family Counseling','2169','Professional therapists provide individual, couple, child, and family counseling. Counseling focuses on a wide variety of issues including:\r\n- Parenting.\r\n- Family conflict.\r\n- Relationships.\r\n- Depression and anxiety.\r\n- Issues of adult children of alcoholics.\r\n- Survivors of sexual abuse.\r\n- Conflict resolution.\r\nArt therapy and play therapy services are also offered.','','http://www.famservcc.org','','',NULL,'Clients seen by appointment; evening hours available.','','','Photo ID, proof of income, and proof of residency.','','294','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(418,5253,'Information and Referral * Older Adults','Senior Information and Assistance','2169','Staff provide information, assistance, and referral to those aged 60 and older, their families, and the community. Staff can provide warm transfers of calls to appropriate referrals. If further assistance or advocacy is needed, staff can work with seniors until they have accessed all possible assistance available. Staff can review needs and resources and help seniors and their families plan for the future.','','http://www.famservcc.org','','',NULL,'Call the Senior Resource Center.','All calls for information and referral accepted.','','','','295','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(420,22584,'Websites * Domestic Violence Shelters','','218','The National Coalition Against Domestic Violence (NCADV) is the voice of victims and survivors. They work towards this mission of society having zero tolerance for domestic violence by effecting public policy, increasing understanding of the impact of domestic violence, and providing programs and education that drive that change.\n\n','','','','',NULL,'','','','','','296','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(422,942,'Homeless School Transition Programs','Education for Homeless Children and Youth Program','2237','The Homeless Liaison works with a wide variety of partners to assist in stabilizing homeless children and their families so that they are more responsive to school enrollment. Funding is available to resolve issues such as a lack of school supplies, physical education clothing, transportation, alarm clocks, or special school fees such as those for field trips, pictures, and book clubs. Funding is also available for tutoring and to assist with the cost of educational summer programs.','','http://www.roe9.k12.il.us','','',NULL,'By phone and through the student\'s school.','- Champaign and Ford County homeless families with children and youth who are of school age. \r\n- Preschool aged children also receive services to ensure access to early childhood and pre-school programs. \r\n- Child\'s school must verify homelessness.','','','','297','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(423,15167,'Truancy Counseling','Attendance Improvement Program (AIP)','2237','The mission of the program is to provide and coordinate services for students who are experiencing attendance problems so the potential for each student to achieve academic success is maximized. The program offers a variety of prevention and intervention services. These services include:\r\n- Attendance incentives.\r\n- Student advocacy.\r\n- Case management.\r\n- Home visits.\r\n- School visits.\r\n- Referral to agencies for counseling.\r\n- Technical assistance to individual school districts and the community. \r\n\r\nThese services are provided based on the needs of individual students, parents, and schools, and are used in designing an individualized service plan for each student. Attendance specialists coordinate program services with school and community services to provide each student with a successful educational plan.','','','','',NULL,'','','','','','298','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(424,15169,'Occupation Specific Job Training * Bus Drivers','','2237','The Regional Office of Education provides training for school bus drivers.','','','','','970915508638448','Call or check website for class schedule.','','','','','299','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(425,29328,'School Districts','Education for Homeless Children and Youth Program','2237','The Homeless Liaison works with a wide variety of partners to assist in stabilizing homeless children and their families so that they are more responsive to school enrollment. Funding is available to resolve issues such as a lack of school supplies, physical education clothing, transportation, alarm clocks, or special school fees such as those for field trips, pictures, and book clubs. Funding is also available for tutoring and to assist with the cost of educational summer programs.','','http://www.roe9.k12.il.us','','',NULL,'By phone and through the student\'s school.','- Champaign and Ford County homeless families with children and youth who are of school age. \r\n- Preschool aged children also receive services to ensure access to early childhood and pre-school programs. \r\n- Child\'s school must verify homelessness.','','','','300','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(426,15168,'Alternative Education','','2237','The mission of the R.E.A.D.Y. Program is to provide a holistic education program for students in an alternative setting. The integrated curriculum includes partnerships with the families, the home school, social service agencies, and educational communities to help students find pathways to academic, occupational, and personal success.','','','','','789038541797078','Must be referred by home school administration.','6th-12th grade students who have been identified as problematic in their home school environments.','','','','301','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(427,16748,'Legislation Information * Alzheimer\'s Disease','','2258','The Illinois Chapter staff and advocates speak out on behalf of the 500,000 Illinois residents affected by Alzheimer\'s. The Chapter works to improve dementia care and services, access to community-based care, quality care in residential settings, and funding for Alzheimer\'s research and public programs serving people with dementia.','','http://www.alz.org/illinois','','',NULL,'','','','','','302','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(428,13757,'Pregnancy Counseling','','2361','1) PRC is a medical facility that offers free on-site pregnancy testing, on-site limited obstetrical ultrasound services, and STI testing for women of all ages that qualify.\r\n2) Education and counseling on pregnancy, abortion, and alternatives to abortion.\r\n3) Parenting education program, \"HOPE.\"\r\n4) Support to the pregnant woman whose unborn baby has been diagnosed with an adverse or terminal condition and wishes to carry to term, \"Rocking Chair.\"','','','','',NULL,'Appointments by phone or website.','','','','','303','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(429,13758,'Pregnancy Testing','','2361','1) PRC is a medical facility that offers free on-site pregnancy testing, on-site limited obstetrical ultrasound services, and STI testing for women of all ages that qualify.\r\n2) Education and counseling on pregnancy, abortion, and alternatives to abortion.\r\n3) Parenting education program, \"HOPE.\"\r\n4) Support to the pregnant woman whose unborn baby has been diagnosed with an adverse or terminal condition and wishes to carry to term, \"Rocking Chair.\"','','','','',NULL,'Appointments by phone or website.','','','','','304','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(430,14419,'Postabortion Counseling','','2361','Support from trained volunteers for those who have received a terminal pregnancy diagnosis, those who are concerned about their options for pregnancy, and those who have terminated a pregnancy.','','','','',NULL,'','','','','','305','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(431,22336,'Expectant/New Parent Assistance','','2361','1) PRC is a medical facility that offers free on-site pregnancy testing, on-site limited obstetrical ultrasound services, and STI testing for women of all ages that qualify.\r\n2) Education and counseling on pregnancy, abortion, and alternatives to abortion.\r\n3) Parenting education program, \"HOPE.\"\r\n4) Support to the pregnant woman whose unborn baby has been diagnosed with an adverse or terminal condition and wishes to carry to term, \"Rocking Chair.\"','','','','',NULL,'Appointments by phone or website.','','','','','306','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(432,1449,'Low Income/Subsidized Rental Housing','','2426','Low income housing rentals for families, elderly, and people with disabilities.','','','','','929094559121639','','Serves individuals who are elderly, disabled, and/or low-income families.','','','','307','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(433,16535,'Housing Authorities','','2426','Low income housing rentals for families, elderly, and people with disabilities.','','','','','929094559121639','','Serves individuals who are elderly, disabled, and/or low-income families.','','','','308','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(434,1073,'Medicaid * Disabilities and Health Conditions','','2437','The goal of this program is to help people with disabilities work with full Medicaid healthcare benefits. HBWD not only encourages enrollees to work, but to increase the number of hours they are currently working.','','http://www.illinois.gov/hfs/MedicalPrograms/hbwd/Pages/default.aspx','hfs.webmaster@illinois.gov','','968511154801619','Applications are available through the website or request an application to be mailed. For more information, call the toll-free number.','Disabled individuals (ages 16-64) who are working.','','','Up to 350% of Federal Poverty Level. Unlike other Medicaid programs, HBWD allows enrollees to have up to $25,000 in assets.','309','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(435,1079,'Utility Assistance * Telephone Service Payment Assistance','Lifeline / Link-Up','2449','Lifeline helps subsidize the monthly cost of basic local landline phone service. Link-Up helps pay for installing a landline phone in the homes of low-income individuals or families in Illinois.','','http://www.linkupillinois.org','','',NULL,'By phone. To enroll in Lifeline or Link-Up, call your local telephone company. For Lifeline benefits only, you can also call a participating cell phone company (list on ICC website).','Illinois households qualify for Lifeline and Link-Up telephone assistance if they have an income of 135% or less of federal poverty guidelines or if they are enrolled in any of the following:\r\n- Medicaid.\r\n- Supplemental Nutrition Assistance Program (SNAP).\r\n- Supplemental Security Income (SSI).\r\n- Federal Public Housing Assistance.\r\n- Veterans Pension and Survivors Benefit Programs.','','','135% of federal poverty guidelines.','310','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(436,1180,'Medicaid','Get Covered Illinois','2470','COVID19:\r\nAlthough many of the DHS offices are mostly closed and are not seeing customers face to face, people can still apply for SNAP, medical, and TANF benefits online and by phone:\r\ngo to ABE.illinois.gov or call the Help is Here Hotline at 833-2-FIND-HELP (833-234-6343). \r\nThere are NO public benefits that require face to face appointments in the office.\r\n----------------------------\r\n\r\nMedicaid and CHIP (Children\'s Health Insurance Program) provide free or low-cost health coverage to people with low incomes, families and children, pregnant women, the elderly, and people with disabilities. DHS administers the applications for Medicaid through ABE (Application for Benefits Eligibility), which is the part of the DHS website where Illinois residents can apply for Medicaid, SNAP, and cash benefits.','','','','',NULL,'By phone, walk-in, or website.','','','','138% of the federal poverty level.','311','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(437,2099,'Burial Services','Funeral & Burial Benefits','2470','Pays for funeral and burial expenses when a person\'s resources and all other sources of payment are less than the DHS standard payment rates. The maximum amount that DHS will pay is $1,103 for a funeral and $552 for a cremation/burial.','','http://www.dhs.state.il.us','','',NULL,'By phone, website. Funeral and Burial Unit (217)785-2679.','The Department pays the funeral and burial expenses of a person who at the time of death:\r\n1) was receiving any of the following kinds of assistance: \r\n- Temporary Assistance for Needy Families (TANF) Cash.\r\n- Aid to the Aged, Blind, or Disabled (AABD) Cash. \r\n- All Kids Assist.\r\n- Parent/All Kids Assist.\r\n- All Kids Moms & Babies.\r\n- Family Assist.\r\n- AABD Medical.\r\n- General Assistance Foster Care/Adoption Care.\r\nOR \r\n(2) who would have qualified for: \r\n- All Kids Assist.\r\n- Parent/All Kids Assist. \r\n- All Kids Moms & Babies. \r\n- Family Assist. \r\n- AABD Medical.','','','','312','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(438,2100,'Child Support Assistance/Enforcement','Child Support Hotline','2470','Child support services are available to any parent who needs assistance in establishing legal parentage, or establishing or enforcing child support or medical support, regardless of income.','','http://www.childsupportillinois.com','','',NULL,'By phone or website. Child Support Services Center: 1-800-447-4278.','','','','','313','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(439,2101,'Medicaid','AABD (Aid to the Aged, Blind or Disabled)','2470','This program provides medical and cash assistance for customers who are 65 years of age or older, blind, or disabled. This program also includes the QMB (Qualified Medicare Beneficiary) program which provides payment of Medicare premiums and some Medicare co-payments.','','http://www.dhs.state.il.us','','',NULL,'By phone, walk-in, or online.','Eligibility is based on income and assets.','','Photo ID, birth certificate, proof of income, proof of residency, and Social Security card.','','314','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(440,12771,'Disaster Relief Services','Individual and Family Grant Program for Disaster Relief','2470','Disaster Relief - In the event of a presidentially-declared disaster, DHS administers the Individual and Family Grant Program which provides financial aid and other appropriate assistance to victims of disaster.','','','','',NULL,'','','','','','315','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(441,15284,'Extreme Weather Shelters','Illinois Warming/Cooling Centers','2470','All DHS offices across the state are open, M-F, 8:00 - 5:00 for people to use as a warm/cool place to stay during the day.','','','','',NULL,'','','','','','316','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(442,31931,'Grocery Ordering/Delivery * COVID-19','SNAP/Food Stamps','2470','COVID-19:\r\n\r\nNew! 5-21-20 - SNAP Electronic Benefit Transfer (EBT):\r\nBeginning June 2, 2020, SNAP recipients will be able to purchase food from participating grocery retailers online (Amazon & Walmart are on board and other retailers are likely to be soon). Access will be provided automatically to all existing Link card holders beginning June 2. Customers will not need to call or visit an office. Customers will use their SNAP Personal Identification Number (PIN) to order. All SNAP recipients in Illinois will be able to participate.\r\n\r\n4/22/20 - To increase food security during the coronavirus national emergency, SNAP households nationwide will receive emergency benefits representing a 40% increase in overall monthly SNAP benefits.\r\n\r\nDHS offices are closed and not seeing customers face to face, but people can still apply for SNAP, medical, and TANF benefits online and by phone:\r\ngo to ABE.illinois.gov or call the Help is Here Hotline at 833-2-FIND-HELP (833-234-6343). \r\nThere are NO public benefits that require face to face appointments in the office.\r\n-----------------------\r\n(Pre-COVID)\r\nProvides a supplement to the food budgets of low-income households. Recipients receive a \"link\" card to purchase groceries. SNAP for low income community college students is also available.\r\n\r\nSNAP/LINK benefits may now be used at restaurants. The SNAP Restaurant Meals Program goes into effect immediately for elderly, people with disabilities, or people experiencing homelessness.','','http://www.idhslink.com','','',NULL,'May apply in the office or online.','','','Photo ID, birth certificate, proof of income, proof of residency, and social security card. College students must get a verification form signed by a school counselor or administrator and take a current copy of their transcript or class schedule to the appointment.','Household total gross monthly income must be 130% to 165% of the Federal Poverty Level, but also takes into consideration household size and expenses. Older adults and people with disabilities can have higher gross monthly income limits and qualify. The maximum gross monthly income for a household of one (not disabled or over age 60) is around $1,634. A “household” is anyone living together who regularly purchases and prepares meals together.','317','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(443,33,'Adult Protective Intervention/Investigation * Inpatient Health Facilities','','2481','OIG investigates allegations of abuse or neglect of individuals who receive mental health services or developmental disability services in programs that are operated, licensed, certified, or funded by the Illinois Department of Human Services (e.g., State-Operated Facilities, CILAs, and Workshops).','','http://www.dhs.state.il.us/page.aspx?item=29410','','','941516382466411','By phone.','','','','','318','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(444,14310,'Parenting Skills Classes * Sexual Assault Issues','','294','Parent/Guardian Education Classes offered by ABC Counseling:\r\n1) Classes to educate parents/guardians about the sexually abused individual.\r\n2) Classes to educate parents/guardians about child sexual abuse.','','','','',NULL,'','','','','','319','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(445,30855,'Adolescent/Youth Counseling','','294','Child Victims of Sexual Abuse and Sexually Reactive Children - Assessment, treatment, and comprehensive risk assessment to determine treatment need of child. Psycho-educational classes are available for parents of children affected by sexual abuse. \r\n\r\nAlso offers general counseling services, such as individual and group counseling.','','','','',NULL,'','','','Proof of income.','','320','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(447,14971,'Support Groups * Eating Disorders','ANAD Eating Disorder Support Groups','296','ANAD coordinates a national network of free support groups facilitated by approved leaders or professionals, in order to assist individuals and families in a greater understanding of the complexity of eating disorders and maintaining lifelong recovery.','','http://www.anad.org/our-services/treatment-directory','','',NULL,'Call for more information.','Anyone affected by an eating disorder, or their family or friends.','','','','321','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(448,14408,'Disease/Disability Information * Cancer','','3','The American Cancer Society is a nationwide, community-based voluntary health organization dedicated to eliminating cancer as a major health problem. Services include:\r\n\r\n1) Cancer information and referral: 24 hours a day, 365 days a year, including every holiday. The society answers questions about cancer. By calling the National 800 number or visiting www.cancer.org, clients will find:\r\n- Information about the nature of a patient\'s cancer and treatment options.\r\n- Assistance in locating financial aid resources and support services.\r\n- Assistance in securing free or low-cost lodging for patients receiving treatment away from home.\r\n- Information on a variety of ACS programs and services.\r\n2) Reach to Recovery: This program is for any person undergoing treatment for breast cancer. The program pairs a breast cancer survivor with a recently diagnosed patient who has similar issues. Contact may be either a personal visit, a phone call, or online based on location.\r\n3) Road to Recovery Program: This program provides free rides to cancer treatment appointments for any cancer patient.\r\n4) Look Good Feel Better: This is a program for any woman undergoing treatment for cancer. Sessions given by trained cosmetologists teach patients about skin care, nail care, and wig care or hair wraps. Each participant will receive a free cosmetic kit to take home. One-on-one salon consultations may be available for those who cannot attend the workshops, and at-home materials for both men and women are also available.\r\n5) Community and workplace education and wellness programs.\r\n6) Wig services: Affordable wigs, hats, turbans, or scarves to any woman diagnosed with cancer.\r\n7) Cancer Survivors Network: Online community to connect with others with cancer and their families.','','','','',NULL,'By phone.','','','','','322','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(449,14409,'Non-Emergency Medical Transportation * Cancer','','3','The American Cancer Society is a nationwide, community-based voluntary health organization dedicated to eliminating cancer as a major health problem. Services include:\r\n\r\n1) Cancer information and referral: 24 hours a day, 365 days a year, including every holiday. The society answers questions about cancer. By calling the National 800 number or visiting www.cancer.org, clients will find:\r\n- Information about the nature of a patient\'s cancer and treatment options.\r\n- Assistance in locating financial aid resources and support services.\r\n- Assistance in securing free or low-cost lodging for patients receiving treatment away from home.\r\n- Information on a variety of ACS programs and services.\r\n2) Reach to Recovery: This program is for any person undergoing treatment for breast cancer. The program pairs a breast cancer survivor with a recently diagnosed patient who has similar issues. Contact may be either a personal visit, a phone call, or online based on location.\r\n3) Road to Recovery Program: This program provides free rides to cancer treatment appointments for any cancer patient.\r\n4) Look Good Feel Better: This is a program for any woman undergoing treatment for cancer. Sessions given by trained cosmetologists teach patients about skin care, nail care, and wig care or hair wraps. Each participant will receive a free cosmetic kit to take home. One-on-one salon consultations may be available for those who cannot attend the workshops, and at-home materials for both men and women are also available.\r\n5) Community and workplace education and wellness programs.\r\n6) Wig services: Affordable wigs, hats, turbans, or scarves to any woman diagnosed with cancer.\r\n7) Cancer Survivors Network: Online community to connect with others with cancer and their families.','','','','','1232587316936391','By phone.','','','','','323','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(450,14410,'Wigs','','3','The American Cancer Society is a nationwide, community-based voluntary health organization dedicated to eliminating cancer as a major health problem. Services include:\r\n\r\n1) Cancer information and referral: 24 hours a day, 365 days a year, including every holiday. The society answers questions about cancer. By calling the National 800 number or visiting www.cancer.org, clients will find:\r\n- Information about the nature of a patient\'s cancer and treatment options.\r\n- Assistance in locating financial aid resources and support services.\r\n- Assistance in securing free or low-cost lodging for patients receiving treatment away from home.\r\n- Information on a variety of ACS programs and services.\r\n2) Reach to Recovery: This program is for any person undergoing treatment for breast cancer. The program pairs a breast cancer survivor with a recently diagnosed patient who has similar issues. Contact may be either a personal visit, a phone call, or online based on location.\r\n3) Road to Recovery Program: This program provides free rides to cancer treatment appointments for any cancer patient.\r\n4) Look Good Feel Better: This is a program for any woman undergoing treatment for cancer. Sessions given by trained cosmetologists teach patients about skin care, nail care, and wig care or hair wraps. Each participant will receive a free cosmetic kit to take home. One-on-one salon consultations may be available for those who cannot attend the workshops, and at-home materials for both men and women are also available.\r\n5) Community and workplace education and wellness programs.\r\n6) Wig services: Affordable wigs, hats, turbans, or scarves to any woman diagnosed with cancer.\r\n7) Cancer Survivors Network: Online community to connect with others with cancer and their families.','','','','',NULL,'By phone.','','','','','324','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(454,4936,'Veterans Affairs Medical Centers','','3724','VA Illiana Health Care System (VAIHCS) provides primary, secondary, medical and surgical care, acute psychiatric care, extended long-term care, and skilled nursing home care including Rehabilitation, Alzheimer\'s, and Palliative Care to veterans primarily residing in central Illinois and west central Indiana. VAIHCS offers a full cadre of ambulatory care including mental health and substance abuse services.','','http://www.danville.va.gov','','',NULL,'','All veterans are encouraged to enroll in the VA Health Care System.','','Whether mailing or bringing  application to the facility, please include the following items:\r\n- Copy of both sides of current insurance card (including Medicare or Medicaid).\r\n- Copy of DD214.\r\n- (Purple Heart recipients only) Copy of award letter if \'Purple Heart\' is not noted on DD214.','','325','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(455,5121,'College/University Entrance Support','','3744','ISAC\'s college access and outreach activities are focused on helping families navigate the numerous steps involved in career and college planning as well as finding, applying to, and paying for college. These resources include:\r\n\r\n- ISAC Student Portal: Provides free online tools to help with college and scholarship search, financial aid planning, money management, and career and job searches.\r\n\r\n- ISACorps: Provides student outreach and offers free one-on-one college mentoring, presentations, financial aid application assistance, and a number of other college-related services. \r\n\r\n- Helping families pay for college: Offers Illinois residents a variety of grant and scholarship programs, eligibility for which is based on factors such as financial need, academic achievement, chosen field of study, or military service. Also offers student loan repayment programs.','','http://www.isac.org','isac.studentservices@isac.illinois.gov','',NULL,'Students interested in attending college can visit the website for information and resources. If interested in one-on-one college mentoring or presentations, call for information on local ISACorps outreach representatives.','','','','','326','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(457,5135,'Dropout Programs','Stay 4 Project','3763','This program is designed to identify, help, and retain low-income students who demonstrate the ability to succeed, yet are considered to be at risk of dropping out of high school. Upon completion of the \"Stay 4\" criteria, high school graduation, and enrollment in a trade school, community college, or four-year university, students will be awarded a monetary grant from Great Plains LIFE Foundation to support their continuing educational efforts.','','http://www.stay4.org','gplife@stay4.org','',NULL,'Selection of students placed into the \"Stay 4\" program is the responsibility of the student\'s school/school district.','The school district is responsible for selecting those students who have the potential to succeed but for a variety of reasons are at risk for dropping out of school. Students selected must qualify for the National School Lunch Program (free & reduced price meals). Students will be chosen in their junior year of high school. Participants must maintain criteria in the areas of academics, community services, and extra-curricular activities.','','','','327','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(458,923,'Support Groups * Families/Friends of Murder Victims','','378','POMC offers support through meetings and telephone contact. Will provide grief processing information and communicate with professionals in the helping fields about problems faced by those surviving a homicide. Also supplies criminal justice system information, accompanies survivors in court, and attempts to increase society\'s awareness of survivors\' issues and problems. The national website provides links/information about regional chapters across the US.','','http://www.pomc.org','','',NULL,'Prefer contact by phone or e-mail initially; walk-in at meetings acceptable.','','','','','328','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(459,5196,'Special Education * Hearing Loss','','3813','The Illinois Service Resource Center provides behavior support for families and educators of children who are deaf, hard of hearing, or blind. Free onsite visits for schools and homes are available. Additional services include free training for school and parent groups, free library with return postage included, and 24-hour helpline.','','http://www.isrc.us','isrc@isrc.us','',NULL,'By phone or email.','Families of children with hearing or vision loss.','','','','329','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(460,936,'Support Groups * Parkinson\'s Disease','','384','APDA strives to improve the lives of people with Parkinson’s, their caregivers, and their family members by providing education, creating public awareness, fostering a supportive environment, and raising funds for research.\r\n\r\nPersons can also call the information and referral center to receive information on respite care, support groups, caregiver specific educational programs, and other means of support.','','','','',NULL,'By phone, website.','','','','','330','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(461,16473,'Disease/Disability Information * Parkinson\'s Disease','','384','APDA strives to improve the lives of people with Parkinson’s, their caregivers, and their family members by providing education, creating public awareness, fostering a supportive environment, and raising funds for research.\r\n\r\nPersons can also call the information and referral center to receive information on respite care, support groups, caregiver specific educational programs, and other means of support.','','','','',NULL,'By phone, website.','','','','','331','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(462,5312,'Information and Referral * Respite Care','Lifespan Respite Program','3864','The Lifespan Respite Program has been established to help coordinate systems of accessible, community-based respite care services for family caregivers of children and adults with special needs living in the state of Illinois.\r\n\r\nThe goal of the IRC is to help families navigate respite funding streams, eligibility criteria, and fragmented services. The IRC also provides a network for caregivers and providers to get linked together by offering online respite resources and access to training opportunities.','','http://www.illinoisrespitecoalition.org','','',NULL,'By phone.','Eligibility depends on funding source. The DHS in-home respite grant is dependent on I/DD diagnosis. When funding is available, the IRC will also continue to provide Emergency Respite Care (ERC) funding to families across the lifespan in crisis statewide. This funding is available to anyone with a disability. The funding, once approved, would be for crisis/emergency situations. Individuals on state waivers and/or receiving respite services through other agencies are not eligible for either funding opportunity.','','','No income guidelines for either in-home or emergency respite care program.','332','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(463,31231,'Respite Care','','3864','In-home and emergency respite services for families/caregivers.','','','','','637158405241810','By phone or email. There is an intake and application process.','Eligibility depends on funding source. A DHS in-home respite grant is dependent on I/DD diagnosis. When funding is available, the IRC will also continue to provide Emergency Respite Care (ERC) funding to families across the lifespan in crisis statewide. This funding is available to anyone with a disability. The funding once approved, would be for crisis/emergency situations. \n\nIndividuals on state waivers and/or receiving respite services through other agencies are not eligible for either funding opportunity.','','','','333','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(464,5313,'Bed Bug Control','Bed Bug Information','3866','To get educational information about bed bugs, go to the Illinois Department of Public Health website.','','','','',NULL,'','','','','','334','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(465,18480,'Health Facility Complaints','Office of Health Care Regulation','3866','When using health care facilities in Illinois, patients and their families can be assured quality of care standards have been established to ensure facilities provide health care services in a clean and safe environment that meets their physical, mental, and psychological needs. Depending on the health care provider, the Office of Health Care Regulation may license, inspect, or certify those that must comply with state and federal regulations. The office also operates a hotline (1-800-252-4343) that people can call to register complaints against health care facilities. Facilities, equipment, and providers subject to review include: \r\n- Alternative health care delivery.\r\n- Ambulatory surgical treatment centers (ASTCs).\r\n- Clinical laboratories (CLIA).\r\n- Community mental health centers and accredited mental health centers (only Medicare certified).\r\n- Comprehensive outpatient rehabilitation facilities.\r\n- Critical access hospitals.\r\n- End-stage renal dialysis units.\r\n- Free standing emergency centers.\r\n- Health maintenance organizations (HMOs).\r\n- Home health agencies.\r\n- Hospices.\r\n- Hospitals.\r\n- Outpatient physical therapy.\r\n- Portable X-ray services.\r\n- Rural health clinics.','','http://dph.illinois.gov/topics-services/health-care-regulation/complaints','','','941516382466411','Complaints can be filed by phone, mail, or fax.','','','','','335','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(466,22100,'Public Health Information/Inspection/Remediation','','3866','The mission of IDPH is to promote health through the prevention and control of disease and injury. Assuring the quality of our food, setting the standards for hospital and nursing home care, checking the safety of recreation areas, overseeing the inspection of milk producing farms and processing plants, maintaining the state\'s vital records and screening newborns for genetic diseases are just some of the duties of IDPH.','','http://www.dph.illinois.gov','','','941516382466411','','','','','','336','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(467,24886,'Cancer Detection * Breast Cancer * Cervical Cancer','Illinois Breast and Cervical Cancer Program (IBCCP)','3866','Offers free mammograms, breast exams, pelvic exams and Pap tests to eligible women. Even if a woman has already been diagnosed with cancer, she may receive free treatment if she qualifies. Some cases diagnosed outside of the program may also qualify for free treatment.','','http://dph.illinois.gov/topics-services/life-stages-populations/womens-health-services/ibccp','','',NULL,'By phone. The Women\'s Health Line will pre-screen for this program and then make a referral to local agencies for health screening and treatment.','Women are eligible who are:\r\n- Living in Illinois.\r\n- Without insurance.\r\n- Breast services: Age 40 to 64 years old.\r\n- Cervical Services: Age 21 to 64 years old.','','','','337','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(468,31509,'COVID-19 Control','Coronavirus (COVID-19) Hotline','3866','Callers who are symptomatic or have specific questions concerning the Coronavirus (named COVID-19) should call the IDPH hotline @ 800-889-3931 or see the website for information. Callers who are looking for their local testing site should visit the IDPH website. \r\n\r\nNEW! Testing Guidelines: \r\nAnyone with COVID-19-like illness or symptoms can get a test, even without a doctor’s order. As testing capacity expands, testing is now available for people who:\r\n- Have COVID-19 symptoms (cough, shortness of breath and fever) OR\r\n- Have a risk factor, such as\r\n---- Contact with someone confirmed to have COVID-19.\r\n---- A compromised immune system or a serious chronic medical condition.\r\n\r\nTesting is also available for those with or without symptoms who:\r\n- Work in a health care facility.\r\n- Work in correctional facilities, such as jails or prisons.\r\n- Serve as first responders, such as paramedics, emergency medical technicians, law enforcement officers, or firefighters.\r\n- Support critical infrastructure, such as workers in grocery stores, pharmacies, restaurants, gas stations, public utilities, factories, childcare, and sanitation.\r\n\r\nA list of testing sites can be found online at --- https://www.dph.illinois.gov/covid19/covid-19-testing-sites#','','http://www.dph.illinois.gov/topics-services/diseases-and-conditions/diseases-a-z-list/coronavirus','DPH.SICK@ILLINOIS.GOV','',NULL,'By phone, website, email.','','','','','338','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(469,31832,'COVID-19 Diagnostic Tests','Coronavirus (COVID-19) Hotline','3866','Callers who are symptomatic or have specific questions concerning the Coronavirus (named COVID-19) should call the IDPH hotline @ 800-889-3931 or see the website for information. Callers who are looking for their local testing site should visit the IDPH website. \r\n\r\nNEW! Testing Guidelines: \r\nAnyone with COVID-19-like illness or symptoms can get a test, even without a doctor’s order. As testing capacity expands, testing is now available for people who:\r\n- Have COVID-19 symptoms (cough, shortness of breath and fever) OR\r\n- Have a risk factor, such as\r\n---- Contact with someone confirmed to have COVID-19.\r\n---- A compromised immune system or a serious chronic medical condition.\r\n\r\nTesting is also available for those with or without symptoms who:\r\n- Work in a health care facility.\r\n- Work in correctional facilities, such as jails or prisons.\r\n- Serve as first responders, such as paramedics, emergency medical technicians, law enforcement officers, or firefighters.\r\n- Support critical infrastructure, such as workers in grocery stores, pharmacies, restaurants, gas stations, public utilities, factories, childcare, and sanitation.\r\n\r\nA list of testing sites can be found online at --- https://www.dph.illinois.gov/covid19/covid-19-testing-sites#','','https://www.dph.illinois.gov/covid19/covid-19-testing-sites#','DPH.SICK@ILLINOIS.GOV','',NULL,'By phone, website, email.','','','','','339','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(470,22801,'Birth Certificates','Birth and Death Records','3866','The Division of Vital Records at IDPH can obtain birth and death certificates for the state of Illinois.','','','','',NULL,'Birth certificates can be ordered through mail, fax, online, or in person. Applications to mail or fax are available online.','','','Photo ID.','','340','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(471,22802,'Death Certificates','Birth and Death Records','3866','The Division of Vital Records at IDPH can obtain birth and death certificates for the state of Illinois.','','','','',NULL,'Birth certificates can be ordered through mail, fax, online, or in person. Applications to mail or fax are available online.','','','Photo ID.','','341','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(478,21865,'Special Education * Mental Illness/Emotional Disabilities','Pavilion Foundation School','422','The Pavilion Foundation School, a private day school located on the hospital campus, provides education services to more than 100 students. Serving children with behavioral and learning disorders, the goal is to work with the student, family and home district toward a successful reintegration with their former school.','','','','','968511154801619','','','','','','342','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(479,70,'Congregate Meals/Nutrition Sites','','432','Nutritious noon meals and the opportunity for fellowship are offered to persons 60 years of age and older and spouses, regardless of age. Meals are served Monday through Friday at various sites in central Illinois. Reservations are required and can be made by phoning before 12:00 pm one day in advance on weekdays. Outreach and recreational activities are often available.','','http://www.sarahbush.org/peacemeal','peacemeal@sblhs.org','',NULL,'Call for reservations or go to the website for more information. A referral form can be filled out and submitted online by the individual wanting service or by someone who knows of a senior they think would benefit from the program.','','','','','343','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(480,10608,'Safer Sex Education','','492','PPIL offers numerous types of educational and youth programs and resources to bring sexual health information directly to people in local communities. Educators work in schools, social service organizations, professional organizations, and faith organizations with the goal of preventing unintended pregnancy and disease through helping people develop healthy, responsible attitudes and behaviors regarding sexuality. \r\n\r\nPPIL encourages and supports parents in being the primary educators of their children. When it comes to sexuality education in the home, PPIL can assist parents in identifying what their children need to know and when, as well as providing resources that meet the needs of their family.','','http://www.ppil.org','ppileducation@ppil.org','',NULL,'For more information, contact the Education Department by calling 312-592-6800 or email ppileducation@ppil.org.','','','','','344','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(481,10609,'Sexually Transmitted Disease Treatment','','492','Medical Services provided to women and men, by appointment:\r\n- Gynecological exams (cancer screenings, evaluation, and treatment of infections).\r\n- Clinical breast exams.\r\n- Male reproductive health services.\r\n- HIV testing and counseling.\r\n- STD testing, treatment, & vaccines.\r\n- Gardasil (HPV vaccine).\r\n- Hepatitis B vaccine.','','http://www.ppil.org','','',NULL,'Call or use the website to set up an appointment.','','','Photo ID and proof of income.','','345','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(482,10610,'Pregnancy Counseling','','492','Pregnancy testing and options counseling.','','http://www.ppil.org','','',NULL,'Appointments are preferred; can be scheduled by phone or online.','','','Photo ID and proof of income.','','346','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(483,10611,'Pregnancy Testing','','492','Pregnancy testing and options counseling.','','http://www.ppil.org','','',NULL,'Appointments are preferred; can be scheduled by phone or online.','','','Photo ID and proof of income.','','347','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(484,14265,'Sexually Transmitted Disease Screening','','492','Medical Services provided to women and men, by appointment:\r\n- Gynecological exams (cancer screenings, evaluation, and treatment of infections).\r\n- Clinical breast exams.\r\n- Male reproductive health services.\r\n- HIV testing and counseling.\r\n- STD testing, treatment, & vaccines.\r\n- Gardasil (HPV vaccine).\r\n- Hepatitis B vaccine.','','','','',NULL,'Call or use the website to set up an appointment.','','','Photo ID and proof of income.','','348','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(485,14266,'HIV Testing','','492','Medical Services provided to women and men, by appointment:\r\n- Gynecological exams (cancer screenings, evaluation, and treatment of infections).\r\n- Clinical breast exams.\r\n- Male reproductive health services.\r\n- HIV testing and counseling.\r\n- STD testing, treatment, & vaccines.\r\n- Gardasil (HPV vaccine).\r\n- Hepatitis B vaccine.','','','','',NULL,'Call or use the website to set up an appointment.','','','Photo ID and proof of income.','','349','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(486,18441,'Adult Diversion','Adult Court and Probation Services','4941','TASC provides substance use assessments and case management services for courts across Illinois. \n\nClients may be mandated to TASC as an alternative to incarceration at the time of sentencing, or they may be referred post-sentence when they\'re on probation. TASC case managers conduct clinical assessments, advocate for treatment for those who need it, develop individualized service plans, and place clients into treatment and recovery support services. TASC also reports client progress to the court, and provides monitoring and guidance as clients work their way through the recovery process.','','','','',NULL,'By phone.','Individuals may be eligible for TASC\'s Adult Court and Probation services if they: \r\n- Are 18 years or older.\r\n- Have a current nonviolent felony offense charge.\r\n- Have a substance use disorder that requires clinical intervention. Clients must agree to abide by the mandates of the court, including following TASC\'s clinical recommendations for treatment in the community.\r\n','','','','350','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(487,18461,'Ex-Offender Reentry Programs','IDOC Clinical Reentry Case Management','4941','Under the leadership of the Illinois Department of Corrections (IDOC), TASC provides reentry case management services across Illinois that help parolees successfully transition to their communities. TASC provides comprehensive assessments and linkages to community-based substance abuse treatment, mental health services, housing support, education, job training, emergency shelter, emergency food, primary healthcare, and transportation. These clinical case management services are designed to reduce recidivism, support recovery, and facilitate client movement toward self-sufficiency.','','','','',NULL,'','TASC\'s clinical reentry case management is provided for: \r\n\r\n- Men returning to their communities from the Graham Correctional Center; Crossroads Adult Transition Center (ATC); Sheridan Correctional Center; and Southwestern Illinois Correctional Center (SWICC).\r\n\r\n- Women returning from the Decatur Correctional Center--including those in the Females in Transition Program--and Logan Correctional Center.\r\n\r\n- Youth returning from Illinois Youth Center in Chicago.','','','','351','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(488,24294,'Food Pantries','St. Patrick\'s Tolono Food Pantry','5007','Catholic Charities, in partnership with St. Patrick\'s Catholic Church, distributes non-perishable food, frozen meat, potatoes, and bread (as available) from St. Patrick\'s Catholic Church Parish Center.','','','','','832990803111047','Walk-in accepted.','Ages 18 and older.','','Photo ID.','185% of the Federal Poverty Level.','352','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(493,134,'Public Guardianship/Conservatorship Programs','Office of State Guardian','51','The Office of State Guardian (OSG) handles the personal, financial, and legal affairs of developmentally disabled, mentally ill, and elderly persons with disabilities. OSG serves as \"guardian of last resort\" for individuals with disabilities when no other person is available to serve. Most of its wards are indigent or have limited assets. The Office of State Guardian also assists the court, as the court directs, in guardianship proceedings. In addition, OSG counsels and assists families or others willing to become guardians, with the goal of locating non-public guardians and structuring alternatives to guardianship.','','http://gac.state.il.us','','',NULL,'By phone or website.','','','','','353','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(494,620,'Disability Rights Groups','Human Rights Authority','51','The Human Rights Authority exists to conduct investigations of complaints of violations of the rights of persons with disabilities. Based on early models of a singular regional grassroots program, the Human Rights Authority serves as a statewide framework providing direction and standards for a largely volunteer effort.','','http://gac.state.il.us','','',NULL,'','','','','','354','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(495,1724,'Advocacy * Disabilities Issues','Legal Advocacy Services','51','The LAS was created so that eligible children and adults who have a disability could obtain legal advice and representation to protect and enforce their rights guaranteed by Illinois\' mental health laws. LAS attorneys provide needed assistance to persons with disabilities in a variety of settings: mental health facilities, residential programs, community placements, and nursing homes. Issues addressed include, but are not limited to: admission and discharge from hospitalization, adequate treatment, refusal of unwanted services, and confidentiality of mental health records. Assistance takes the form of information, referral, and legal representation in court hearings and administrative proceedings.','','http://gac.state.il.us','','','637158405241810','','','','','','355','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(496,31280,'Nursing Facilities','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral Feeding.\r\n- Hospice Care.\r\n- Respite Care.\r\n- Alzheimer\'s and Dementia care.\r\n- Restorative Services.\r\n- Podiatry Services.\r\n- Peritoneal dialysis.','','http://danvillecarerehab.com','','',NULL,'By phone, walk-in.','','','','','356','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(497,31281,'Respite Care','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral Feeding.\r\n- Hospice Care.\r\n- Respite Care.\r\n- Alzheimer\'s and Dementia care.\r\n- Restorative Services.\r\n- Podiatry Services.\r\n- Peritoneal dialysis.','','http://danvillecarerehab.com','','','637158405241810','By phone, walk-in.','','','','','357','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(498,31282,'Physical Therapy','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral Feeding.\r\n- Hospice Care.\r\n- Respite Care.\r\n- Alzheimer\'s and Dementia care.\r\n- Restorative Services.\r\n- Podiatry Services.\r\n- Peritoneal dialysis.','','http://danvillecarerehab.com','','',NULL,'By phone, walk-in.','','','','','358','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(499,31283,'Occupational Therapy','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral Feeding.\r\n- Hospice Care.\r\n- Respite Care.\r\n- Alzheimer\'s and Dementia care.\r\n- Restorative Services.\r\n- Podiatry Services.\r\n- Peritoneal dialysis.','','http://danvillecarerehab.com','','',NULL,'By phone, walk-in.','','','','','359','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(500,31284,'Diabetes Management Clinics','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral Feeding.\r\n- Hospice Care.\r\n- Respite Care.\r\n- Alzheimer\'s and Dementia care.\r\n- Restorative Services.\r\n- Podiatry Services.\r\n- Peritoneal dialysis.','','http://danvillecarerehab.com','','',NULL,'By phone, walk-in.','','','','','360','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(501,13755,'Dental Care','','5136','Familia Dental provides general dentistry as well as orthodontic services. Specific services include:\r\n- Digital x-rays.\r\n- Cleanings and check-ups.\r\n- Fillings.\r\n- Root canals.\r\n- Sealants.\r\n- Crowns.\r\n- Extractions.\r\n- Dentures and bridges.\r\n- Periodontal or gum disease care.\r\n- Cosmetic dentistry.\r\n- Oral surgery.','','','','',NULL,'By phone or website to schedule an appointment.','','','','','361','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(502,10791,'Patient/Family Housing','Ronald McDonald House','5156','RMHCCI provides a temporary home away from home for families of children receiving medical treatment in Springfield.','','http://www.rmhc-centralillinois.org','','','929094559121639','Guests are referred by their physician, nurse, hospital social worker, or licensed clinical professional counselor.','The patient must be under the age of 22. Immediate family members are able to stay at the House while their child is receiving medical care. Families must check out within 24 hours of the patient being discharged from treatment. Individuals who have had contact with any contagious disease or illness (chicken pox, mumps, flu, pertusis) within the past 21 days may not visit or be a guest of the House.','','- Application for Temporary Residence for the family.\r\n- Background check consent form for each family member age 18 and above.','','362','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(503,10508,'Psychiatric Inpatient Units * Youth','Inpatient, Outpatient and Partial Hospitalization','5308','Lincoln Prairie Behavioral Health Center offers families and children in central and southern Illinois the following services:\r\n- 97 inpatient psychiatric beds for youth ages 3-17.\r\n- Array of outpatient programs including partial hospitalization and intensive outpatient to complement and supplement the community needs of Springfield.\r\n- Physicians to monitor medications and treat childhood behavioral and mental health needs.\r\n- Inpatient/Outpatient treatment options.\r\n\r\nFacility and treatment components include:\r\n- Free 24-hour assessments and referrals.\r\n- Multi-disciplined evaluations.\r\n- Qualified mental health professionals.\r\n- Behavioral therapy.\r\n- Expressive therapy.\r\n- Individual, group, and family counseling.','','http://www.lincolnprairiebhc.com','jill.mcclintock@uhsinc.com','',NULL,'By phone, walk-in, or appointment.','Boys and girls, age 3-17.','','','','363','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(504,14179,'Child Care Provider Training','','5759','Child Care Resource Service (CCRS) is part of the statewide network of child care resource and referral agencies. Services include:\r\n1) Providing families seeking child care with a list of local child care options and information on how to select quality care. \r\n2) Supporting child care providers with training opportunities and resource development. \r\n3) Maintaining current local data on child care supply and demand.\r\n4) Administering the state Child Care Assistance Program (CCAP) for working parents with children under the age of 13 who income-qualify. Will pay for parent\'s choice of child care, full or part-time, as well as before- and after-school care.','','','','',NULL,'By phone, walk-in.','','','Proof of income.','Child Care Assistance Program - 200% of the federal poverty level.','364','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(505,11395,'Support Groups * Transgender Individuals','','5797','Chi Upsilon Iota (CUI) is a local chapter of TRI-ESS in Central Illinois. Tri-Ess is an educational, social, and support group for heterosexual crossdressers, their spouses or partners, and their families. The group supports both crossdressers and their spouses.','','http://www.cui-triess.org','raelouisewall@att.net','',NULL,'Contact Rae Louise at 217-637-1343.','','','','','365','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(506,11397,'Support Groups * Cross Dressers','','5797','Chi Upsilon Iota (CUI) is a local chapter of TRI-ESS in Central Illinois. Tri-Ess is an educational, social, and support group for heterosexual crossdressers, their spouses or partners, and their families. The group supports both crossdressers and their spouses.','','http://www.cui-triess.org','raelouisewall@att.net','',NULL,'Contact Rae Louise at 217-637-1343.','','','','','366','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(507,12264,'LGBTQ Helplines','LGBTQ Violence Resource Line','5917','The Anti-Violence Project (AVP) at the Center on Halsted empowers lesbian, gay, bisexual, transgender, queer, and HIV-affected communities and allies to end all forms of violence through organizing and education, and supports survivors through counseling and advocacy.','','http://www.centeronhalsted.org/AVP.html','','',NULL,'By phone; please leave a message. Callers can expect a response within one business day. Survivors can email or attend walk-in hours as well.','Anyone who has been a victim of violence or discrimination.','','','','367','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(508,30572,'Crisis Intervention Hotlines/Helplines * LGBTQ Individuals','LGBTQ Violence Resource Line','5917','The Anti-Violence Project (AVP) at the Center on Halsted empowers lesbian, gay, bisexual, transgender, queer, and HIV-affected communities and allies to end all forms of violence through organizing and education, and supports survivors through counseling and advocacy.','','http://www.centeronhalsted.org/AVP.html','','',NULL,'By phone; please leave a message. Callers can expect a response within one business day. Survivors can email or attend walk-in hours as well.','Anyone who has been a victim of violence or discrimination.','','','','368','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(509,11769,'Advocacy * Children and Youth with Emotional Disturbance','','5937','CRSA was created by the Illinois legislature to address barriers to needed mental health services for youth with severe emotional disabilities. When the system breaks down and constituents are not getting access to state agency services for their child(ren), CRSA will get involved.\r\n\r\nMost referrals to CRSA are from parents who call because their child has either been denied access to a needed plan of mental health care or their community does not have the necessary resources to stabilize their emotionally disturbed child. CRSA will find out where the system broke down, then, case by case, attempt to resolve the barrier.\r\n\r\nCRSA is aware of issues relating to safety and mental health because 99% of youth served have an emotional disturbance, and out of those, 60% are youth with physical aggression problems. Close to 40% of referrals are about youth who are suicidal and over a quarter of the referrals are about youth who want to harm or kill others.\r\n\r\nWhether CRSA is helping child by child or proposing systemic changes in the state service system, one thing is for certain, children and families in Illinois continue to need a \"safety net\" to fall back upon. The CRSA will most likely always have a role in our state. Each wave of systems change creates unintended casualties; children and families who, for one reason or another, do not fit into the system as it changes. We will continue our mission to remain available and committed those children and families in Illinois.','','','','','637158405241810','By phone.','Up to age 21 with severe emotional disturbances and behavior disorders.','','','None.','369','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(510,12280,'Disease/Disability Information * Epilepsy','','5991','The Epilepsy Foundation of Greater Chicago is an Illinois not-for-profit organization offering counseling, advocacy, and educational services to people with epilepsy, their families, and the communities in which they live. Services include:\r\n- Research funding\r\n- Information and referral\r\n- Vocational counseling\r\n- Grassroots advocacy efforts\r\n- Summer camps\r\n- Educational seminars\r\n- Community awareness initiatives\r\n- Support groups\r\n- Mentorship program','','http://www.epilepsychicago.org','info@epilepsychicago.org','',NULL,'By phone or walk-in, referred or self-referred.','','','','','370','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(511,14416,'Internet Safety Education','High Tech Crimes Bureau','610','The Attorney General\'s High Tech Crimes Bureau provides important training and education programs in the area of computer crimes, including online child pornography, online sexual abuse, online fraud, e-mail threats, identity theft, and computer hacking. In addition, the bureau offers investigative and prosecutorial assistance with cases and coordinates the Illinois Internet Child Exploitation Task Force.\r\n\r\nThe Illinois Computer Crime Institute (ICCI), an entity within the Attorney General\'s High Tech Crimes Bureau, is dedicated to training and supporting Illinois law enforcement and prosecutors in the investigation and prosecution of high technology crimes, as well as in the use of high technology tools to enhance the effectiveness of their work.','','http://illinoisattorneygeneral.gov/cyberbullying/','','','789038541797078','By phone, website, or e-mail.','','','','','371','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(512,14417,'Offender Registries/Community Notification','Illinois Automated Victim Notification (AVN) System','610','Provides victims and concerned citizens with a toll-free number they can call for up-to-date information on the custody and/or case status of an offender. Callers may choose to register for automatic notification through Illinois AVN. Illinois AVN is also available online at www.vinelink.com, a public website that allows visitors to search for offender custody and case status. Users can also register online for phone or e-mail notification of changes in an offender\'s custody and/or court case status.','','http://vinelink.com','','',NULL,'','','','','','372','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(513,21671,'Identity Theft Reporting/Recovery Programs','Identity Theft Hotline','610','The Identity Theft Hotline provides Illinoisans who have been victimized by identity theft with one-on-one assistance as they work to report the crime to local law enforcement and financial institutions, repair their credit, and prevent future problems. The website also has several documents concerning identity theft and the recovery process.','','','','',NULL,'','','','','','373','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(516,12571,'Pension Benefits Assistance','','6363','The Illinois Pension Assistance Project, funded by The Retirement Research Foundation, provides free personalized pension counseling to residents of Illinois who have questions about their traditional private pension plans, 401(K) plans, or other private employer-sponsored retirement plans.\r\n\r\nProject can assist individuals who have problems with pensions from the private sector such as those who have been denied pension benefits, who are receiving less than they are entitled to, who are unable to locate a lost pension, as well as with other issues regarding pension eligibility. However, the project does not handle cases that involve public pension benefits such as state or local plans, nor do they handle church plans.','','http://www.umb.edu/pensionaction','pension@umb.edu','',NULL,'By phone or website.','','','','','374','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(517,14656,'Opioid Detoxification','','6404','The treatment centers are licensed by the State of Illinois to provide Opioid Substance Abuse treatment services to help people overcome their dependence on painkillers, heroin, and opiate-based medications. Medicated-assisted treatment is successful in relieving the cravings for opioids, eliminating withdrawal symptoms during treatment, and blocking the euphoric effects one may experience when using opioids.','','http://www.methadonetreatmentcenter.com','Champaign@methadonetreatmentcenter.com','',NULL,'Call for an intake appointment.','Age 18 and over; opiate dependent one year; and persons who would benefit from this sort of treatment.','','Photo ID.','','375','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(518,12748,'Psychiatric Rehabilitation','','6432','Decatur Manor Healthcare is an Intermediate Care Facility for the chronically mentally ill. A variety of mental illnesses are treated in the residential housing setting, including Schizo-Affective Disorder, Major Depression, Bipolar Disorder, Schizophrenia, as well as those who are dually diagnosed with a mental illness and substance abuse. The psych-social rehabilitation programs include anger management, substance abuse groups, and medication management.','','','','',NULL,'By phone.','','','','','376','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(520,13195,'Disease/Disability Information * Arthritis','','6586','The Arthritis Foundation is the largest national nonprofit organization dedicated solely to the prevention, control, and cure of arthritis, the nation\'s leading cause of disability. The Foundation provides education, programs & services, information about upcoming events, programming news, volunteer opportunities, and other Foundation-related business.','','','','',NULL,'By phone or website.','','','','','377','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(523,1975,'Foster Home Placement','','681','ICM recruits, trains, and licenses Christian families to provide home-based foster care for children in need. ICM case workers provide support services depending upon the unique needs of each family. Foster home placements are made strictly on a voluntary basis with the parent or guardian of the child. The goal of the Family Foster Care Ministry is to work toward the best long-term interest of the child while returning the child home as soon as possible.','','http://www.icmfamily.org','admin@icmfamily.org','',NULL,'','Check the website for eligibility requirements.','','','','378','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(524,1976,'Adoption Services','','681','ICM provides home studies for Christian couples and individuals who wish to adopt domestically, within the USA, as well as home studies for Christian couples and individuals who wish to adopt a child from another country. ICM does not guarantee participants will receive a child to adopt through its programs. ICM provides services to birth parents within Illinois that wish to place their born and unborn children for adoption. ICM places these children in Christian homes that meet the criteria to adopt.','','http://www.icmfamily.org','admin@icmfamily.org','',NULL,'','','','','','379','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(525,1977,'Pregnancy Counseling','','681','Caseworkers available to discuss pregnancy options. If living in Illinois or near its borders in another state, a caseworker can come to the client\'s home or meet client at a convenient time and place to discuss these options. Client may bring mother, a friend, the father of the baby, or another support person to the meeting. All information shared is confidential and there is no obligation to continue working with ICM.','','http://www.icmfamily.org','admin@icmfamily.org','',NULL,'','','','','','380','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(526,5407,'Disease/Disability Information * Amyotrophic Lateral Sclerosis','','3911','The ALS Association is the only national not-for-profit health organization dedicated solely to the fight against ALS. ALSA covers all the bases - research, patient & community services, public education, and advocacy - in providing help and hope to those facing the disease. The local chapters focus primarily on helping local patients and families live with ALS while the national office focuses primarily on research and advocacy.','','http://www.alsachicago.org','info@alsachicago.org','',NULL,'','','','','','381','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(527,5408,'Case/Care Management * Amyotrophic Lateral Sclerosis','Care Management Program','3911','Care management is a collaborative process of assessment, planning, facilitation, care coordination, evaluation, and advocating for options and services to meet the person with ALS’s health needs through communication and available resources. Care management can enhance continuity of care, which ensures that persons with ALS are receiving the necessary care resulting in improved health outcomes, better disease planning and reduction or avoidance of complications.\r\n\r\nProgram components include:\r\n- Care management coordinators.\r\n- Home visits and virtual home visits.\r\n- Disease specific education.\r\n- Resources and services for those living with ALS, their families and caregivers, military veterans living with ALS, and neurologists.\r\n- Support and fellowship groups.','','http://www.alsachicago.org','info@alsachicago.org','',NULL,'Call or register through the website.','','','','','382','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(528,14520,'Scouting Programs','','40','The goal of Girl Scouting is to help each girl develop to her full potential through informal, educational group programs. Emphasis is on values clarification, building self-esteem, development of social and leadership skills, and constructive leisure time pursuits.\r\n\r\nGirl Scouts of Central Illinois offers program opportunities in the areas of healthy living, travel, financial literacy, arts, STEM (science, technology, engineering, and math), and outdoor education. Activities are designed to stimulate the leadership qualities in each Girl Scout.  \r\n\r\nGirl Scouts of Central Illinois also has a wide curriculum to meet the needs of schools and service agencies in areas of bullying, self-esteem, body image, and much more. When requested, staff from Girl Scouts of Central Illinois will present programs to students/clients from local schools, troops, and social service agencies. Several programs are offered through these mobile presentations.','','','','',NULL,'By phone; walk-ins accepted.','Girl Scout membership is open to all girls (ages 5 to 17).','','','','383','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(529,14521,'Volunteer Opportunities','','40','Opportunities: Troop leader, co-leader, helpers for events, meetings, and booths representing the Girl Scout Program. Additional volunteers needed to support programing and fundraising. There are comprehensive training and education programs covering child growth and development and leadership skills, which benefit the adult personally as well as in his/her volunteer role.','','','','',NULL,'','','','','','384','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(530,513,'Information and Referral','','402','Information and referral and 2-1-1 services are available 24 hours by telephone. Phonelines are staffed by trained call specialists that can provide information about, and referrals to, human services for everyday needs and during times of crisis.','','http://www.pathcrisis.org','','',NULL,'By phone.','','','','','385','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(533,468,'Home Delivered Meals','','432','Home-delivered meals are available to home-bound seniors and individuals with disabilities who qualify. A program staff person is required to do a home visit for an assessment. Home delivered meal clients receive meals Monday through Friday','','http://www.sarahbush.org/peacemeal','peacemeal@sblhs.org','',NULL,'Home delivered meals are a need-based service and require an in-home assessment -- call for an appointment -- as much notice as possible is appreciated.','Serves seniors (60+). Some individuals with disabilities may qualify for the service if they are able to pay full price for meals. If they cannot afford full price meals, they should contact Illinois DHS\' Division of Rehabilitation Services for possible help.','','','','386','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(534,587,'Volunteer Opportunities','','432','Call for available positions.','','http://www.sarahbush.org/peacemeal','peacemeal@sblhs.org','',NULL,'','','','','','387','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(535,314,'Disease/Disability Information * Heart Disease','','49','The American Heart Association advocates for the reduction of premature death and disability due to heart disease and stroke. This is accomplished through the sponsorship of research, public health education, professional education/training, and community programs.\r\n\r\nThe American Stroke Association is a division of the American Heart Association. The ASA educates people about stroke prevention and treatment.','','http://www.heart.org','','',NULL,'By phone.','','','','','388','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(536,29862,'Disease/Disability Information * Stroke','','49','The American Heart Association advocates for the reduction of premature death and disability due to heart disease and stroke. This is accomplished through the sponsorship of research, public health education, professional education/training, and community programs.\r\n\r\nThe American Stroke Association is a division of the American Heart Association. The ASA educates people about stroke prevention and treatment.','','http://www.heart.org','','',NULL,'By phone.','','','','','389','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(537,1522,'Obstetrics/Gynecology','','492','Medical Services provided to women and men, by appointment:\r\n- Gynecological exams (cancer screenings, evaluation, and treatment of infections).\r\n- Clinical breast exams.\r\n- Male reproductive health services.\r\n- HIV testing and counseling.\r\n- STD testing, treatment, & vaccines.\r\n- Gardasil (HPV vaccine).\r\n- Hepatitis B vaccine.','','http://www.ppil.org','rbeach@ppeci.org','',NULL,'Call or use the website to set up an appointment.','','','Photo ID and proof of income.','','390','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(538,10606,'Abortions','','492','Champaign Health Center Abortion Services:\r\n- abortion pill (medication abortion).\r\n- pre- and post-abortion patient education.\r\n- post-abortion follow-up exams.\r\n- referrals for other abortion services, as needed.','','http://www.ppil.org','','',NULL,'Call or use the website to set up an appointment.','','','Photo ID and proof of income.','','391','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(539,10607,'Birth Control','','492','Comprehensive birth control services. Offers sterilization for men (vasectomy).','','http://www.ppil.org','','',NULL,'Appointments are preferred; can be scheduled by phone or online. Walk-ins always accepted for emergency contraception.','','','Photo ID and proof of income.','','392','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(540,128,'Area Agencies on Aging','','5','The function of the Area Agency on Aging is to plan, coordinate, and advocate for the development of a comprehensive service delivery system for persons age 60 and above and their caregivers. AAA provides federal (Older Americans Act) and state (General Revenue) funds through grants and contracts to community programs on aging in the 16 counties of East Central Illinois.  \r\n\r\nFunded programs in McLean County include:\r\n- Community Care Systems, Inc.\r\n- Case Coordination Unit.\r\n- Peace Meal Senior Nutrition Program.\r\n- Prairie State Legal Services.','','http://www.eciaaa.org','aginginfo@eciaaa.org','',NULL,'','','','','','393','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(541,864,'Long Term Care Ombudsman Programs','Long Term Care Ombudsman','5','A Nursing Home Ombudsman is available to assist residents in long-term care facilities (and their families). The Ombudsman will attempt to investigate and resolve any questions, complaints, or concerns regarding the quality of life and care of a nursing home resident.','','http://www.eciaaa.org','','',NULL,'','','','','','394','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(542,22493,'Information and Referral * Older Adults','','5','The function of the Area Agency on Aging is to plan, coordinate, and advocate for the development of a comprehensive service delivery system for persons age 60 and above and their caregivers. AAA provides federal (Older Americans Act) and state (General Revenue) funds through grants and contracts to community programs on aging in the 16 counties of East Central Illinois.  \r\n\r\nFunded programs in McLean County include:\r\n- Community Care Systems, Inc.\r\n- Case Coordination Unit.\r\n- Peace Meal Senior Nutrition Program.\r\n- Prairie State Legal Services.','','','','',NULL,'','','','','','395','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(543,10,'Child and Adult Care Food Programs','','500','Provides monetary reimbursement for meals and snacks served to children in child care, provided USDA nutritional requirements are met. When sponsored by the Association for Child Development, all child care providers receive a wide range of materials free of charge. In addition, providers receive a bookkeeping calendar, nutrition education activity book, nutrition education/training certificates, and a cookbook to fit the needs of children in child care.','','http://www.acdkids.org','illinois@acdkids.org','','878986697513222','By phone, mail, e-mail, or FAX.','Must be a licensed or license-exempt child care provider.','','','','396','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(544,16412,'Geriatric Counseling','Good Samaritan Program for Seniors','5007','Offers free professional in-home counseling services for people of all faiths who are 60 years of age or older and may be struggling with depression, grief and loss, anxiety, family relationship issues, loss of functioning, chronic illness or other issues affecting their mental well-being. The goal of the counseling services is to help older adults improve their quality of life as well as their ability to continue to live independently.','','http://cdop.org','kmcavoy@ccdop.org','',NULL,'By phone for appointment.','For individuals age 60 and over who live in their own home, apartment, or in assisted/supportive living.','','','','397','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(545,22038,'Volunteer Opportunities','Caring Companions Program','5007','Offers a \"Caring Companions\" program which matches seniors with volunteers who can help them. Examples of services include transportation to appointments or errands, assistance with shopping, light help around the house, or friendly visiting.','','http://cdop.org','kmcavoy@ccdop.org','',NULL,'By phone for appointment.','For individuals 60 and over who live in their own home or apartment and can benefit from support services.','','','','398','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(546,22039,'In Home Assistance * Older Adults','Caring Companions Program','5007','Offers a \"Caring Companions\" program which matches seniors with volunteers who can help them. Examples of services include transportation to appointments or errands, assistance with shopping, light help around the house, or friendly visiting.','','http://cdop.org','kmcavoy@ccdop.org','',NULL,'By phone for appointment.','For individuals 60 and over who live in their own home or apartment and can benefit from support services.','','','','399','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(547,22040,'Friendly Visiting * Older Adults','Caring Companions Program','5007','Offers a \"Caring Companions\" program which matches seniors with volunteers who can help them. Examples of services include transportation to appointments or errands, assistance with shopping, light help around the house, or friendly visiting.','','http://cdop.org','kmcavoy@ccdop.org','',NULL,'By phone for appointment.','For individuals 60 and over who live in their own home or apartment and can benefit from support services.','','','','400','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(548,22041,'Senior Ride Programs','Caring Companions Program','5007','Offers a \"Caring Companions\" program which matches seniors with volunteers who can help them. Examples of services include transportation to appointments or errands, assistance with shopping, light help around the house, or friendly visiting.','','http://cdop.org','kmcavoy@ccdop.org','',NULL,'By phone for appointment.','For individuals 60 and over who live in their own home or apartment and can benefit from support services.','','','','401','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(549,19524,'Advocacy * Disabilities Issues','Legal Advocacy Services','51','The LAS was created so that eligible children and adults who have a disability could obtain legal advice and representation to protect and enforce their rights guaranteed by Illinois\' mental health laws. LAS attorneys provide needed assistance to persons with disabilities in a variety of settings: mental health facilities, residential programs, community placements, and nursing homes. Issues addressed include, but are not limited to: admission and discharge from hospitalization, adequate treatment, refusal of unwanted services, and confidentiality of mental health records. Assistance takes the form of information, referral, and legal representation in court hearings and administrative proceedings.','','','','','637158405241810','','','','','','402','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(550,19525,'Public Guardianship/Conservatorship Programs','Office of State Guardian','51','The Office of State Guardian (OSG) handles the personal, financial, and legal affairs of developmentally disabled, mentally ill, and elderly persons with disabilities. OSG serves as \"guardian of last resort\" for individuals with disabilities when no other person is available to serve. Most of its wards are indigent or have limited assets. The Office of State Guardian also assists the court, as the court directs, in guardianship proceedings. In addition, OSG counsels and assists families or others willing to become guardians, with the goal of locating non-public guardians and structuring alternatives to guardianship.','','','','',NULL,'By phone or website.','','','','','403','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(551,19526,'Disability Rights Groups','Human Rights Authority','51','The Human Rights Authority exists to conduct investigations of complaints of violations of the rights of persons with disabilities. Based on early models of a singular regional grassroots program, the Human Rights Authority serves as a statewide framework providing direction and standards for a largely volunteer effort.','','','','',NULL,'','','','','','404','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(552,9948,'Adult Residential Treatment Facilities','','5126','New Focus is designed to help individuals by treating all forms of mental illness and related behavior disorders. New Focus is only for the treatment and rehabilitation of residents with mental illness. The program is \"stand-alone\" and not mixed within a skilled geriatric nursing home. Some services include but are not limited to:\r\n- Group meetings.\r\n- Psycho-social education - group/individual.\r\n- Individual case management.\r\n- Skills training programs.\r\n- Medication management.\r\n- Chemical dependency.','','http://danvillecarerehab.com','','',NULL,'By phone.','','','','','405','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(553,15864,'Psychiatric Rehabilitation','','5126','New Focus is designed to help individuals by treating all forms of mental illness and related behavior disorders. New Focus is only for the treatment and rehabilitation of residents with mental illness. The program is \"stand-alone\" and not mixed within a skilled geriatric nursing home. Some services include but are not limited to:\r\n- Group meetings.\r\n- Psycho-social education - group/individual.\r\n- Individual case management.\r\n- Skills training programs.\r\n- Medication management.\r\n- Chemical dependency.','','http://danvillecarerehab.com','','',NULL,'By phone.','','','','','406','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(554,31277,'Hospice Care','','5126','Danville Care Center (South building) is dedicated to geriatric long term care specializing in rehabilitation to home. Most residents at Danville Care Center are people who need that little extra help to ensure their health and safety. Specialists are determined to keep guest mentally and physically as independent as possible for both short term and long term residents.\r\n\r\nServices include:\r\n- Physical Therapy.\r\n- Occupational Therapy.\r\n- Speech Therapy.\r\n- IV Therapy.\r\n- Nebulizer treatments.\r\n- Wound Care, including Wound Vac and Mist Therapy.\r\n- Diabetes management.\r\n- Patient and Family education.\r\n- Enteral F