dications and treat childhood behavioral and mental health needs.\r\n- Inpatient/Outpatient treatment options.\r\n\r\nFacility and treatment components include:\r\n- Free 24-hour assessments and referrals.\r\n- Multi-disciplined evaluations.\r\n- Qualified mental health professionals.\r\n- Behavioral therapy.\r\n- Expressive therapy.\r\n- Individual, group, and family counseling.','','http://www.lincolnprairiebhc.com','jill.mcclintock@uhsinc.com','',NULL,'By phone, walk-in, or appointment.','Boys and girls, age 3-17.','','','','411','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(559,31299,'Family Counseling','Inpatient, Outpatient and Partial Hospitalization','5308','Lincoln Prairie Behavioral Health Center offers families and children in central and southern Illinois the following services:\r\n- 97 inpatient psychiatric beds for youth ages 3-17.\r\n- Array of outpatient programs including partial hospitalization and intensive outpatient to complement and supplement the community needs of Springfield.\r\n- Physicians to monitor medications and treat childhood behavioral and mental health needs.\r\n- Inpatient/Outpatient treatment options.\r\n\r\nFacility and treatment components include:\r\n- Free 24-hour assessments and referrals.\r\n- Multi-disciplined evaluations.\r\n- Qualified mental health professionals.\r\n- Behavioral therapy.\r\n- Expressive therapy.\r\n- Individual, group, and family counseling.','','http://www.lincolnprairiebhc.com','jill.mcclintock@uhsinc.com','',NULL,'By phone, walk-in, or appointment.','Boys and girls, age 3-17.','','','','412','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(560,11180,'Mercy Transportation * Air Transportation','Mercy Transportation','5671','LifeLine Pilots facilitates free AIR transportation through volunteer pilots for passengers experiencing financial hardship with medical and humanitarian needs.','','http://www.lifelinepilots.org','missions@lifelinepilots.org','','1232587316936391','By phone, fax, email, website.','Eligibility can be found on the mission application on website or by calling.','','','','413','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(561,11316,'Child Care Provider Referrals','','5759','Child Care Resource Service (CCRS) is part of the statewide network of child care resource and referral agencies. Services include:\r\n1) Providing families seeking child care with a list of local child care options and information on how to select quality care. \r\n2) Supporting child care providers with training opportunities and resource development. \r\n3) Maintaining current local data on child care supply and demand.\r\n4) Administering the state Child Care Assistance Program (CCAP) for working parents with children under the age of 13 who income-qualify. Will pay for parent\'s choice of child care, full or part-time, as well as before- and after-school care.','','http://www.ccrs.illinois.edu','ccrs@illinois.edu','',NULL,'By phone, walk-in.','','','Proof of income.','Child Care Assistance Program - 200% of the federal poverty level.','414','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(562,11317,'Child Care Expense Assistance','','5759','Child Care Resource Service (CCRS) is part of the statewide network of child care resource and referral agencies. Services include:\r\n1) Providing families seeking child care with a list of local child care options and information on how to select quality care. \r\n2) Supporting child care providers with training opportunities and resource development. \r\n3) Maintaining current local data on child care supply and demand.\r\n4) Administering the state Child Care Assistance Program (CCAP) for working parents with children under the age of 13 who income-qualify. Will pay for parent\'s choice of child care, full or part-time, as well as before- and after-school care.','','http://www.ccrs.illinois.edu','ccrs@illinois.edu','',NULL,'By phone, walk-in.','','','Proof of income.','Child Care Assistance Program - 200% of the federal poverty level.','415','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(563,12343,'Support Groups * Families/Friends of Individuals With a Drug Use Disorder','','5993','A 12-step fellowship for families and friends of those individuals with drug, alcohol, or related behavioral issues.','','http://www.familiesanonymous.org','','',NULL,'By phone, website.','','','','','416','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(564,29753,'Support Groups * Families/Friends of Individuals With an Alcohol Use Disorder','','5993','A 12-step fellowship for families and friends of those individuals with drug, alcohol, or related behavioral issues.','','http://www.familiesanonymous.org','','',NULL,'By phone, website.','','','','','417','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(565,899,'Support Groups * Adoptive Parent/Child Search','Adoption Triad Members Support Group','60','An adoption support group open to all adoptees, birth parents, adoptive parents, birth family members, or anyone whose life has been touched by adoption. Minors 17 years of age and under must be accompanied by a parent or legal guardian.','','','','',NULL,'','','','','','418','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(566,15622,'Dental Care','Donated Dental Services Program (DDS)','6057','The Donated Dental Services program tends to the essential and comprehensive dental care needs of the nation’s most vulnerable people: disabled, elderly, or medically-compromised individuals who cannot afford necessary treatment or get public aid. Volunteer dentists treat DDS patients in their own offices where they can work more efficiently with their own equipment, supplies, and staff. This is not an emergency service and there is a wait list.','','','','',NULL,'Must fill out an application to get on the wait list, which is available on the website. Once the name comes up on the wait list (which may be several months), an intake interview will be done over the phone.\r\n\r\nLisa Williamson, DDS Coordinator, can be reached by phone at 309-691-5938. Lisa is the contact for all Illinois counties outside of the Cook County Area. Please note, as of 1/2019, the following counties are closed due to lengthy wait lists: Grundy, Kankakee, Kendall, Stephenson, and Whiteside.','One must lack adequate income to pay for major dental care and either be:\r\n- Permanently disabled.\r\n- Medically at-risk.\r\n- 65 years old or older.','','Proof of income, Social Security award letter (if applicable).','','419','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(567,22476,'Dental Care * Orthodontists','Donated Orthodontic Services Program (DOS)','6057','Donated Orthodontic Services (DOS) is a program operated by Dental Lifeline Network. DOS enables low-income children to receive orthodontic treatment. There are currently 138 orthodontists waiting to see qualified applicants in Illinois.','','','','',NULL,'Applications are available on the website. After the application is received, the child is place on a waiting list. Waitings lists vary from 3-18 months, depending on the area. Some orthodontists in Illinois do not have a waiting list at this time.','- Patients must be between the ages of 8-18 when they begin treatment. \r\n- Patients cannot already be in braces or in between phases of orthodontic treatment. \r\n- Patients must be receiving regular dental care and have good oral hygiene. \r\n- Patient must be ineligible for orthodontic treatment through insurance or public aid.','','- Last year’s federal tax return for the household or Social Security award letter.\r\n- Completed dentist referral form that is enclosed; to be completed by the child’s regular dentist.\r\n- A letter from the child explaining why he/she wants the braces and how he/she intends to care for them.','200% of the federal poverty level.','420','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(568,14413,'Government Consumer Protection Agencies','','610','The Consumer Protection Division of the Office of the Attorney General seeks to protect Illinois consumers and businesses victimized by fraud, deception, or unfair methods of competition. Within this division are the Franchise Bureau, Health Care Bureau, Charitable Trusts Bureau, Military and Veterans Rights Bureau, and Consumer Fraud Bureau. The Consumer Fraud and Health Care Bureaus offer informal dispute resolution programs for consumers with complaints concerning their purchases and health care.  Although the attorneys in the AG Office cannot represent any one individual in a lawsuit, a limited mediation program is offered to assist in resolving disputes or complaints filed by individual consumers.','','','','',NULL,'By phone.','','','','','421','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(569,14414,'Crime Victim Support','','610','Financial assistance available with the goal of helping to reduce the financial burden imposed on victims of violent crime and their families. The Illinois Crime Victim Compensation Program can provide innocent victims and their families with financial assistance for expenses accrued as a result of a violent crime. The office of the Attorney General has the statutory duty to process all claims by investigating each claim to determine the claimant’s eligibility.','','','','',NULL,'If you or someone else is having difficulty coping with the long-term effects of a violent crime, please call the toll-free Crime Victims Assistance Line for more information about compensation and other statewide victim services.','','','','','422','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(570,14415,'General Crime Reporting','High Tech Crimes Bureau','610','The Attorney General\'s High Tech Crimes Bureau provides important training and education programs in the area of computer crimes, including online child pornography, online sexual abuse, online fraud, e-mail threats, identity theft, and computer hacking. In addition, the bureau offers investigative and prosecutorial assistance with cases and coordinates the Illinois Internet Child Exploitation Task Force.\r\n\r\nThe Illinois Computer Crime Institute (ICCI), an entity within the Attorney General\'s High Tech Crimes Bureau, is dedicated to training and supporting Illinois law enforcement and prosecutors in the investigation and prosecution of high technology crimes, as well as in the use of high technology tools to enhance the effectiveness of their work.','','http://illinoisattorneygeneral.gov/cyberbullying/','','',NULL,'By phone, website, or e-mail.','','','','','423','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(571,12751,'Adult Residential Treatment Facilities','','6432','Decatur Manor Healthcare is an Intermediate Care Facility for the chronically mentally ill. A variety of mental illnesses are treated in the residential housing setting, including Schizo-Affective Disorder, Major Depression, Bipolar Disorder, Schizophrenia, as well as those who are dually diagnosed with a mental illness and substance abuse. The psych-social rehabilitation programs include anger management, substance abuse groups, and medication management.','','','','',NULL,'By phone.','','','','','424','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(578,1978,'General Counseling Services','','681','Provides theologically-anchored and psychologically-informed counseling services. Services available:\r\n- Early childhood counseling.\r\n- Adolescent counseling.\r\n- Behavioral difficulties.\r\n- Pre-marriage and marriage counseling.\r\n- Relational counseling.\r\n- Crisis counseling.','','http://www.icmfamily.org','admin@icmfamily.org','',NULL,'Phone for appointment.','','','','','425','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(579,17389,'Foster Home Licensing','','681','ICM recruits, trains, and licenses Christian families to provide home-based foster care for children in need. ICM case workers provide support services depending upon the unique needs of each family. Foster home placements are made strictly on a voluntary basis with the parent or guardian of the child. The goal of the Family Foster Care Ministry is to work toward the best long-term interest of the child while returning the child home as soon as possible.','','','','',NULL,'','Check the website for eligibility requirements.','','','','426','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(580,17418,'Respite Care','Safe Families / Parenting Partners','681','Safe Families Program: Provides parents in crisis with respite care for their children, allowing them to temporarily place their children with safe and loving Christian families while addressing their current crisis, with the goal always being reunification.\r\n- Biological parent maintains custody.\r\n- Respite care - average placement lasting anywhere from 2 days to 6 weeks.\r\n- Relationship between the local church, Safe Family, and biological parent is close.\r\n- Volunteer based placements.\r\n- Safe Families go through online training and are monitored by ICM.\r\n\r\nParenting Partners: A volunteer-based ministry with the primary objective to strengthen and equip families in their times of crisis and need.\r\n- Families are DCFS-licensed and monitored by ICM.\r\n- No DCFS children are served.\r\n- A stipend amount is given to Parenting Partners to offset cost for caring for children in care.\r\n- Volunteer-based placements.\r\n- Biological parent(s) maintain full custody.','','','','','637158405241810','By phone.','Families in crisis, whether the issue is abuse, neglect, crisis pregnancy, family conflict, or the lack of an adequate support system.','','','','427','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(581,17419,'Family Support Centers/Outreach','Safe Families / Parenting Partners','681','Safe Families Program: Provides parents in crisis with respite care for their children, allowing them to temporarily place their children with safe and loving Christian families while addressing their current crisis, with the goal always being reunification.\r\n- Biological parent maintains custody.\r\n- Respite care - average placement lasting anywhere from 2 days to 6 weeks.\r\n- Relationship between the local church, Safe Family, and biological parent is close.\r\n- Volunteer based placements.\r\n- Safe Families go through online training and are monitored by ICM.\r\n\r\nParenting Partners: A volunteer-based ministry with the primary objective to strengthen and equip families in their times of crisis and need.\r\n- Families are DCFS-licensed and monitored by ICM.\r\n- No DCFS children are served.\r\n- A stipend amount is given to Parenting Partners to offset cost for caring for children in care.\r\n- Volunteer-based placements.\r\n- Biological parent(s) maintain full custody.','','','','',NULL,'By phone.','Families in crisis, whether the issue is abuse, neglect, crisis pregnancy, family conflict, or the lack of an adequate support system.','','','','428','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(582,14923,'Scouting Programs','','6839','Boy Scouting provides young people an opportunity to develop a set of core values, based on the Scout Oath and Law. The Scout mission is accomplished through adult volunteers, as they teach values and appreciation of the outdoors and the world through camping, community service, youth leadership, and more. Young people also learn the skills of goal setting and achievement as they work toward the Eagle Scout Award.\r\n\r\nAge appropriate activities are used for Cub Scouts, Boy Scouts, Venturers, and Explorers to help achieve those goals.','','','','',NULL,'By phone, walk-in, or appointment.','Boys and girls ages 5-20.','','','','429','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(583,14928,'Tutoring Services * Youth','','6861','The Children\'s Dyslexia Center of East Central Illinois provides free customized one-on-one instruction for children who have been diagnosed as dyslexic. The Center also provides free training for teachers or others with a Bachelor\'s Degree who wish to tutor children with dyslexia.','','','','',NULL,'By phone.','Students/parents are to submit an IQ test score and standard achievement test scores for eligibility in reading, spelling, or writing. Students must be diagnosed with dyslexia from a doctor or psychologist.','','','','430','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(584,15109,'Urgent Care Centers','','6863','Convenient Care treats non-emergency conditions like allergies and infections, abrasions and bruises, colds and flu, and sprains and pains.','','','','',NULL,'Walk-in.','','','','','431','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(585,15111,'Urgent Care Centers','','6863','Convenient Care treats non-emergency conditions like allergies and infections, abrasions and bruises, colds and flu, and sprains and pains.','','','','',NULL,'Walk-in.','','','','','432','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(586,22825,'Urgent Care Centers','','6863','Convenient Care treats non-emergency conditions like allergies and infections, abrasions and bruises, colds and flu, and sprains and pains.','','','','',NULL,'Walk-in.','','','','','433','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(587,22826,'Urgent Care Centers','','6863','Convenient Care treats non-emergency conditions like allergies and infections, abrasions and bruises, colds and flu, and sprains and pains.','','','','',NULL,'Walk-in.','','','','','434','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(588,13583,'SSI','Supplemental Security Income (SSI)','687','COVID-19:\r\nSocial Security and Supplemental Security Income (SSI) benefit payments will continue to be paid on time during the COVID-19 pandemic. \r\nPlease visit the agency’s COVID-19 web page at www.socialsecurity.gov/coronavirus/ for important information and updates.\r\n\r\nOR CALL- (800) 772-1213\r\n______________________________________________________________________________________________________\r\n\r\nThe Supplemental Security Income (SSI) program pays benefits to disabled adults and children who have limited income and resources. SSI benefits also are payable to people 65 and older without disabilities who meet the financial limits.','','','','',NULL,'Call for an appointment to fill out an application. Decisions may take 3-4 months depending on the situation. Walk-ins accepted, although wait times will be longer.','Supplemental Security Income eligibility is based on financial need as well as being age 65, blind, or disabled.','','Social Security card, birth certificate, proof of residency, proof of income, medical information, proof of citizenship, work history (if applicable).','','435','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(589,13584,'Social Security Disability Insurance','','687','COVID-19:\r\nSocial Security and Supplemental Security Income (SSI) benefit payments will continue to be paid on time during the COVID-19 pandemic. \r\nPlease visit the agency’s COVID-19 web page at www.socialsecurity.gov/coronavirus/ for important information and updates.\r\n\r\nOR CALL- (800) 772-1213\r\n______________________________________________________________________________________________________\r\n\r\nSocial Security Disability Insurance pays benefits to people who can no longer work because of a medical condition that is expected to last at least one year or result in death. Decisions may take 3-5 months, depending on the situation. Social Security retirement benefits can start as early as age 62, with full benefits available at age 67.','','','','',NULL,'By phone, walk-in, appointment, or mail. Retirement and Disability claims may be filed online on the website. Appointments are strongly preferred for in-person applications.','To be eligible for retirement, survivors, or disability payments, a person must have paid into Social Security long enough to be insured or be a qualified dependent.','','Social Security card, birth certificate, proof of residency, proof of income, medical information.','','436','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(590,13585,'Social Security Retirement Benefits','','687','COVID-19:\r\nSocial Security and Supplemental Security Income (SSI) benefit payments will continue to be paid on time during the COVID-19 pandemic. \r\nPlease visit the agency’s COVID-19 web page at www.socialsecurity.gov/coronavirus/ for important information and updates.\r\n\r\nOR CALL- (800) 772-1213\r\n______________________________________________________________________________________________________\r\n\r\nSocial Security Disability Insurance pays benefits to people who can no longer work because of a medical condition that is expected to last at least one year or result in death. Decisions may take 3-5 months, depending on the situation. Social Security retirement benefits can start as early as age 62, with full benefits available at age 67.','','','','',NULL,'By phone, walk-in, appointment, or mail. Retirement and Disability claims may be filed online on the website. Appointments are strongly preferred for in-person applications.','To be eligible for retirement, survivors, or disability payments, a person must have paid into Social Security long enough to be insured or be a qualified dependent.','','Social Security card, birth certificate, proof of residency, proof of income, medical information.','','437','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(591,13586,'Social Security Survivors Insurance','','687','Applications are taken for survivor\'s benefits upon the death of a spouse or parent.','','','','',NULL,'Call for an appointment to report the death and to fill out an application.','To be eligible for survivor\'s benefits, the deceased person must have paid into Social Security long enough to be insured and the family member(s) must be a qualified dependent.','','','','438','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(592,30051,'Medicare','','687','Federal health insurance for people 65 years of age and older. Can apply for Medicare online or at the local office. For further information:\r\nMedicare Hotline - 800-633-4227\r\nwww.ssa.gov or www.medicare.gov','','','','',NULL,'Phone for appointment or see website.','','','','','439','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(594,1466,'Information Sources * Food','','697','Individuals can call the Hunger Hotline to apply for SNAP benefits (food stamps), state health coverage (Medicaid), and TANF. Can also find out whether they qualify for other programs like WIC, LIHEAP, child care, senior programs, etc. The hotline will refer to food pantries or soup kitchens within the caller\'s geographic location.\r\n\r\nCallers can get free, confidential help if they have already applied for benefits and are having a difficult time getting them.','','http://www.ilhunger.org','','','832990803111047','By phone. No walk-in services.','','','','','440','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(595,31510,'General Benefits Assistance * Medicaid','','697','Individuals can call the Hunger Hotline to apply for SNAP benefits (food stamps), state health coverage (Medicaid), and TANF. Can also find out whether they qualify for other programs like WIC, LIHEAP, child care, senior programs, etc. The hotline will refer to food pantries or soup kitchens within the caller\'s geographic location.\r\n\r\nCallers can get free, confidential help if they have already applied for benefits and are having a difficult time getting them.','','http://www.ilhunger.org','','',NULL,'By phone. No walk-in services.','','','','','441','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(596,31512,'General Benefits Assistance * Food Stamps/SNAP','','697','Individuals can call the Hunger Hotline to apply for SNAP benefits (food stamps), state health coverage (Medicaid), and TANF. Can also find out whether they qualify for other programs like WIC, LIHEAP, child care, senior programs, etc. The hotline will refer to food pantries or soup kitchens within the caller\'s geographic location.\r\n\r\nCallers can get free, confidential help if they have already applied for benefits and are having a difficult time getting them.','','http://www.ilhunger.org','','','878986697513222','By phone. No walk-in services.','','','','','442','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(597,18675,'Information and Referral * Disabilities Issues','','7','Information, referral, advocacy, and follow-up services available.','','','','',NULL,'','','','','','443','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(598,20442,'Wheelchairs/Wheeled Mobility','Assistive Technology Clinics','7','- Equipment available includes seating/positioning devices, bathing/toileting equipment, standing devices, wheeled mobility, and electronic aids to daily living. Evaluations and fittings are provided by Easterseals and NuMotion staff that are certified in Assistive Technology for pediatrics. \r\n- \"I Can Bike\" program teaches children how to ride a bicycle.','','','','',NULL,'','','','','','444','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(599,20443,'Assistive Technology Equipment Sales','Assistive Technology Clinics','7','- Equipment available includes seating/positioning devices, bathing/toileting equipment, standing devices, wheeled mobility, and electronic aids to daily living. Evaluations and fittings are provided by Easterseals and NuMotion staff that are certified in Assistive Technology for pediatrics. \r\n- \"I Can Bike\" program teaches children how to ride a bicycle.','','','','',NULL,'','','','','','445','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(600,633,'Therapeutic Camps','','7','Owned and operated by Easterseals Central Illinois, Timber Pointe Outdoor Center is the premier resource in the state of Illinois for providing specialized outdoor recreational, experiential and family programs for individuals with disabilities and illnesses in a fun, safe and accessible environment.\r\n\r\nCamp: Timber Pointe Outdoor Center provides specialized lodging, staff and programming modified to accommodate kids and adults of all abilities. From day camps, overnight summer camps, partner group camps, and weekend family retreats there is a camp fit for everyone. \r\n\r\nRentals: Timber Pointe is a wonderful and unique resource available to the Central Illinois community. Offers overnight rentals in cabins and lodges as well as day use for corporate meetings and events. Offers activities and team building exercises for groups. Also a picture perfect wedding venue.','','http://www.easterseals-ucp.org','','',NULL,'By phone.','','','','','446','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(601,14829,'General Counseling Services','','7004','Groups, process groups, and individual counseling for adults, youth, seniors, men, and women. All treatment is individualized, considering age, ethnic background, development, and clinical issues. Christian counseling for families, marriages, children, and individuals is also available.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','447','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(602,14830,'Substance Use Disorder Treatment Programs','','7004','Outpatient substance and alcohol abuse treatment services include information and education, intervention groups, intensive process groups, and individual counseling for clients, significant others, and family. Day and night treatment is available.\r\n\r\nNew Directions Treatment Center also provides DUI evaluations to determine to nature and extent of the use of alcohol or other drugs.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','448','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(603,14831,'General Counseling Services * Christian Community','','7004','Groups, process groups, and individual counseling for adults, youth, seniors, men, and women. All treatment is individualized, considering age, ethnic background, development, and clinical issues. Christian counseling for families, marriages, children, and individuals is also available.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','449','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(604,14833,'AIDS/HIV Prevention Counseling','','7004','Offers HIV and AIDS education and counseling for people at risk for AIDS. Training is available for clients and service providers.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','450','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(605,14834,'Disease/Disability Information * AIDS/HIV','','7004','Offers HIV and AIDS education and counseling for people at risk for AIDS. Training is available for clients and service providers.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','451','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(606,14835,'Stress Management','','7004','Stress Management - Teaches exercise techniques, systematic progressive relaxation, and coping techniques.\r\nAnger Management - Teaches techniques to assist in increasing personal power through greater self-control.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','452','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(607,20217,'Specialized Telecommunications Equipment','General Independent Living Services','7008','Offers services which assist persons with disabilities in achieving and/or maintaining independence. Services include, but are not limited to:\r\n- Information and Referral (personal assistant, interpreter, and housing referrals).\r\n- Access and Advocacy (accessibility surveys, assistive devices, Braille printing).\r\n- Skills Development (personal assistant management training, basic computer skills, public transit use, budgeting).\r\n- Counseling (independent living, peer, vocational).\r\n- Free Amplified Phones for Illinois residents with verifiable hearing loss who have a land line.\r\n- Independent Living Needs Assessment.\r\n- Mass Transit District Disability Verification.\r\n- Reintegration into the community from nursing home, etc. (This includes possible financial assistance for moving home or into supportive living).\r\n- Volunteer Opportunities.\r\n- PACE Presentations and Newsletter.\r\n- PACE will readily provide sign language interpreters to access PACE events on request.','','','','',NULL,'By phone or appointment by the person needing assistance.','Varies per program.','','Varies by program.','','453','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(608,20218,'In Home Assistance * Personal Care','General Independent Living Services','7008','Offers services which assist persons with disabilities in achieving and/or maintaining independence. Services include, but are not limited to:\r\n- Information and Referral (personal assistant, interpreter, and housing referrals).\r\n- Access and Advocacy (accessibility surveys, assistive devices, Braille printing).\r\n- Skills Development (personal assistant management training, basic computer skills, public transit use, budgeting).\r\n- Counseling (independent living, peer, vocational).\r\n- Free Amplified Phones for Illinois residents with verifiable hearing loss who have a land line.\r\n- Independent Living Needs Assessment.\r\n- Mass Transit District Disability Verification.\r\n- Reintegration into the community from nursing home, etc. (This includes possible financial assistance for moving home or into supportive living).\r\n- Volunteer Opportunities.\r\n- PACE Presentations and Newsletter.\r\n- PACE will readily provide sign language interpreters to access PACE events on request.','','','','',NULL,'By phone or appointment by the person needing assistance.','Varies per program.','','Varies by program.','','454','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(609,24067,'Nursing Home Transition Financing Programs','Reintegration','7008','People are sometimes financially trapped in nursing facilities long after their physical needs are met. Sometimes nursing home residents who rely on fixed income cannot afford to go home; their income goes entirely to nursing care. Whether one is financial unable to move out of skilled nursing into their own home, or simply unaware of what equipment and supports they would need to return home, PACE staff work with the consumer to evaluate if and how one may become more independent. PACE staff arrange these supports, assess any equipment needs, and may help with the first month of expenses to get clients over the hump financially so they can take control of their lives.','','','','',NULL,'By phone.','Must reside in a nursing facility and desire to move back into a more independent setting (supportive living or ones own place). \r\n\r\nPACE serves people with many various disabilities but are prevented by funding to serve those with developmental disabilities or mental illness if that is the only disability present. PACE may be able to refer to other agencies for assistance in these cases. If there are multiple disabilities, PACE can sometimes work with a client.','','Varies, call for details.','Must be low income. Call for more info.','455','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(610,14868,'Hospitals','','7022','OSF offers a full range of inpatient and outpatient medical services for Danville and surrounding communities in East Central Illinois and Western Indiana.','','','','',NULL,'','','','','To qualify for FREE services (100% financial assistance) your household income must be at or below 200% of the current federal poverty guidelines. To qualify for partial financial assistance, your household income must be between 200% and 600% of the federal poverty guidelines for hospitals.','456','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(611,30729,'Detoxification','StepOne Service','7022','Inpatient, hospital-based, three-to- five-day acute withdrawal management service for adults who require medical management of withdrawal symptoms from alcohol or opioids. It is available to adults who are in the impending or early stages of acute withdrawal at the time of their voluntary admission to the hospital. The goal is to medically assist them through the withdrawal process and help navigate the transition to an appropriate level of community-based addiction treatment that can address the underlying causes of their substance use disorder.','','','','',NULL,'The first step to being admitted is a phone call. Upon verifying insurance, a time will be set in place for both parties to be prepared (patient will be 12-24 hours clean and SOS staff will arrange for a bed). Patients may self-refer.','Patient must want to get treatment and get clean. Patient will need to be 12-24 hours clean (since last use) and have some form of insurance.','','','','457','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(612,19469,'Support Groups * Breast Cancer','New Horizon Breast Cancer Support Group','7022','Support group for breast cancer survivors, ranging from the recently diagnosed to the person who is a 30+ year survivor. A variety of topics are discussed.','','','','',NULL,'By phone, website.','','','','','458','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(613,19471,'Cancer Clinics','OSF Bobette Steely Hegeler Cancer Care Center','7022','Provides comprehensive cancer care, using the latest treatments and technologies. Services include:\r\n- Advanced cancer diagnosis.\r\n- Leading-edge technology.\r\n- Specialized cancer care for breast, lung, prostate, colon, bladder, and head/neck cancer.\r\n- Clinical trials.\r\n- Rehabilitation and survivorship programs.\r\n- Radiation therapy services.\r\n- Hematology/Oncology services.\r\n\r\nThe Cancer Care Center also provides the Cancer Center Patient Fund. Through its foundation, donors and businesses help cancer patients make ends meet, from gas cards to assistance with prescription costs, so that no one goes without care.','','','','',NULL,'','','','','','459','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(614,19472,'Hospital Based Outpatient Services * Sleep Disorders','','7022','Provides diagnosis and treatment for all sleep disorders including insomnia, sleep apnea, restless legs syndrome, sleepwalking, night terrors, and narcolepsy.','','','','',NULL,'By phone.','','','','','460','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(615,21687,'Case/Care Management * Families','Peer-to-Peer Coaching and Advocacy Services','7121','Through the Alliance’s Peer-to-Peer Coaching and Advocacy services, staff and peer supporters work with families to:\r\n- Develop a family-centered action plan and other strategies for care and treatment.\r\n- Train, model, and empower family members to advocate for their child’s needs.\r\n- Empower the entire family to be involved in their own care and treatment.\r\n- Navigate 504 Plan, IEP, and other school meetings with your family.\r\n- Locate resources.\r\n- Be a shoulder to lean on and an ear to listen during stressful times and times of need.\r\n- Call to Schedule Appointment','','http://www.ilalliance.org','regina@ilalliance.org','Call to schedule appointment','535512457471607,655668553137432','By phone\r\n or e-mail.','Must reside in Champaign County.','None','Helpful to have  paperwork associated with the  system you are trying  to work with, such as notice of child\'s IEP .',NULL,'461,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2020-12-19 06:07:19'),(616,14688,'Extended Child Care','Before & After School Child Care Program','7123','The Before & After School Child Care Program is an extracurricular part of the Urbana School District. It provides a safe, supervised place for children in grades K-5 before and after school. It is operated by Urbana School District 116 and currently uses space at Leal, Prairie, Thomas Paine, Wiley, and Yankee Ridge Elementary Schools. The program offers supervision and leadership in a variety of areas including recreational activities, occasional special interest projects, reading, homework opportunities, and a limited number of field trips. A light breakfast and afternoon snack is served daily.','','','','',NULL,'By phone.','Any student enrolled in an Urbana School District #116 elementary school.','','','','462','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(617,14537,'Animal Shelters','','7159','CCHS provides shelter to homeless animals and places suitable animals in new homes through an adoption program. The Society accepts companion animals (dogs, cats, rabbits, and other pets) relinquished by their owners.\r\n\r\nCCHS also conducts investigations of possible animal neglect or cruelty under the Illinois Humane Care for Animals Act. However, any emergencies involving animal abuse should be reported to the Police immediately.\r\n\r\nCCHS provides dog training, low-cost spay/neuter programs, and a variety of humane education programs.\r\n\r\nNote: People with problems related to stray or lost/found pets should be directed to Champaign County Animal Control.','','','','',NULL,'By phone or walk-in.','Those interested in adopting an animal must be at least 21 years of age. Other adoption requirements will be discussed during the adoption process.','','','','463','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(618,14538,'Cruelty to Animals Investigation'