-00 00:00:00'),(620,20633,'Animal Adoption','','7159','CCHS provides shelter to homeless animals and places suitable animals in new homes through an adoption program. The Society accepts companion animals (dogs, cats, rabbits, and other pets) relinquished by their owners.\r\n\r\nCCHS also conducts investigations of possible animal neglect or cruelty under the Illinois Humane Care for Animals Act. However, any emergencies involving animal abuse should be reported to the Police immediately.\r\n\r\nCCHS provides dog training, low-cost spay/neuter programs, and a variety of humane education programs.\r\n\r\nNote: People with problems related to stray or lost/found pets should be directed to Champaign County Animal Control.','','','','',NULL,'By phone or walk-in.','Those interested in adopting an animal must be at least 21 years of age. Other adoption requirements will be discussed during the adoption process.','','','','466','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(621,30708,'Volunteer Opportunities','','7159','CCHS provides shelter to homeless animals and places suitable animals in new homes through an adoption program. The Society accepts companion animals (dogs, cats, rabbits, and other pets) relinquished by their owners.\r\n\r\nCCHS also conducts investigations of possible animal neglect or cruelty under the Illinois Humane Care for Animals Act. However, any emergencies involving animal abuse should be reported to the Police immediately.\r\n\r\nCCHS provides dog training, low-cost spay/neuter programs, and a variety of humane education programs.\r\n\r\nNote: People with problems related to stray or lost/found pets should be directed to Champaign County Animal Control.','','','','',NULL,'By phone or walk-in.','Those interested in adopting an animal must be at least 21 years of age. Other adoption requirements will be discussed during the adoption process.','','','','467','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(622,14645,'Juvenile Detention Facilities','','7161','The Juvenile Detention Center serves as a secure, locked facility for minors apprehended by law enforcement. It provides a secure setting for minors adjudicated of, or alleged to have committed crimes, as defined by the penal statutes. Juvenile probation officers at the Detention Center prepare reports for the Court; supervise minors within the detention facility and carry out such directives as the court may require.\r\n\r\nWhen a juvenile petition alleging delinquency is filed with the court, the probation officer compiles a detailed social study concerning the minor in order to make a suitable recommendation to the court at the dispositional hearing. Should the minor be sentenced to probation or granted court supervision, the probation officer is involved in supervising and referring the minor to appropriate community resources as needed. The Department also operates a Public Service Work Program, which refers any person placed under court order to various not-for-profit agencies for completion of public service work.','','','','',NULL,'','','','','','468','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(623,14646,'Juvenile Probation','','7161','The Juvenile Detention Center serves as a secure, locked facility for minors apprehended by law enforcement. It provides a secure setting for minors adjudicated of, or alleged to have committed crimes, as defined by the penal statutes. Juvenile probation officers at the Detention Center prepare reports for the Court; supervise minors within the detention facility and carry out such directives as the court may require.\r\n\r\nWhen a juvenile petition alleging delinquency is filed with the court, the probation officer compiles a detailed social study concerning the minor in order to make a suitable recommendation to the court at the dispositional hearing. Should the minor be sentenced to probation or granted court supervision, the probation officer is involved in supervising and referring the minor to appropriate community resources as needed. The Department also operates a Public Service Work Program, which refers any person placed under court order to various not-for-profit agencies for completion of public service work.','','','','',NULL,'','','','','','469','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(624,14132,'Nursing Facilities','','7165','Provides long-term, rehabilitative, and memory care services.','','','','',NULL,'By phone, appointment, or e-mail.','','','Photo ID, birth certificate, social security card, and immunization records.','','470','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(625,14133,'Adult Day Programs','Sunshine Center','7165','The Adult Day Care Program at Champaign County Nursing Home provides a variety of different activities, therapy services, and help with personal care needs for older adults.','','','','','789038541797078','By phone, appointment, or e-mail.','','','Photo ID, birth certificate, social security card, and immunization records. Medicare card or Public aid card also needed.','','471','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(626,14458,'State\'s Attorney','','7167','The Office of the State\'s Attorney commences and prosecutes all criminal and traffic cases in the Circuit Court and initiates all dependency, neglect, abuse, and delinquency juvenile petitions and proceedings. The Office also commences and prosecutes all actions and proceedings brought by any County officer and defends actions and proceedings brought against the County or against County officers. In addition, the Office gives opinions to any County officer upon request and provides interpretation of the law relating to concerns of the County.\r\n\r\nThe Office also provides child support enforcement services through a joint venture with the Illinois Department of Healthcare and Family Services.','','','','',NULL,'','','','','','472','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(627,14650,'Juvenile Delinquency Prevention','','7181','The Champaign-Urbana Area Project is organized to serve as a catalyst for citizens working together to address problems and issues affecting them. Specifically, CUAP is to provide services to \"at-risk\" youth and their families. These activities seek to empower low-income citizens and shall include, but not be limited to: cultural, educational, recreational, community organization and development, self-esteem enhancing, and social activities which result in preventing juvenile delinquency.\r\n\r\nPrograms include:\r\n- TRUCE: Seeks to address the issue of gun violence prevention from a public health perspective.\r\n- CU Neighborhood Champions: An initiative designed to increase the community\'s understanding of trauma and expand the community\'s capacity to implement trauma-informed practices and procedures.\r\n- CUperStar Competition: Finalists are chosen from vocal auditions (singing/rapping) and receive summer-long training and a chance to compete for the title of Champaign-Urbana\'s CUperStar.\r\n- Mentoring Young Sisters: A multicultural program targeting middle school girls and providing them with caring mentors in a group setting. The program structure lays the groundwork for increased achievement in all areas throughout their lives.\r\n- Restorative Justice: Seeks to ensure that victims\' needs are met and that the harm done can be made right so that victims can thrive, communities can become peaceful places, and that offenders can become successful members of society.\r\n- LEAP (Learning Encourages Active Progress): LEAP is for 4th-8th graders and provides mentoring, tutoring, and physical activities.','','http://cuapweb.org','','',NULL,'','','','','','473','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(628,22814,'Mentoring Programs','','7181','The Champaign-Urbana Area Project is organized to serve as a catalyst for citizens working together to address problems and issues affecting them. Specifically, CUAP is to provide services to \"at-risk\" youth and their families. These activities seek to empower low-income citizens and shall include, but not be limited to: cultural, educational, recreational, community organization and development, self-esteem enhancing, and social activities which result in preventing juvenile delinquency.\r\n\r\nPrograms include:\r\n- TRUCE: Seeks to address the issue of gun violence prevention from a public health perspective.\r\n- CU Neighborhood Champions: An initiative designed to increase the community\'s understanding of trauma and expand the community\'s capacity to implement trauma-informed practices and procedures.\r\n- CUperStar Competition: Finalists are chosen from vocal auditions (singing/rapping) and receive summer-long training and a chance to compete for the title of Champaign-Urbana\'s CUperStar.\r\n- Mentoring Young Sisters: A multicultural program targeting middle school girls and providing them with caring mentors in a group setting. The program structure lays the groundwork for increased achievement in all areas throughout their lives.\r\n- Restorative Justice: Seeks to ensure that victims\' needs are met and that the harm done can be made right so that victims can thrive, communities can become peaceful places, and that offenders can become successful members of society.\r\n- LEAP (Learning Encourages Active Progress): LEAP is for 4th-8th graders and provides mentoring, tutoring, and physical activities.','','','','',NULL,'','','','','','474','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(629,14524,'Public Health Information/Inspection/Remediation','','7185','The Division of Environmental Health is the regulatory arm of public health. Areas of expertise include food safety and protection, private sewage systems, private water wells, lead poisoning prevention, radon, mosquito/vector control, and tanning facility inspections.','','','','','941516382466411','','','','','','475','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(630,14527,'General Health Education Programs','','7185','The Health Promotion department has many education programs to better the health of the community. Many of these programs are funded through grants, and thus are low or no cost to the residents.','','','','','789038541797078','By phone, walk-in, or appointment.','','','Photo ID and proof of income.','','476','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(631,14528,'Dental Care * Children','','7185','A full range of dental services are available for children (ages 0-18) with Medicaid/All Kids who are residents of Champaign or Urbana. Appointments are available Monday through Friday, with emergency and urgent care appointments also available. Services include exams, cleanings, fluoride, sealants, fillings, some root canals, stainless steel crowns, and space maintainers.','','','','',NULL,'Call for an appointment.','Children (ages 0-18) with Medicaid/All Kids.','','','','477','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(632,14529,'Hearing Screening * Children','','7185','The Hearing and Vision Screening Program provides state mandated hearing and vision screenings to children enrolled in licensed day cares, preschools, or private schools in Champaign County.','','','','',NULL,'Call for appointment.','','','','','478','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(633,14530,'Vision Screening * Children','','7185','The Hearing and Vision Screening Program provides state mandated hearing and vision screenings to children enrolled in licensed day cares, preschools, or private schools in Champaign County.','','','','',NULL,'Call for appointment.','','','','','479','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(634,14531,'Smoking/Vaping Cessation','','7185','The Illinois Tobacco-Free Communities Grant includes many programs that address tobacco prevention, smoking cessation, healthy lifestyles, and tobacco laws. These programs reach a diversity of residents in Champaign County.','','','','',NULL,'','','','','','480','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(635,14532,'Communicable Disease Control','','7185','Public Health Departments are required to investigate communicable (infectious) diseases such as whooping cough, tuberculosis, hepatitis, and foodborne or waterborne illnesses. The Communicable Disease Investigator works with the state health department and local health care providers to identify, investigate, and try to control disease outbreaks in the community.\r\n\r\nWhenever someone is diagnosed with an infectious disease that could lead to an outbreak, the Communicable Disease Investigator conducts an interview with that person. The interview is confidential and helps confirm the diagnosis, determine the source of the infection, and limit the spread of the disease.','','','','',NULL,'','','','','','481','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(636,14533,'AIDS/HIV Clinics','','7185','The East Central Illinois HIV Care Connect provides medical case management, support groups, oral health care, housing, utility, primary medical care, nutrition services, vaccination programs, transportation, mental health, and legal assistance to eligible individuals within the care connect region. \r','','','','','941516382466411','By appointment.','Anyone living with HIV/AIDS is eligible for case management services, regardless of income or insurance. Those who meet income and insurance guidelines are also eligible for additional services.','','','','482','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(637,14565,'Mobile Health Care','Wellness On Wheels (WOW) Programs','7185','Champaign-Urbana Public Health District offers mobile clinics. These converted RVs are equipped to offer basic services to clients. These mobiles are parked outside area high schools during the school year. They also reach out to local food pantries and soup kitchens to provides services for those patrons. Depending on population served, this program includes:\r\n- Pregnancy tests.\r\n- HIV tests and tests for sexually transmitted diseases (STDs).\r\n- Prostate blood tests.\r\n- Referrals to the Illinois Breast and Cervical Cancer Program.\r\n- Information about disease prevention, diet and exercise.','','','','','941516382466411','Call for more information about schedule and programs.','Anyone aged 12 and older is eligible for services on any WOW van.','','','','483','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(638,14597,'Summer Food Service Programs','Summer Food Service Program','7185','Offers free lunch to any child up to age 18.\r\n\r\nMon & Wed lunch served 11:00 am - 1:00 pm, Ivanhoe Estates Park, 62 Ivanhoe Drive, Urbana.\r\nTues lunch (beginning June 11) served 11:00 am - 1:00 pm, Crestview Park, 1802 S. Cottage Ave., Urbana.\r\nThurs lunch served (June 13) 11:00 am - 1:00 pm, Victory Park, 1000 E. Green St., Urbana.','','','vkoress@c-uphd.org','','832990803111047','Walk-in.','','','','','484','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(639,15244,'Birth Certificates','','7185','The Vital Records Division of Champaign-Urbana Public Health distributes birth and death certificates for all Champaign County births and deaths that have occurred in the last ten years.','','','','',NULL,'Walk in and fill out an application. For more information, call 217-531-4255 or email elarson@c-uphd.org.','Birth certificates may only be released to a parent listed on the birth certificate or a legal guardian able to present court documentation of their guardian status. Death certificates may only be released to relatives of the deceased or a non-relative who can prove a financial or property interest in the deceased, such as a beneficiary of a life insurance policy.','','Photo ID.','','485','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(640,15245,'Death Certificates','','7185','The Vital Records Division of Champaign-Urbana Public Health distributes birth and death certificates for all Champaign County births and deaths that have occurred in the last ten years.','','','','',NULL,'Walk in and fill out an application. For more information, call 217-531-4255 or email elarson@c-uphd.org.','Birth certificates may only be released to a parent listed on the birth certificate or a legal guardian able to present court documentation of their guardian status. Death certificates may only be released to relatives of the deceased or a non-relative who can prove a financial or property interest in the deceased, such as a beneficiary of a life insurance policy.','','Photo ID.','','486','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(641,15651,'Extreme Weather Shelters','','7185','Operates as a warming center during daytime hours for anyone needing shelter from the exteme cold.','','','','',NULL,'','','','','','487','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(642,16204,'Case/Care Management * Pregnant Women','Family Case Management','7185','Preventive care, developmental testing, immunizations, referrals, and follow-up for pregnant women and children who meet income guidelines.','','','','',NULL,'By walk-in or appointment.','','','','200% of the federal poverty level.','488','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(643,22409,'Food Pantries','Friends of Champaign County Food Pantry','7185','New on-site food pantry provides free bags of food. The service is first come, first served. The bags usually have canned vegetables, fish, pasta, granola bars, and a variety of other items. Also provides fresh bread and produce when available.','','','','','832990803111047','Walk in.','','','','','489','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(644,24865,'Opioid Antidote Distribution Programs','SWAP - Harm Reduction Program','7185','Services include:\r\n- Syringe access.\r\n- Naloxone.\r\n- HCV services.\r\n- HIV testing.','','','','',NULL,'By phone or walk-in.','','','','','490','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(645,24866,'Needle Exchange/Distribution Programs','SWAP - Harm Reduction Program','7185','Services include:\r\n- Syringe access.\r\n- Naloxone.\r\n- HCV services.\r\n- HIV testing.','','','','',NULL,'By phone or walk-in.','','','','','491','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(646,30735,'Cancer Detection * Breast Cancer * Cervical Cancer','','7185','Family Planning services at CUPHD include Pap Smear (cervical cancer detection), reproductive health examinations for females and males, breast examinations, education on reproductive health, and a variety of pregnancy prevention options. Parental consent is not necessary.','','','','',NULL,'Walk-in.','','','Photo ID.','','492','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(647,21389,'Sexually Transmitted Disease Treatment','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','493','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(648,14522,'Recreational Activities/Sports * Disabilities and Health Conditions','','7187','CUSR offers recreational programs and services for individuals with disabilities throughout the year. CUSR supports inclusion within both the Champaign and Urbana Park District programs available year round. CUSR offers inclusive and cooperative programs, special events, after school programs, trips, Special Olympics, summer day camps, and much more.','','','','','968511154801619','Prior registration is required. Registration is available online, in person, or by fax.','Individuals must have a diagnosis of a disability. Programming available for both children and adults.','','','','494','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(649,14018,'Community Clinics','','7191','COVID-19:\r\nFree telehealth services are available. Please call.\r\n---------------------------\r\nProvides primary medical care services for most minor or intermediate sickness. Physicals are also available for adults.\r\n\r\nScreenings are conducted throughout the community for individuals who are at high risk for a particular disease, like high blood pressure, diabetes, high cholesterol, or cancer. Referrals to outside health organizations are made for further testing if needed, with follow-ups by CCCHC to make sure that the clients\' needs continue to be met.\r\n\r\nThe dental clinic provides dental screenings and simple extractions. Will connect to other local organizations if other services are needed.','','http://www.ccchc2003.org','','',NULL,'Appointments preferred, walk-ins accepted. Request an appointment by phone (leave message) or website.','Services are provided to those WITHOUT health insurance or a medical card, or those without access to health care services using the insurance they currently have.','','','','495','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(650,14020,'General Medical Care','','7191','COVID-19:\r\nFree telehealth services are available. Please call.\r\n---------------------------\r\nProvides primary medical care services for most minor or intermediate sickness. Physicals are also available for adults.\r\n\r\nScreenings are conducted throughout the community for individuals who are at high risk for a particular disease, like high blood pressure, diabetes, high cholesterol, or cancer. Referrals to outside health organizations are made for further testing if needed, with follow-ups by CCCHC to make sure that the clients\' needs continue to be met.\r\n\r\nThe dental clinic provides dental screenings and simple extractions. Will connect to other local organizations if other services are needed.','','http://www.ccchc2003.org','','',NULL,'Appointments preferred, walk-ins accepted. Request an appointment by phone (leave message) or website.','Services are provided to those WITHOUT health insurance or a medical card, or those without access to health care services using the insurance they currently have.','','','','496','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(651,31475,'Dental Care','','7191','COVID-19:\r\nFree telehealth services are available. Please call.\r\n---------------------------\r\nProvides primary medical care services for most minor or intermediate sickness. Physicals are also available for adults.\r\n\r\nScreenings are conducted throughout the community for individuals who are at high risk for a particular disease, like high blood pressure, diabetes, high cholesterol, or cancer. Referrals to outside health organizations are made for further testing if needed, with follow-ups by CCCHC to make sure that the clients\' needs continue to be met.\r\n\r\nThe dental clinic provides dental screenings and simple extractions. Will connect to other local organizations if other services are needed.','','http://www.ccchc2003.org','','',NULL,'Appointments preferred, walk-ins accepted. Request an appointment by phone (leave message) or website.','Services are provided to those WITHOUT health insurance or a medical card, or those without access to health care services using the insurance they currently have.','','','','497','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(652,14166,'City Government Departments/Offices','','7195','The city\'s website can be helpful in locating and utilizing city services.','','','','',NULL,'','','','','','498','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(653,14140,'General Relief','General Transitional Assistance','7197','The General Assistance Program is primarily for those adults without minor children, without adequate income, and ineligible for any other monetary forms of assistance.','','','','',NULL,'By phone, walk-in, online, or appointment. Applications are available on the website.','- Individuals must live within the city limits of Champaign.\r\n- 18 years or older.\r\n- US resident or legal alien.\r\n- Applicants must have a disability and have applied for Social Security benefits but not yet receiving it.\r\n- Must be ineligible for unemployment benefits.','','There are a number of items that must be documented. See the online application or call for further information.','','499','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(654,30631,'Rent Payment Assistance','One-Time Emergency Rental Assistance Program','7197','Description/Eligibility:\r\n- Applicants must reside within the city limits of Champaign or be moving to an address located within the city limits.\r\n- Must provide a reason (hardship) that they cannot pay rent that month.\r\n- Must have 5 or 10-day landlord\'s notice OR an eviction notice to receive assistance with rent arrear, or proof of homelessness if seeking funds for a security deposit.\r\n- Must have proof of verifiable, reoccurring income.\r\n- The applicant\'s income must be two times the amount of their rent (i.e., if rent is $500/mo, the household must be making at least $1000).\r\n- The maximum amount of assistance possible is $600. Any remaining balance must be paid prior to submitting application, and proof of payment needs to be provided.\r\n- Applicant can not have received rental assistance from the City of Champaign Township, Cunningham Township or Champaign County Regional Planning Commission within the last 2 years.\r\n- Applications must be completed with all documentation upon submission. All applications are final and are considered the determining factor of eligibility. \r\n- Availability of funds may take 7-10 days after application is processed and approved. An applicant can receive this assistance one time in a two-year period.','','','','',NULL,'By phone, walk-in, online, or appointment. Applications are available on the website.','','','Documents required to be turned in with completed application:\r\n- Proof of Hardship.\r\n- Copy of ID and Social Security card for all adults in the household.\r\n- Proof of income for the last 30 days (this includes paystubs, child support funds received, social security/disability, and pensions).\r\n- Copy of current lease.\r\n- Eviction order OR landlord\'s 5 or 10-day notice.\r\n- Document that shows your current balance needing paid (ledger from landlord).\r\n- Receipt of payment if there was more than $600 owed.','','500','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(655,14089,'General Legal Aid','Family Advocacy Clinic','7199','The Family Advocacy Clinic was formed to provide legal representation to parents, children, and families facing separation due to allegations of abuse or neglect. This clinic affords students an opportunity to represent low-income parents and/or children as court-appointed counsel in juvenile abuse and neglect cases in Champaign County.','','http://www.law.illinois.edu','clinic@law.illinois.edu','','917725171609009','By phone.','','','','Non-working households: 125% of federal poverty level.\r\nWorking households: 200% of federal poverty level.','501','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(656,14207,'English as a Second Language','','7201','East Central Illinois Refugee Mutual Assistance Center educates and supports refugee, asylee, and immigrant families and helps them transition to a new culture. Services include:\r\n- Refugee/immigrant mutual support groups. \r\n- Linkage with mainstream providers regarding the mental health needs of clientele and the barriers encountered by them. Mediations and education related to cultural differences are provided.\r\n- One-on-one counseling at the Center, a neutral site, or in the homes of families in crisis.\r\n- Violence Against Women Act (VAWA) immigration applications and referrals. This helps spouses ensnared in domestic violence situations to obtain legal permanent residency without the spouse\'s approval.\r\n- Educational program, in collaboration with the Champaign County Adult Diversion Program, to explain American Cultural expectations of proper behavior.\r\n- Culturally appropriate workshops dealing with money and health issues.\r\n- Translation of documents and interpretation in community settings.\r\n- Advocate and liaison in clients\' places of employment, schools, hospitals, courts, with landlords, etc.  \r\n- Aid in completing paperwork for citizenship, asylum, residency, family reunification, etc.\r\n- Assistance with applying for government benefits for which an individual is eligible.\r\n- Referrals to community resources.\r\n- Citizenship and ESL classes.','','https://www.therefugeecenter-cu.org/','','',NULL,'By phone, walk-in, and appointments.','Primarily serves immigrants, refugees, aslyees, or family members of those populations.','','','','502','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(657,14257,'Tutoring Services * Immigrants','Children\'s Program','7201','The Children\'s Program provides school-aged refugee and immigrant children with the opportunity to be matched one-on-one or in small groups with a tutor; to practice their English; to socialize with other refugee and immigrant children of diverse backgrounds; to go on exciting, educational field trips; and to participate in both individual and group activities designed to foster their psychosocial and creative growth.','','https://www.therefugeecenter-cu.org/','','',NULL,'By phone or walk-in.','','','','','503','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(658,16297,'Citizenship Education','','7201','East Central Illinois Refugee Mutual Assistance Center educates and supports refugee, asylee, and immigrant families and helps them transition to a new culture. Services include:\r\n- Refugee/immigrant mutual support groups. \r\n- Linkage with mainstream providers regarding the mental health needs of clientele and the barriers encountered by them. Mediations and education related to cultural differences are provided.\r\n- One-on-one counseling at the Center, a neutral site, or in the homes of families in crisis.\r\n- Violence Against Women Act (VAWA) immigration applications and referrals. This helps spouses ensnared in domestic violence situations to obtain legal permanent residency without the spouse\'s approval.\r\n- Educational program, in collaboration with the Champaign County Adult Diversion Program, to explain American Cultural expectations of proper behavior.\r\n- Culturally appropriate workshops dealing with money and health issues.\r\n- Translation of documents and interpretation in community settings.\r\n- Advocate and liaison in clients\' places of employment, schools, hospitals, courts, with landlords, etc.  \r\n- Aid in completing paperwork for citizenship, asylum, residency, family reunification, etc.\r\n- Assistance with applying for government benefits for which an individual is eligible.\r\n- Referrals to community resources.\r\n- Citizenship and ESL classes.','','https://www.therefugeecenter-cu.org/','','','789038541797078','By phone, walk-in, and appointments.','Primarily serves immigrants, refugees, aslyees, or family members of those populations.','','','','504','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(659,14611,'Student Counseling Services * College/University Students','','7209','Suicide 911 (Emergency):\r\n- If suicide is imminent, contact the Police Department immediately or Suicide Prevention Team at the Counseling Center at 217-333-3704 during office hours, 8:00 am to 5:00 pm).\r\n- Any individual (friend, relative, faculty, residence hall staff) can notify the Suicide Prevention Team, 217-333-3704, if a student they know makes a suicidal threat or attempt and is no longer in imminent danger.\r\n- For emergency services after-hours, please call the Crisis Line at 217-359-4141.\r\n\r\nNon-suicide Psychological Emergency:\r\n- Contact the Counseling Center at 217-333-3704, M-F, between 8:00 am and 5:00 pm.\r\n- If the emergency is urgent in nature, please “walk-in” for services.\r\n- For emergency services after-hours, please call the Crisis Line at 217-359-4141.\r\n\r\nFor all other emergencies, contact the Emergency Dean at 217-333-0050.','','','','',NULL,'By phone.','','','','','505','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(660,30966,'Crisis Intervention * College/University Students','','7209','Suicide 911 (Emergency):\r\n- If suicide is imminent, contact the Police Department immediately or Suicide Prevention Team at the Counseling Center at 217-333-3704 during office hours, 8:00 am to 5:00 pm).\r\n- Any individual (friend, relative, faculty, residence hall staff) can notify the Suicide Prevention Team, 217-333-3704, if a student they know makes a suicidal threat or attempt and is no longer in imminent danger.\r\n- For emergency services after-hours, please call the Crisis Line at 217-359-4141.\r\n\r\nNon-suicide Psychological Emergency:\r\n- Contact the Counseling Center at 217-333-3704, M-F, between 8:00 am and 5:00 pm.\r\n- If the emergency is urgent in nature, please “walk-in” for services.\r\n- For emergency services after-hours, please call the Crisis Line at 217-359-4141.\r\n\r\nFor all other emergencies, contact the Emergency Dean at 217-333-0050.','','','','',NULL,'By phone.','','','','','506','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(661,14142,'Home Based Parenting Education','','7213','CU Early provides parent support and education programming, including:\r\n- Home visiting.\r\n- Developmental screening.\r\n- Assisted resource and referral.\r\n- Playgroups.\r\n- Toy and book lending library.\r\n- Individualized family service plan.\r\n- Teen parent support groups at local high schools.\r\n- Parenting education classes.','','','','','789038541797078','Phone or e-mail.','Have child younger than 3 years old (including prenatal), low income and/or significant family stressors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income.','','507','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(662,14143,'Case/Care Management * Families with Infants/Toddlers','','7213','CU Early provides parent support and education programming, including:\r\n- Home visiting.\r\n- Developmental screening.\r\n- Assisted resource and referral.\r\n- Playgroups.\r\n- Toy and book lending library.\r\n- Individualized family service plan.\r\n- Teen parent support groups at local high schools.\r\n- Parenting education classes.','','','','',NULL,'Phone or e-mail.','Have child younger than 3 years old (including prenatal), low income and/or significant family stressors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income.','','508','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(663,14144,'Support Groups * Teenage Parents','','7213','CU Early provides parent support and education programming, including:\r\n- Home visiting.\r\n- Developmental screening.\r\n- Assisted resource and referral.\r\n- Playgroups.\r\n- Toy and book lending library.\r\n- Individualized family service plan.\r\n- Teen parent support groups at local high schools.\r\n- Parenting education classes.','','','','',NULL,'Phone or e-mail.','Have child younger than 3 years old (including prenatal), low income and/or significant family stressors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income.','','509','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(664,14614,'Special Olympics','','699','SSpecial Olympics is an international program of physical fitness, sports training, and athletic competition for individuals with intellectual disabilities who are eight years of age or older. Athletes may participate in basketball, bowling, power lifting, soccer, softball, volleyball, aquatics, athletics, motor activities, golf, and flag football. Athletes develop better coordination, get needed exercise, improve concentration and discipline, meet other athletes, and gain a feeling of satisfaction and success.','','','','',NULL,'Call for information regarding volunteer opportunities or potential athletes.','','','Medical form for athletes.','','510','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(665,14619,'Volunteer Opportunities','','699','Volunteers needed to coach athletes. On the day of the event, volunteers are needed to be scorekeepers, timers, escorts, officials, food service workers, and registration workers.','','','','',NULL,'By website.','','','','','511','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(666,1614,'Developmental Screening','Therapy Services','7','Physical Therapy (PT)\r\nEasterseals pediatric physical therapists promote increased independence and confidence with gross motor abilities. Physical therapists are experts in movement, motor development, and body function (ex: strength, flexibility, coordination, and endurance). They work closely with each child and their caregivers to determine a treatment plan based upon goals and priorities. Physical therapists work with children with a wide variety of diagnoses including, but not limited to: developmental delays, cerebral palsy, down syndrome, spina bifida, torticollis, plagiocephaly, genetic disorders, hypotonia, toe walking, and those needing post-surgical rehabilitation. \r\n-------------------\r\nOccupational Therapy (OT)\r\nEasterseals pediatric occupational therapists help find what is meaningful to your child and therapy focuses on caregiver and child-centered goals. Occupational therapists increase a child\'s independence and quality of life while targeting a variety of areas including daily living skills, sensory processing, self-regulation, motor skills, and coordination. Treatment includes an emphasis on educating the caregivers and providing strategies to increase participation in their home and community environments. \r\n-------------\r\nSpeech Therapy (ST)\r\nEasterseals pediatric speech therapists use a variety of techniques to teach essential skills needed to be confident and successful communicators. Speech-language treatment plans and goals are developed and implemented based on your child\'s needs and goals of the family. Our therapists are experts in creating an environment in which children feel successful, yet are challenged to develop their individual skills. \r\n-------------\r\nFeeding Therapy\r\nEasterseals feeding therapists can turn mealtime struggles back to an enjoyable experience again. By working closely with the family, our therapists utilize several different approaches depending on the needs of the child. One of which includes SOS (Sequential Oral Sensory) approach to feeding which address both sensory processing and oral motor skills a child needs to eat a wide variety of food groups and textures. This approach allows a child to interact with food in a playful, non-stressful way.\r\n------------------------\r\nDevelopmental Therapy (DT)\r\nEasterseals developmental therapists help children birth to 3 years old meet milestones by supporting the whole family. This therapy addresses a child\'s global development by providing services in a child\'s natural environment. Caregivers are provided home therapy strategies to help the child gain skills and make progress.','','http://www.eastersealsci.com','','','637158405241810','','','','','','512','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(667,18659,'Pediatrics','Therapy Services','7','Physical Therapy (PT)\r\nEasterseals pediatric physical therapists promote increased independence and confidence with gross motor abilities. Physical therapists are experts in movement, motor development, and body function (ex: strength, flexibility, coordination, and endurance). They work closely with each child and their caregivers to determine a treatment plan based upon goals and priorities. Physical therapists work with children with a wide variety of diagnoses including, but not limited to: developmental delays, cerebral palsy, down syndrome, spina bifida, torticollis, plagiocephaly, genetic disorders, hypotonia, toe walking, and those needing post-surgical rehabilitation. \r\n-------------------\r\nOccupational Therapy (OT)\r\nEasterseals pediatric occupational therapists help find what is meaningful to your child and therapy focuses on caregiver and child-centered goals. Occupational therapists increase a child\'s independence and quality of life while targeting a variety of areas including daily living skills, sensory processing, self-regulation, motor skills, and coordination. Treatment includes an emphasis on educating the caregivers and providing strategies to increase participation in their home and community environments. \r\n-------------\r\nSpeech Therapy (ST)\r\nEasterseals pediatric speech therapists use a variety of techniques to teach essential skills needed to be confident and successful communicators. Speech-language treatment plans and goals are developed and implemented based on your child\'s needs and goals of the family. Our therapists are experts in creating an environment in which children feel successful, yet are challenged to develop their individual skills. \r\n-------------\r\nFeeding Therapy\r\nEasterseals feeding therapists can turn mealtime struggles back to an enjoyable experience again. By working closely with the family, our therapists utilize several different approaches depending on the needs of the child. One of which includes SOS (Sequential Oral Sensory) approach to feeding which address both sensory processing and oral motor skills a child needs to eat a wide variety of food groups and textures. This approach allows a child to interact with food in a playful, non-stressful way.\r\n------------------------\r\nDevelopmental Therapy (DT)\r\nEasterseals developmental therapists help children birth to 3 years old meet milestones by supporting the whole family. This therapy addresses a child\'s global development by providing services in a child\'s natural environment. Caregivers are provided home therapy strategies to help the child gain skills and make progress.','','','','',NULL,'','','','','','513','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(668,18662,'Adapted Cycling Equipment','Assistive Technology Clinics','7','- Equipment available includes seating/positioning devices, bathing/toileting equipment, standing devices, wheeled mobility, and electronic aids to daily living. Evaluations and fittings are provided by Easterseals and NuMotion staff that are certified in Assistive Technology for pediatrics. \r\n- \"I Can Bike\" program teaches children how to ride a bicycle.','','','','',NULL,'','','','','','514','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(669,18663,'Assistive Technology Information','Assistive Technology Clinics','7','- Equipment available includes seating/positioning devices, bathing/toileting equipment, standing devices, wheeled mobility, and electronic aids to daily living. Evaluations and fittings are provided by Easterseals and NuMotion staff that are certified in Assistive Technology for pediatrics. \r\n- \"I Can Bike\" program teaches children how to ride a bicycle.','','','','',NULL,'','','','','','515','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(670,18665,'Autism Therapy','Autism Services and Supports','7','Autistic Spectrum Disorder Early Diagnosis Clinic: 1-2-day process that includes a play-based assessment, speech and language evaluation, neurodevelopmental examination, and psychological/behavioral assessment.\r\nAutism Services and Supports include:\r\n- Adaptive Swim Lessons (Peoria).\r\n- Applied Behavior Analysis (ABA).\r\n- Assistive Technology Clinic (AT Clinic).\r\n- Augmentative & Alternative Communication (AAC) Evaluation and Treatment.\r\n- Autism Diagnostic Clinic.\r\n- Autism Resource Center. \r\n- Counseling Services.\r\n- New Diagnosis Family Orientation.\r\n- Occupational Therapy.\r\n- Physical Therapy.\r\n- Sequential Oral Sensory (SOS) Feeding and ASD.\r\n- Social Skills.\r\n- Speech Therapy.\r\n- Water Seals Group (Peoria).','','','','',NULL,'','','','','','516','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(671,18673,'Orthopedic/Orthotic Devices','','7','Ray & Kathy LaHood Center for Cerebral Palsy\r\nChildren seen in the cerebral palsy clinic may have a variety of diagnoses that impact movement and motor development including, but not limited to, cerebral palsy, hypotonia, developmental delays, and genetic disorders. An Easterseals physical therapist, in conjunction with a clinic physician, may assess the child\'s range of motion, gait pattern, orthotics, and other assistive technology equipment, review the child and family\'s needs, and work with the family and physician to establish a plan of care.\r\n-------------\r\nOrthotics Clinic\r\nEasterseals physical therapists consult with an orthotist to determine the appropriate prescription for custom-fitted orthotics/braces to provide stability and support for proper positioning of the feet and ankles during standing, walking, and other functional activities.','','','','',NULL,'','','','','','517','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(672,18674,'Health/Disability Related Counseling * Children and Youth With Disabilities/Health Conditions','Counseling Services','7','Caring for children of all ages is a tough job, however many children, youth, and teenagers with disabilities face special challenges.  They may experience fears about the future, poor self-esteem, and difficulty coping with their disability.  Many parents of children with disabilities also experience very unique challenges related to managing their child\'s development and behavior.  Counselors at Easterseals can help individuals and families, with and without disabilities, focus on their abilities, learn positive coping methods, improve challenging parenting tasks, and enhance social and behavioral skills in a comfortable and fun environment. Counseling helps children improve their quality of life and works to increase their happiness.','','','','','941516382466411','','Children up to age 21 with a disability.','','','','518','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(673,14836,'Anger Management','','7004','Stress Management - Teaches exercise techniques, systematic progressive relaxation, and coping techniques.\r\nAnger Management - Teaches techniques to assist in increasing personal power through greater self-control.','','','','',NULL,'By phone, walk-in, appointment, or fax.','','','Photo ID and proof of income.','','519','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(674,22989,'Ex-Offender Employment Programs','Second Chance Program','7004','The program offers a 10-week job readiness training component intended to help those we serve acquire the education and soft skills necessary to get gainful employment. Clients will learn valuable skills to help successfully reintegrate back into society, such as:\r\n- Interview techniques.\r\n- Job search strategies.\r\n- Preparation of a resume.\r\n- Life skills.\r\n- Financial literacy skills.\r\n- Communication skills.\r\n\r\nGraduates of the program receive follow-up services including mental health counseling, job placement services, professional clothing, transportation assistance to interviews, and training opportunities.','','','','',NULL,'Walk-in to complete a program application, assessment form, and to schedule an intake interview.','To qualify you must have been convicted of a felony and be at least 18 years of age.','','','','520','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(675,14581,'Centers for Independent Living','General Independent Living Services','7008','Offers services which assist persons with disabilities in achieving and/or maintaining independence. Services include, but are not limited to:\r\n- Information and Referral (personal assistant, interpreter, and housing referrals).\r\n- Access and Advocacy (accessibility surveys, assistive devices, Braille printing).\r\n- Skills Development (personal assistant management training, basic computer skills, public transit use, budgeting).\r\n- Counseling (independent living, peer, vocational).\r\n- Free Amplified Phones for Illinois residents with verifiable hearing loss who have a land line.\r\n- Independent Living Needs Assessment.\r\n- Mass Transit District Disability Verification.\r\n- Reintegration into the community from nursing home, etc. (This includes possible financial assistance for moving home or into supportive living).\r\n- Volunteer Opportunities.\r\n- PACE Presentations and Newsletter.\r\n- PACE will readily provide sign language interpreters to access PACE events on request.','','','','',NULL,'By phone or appointment by the person needing assistance.','Varies per program.','','Varies by program.','','521','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(676,14610,'Support Groups * Visual Impairments','Low Vision Peer Support Groups','7008','Low Vision Peer Support Groups discuss access solutions with others who have similar circumstances. The consumers served find the support of each other invaluable, positive and uplifting. Groups focus on solutions and learn about tools for independence that can facilitate staying in their own homes in the community if so desired. \nEquipment assessment and demonstration, some giveaways and larger equipment purchases are available such as OrCam small camera that fits on glasses to read print to wearer or recognize items and faces. Some CCTVs on site can be tried out. Iris Vision wearable technology for magnified vision is also available.','','','','',NULL,'By phone.','Persons age 55 and up that have a significant vision impairment such as macular degeneration, retinitis pigmentosa, glaucoma, diabetic retinopathy, etc.','','','','522','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(677,20212,'Advocacy * Disabilities Issues','General Independent Living Services','7008','Offers services which assist persons with disabilities in achieving and/or maintaining independence. Services include, but are not limited to:\r\n- Information and Referral (personal assistant, interpreter, and housing referrals).\r\n- Access and Advocacy (accessibility surveys, assistive devices, Braille printing).\r\n- Skills Development (personal assistant management training, basic computer skills, public transit use, budgeting).\r\n- Counseling (independent living, peer, vocational).\r\n- Free Amplified Phones for Illinois residents with verifiable hearing loss who have a land line.\r\n- Independent Living Needs Assessment.\r\n- Mass Transit District Disability Verification.\r\n- Reintegration into the community from nursing home, etc. (This includes possible financial assistance for moving home or into supportive living).\r\n- Volunteer Opportunities.\r\n- PACE Presentations and Newsletter.\r\n- PACE will readily provide sign language interpreters to access PACE events on request.','','','','','637158405241810','By phone or appointment by the person needing assistance.','Varies per program.','','Varies by program.','','523','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(678,20213,'Independent Living Skills Instruction','General Independent Living Services','7008','Offers services which assist persons with disabilities in achieving and/or maintaining independen