mTryke therapeutic tricycles to individuals who are unable to operate traditional bikes, and awarding scholarships to students pursuing a career in the field of therapy.','','','denhart@illinois.edu','',NULL,'Ramps: Sally Denhart via email at denhart@illinois.edu or phone 217-552-3331.\r\n\n\r\nAfter an application is sent, it may take awhile before building the ramp due to the high volume of requests.\n\n\r\n\r\nFor AmTrykes, contact Scott Price via email at scott.price@flex-n-gate.com.','','','','','527','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(682,14808,'Adapted Cycling Equipment','','7127','The Greater Champaign County AMBUCS chapter is actively involved in building wheelchair ramps, donating AmTryke therapeutic tricycles to individuals who are unable to operate traditional bikes, and awarding scholarships to students pursuing a career in the field of therapy.','','','scott.price@flex-n-gate.com','',NULL,'Ramps: Sally Denhart via email at denhart@illinois.edu or phone 217-552-3331.\r\n\n\r\nAfter an application is sent, it may take awhile before building the ramp due to the high volume of requests.\n\n\r\n\r\nFor AmTrykes, contact Scott Price via email at scott.price@flex-n-gate.com.','','','','','528','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(683,14464,'Community Clinics','','7135','Avicenna Community Health Center aims to educate and counsel patients to prevent disease, screen patients to identify disease, and prescribe treatment and education to patients to minimize disease burden. The Center manages both long- and short-term diseases. Our prescription assistance team works to find free or reduced cost medications. Every patient is seen by the nutrition and exercise team to provide education on how diet and exercise affects their illness. Case Management is also available to every patient.','','','','',NULL,'Call for appointment. Walk-ins are accepted.','Any adult (18+) without health insurance (uninsured) and those without health access (underinsured).','','None.','','529','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(684,14465,'General Medical Care','','7135','Avicenna Community Health Center aims to educate and counsel patients to prevent disease, screen patients to identify disease, and prescribe treatment and education to patients to minimize disease burden. The Center manages both long- and short-term diseases. Our prescription assistance team works to find free or reduced cost medications. Every patient is seen by the nutrition and exercise team to provide education on how diet and exercise affects their illness. Case Management is also available to every patient.','','','','',NULL,'Call for appointment. Walk-ins are accepted.','Any adult (18+) without health insurance (uninsured) and those without health access (underinsured).','','None.','','530','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(685,19326,'Advocacy * Disabilities Issues','','7149','CCAMR is dedicated to providing advocacy and supports that will contribute to improving the quality of lives and facilitating the independence of people with disabilities in Champaign County.\r\n\r\nCCAMR strives to increase the opportunities for individuals with disabilities to:\r\n- Attain the most independent, productive, and dignified lifestyle possible.\r\n- Attain the living arrangement they choose.\r\n- Learn new skills and values to realize their personal goals.\r\n- Be an active member of his or her community and utilize available opportunities.\r\n- Form friendships and social ties.','','','','','637158405241810','By email or website.','Adults with intellectual disability.','','Application and proof of intellectual disability.','','531','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(686,14644,'Disease/Disability Information * Down Syndrome','','7153','The Champaign County Down Syndrome Network operates as a not-for-profit organization serving families with members who have Down syndrome in Champaign and surrounding counties. The DSN offers support to families by providing current information for parents, professionals, and the general public. The Network also reaches out to new parents and tries to raise awareness of Down syndrome in the community.','','http://www.champaigndsn.org','president@champaigndsn.org','',NULL,'Contact by website/e-mail preferred, but may contact by phone or walk-in to meetings.','','','','','532','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(687,14566,'Regional Economic Development','','7155','The Champaign County Economic Development Corporation (CCEDC) is a public-private partnership dedicated to fostering a cooperative, county-wide approach to economic development. CCEDC coordinates with a number of other key organizations in the area to promote an environment in which business thrives.','','http://www.champaigncountyedc.org','edc@champaigncountyedc.org','',NULL,'By phone, website.','','','','','533','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(688,14481,'County Offices of Emergency Services','','7157','The Emergency Management Agency (EMA) prepares and carries out disaster response and recovery actions to prevent, minimize, repair, and alleviate injury and damage from natural, man-made, or nuclear disasters. Emergency preparedness and recovery resources are available for natural hazards such as: \r\n- Droughts.\r\n- Earthquakes. \r\n- Floods. \r\n- Large-scale fires.\r\n- Tornadoes. \r\n- Winter storms.  \r\nAs well as man-made hazards such as: \r\n- Civil disorder incidents. \r\n- Hazardous material incidents. \r\n- Major transportation accidents.\r\n- Nuclear power plant accidents. \r\n- Pollution and sanitation problems. \r\n- Terrorism incidents.','','http://www.champaigncountyema.org','','','878986697513222','By phone, website.','','','','','534','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(689,30771,'Disaster Relief/Recovery Organizations','','7157','The Emergency Management Agency (EMA) prepares and carries out disaster response and recovery actions to prevent, minimize, repair, and alleviate injury and damage from natural, man-made, or nuclear disasters. Emergency preparedness and recovery resources are available for natural hazards such as: \r\n- Droughts.\r\n- Earthquakes. \r\n- Floods. \r\n- Large-scale fires.\r\n- Tornadoes. \r\n- Winter storms.  \r\nAs well as man-made hazards such as: \r\n- Civil disorder incidents. \r\n- Hazardous material incidents. \r\n- Major transportation accidents.\r\n- Nuclear power plant accidents. \r\n- Pollution and sanitation problems. \r\n- Terrorism incidents.','','http://www.champaigncountyema.org','','',NULL,'By phone, website.','','','','','535','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(690,14460,'Protective/Restraining Orders','','7167','The Office of the State\'s Attorney commences and prosecutes all criminal and traffic cases in the Circuit Court and initiates all dependency, neglect, abuse, and delinquency juvenile petitions and proceedings. The Office also commences and prosecutes all actions and proceedings brought by any County officer and defends actions and proceedings brought against the County or against County officers. In addition, the Office gives opinions to any County officer upon request and provides interpretation of the law relating to concerns of the County.\r\n\r\nThe Office also provides child support enforcement services through a joint venture with the Illinois Department of Healthcare and Family Services.','','','','',NULL,'','','','','','536','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(691,14461,'Crime Victim Support','','7167','The Office of the State\'s Attorney commences and prosecutes all criminal and traffic cases in the Circuit Court and initiates all dependency, neglect, abuse, and delinquency juvenile petitions and proceedings. The Office also commences and prosecutes all actions and proceedings brought by any County officer and defends actions and proceedings brought against the County or against County officers. In addition, the Office gives opinions to any County officer upon request and provides interpretation of the law relating to concerns of the County.\r\n\r\nThe Office also provides child support enforcement services through a joint venture with the Illinois Department of Healthcare and Family Services.','','','','',NULL,'','','','','','537','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(692,21948,'Child Support Assistance/Enforcement','','7167','The Office of the State\'s Attorney commences and prosecutes all criminal and traffic cases in the Circuit Court and initiates all dependency, neglect, abuse, and delinquency juvenile petitions and proceedings. The Office also commences and prosecutes all actions and proceedings brought by any County officer and defends actions and proceedings brought against the County or against County officers. In addition, the Office gives opinions to any County officer upon request and provides interpretation of the law relating to concerns of the County.\r\n\r\nThe Office also provides child support enforcement services through a joint venture with the Illinois Department of Healthcare and Family Services.','','','','',NULL,'','','','','','538','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(693,15365,'Eye Care','','7171','Champaign Lions Club runs a screening process that provides financial assistance toward eye glasses for those found eligible.','','','','',NULL,'Fill out the form on the website at the following link: \nhttp://www.champaignlions.org/eyeglasses-program.html\n\nIf no access to the website, contact by phone at (217) 359-5333.','','','Online form.','','539','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(694,15366,'Hearing Aids','','7171','Champaign Lions Club can provide monetary help toward obtaining hearing aids.','','','','',NULL,'Submit the letter explaining the need.  You may also contact by phone.','','','A letter explaining individual\'s need for a hearing aid and why he or she cannot afford one.','','540','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(695,20724,'Glasses/Contact Lenses','','7171','Champaign Lions Club runs a screening process that provides financial assistance toward eye glasses for those found eligible.','','','','',NULL,'Fill out the form on the website at the following link: \nhttp://www.champaignlions.org/eyeglasses-program.html\n\nIf no access to the website, contact by phone at (217) 359-5333.','','','Online form.','','541','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(696,14061,'General Relief','General Assistance Program','7177','General assistance is available to qualifying residents of Champaign Township taxing district.','','','','',NULL,'By appointment only.','Champaign Township residents who are indigent, usually adults who have no minor children in the home, and are ineligible for any of the federally-funded cash grant programs.','','Photo ID, proof of income, proof of residency, and Social Security card.','','542','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(697,14065,'Rent Payment Assistance','Emergency Assistance Program','7177','Rent or utility assistance may be available to individuals or families with an eviction notice or utility shut-off notice. Assistance is available once every calendar year.','','','','',NULL,'By appointment only.','Income eligible residents of Champaign Township.','','Photo ID, proof of income, proof of residency, and Social Security card/number.','','543','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(698,14066,'Utility Assistance','Emergency Assistance Program','7177','Rent or utility assistance may be available to individuals or families with an eviction notice or utility shut-off notice. Assistance is available once every calendar year.','','','','',NULL,'By appointment only.','Income eligible residents of Champaign Township.','','Photo ID, proof of income, proof of residency, and Social Security card/number.','','544','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(699,14534,'Case/Care Management * AIDS/HIV','','7185','The East Central Illinois HIV Care Connect provides medical case management, support groups, oral health care, housing, utility, primary medical care, nutrition services, vaccination programs, transportation, mental health, and legal assistance to eligible individuals within the care connect region. \r','','','','',NULL,'By appointment.','Anyone living with HIV/AIDS is eligible for case management services, regardless of income or insurance. Those who meet income and insurance guidelines are also eligible for additional services.','','','','545','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(700,14541,'Lead Poisoning Screening','','7185','Lead poisoning screenings are available for children living in Champaign County.','','','','',NULL,'By walk-in or appointment.','','','','','546','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(701,14543,'Pregnancy Testing','','7185','Any woman who is a resident of Champaign County may come in for a pregnancy test.','','','','',NULL,'By walk-in or appointment.','','','Proof of income and proof of residency for WIC application.','','547','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(702,14547,'WIC','WIC','7185','Women, Infants and Children (WIC) is a federally funded program which provides a supplemental package of food and nutrition education for income-eligible women, infants, and children to promote health, growth, and development. The program encourages regular health care and promotes good nutrition through education. Special supplemental foods are provided to eligible pregnant, nursing or post-partum women, infants, and children up to five years of age. Breastfeeding support is also available to participants of the WIC program.','','','','',NULL,'By walk-in or appointment. New participants MUST call the day before services begin or may have to wait 24 hours before receiving food benefits.','Champaign County resident; pregnant, recently delivered, or breastfeeding mother; children under age 5.','','Photo ID, proof of income for household, proof of residency, and medical card/insurance card.','185% of federal poverty level. For example, a family of 4 would need to make less than $45,510 per year or $3,793 per month; a family of 6 less than $60,976 per year or $5,083 per month.','548','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(703,14551,'Case/Care Management * Families with Infants/Toddlers','Family Case Management','7185','Preventive care, developmental testing, immunizations, referrals, and follow-up for pregnant women and children who meet income guidelines.','','','','',NULL,'By walk-in or appointment.','','','','200% of the federal poverty level.','549','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(704,14555,'Immunizations * Youth','','7185','Immunizations are provided to kids through the federal Vaccines for Children (VFC) program. The following immunizations are offered to Champaign County children:\r\n- Diphtheria/Tetanus/Pertussis (DTaP).\r\n- Hepatitis B.\r\n- Haemophilus influenza type b (Hib).\r\n- Measles/Mumps/Rubella (MMR).\r\n- Meningococcal conjugate vaccine (type of vaccine used to protect adolescents from certain types of meningitis).\r\n- Pneumococcal conjugate vaccine (type of vaccine used to protect infants and toddlers from getting life-threatening meningitis and blood infections from certain pneumococcal bacteria).\r\n- Polio.\r\n- Tetanus/Diphtheria (Td).\r\n- Varicella (Chickenpox).\r\n- Flu vaccine is offered seasonally. Preservative-free flu vaccine is available by request for eligible children 6 months to 35 months of age.','','','','',NULL,'By walk-in or appointment.','At least one of the following qualifications for free vaccinations:\r\n- Native American or a Native Alaskan.\r\n- Uninsured.\r\n- Have medical card.\r\n- Have insurance that does not fully cover the cost of vaccination.','','','','550','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(705,14559,'Tuberculosis Screening','','7185','TB skin tests are offered.','','','','',NULL,'By walk-in or appointment.','Call for eligbility requirements.','','','','551','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(706,14561,'Sexually Transmitted Disease Screening','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','552','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(707,14562,'Sexually Transmitted Disease Treatment','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','553','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(708,14563,'Birth Control','','7185','Family Planning services at CUPHD include Pap Smear (cervical cancer detection), reproductive health examinations for females and males, breast examinations, education on reproductive health, and a variety of pregnancy prevention options. Parental consent is not necessary.','','','','',NULL,'Walk-in.','','','Photo ID.','','554','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(709,14564,'HIV Testing','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','555','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(710,30760,'Home Based Parenting Education','GREAT Start','7185','GREAT Start provides parent support and education programming including: \r\n- Home visiting. \r\n- Developmental screening. \r\n- Assisted resource and referral.\r\n- Monthly playgroups.\r\n- Toy and book lending library.\r\n- Literacy bags for parents to borrow.\r\n- Individualized family service plan.\r\n- Infant massage trained staff.\r\n- Breastfeeding support.\r\n- Welcome bags and safety bags.','','http://www.c-uphd.org','','','789038541797078','By phone, walk-in.','Have child younger than 3 years old (including prenatal), low income and/or significant family risk factors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income, immunization records.','125% of the federal poverty level.','556','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(711,30761,'Developmental Screening','GREAT Start','7185','GREAT Start provides parent support and education programming including: \r\n- Home visiting. \r\n- Developmental screening. \r\n- Assisted resource and referral.\r\n- Monthly playgroups.\r\n- Toy and book lending library.\r\n- Literacy bags for parents to borrow.\r\n- Individualized family service plan.\r\n- Infant massage trained staff.\r\n- Breastfeeding support.\r\n- Welcome bags and safety bags.','','http://www.c-uphd.org','','','637158405241810','By phone, walk-in.','Have child younger than 3 years old (including prenatal), low income and/or significant family risk factors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income, immunization records.','125% of the federal poverty level.','557','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(712,30762,'Breastfeeding Support Programs','GREAT Start','7185','GREAT Start provides parent support and education programming including: \r\n- Home visiting. \r\n- Developmental screening. \r\n- Assisted resource and referral.\r\n- Monthly playgroups.\r\n- Toy and book lending library.\r\n- Literacy bags for parents to borrow.\r\n- Individualized family service plan.\r\n- Infant massage trained staff.\r\n- Breastfeeding support.\r\n- Welcome bags and safety bags.','','http://www.c-uphd.org','','',NULL,'By phone, walk-in.','Have child younger than 3 years old (including prenatal), low income and/or significant family risk factors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income, immunization records.','125% of the federal poverty level.','558','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(713,14542,'Lead Poisoning Screening','','7185','Lead poisoning screenings are available for children living in Champaign County.','','','','',NULL,'By walk-in or appointment.','','','','','559','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(714,14544,'Pregnancy Testing','','7185','Any woman who is a resident of Champaign County may come in for a pregnancy test.','','','','',NULL,'By walk-in or appointment.','','','Proof of income and proof of residency for WIC application.','','560','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(715,14548,'WIC','WIC','7185','Women, Infants and Children (WIC) is a federally funded program which provides a supplemental package of food and nutrition education for income-eligible women, infants, and children to promote health, growth, and development. The program encourages regular health care and promotes good nutrition through education. Special supplemental foods are provided to eligible pregnant, nursing or post-partum women, infants, and children up to five years of age. Breastfeeding support is also available to participants of the WIC program.','','','','',NULL,'By walk-in or appointment. New participants MUST call the day before services begin or may have to wait 24 hours before receiving food benefits.','Champaign County resident; pregnant, recently delivered, or breastfeeding mother; children under age 5.','','Photo ID, proof of income for household, proof of residency, and medical card/insurance card.','185% of federal poverty level. For example, a family of 4 would need to make less than $45,510 per year or $3,793 per month; a family of 6 less than $60,976 per year or $5,083 per month.','561','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(716,14552,'Case/Care Management * Families with Infants/Toddlers','Family Case Management','7185','Preventive care, developmental testing, immunizations, referrals, and follow-up for pregnant women and children who meet income guidelines.','','','','',NULL,'By walk-in or appointment.','','','','200% of the federal poverty level.','562','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(717,14556,'Immunizations * Youth','','7185','Immunizations are provided to kids through the federal Vaccines for Children (VFC) program. The following immunizations are offered to Champaign County children:\r\n- Diphtheria/Tetanus/Pertussis (DTaP).\r\n- Hepatitis B.\r\n- Haemophilus influenza type b (Hib).\r\n- Measles/Mumps/Rubella (MMR).\r\n- Meningococcal conjugate vaccine (type of vaccine used to protect adolescents from certain types of meningitis).\r\n- Pneumococcal conjugate vaccine (type of vaccine used to protect infants and toddlers from getting life-threatening meningitis and blood infections from certain pneumococcal bacteria).\r\n- Polio.\r\n- Tetanus/Diphtheria (Td).\r\n- Varicella (Chickenpox).\r\n- Flu vaccine is offered seasonally. Preservative-free flu vaccine is available by request for eligible children 6 months to 35 months of age.','','','','',NULL,'By walk-in or appointment.','At least one of the following qualifications for free vaccinations:\r\n- Native American or a Native Alaskan.\r\n- Uninsured.\r\n- Have medical card.\r\n- Have insurance that does not fully cover the cost of vaccination.','','','','563','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(718,16205,'Case/Care Management * Pregnant Women','Family Case Management','7185','Preventive care, developmental testing, immunizations, referrals, and follow-up for pregnant women and children who meet income guidelines.','','','','',NULL,'By walk-in or appointment.','','','','200% of the federal poverty level.','564','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(719,21387,'HIV Testing','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','565','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(720,21388,'Sexually Transmitted Disease Screening','','7185','STD clinics are offered in the Champaign office with diagnostic services and treatment for gonorrhea, chlamydia, human papilloma virus infections (genital warts), genital herpes, syphilis, and trichomonas. Hepatitis A and B immunizations are provided to all STD clients.','','','','',NULL,'Walk-in during open hours, or call for an appointment.','Age 12 and older.','','','','566','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(721,25088,'General Legal Aid * Veterans','Veterans Legal Clinic','7199','The Veterans Legal Clinic will focus on the civil legal needs of veterans in the community. The VLC will have the opportunity to provide high-quality legal help in civil matters such as family law, consumer disputes, and evictions. The clinic will also assist veterans with service-related matters such as discharge upgrades. The VLC will collaborate with local veteran service organizations to holistically address the needs of their clients.','','http://www.law.illinois.edu','clinic@law.illinois.edu','','917725171609009','By phone.','Must be a US Veteran.','','','','567','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(722,14200,'Language Interpretation','','7201','East Central Illinois Refugee Mutual Assistance Center educates and supports refugee, asylee, and immigrant families and helps them transition to a new culture. Services include:\r\n- Refugee/immigrant mutual support groups. \r\n- Linkage with mainstream providers regarding the mental health needs of clientele and the barriers encountered by them. Mediations and education related to cultural differences are provided.\r\n- One-on-one counseling at the Center, a neutral site, or in the homes of families in crisis.\r\n- Violence Against Women Act (VAWA) immigration applications and referrals. This helps spouses ensnared in domestic violence situations to obtain legal permanent residency without the spouse\'s approval.\r\n- Educational program, in collaboration with the Champaign County Adult Diversion Program, to explain American Cultural expectations of proper behavior.\r\n- Culturally appropriate workshops dealing with money and health issues.\r\n- Translation of documents and interpretation in community settings.\r\n- Advocate and liaison in clients\' places of employment, schools, hospitals, courts, with landlords, etc.  \r\n- Aid in completing paperwork for citizenship, asylum, residency, family reunification, etc.\r\n- Assistance with applying for government benefits for which an individual is eligible.\r\n- Referrals to community resources.\r\n- Citizenship and ESL classes.','','https://www.therefugeecenter-cu.org/','','',NULL,'By phone, walk-in, and appointments.','Primarily serves immigrants, refugees, aslyees, or family members of those populations.','','','','568','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(723,14201,'General Benefits Assistance * Immigrants','','7201','East Central Illinois Refugee Mutual Assistance Center educates and supports refugee, asylee, and immigrant families and helps them transition to a new culture. Services include:\r\n- Refugee/immigrant mutual support g