ding library.\r\n- Individualized family service plan.\r\n- Teen parent support groups at local high schools.\r\n- Parenting education classes.','','','','',NULL,'Phone or e-mail.','Have child younger than 3 years old (including prenatal), low income and/or significant family stressors (homeless, domestic violence, mental or physical health issues, etc).','','Proof of income.','','577','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(732,14467,'Soup Kitchens','','7215','Daily Bread Soup Kitchen has stopped serving meals. Instead, they are handing out a boxed hot lunch and a cold sack lunch at the front door. No one is allowed inside. Serve time remains the same: 11:00 am - 12:30 pm.\r\n-----------------------------------\r\n\r\nThe mission of the Daily Bread Soup Kitchen is to feed the hungry of the Champaign-Urbana community regardless of race, religion, or ethnicity, in a safe, respectful, and inviting environment that emphasizes an unconditional positive regard for every human being.','','','','',NULL,'Walk-in, by phone.','Open to anyone.','','','','578','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(733,21074,'Identification Cards','ID Day','7215','Daily Bread helps guests get State ID\'s and birth certificates. When resources are available, yearly bus passes may be purchased for guests who demonstrate a need.','','','','',NULL,'','','','','','579','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(734,21075,'Birth Certificates','ID Day','7215','Daily Bread helps guests get State ID\'s and birth certificates. When resources are available, yearly bus passes may be purchased for guests who demonstrate a need.','','','','',NULL,'','','','','','580','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(735,21076,'Transportation Passes','ID Day','7215','Daily Bread helps guests get State ID\'s and birth certificates. When resources are available, yearly bus passes may be purchased for guests who demonstrate a need.','','','','','1232587316936391','','','','','','581','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(736,31621,'Packed Lunches/Dinners','','7215','Daily Bread Soup Kitchen has stopped serving meals. Instead, they are handing out a boxed hot lunch and a cold sack lunch at the front door. No one is allowed inside. Serve time remains the same: 11:00 am - 12:30 pm.\r\n-----------------------------------\r\n\r\nThe mission of the Daily Bread Soup Kitchen is to feed the hungry of the Champaign-Urbana community regardless of race, religion, or ethnicity, in a safe, respectful, and inviting environment that emphasizes an unconditional positive regard for every human being.','','','','',NULL,'Walk-in, by phone.','Open to anyone.','','','','582','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(737,14450,'Dental Care','','7217','Students training in the Dental Hygiene program at Parkland College provides the following dental services:\r\n- Oral examination.  \r\n- Oral cancer screening.\r\n- Oral hygiene instruction.\r\n- Periodontal disease evaluation.\r\n- X-rays.\r\n- Topical and/or local anesthesia.\r\n- Nitrous oxide and oxygen sedation.\r\n- Impressions for study models.\r\n- Bleaching (additional cost).\r\n- Pit and fissure sealant placement.\r\n- Care of restorations.\r\n- Fluoride application.\r\n- Placement of antibiotic therapy.\r\n- Desensitization.\r\n\r\nAppointments are available twice per day and last 3.5 hours.','','','','',NULL,'By appointment. Appointments are 3.5 hours long and patients may need more than one appointment.','Adults and Children age 4 and over.','','Medical history and pharmaceuticals.','','583','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(738,14654,'Support Groups * Families/Friends of Mentally Ill','','7219','DBSA provides hope, help, support, and education to improve the lives of people who have mood disorders. DBSA of Urbana-Champaign is a peer-run support group for those individuals dealing with mood disorders.','','http://cudbsa.org','dbsaurbana@gmail.com','','637158405241810','By phone, email, or website.','','','','','584','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(739,14655,'Support Groups * Depression * Bipolar Disorder','','7219','DBSA provides hope, help, support, and education to improve the lives of people who have mood disorders. DBSA of Urbana-Champaign is a peer-run support group for those individuals dealing with mood disorders.','','http://cudbsa.org','dbsaurbana@gmail.com','',NULL,'By phone, email, or website.','','','','','585','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(740,22984,'Support Groups * Mental Illness/Emotional Disabilities','','7219','DBSA provides hope, help, support, and education to improve the lives of people who have mood disorders. DBSA of Urbana-Champaign is a peer-run support group for those individuals dealing with mood disorders.','','http://cudbsa.org','dbsaurbana@gmail.com','','637158405241810','By phone, email, or website.','','','','','586','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(741,14096,'Early Intervention for Children with Disabilities/Delays','Family Development','7223','Family Development is primarily a home visiting program improving the quality of life for infants and toddlers with special needs through early identification, early intervention, and family support.  Developmental Therapy, Speech/Language Therapy, play groups, P.L.A.Y. Project, developmental screenings are all available through the Family Development program.','','','','',NULL,'By phone for appointment.','','','','','587','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(742,14097,'Case/Care Management * People With Disabilities/Health Conditions','Case Management/Family Support','7223','Provides a full range of services to children and adults with intellectual/developmental disabilities including advocacy, referral linkage, crisis intervention, and intermittent direct service. Each individual is assigned a case coordinator who supports person-centered planning, and implementation. As the single point-of-contact for each individual receiving services for DSC, the CM/FSS staff is responsible for coordinating the interplay of agency and community service providers.','','','','','941516382466411','By phone for appointment. Please request Vickie Tolf for Intake/Referral/Admissions process.','','','Photo ID, social security card, and documentation to support intellectual/developmental disability.','','588','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(743,14098,'Developmental Disabilities Day Habilitation Programs','Community Day Services','7223','Community Day Services (CDS) offers adults with intellectual/developmental disabilities a variety of opportunities to include community options within Champaign County to enhance or develop greater independence for daily living. CDS supports individuals to achieve greater levels of self-sufficiency through personalized support within the program, in community activities, and employment/volunteer sites.','','','','','637158405241810','By phone for appointment. Please request Vickie Tolf for Intake/Referral/Admissions process.','','','Photo ID, social security card, and documentation to support intellectual/developmental disability.','','589','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(744,14128,'Comprehensive Job Assistance Centers * Disabilities and Health Conditions','Employment Services','7223','Provides assessment, placement, training, and support to individuals with intellectual/developmental disabilities for the purpose of the most independent employment possible. Community access and exploration is also incorporated into this program so participants are introduced to a variety of experiences.\r\n\r\nEmployment services include, but are not limited to:\r\n- Assistance in preparing and obtaining community employment.\r\n- Training and placement.\r\n- Employer education and support.\r\n- Planning for job advancement.\r\n- On-the-job training.\r\n- Follow-up support.\r\n- Transition planning.','','','','','970915508638448','By phone for appointment.','','','Photo ID, social security, and documentation to support intellectual/developmental disability.','','590','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(745,14130,'Group Residences for Adults with Disabilities','Residential Services','7223','Provides a residential or community setting that empowers individuals to live as independently as possible. Residential options include 24-hour CILA (Community Integrated Living Arrangement) support, a 24-unit apartment building, and other community apartments. Supports and services vary and are uniquely designed for each person.','','','','',NULL,'By phone for appointment.','','','Photo ID, social security card, and documentation to support intellectual/developmental disability.','','591','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(746,19329,'Semi-Independent Living Residences for Adults with Disabilities','Residential Services','7223','Provides a residential or community setting that empowers individuals to live as independently as possible. Residential options include 24-hour CILA (Community Integrated Living Arrangement) support, a 24-unit apartment building, and other community apartments. Supports and services vary and are uniquely designed for each person.','','','','',NULL,'By phone for appointment.','','','Photo ID, social security card, and documentation to support intellectual/developmental disability.','','592','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(747,19473,'Home Based Parenting Education','Parent Wonders','7223','Partners with young families to nurture healthy parent-child relationships during the early years (prenatal to age 3) to improve school readiness. Parents learn about positive parent-child interactions, infant/toddler development, positive discipline, and practical parenting.','','','','','789038541797078','By phone.','- Families must meet WIC income requirements.\r\n- Families must live in rural Champaign County.','','None.','','593','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(748,14600,'Friendly Visiting * Older Adults','Faith In Action','7235','Faith in Action, an interfaith, volunteer-based program, provides free services to residents of Champaign County who are 55 years and older. Those services include transportation to medical appointments, dental appointments, pharmacies, and grocery stores. Other services provided by volunteers are friendly home visiting, reassurance phone calls, light housekeeping, and yard work.','','','','',NULL,'By phone.','Age 55 and older.','','','None.','594','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(749,14601,'In Home Assistance * Older Adults','Faith In Action','7235','Faith in Action, an interfaith, volunteer-based program, provides free services to residents of Champaign County who are 55 years and older. Those services include transportation to medical appointments, dental appointments, pharmacies, and grocery stores. Other services provided by volunteers are friendly home visiting, reassurance phone calls, light housekeeping, and yard work.','','','','',NULL,'By phone.','Age 55 and older.','','','None.','595','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(750,21274,'Volunteer Opportunities','Faith In Action','7235','Faith in Action, an interfaith, volunteer-based program, provides free services to residents of Champaign County who are 55 years and older. Those services include transportation to medical appointments, dental appointments, pharmacies, and grocery stores. Other services provided by volunteers are friendly home visiting, reassurance phone calls, light housekeeping, and yard work.','','','','',NULL,'By phone.','Age 55 and older.','','','None.','596','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(751,21288,'Low Income/Subsidized Rental Housing * Older Adults','','7237','Affordable senior retirement community. Residents pay 30% of adjusted gross income.','','','','','929094559121639','By phone or walk-in.','','','Current Social Security statement of benefits from local office, photo ID, birth certificate, Social Security card. Proof of all income, assets, and medical expenses.','','597','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(752,14420,'Food Pantries','','7245','Grace Lutheran Church offers a food pantry for residents of Champaign County. Can access pantry once a month.','','','','','832990803111047','Walk-in.','','','','','598','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(753,14138,'Temporary Financial Assistance * AIDS','','7249','Eligible clients may request emergency assistance for past due rent, utilities, medical co-pays, and health/work-related transportation costs. GCAP is a payer of last resort, and the amount of assistance is capped. Clients are also able to access up to 50 lbs of food. All items must be for personal (including immediate household) consumption.','','','','','1077790582995406','Clients must request assistance through the Champaign-Urbana Public Health District HIV care coordinator, who will help clients gather required documentation. Call or e-mail for more information.','Clients must be in or establishing services with HIV physician, involved with HIV case management, and fall within program guidelines.','','Proof of HIV status, photo ID, proof of income, and documentation of need.','','599','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(754,14247,'Transitional Housing/Shelter * AIDS/HIV','Champaign House','7249','Transitional housing for persons living with HIV that are homeless. Must be engaged in case coordination with Champaign Urbana Health District and agree to participate in non-medical case management. Residents are expected to be actively seeking permanent housing.','','','','','929094559121639','First point-of-contact is Champaign County Centralized Intake.  Out of county can call the GCAP office to discuss protocol.','Homeless per HUD definition (street homeless).','','Proof of HIV status, homelessness verification, photo ID, proof of income, and negative TB test.','No income guidelines.','600','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(755,14658,'Public Parks','','7255','Located in west Champaign, this multi-purpose recreation center provides educational, social, recreational, and fitness programs for preschool, youth, adults, and mature adults. The Hays Recreation Center is equipped with two activity rooms and is available to rent weekday evening and weekends for your next meeting, reception, reunion, or neighborhood social.','','','','',NULL,'By phone.','','','','','601','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(756,20523,'Recreational Activities/Sports','','7255','Located in west Champaign, this multi-purpose recreation center provides educational, social, recreational, and fitness programs for preschool, youth, adults, and mature adults. The Hays Recreation Center is equipped with two activity rooms and is available to rent weekday evening and weekends for your next meeting, reception, reunion, or neighborhood social.','','','','',NULL,'By phone.','','','','','602','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(757,14689,'Recovery Homes/Halfway Houses','S.A.F.E. House (Substance Abuse Free Environment)','7285','In an effort to help people break free from controlling addictions and troublesome habits, members of the Champaign-Urbana Christian community joined together in the creation of SAFE House (Substance Abuse Free Environment). Offers a 12-month faith based, residential treatment program for men at the Men\'s SAFE House and women at the Women\'s Safe House. Programs incorporate a structured daily regiment of GED and/or adult education, devotions, group therapy, personal counseling, volunteer work projects, evening community-wide personal enrichment courses, and weekly worship services.','','','','',NULL,'By phone or walk-in.','Detoxed.','','Report from Detox facility.','','603','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(758,22933,'Recovery Homes/Halfway Houses','S.A.F.E. House (Substance Abuse Free Environment)','7285','In an effort to help people break free from controlling addictions and troublesome habits, members of the Champaign-Urbana Christian community joined together in the creation of SAFE House (Substance Abuse Free Environment). Offers a 12-month faith based, residential treatment program for men at the Men\'s SAFE House and women at the Women\'s Safe House. Programs incorporate a structured daily regiment of GED and/or adult education, devotions, group therapy, personal counseling, volunteer work projects, evening community-wide personal enrichment courses, and weekly worship services.','','','','',NULL,'By phone or walk-in.','Detoxed.','','Report from Detox facility.','','604','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(759,14628,'Disease/Disability Information * Muscular Dystrophy','','7287','MDA is dedicated to finding treatments and cures for muscular dystrophy, amyotrophic lateral sclerosis (ALS) and other neuromuscular diseases. The Association does so by funding worldwide research; by providing comprehensive health care services and support to MDA families nationwide; and by rallying communities to fight back through advocacy, fundraising, and local engagement.\r\n\r\nMDA has more than 150 Care Centers across the United States and in Puerto Rico located at top hospitals and health care facilities. To find the closest MDA Care Center, contact the local office, use the website zip code search, or call (800) 572-1717.','','','','',NULL,'By website or phone.','','','','','605','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(760,14629,'Muscular Dystrophy Clinics','','7287','MDA is dedicated to finding treatments and cures for muscular dystrophy, amyotrophic lateral sclerosis (ALS) and other neuromuscular diseases. The Association does so by funding worldwide research; by providing comprehensive health care services and support to MDA families nationwide; and by rallying communities to fight back through advocacy, fundraising, and local engagement.\r\n\r\nMDA has more than 150 Care Centers across the United States and in Puerto Rico located at top hospitals and health care facilities. To find the closest MDA Care Center, contact the local office, use the website zip code search, or call (800) 572-1717.','','','','',NULL,'By website or phone.','','','','','606','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(761,14627,'Constitutional/Civil Rights Groups','','7289','The NAACP Champaign County Branch serves the people of Champaign County. The primary focus is to provide programs and services that promote and enhance civil and equal rights, political empowerment, educational excellence, economic development, and outreach, such as health, youth, etc.','','','','',NULL,'By phone, email, website.','','','','','607','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(762,14445,'Food Pantries','Open Door','7293','Instant meal packs and bags of groceries may be offered. As long as funding is available, 3 annual bus passes are provided on the first Tuesday of the month on a first-come, first-serve basis. A valid photo ID is required to request a bus pass.','','','','','832990803111047','Walk-in.','Anyone is welcome to come and discuss their situation/need.','','Valid photo ID.','','608','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(763,21344,'Transportation Passes','Open Door','7293','Instant meal packs and bags of groceries may be offered. As long as funding is available, 3 annual bus passes are provided on the first Tuesday of the month on a first-come, first-serve basis. A valid photo ID is required to request a bus pass.','','','','','1232587316936391','Walk-in.','Anyone is welcome to come and discuss their situation/need.','','Valid photo ID.','','609','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(764,24173,'Community Meals','UniPlace Community Dinner','7293','Every Wednesday during the University of Illinois academic school year, students at the university volunteer in the UniPlace Christian Church kitchen where they serve free meals to those who live in the Champaign-Urbana community.','','','','',NULL,'Walk-in.','','','','','610','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(765,14549,'English as a Second Language','','7297','1) Provides ESL classes for persons with limited English proficiency. Morning and evening class times are available on campus and at Rantoul location for beginners through advanced learners.\r\n2) Instruction is offered for persons needing to improve their basic literacy skills or obtain high school equivalency certificate.','','','','',NULL,'By phone.','Our classes are for permanent residents, immigrants or refugees, and people with a green card. Those visiting the U.S. on a VISA make take courses at Parkland\'s main campus for a fee.','','','','611','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(766,14550,'Tutoring Services * Adult Education','','7297','1) Provides ESL classes for persons with limited English proficiency. Morning and evening class times are available on campus and at Rantoul location for beginners through advanced learners.\r\n2) Instruction is offered for persons needing to improve their basic literacy skills or obtain high school equivalency certificate.','','','','',NULL,'By phone.','Our classes are for permanent residents, immigrants or refugees, and people with a green card. Those visiting the U.S. on a VISA make take courses at Parkland\'s main campus for a fee.','','','','612','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(767,14641,'Clothing','','7303','Provides a clothing closet.','','','','',NULL,'Walk-in.','','','','','613','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(768,14642,'Transitional Housing/Shelter','Restoration Transitional Housing Program','7303','Offers faith-based transitional housing. Program participants are required to participate in services and classes and work with Case Manager. This is an 11 month program. Orientation occurs every August and December. Call or e-mail for detailed program requirements and information.','','','','','929094559121639','Call office for more information and to receive date for next orientation that explains the program and application process. After the orientation, the Resident Director will make an appointment for an interview. It usually takes at least a couple of days to schedule the interview.','- Be willing to participate in program activities.\r\n- Consent to a background check.\r\n- Does not accept persons with a sex offense.','','','','614','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(769,14422,'Child Passenger Safety Seats','Child Safety Seat Inspection Station (CSSIS)','7307','Provides child safety seats (car seats) at a discounted price, free car seat inspections, car seat installations, and education. Each appointment lasts approximately 45 minutes.','','','','',NULL,'Phone for appointment. To schedule an appointment, please call the Buckle-Up Line at 217-353-4932. An appointment must be made for each child attending the inspection station - no extra children without appointment. Cancellations should be made at least 24 hours in advance. For those purchasing a car seat, a referral form from the WIC office is required.','No eligibility requirements for car seat inspections. To receive a discounted car seat, family must be a participant of the WIC program.','','For car seat inspections, bring the following:\r\n- Car seat, instruction manual for car seat (if available), instruction manual for vehicle (if available), and while not required to have child present, it is recommended.\r\nIf purchasing a car seat, bring the following:\r\n- Referral form from the WIC office, child who will be receiving the new seat (mandatory unless pregnant), and co-pay of $20.','','615','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(770,14423,'Child Passenger Safety Seat Inspections','Child Safety Seat Inspection Station (CSSIS)','7307','Provides child safety seats (car seats) at a discounted price, free car seat inspections, car seat installations, and education. Each appointment lasts approximately 45 minutes.','','','','',NULL,'Phone for appointment. To schedule an appointment, please call the Buckle-Up Line at 217-353-4932. An appointment must be made for each child attending the inspection station - no extra children without appointment. Cancellations should be made at least 24 hours in advance. For those purchasing a car seat, a referral form from the WIC office is required.','No eligibility requirements for car seat inspections. To receive a discounted car seat, family must be a participant of the WIC program.','','For car seat inspections, bring the following:\r\n- Car seat, instruction manual for car seat (if available), instruction manual for vehicle (if available), and while not required to have child present, it is recommended.\r\nIf purchasing a car seat, bring the following:\r\n- Referral form from the WIC office, child who will be receiving the new seat (mandatory unless pregnant), and co-pay of $20.','','616','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(771,14424,'Child Passenger Safety Education','Child Safety Seat Inspection Station (CSSIS)','7307','Provides child safety seats (car seats) at a discounted price, free car seat inspections, car seat installations, and education. Each appointment lasts approximately 45 minutes.','','','','','789038541797078','Phone for appointment. To schedule an appointment, please call the Buckle-Up Line at 217-353-4932. An appointment must be made for each child attending the inspection station - no extra children without appointment. Cancellations should be made at least 24 hours in advance. For those purchasing a car seat, a referral form from the WIC office is required.','No eligibility requirements for car seat inspections. To receive a discounted car seat, family must be a participant of the WIC program.','','For car seat inspections, bring the following:\r\n- Car seat, instruction manual for car seat (if available), instruction manual for vehicle (if available), and while not required to have child present, it is recommended.\r\nIf purchasing a car seat, bring the following:\r\n- Referral form from the WIC office, child who will be receiving the new seat (mandatory unless pregnant), and co-pay of $20.','','617','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(772,14667,'Food Cooperatives','Grocery Store','7309','Salt and Light\'s grocery store provides individuals the opportunity to use their skills, talents, gifts, and abilities to provide food for themselves and their families. Participants shop in our grocery store and choose the foods they want to eat.\r\n \r\nMembers can pay with credit, which can be earned by volunteering. Each member account can earn up to $165 each month to spend in the grocery or the thrift store.','','','','','832990803111047','All new participants must attend a one-time New Member Orientation. Orientations are held at the Urbana location on Mondays at 11:00am and at the Champaign location on Thursdays at 3:00pm.','','','','','618','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(773,14668,'Clothing','Salt and Light Thrift Store','7309','Clothing, household, and other items available at low cost. Items may be purchased with cash, credit, or debit. Alternatively, if an individual is unable to purchase items in the store for any reason, they can volunteer at Salt & Light, earning credit to spend in the thrift store and/or grocery store.','','','','',NULL,'By phone, walk-in.','','','','','619','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(774,14669,'Furniture','Salt and Light Thrift Store','7309','Clothing, household, and other items available at low cost. Items may be purchased with cash, credit, or debit. Alternatively, if an individual is unable to purchase items in the store for any reason, they can volunteer at Salt & Light, earning credit to spend in the thrift store and/or grocery store.','','','','',NULL,'By phone, walk-in.','','','','','620','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(775,14670,'Financial Literacy Training','Financial Literacy Classes/Financial Education','7309','Several financial education programs are offered:\r\n\r\n- Financial Peace University: A 13-week program for families created by author Dave Ramsey. Struggling families are taught how to get out of debt, budget their expenses, plan for emergencies, and establish a financial future. One-on-one counseling is also provided.\r\n\r\n- Faith & Finances: Financial education course developed specifically for families in poverty. Clients receive education on basic, technical financial management skills, financial practices and systems, and encourages people with the understanding that there is healing and peace for their relationships, themselves, and their money.','','','','','1077790582995406','To learn more or sign up, contact Terry at terry@saltandlightministry.org.','','','','','621','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(776,14672,'Computer and Related Technology Classes','','7309','Through a partnership with the Graduate School of Library Sciences at the University of Illinois and CU Citizen Access, a computer lab is at Salt & Light. The lab offers basic computer access with lab times for children and adults as well as basic instruction.','','','','',NULL,'Walk-in.','','','','','622','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(777,14427,'Printed Materials * Kindergartens','Getting Ready for Kindergarten Calendar','7333','The Getting Ready for Kindergarten Calendar was developed by \"Success By 6\" - the early childhood initiative of United Way of Champaign County - to help parents and children prepare for kindergarten.\r\n\r\nThe calendar is filled with ideas, activities and tips for parents and children to READ, TALK, PLAY Every Day!\r\n\r\nCalendars are available free of charge to all parents of 4-year olds in Champaign County.','','','','',NULL,'By email or phone. Call if a print copy is needed.','','','','','623','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(778,14809,'Youth Agricultural Programs','','7335','4-H is a national organization which helps young people develop knowledge and skills to become productive citizens. The Illinois 4-H program is conducted by University of Illinois Extension. Young people in 4-H learn about citizenship, leadership, cooking, arts and crafts, mechanics and technology, horticulture, agriculture, and other subjects. To teach young people about these subjects, the 4-H program uses the learn-by-doing method of instruction.','','','','',NULL,'By phone or website.','Youth ages 8-18.','','','','624','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(779,14811,'Personal Financial Counseling','Money Mentors','7335','The Money Mentor program is a network of trained volunteers who work one-on-one with individuals who request help with personal money management. Money Mentors is a free and confidential service available to assist individuals with personal finance strategies, including:\r\n- Budgeting.\r\n- Establishing financial goals.\r\n- Building savings.\r\n- Managing credit.\r\n- Organizing finances.','','http://go.illinois.edu/moneymentors','','','1077790582995406','By phone or website.','','','','','625','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(780,23979,'Cooperative Extension Service Education Programs','','7335','University of Illinois Extension offers a variety of health and nutrition education programs for the community, including the Expanded Food and Nutrition Education Program (EFNEP) and the Supplemental Nutrition Assistance Program Education Programs (SNAP-Ed) for low-income families.','','','','','789038541797078','By phone or website.','','','','','626','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(781,14813,'General Health Education Programs','','7335','University of Illinois Extension offers a variety of health and nutrition education programs for the community, including the Expanded Food and Nutrition Education Program (EFNEP) and the Supplemental Nutrition Assistance Program Education Programs (SNAP-Ed) for low-income families.','','','','','789038541797078','By phone or website.','','','','','627','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(782,14814,'Nutrition Education','','7335','University of Illinois Extension offers a variety of health and nutrition education programs for the community, including the Expanded Food and Nutrition Education Program (EFNEP) and the Supplemental Nutrition Assistance Program Education Programs (SNAP-Ed) for low-income families.','','','','','789038541797078','By phone or website.','','','','','628','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(783,14770,'Adult Basic Education','Urbana Adult Education Center','7337','Urbana Adult Education Center provides lifelong learning opportunities to persons 16 years of age and over (some restrictions will apply). Classes are funded through federal and state grants, with help from sources such as The United Way of Champaign County.','','','','','789038541797078','By phone or website.','','','- If under age 18, you must show proof of residency for Urbana.\r\n- Transcript from the last school attended that shows withdrawal date.\r\n- Medical card from the state (if received).\r\n- Social Security number if applicable.','','629','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(784,14771,'English as a Second Language','Urbana Adult Education Center','7337','Urbana Adult Education Center provides lifelong learning opportunities to persons 16 years of age and over (some restrictions will apply). Classes are funded through federal and state grants, with help from sources such as The United Way of Champaign County.','','','','',NULL,'By phone or website.','','','- If under age 18, you must show proof of residency for Urbana.\r\n- Transcript from the last school attended that shows withdrawal date.\r\n- Medical card from the state (if received).\r\n- Social Security number if applicable.','','630','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(785,14815,'Book Distribution Programs * Inmates','','7339','UC Books to Prisoners is an Urbana Illinois based project providing books to Illinois inmates at no cost by mail as well as through two county jail libraries. Volunteers primarily interact with inmates by reading their letters, selecting books from a collection of donated materials, and shipping those books directly to inmates in response to their requests. Books to Prisoners also staffs the two lending libraries located in the Champaign, IL County jails. The organization can utilize those with skills managing volunteers, coordinating book donations, and fund raising, as well as many other education, outreach, and technical tasks.','','','','',NULL,'By phone or website. Book dropoff locations in the Urbana-Champaign area are listed on the website.','','','','','631','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(786,14816,'Volunteer Opportunities','','7339','UC Books to Prisoners is an Urbana Illinois based project providing books to Illinois inmates at no cost by mail as well as through two county jail libraries. Volunteers primarily interact with inmates by reading thei