roup, Urbana\r\n- Cardiomyopathy/LVAD Support Group, Urbana\r\n- Children\'s Cancer Support Group, Urbana\r\n- Diabetes Support Group, Danville and Champaign\r\n- Fibromyalgia Support Group, Champaign\r\n- Head and Neck Cancer Support Group, Urbana\r\n- Life After Loss Support Group (Grief support group), Champaign\r\n- NICU Sibling Support Group, Urbana\r\n- Ostomy Support Group, Urbana\r\n- Parkinson\'s Support Group, Urbana\r\n- Women\'s Room Cancer Support Group, Urbana','','','','',NULL,'Call for more information or to register.','','','','','642','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(797,22729,'General Medical Care','Primary/Speciality Care Services','7378','The following services are offered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','',NULL,'By appointment only.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','643','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(798,22730,'Women\'s Health Centers','Primary/Speciality Care Services','7378','The following services are offered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','','941516382466411','By appointment only.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','644','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(799,14043,'Audiological Evaluations * Children','Carle Hospital ECHO program (Expanding Children\'s Hearing Opportunities)','7386','ECHO (Expanding Children\'s Hearing Opportunities) offers comprehensive services for children with hearing loss from diagnosis, evaluation, and treatment including early intervention services. The Pediatric Hearing Center (PHC) multidisciplinary team serves children who use all communication modes, offering hearing evaluation, speech language evaluation, hearing aids, cochlear implants and therapy.','','','','',NULL,'By appointment.','','','Insurance card. Proof of income required for financial assistance.','Free or discounted care may be available through the Carle Financial Assistance Program. Other discount options may be available. Please visit carle.org/Patients-Visitors/Financial-Assistance','645','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(800,14044,'General Counseling Services','','7388','Mental health counseling is available for individuals, couples, and families suffering from emotional and relationship difficulties.','','','','',NULL,'By phone.','','','','','646','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(801,14045,'Pregnancy Counseling','','7388','The Crisis Pregnancy Counselors at The Center for Youth and Family Solutions are available to assist expecting parents facing an unplanned pregnancy as they sort through their thoughts and feelings and consider their options. By providing a safe, nonjudgmental, and supportive environment, counselors can help provide information, education, and resources so that expecting parents can make an informed decision. The counselors are also available to help with next steps once a plan is in place.','','','','',NULL,'By phone.','','','','','647','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(802,14046,'Runaway/Homeless Youth Counseling','Comprehensive Community Based Youth Services (CCBYS)','7388','CYFS provides crisis intervention for families with children between the ages of 11-17 who are in trouble with the law or who are locked out of their homes. The primary purpose of the Crisis Response Services program is to provide at-risk youth with a continuum of services according to their needs, with the overarching goal being family preservation, reunification, or independence.','','','','',NULL,'Call the 24-hour hotline.','','','','','648','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(803,14047,'Runaway/Youth Shelters','Comprehensive Community Based Youth Services (CCBYS)','7388','CYFS provides crisis intervention for families with children between the ages of 11-17 who are in trouble with the law or who are locked out of their homes. The primary purpose of the Crisis Response Services program is to provide at-risk youth with a continuum of services according to their needs, with the overarching goal being family preservation, reunification, or independence.','','','','',NULL,'Call the 24-hour hotline.','','','','','649','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(804,14048,'Adoption Services','','7388','The Adoption Program serves families interested in adopting a legally free child. The Domestic Infant Adoption Program and Pregnancy Support Services Program are committed to allowing birth parents and adoptive parents design an adoption plan that is in the best interest of the child. The Adoption Program recognizes the importance of the adoptive parents and birth parents developing an on-going relationship. Adoption Program services include counseling young women who are pregnant, adoption orientations, adoption home studies for domestic and international adoptions, post-placement supervision, on-going support groups, and adoption searches.','','','','',NULL,'By phone.','','','','','650','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(805,14705,'Case/Care Management * Foster Children','','7388','The Center for Youth & Family Solutions is the largest provider of Foster Care Services in Central Illinois. The Center provides licensing, training, and ongoing support to foster families who provide children with a safe haven during a time of crisis. Foster care services include:\r\n- Relative Foster Care.\r\n- Traditional Foster Care.\r\n- Specialized Foster Care.\r\n- Medically Complex.\r\n- Foster Parent Recruitment.\r\n- Adoption Conversions.','','','','',NULL,'Children are referred through DCFS. To become a foster parent, call for more information.','','','','','651','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(806,14706,'Foster Home Licensing','','7388','The Center for Youth & Family Solutions is the largest provider of Foster Care Services in Central Illinois. The Center provides licensing, training, and ongoing support to foster families who provide children with a safe haven during a time of crisis. Foster care services include:\r\n- Relative Foster Care.\r\n- Traditional Foster Care.\r\n- Specialized Foster Care.\r\n- Medically Complex.\r\n- Foster Parent Recruitment.\r\n- Adoption Conversions.','','','','',NULL,'Children are referred through DCFS. To become a foster parent, call for more information.','','','','','652','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(807,14159,'Housing Search Assistance * Older Adults','Senior Housing Assistance','7402','Elderwerks is a complimentary service helping seniors and families find senior housing Staff can help find assisted living, independent living, retirement living, senior living apartments, Alzheimer\'s/memory care, sheltered care, nursing homes, home care, home services, rehab, and emergency placement based on clients\' needs. Person-centered referrals ensure that families are viewing senior communities that are appropriate for their loved one. Staff also refers to support businesses and organizations such as elder law attorneys, ombudsman, SRES Realtors, etc.\r\n\r\nContacts for specific areas in Northern Illinois:\r\n- DuPage, Kane & Rockford area: 224-500-6673\r\n- North Shore & Chicago: 847-877-8215\r\n- Northwest Suburbs: 224-500-4777\r\n- McHenry & Lake: 224-500-6674\r\n- All Other areas 847-462-0885','','','','','929094559121639','By phone or email.','Any senior in need.','','','','653','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(808,30698,'Memory Screening','Senior Memory Assessments','7402','Elderwerks provides memory assessments and then referrals for supportive services and more in depth assessments.','','','','',NULL,'By phone or email.','Seniors only.','','Health and insurance information.','','654','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(809,30699,'Volunteer Opportunities','Senior Housing Assistance','7402','Elderwerks is a complimentary service helping seniors and families find senior housing Staff can help find assisted living, independent living, retirement living, senior living apartments, Alzheimer\'s/memory care, sheltered care, nursing homes, home care, home services, rehab, and emergency placement based on clients\' needs. Person-centered referrals ensure that families are viewing senior communities that are appropriate for their loved one. Staff also refers to support businesses and organizations such as elder law attorneys, ombudsman, SRES Realtors, etc.\r\n\r\nContacts for specific areas in Northern Illinois:\r\n- DuPage, Kane & Rockford area: 224-500-6673\r\n- North Shore & Chicago: 847-877-8215\r\n- Northwest Suburbs: 224-500-4777\r\n- McHenry & Lake: 224-500-6674\r\n- All Other areas 847-462-0885','','','','',NULL,'By phone or email.','Any senior in need.','','','','655','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(810,31996,'Information and Referral * Older Adults','Senior living, care, support and benefit counseling for seniors','7402','Elderwerks helps all seniors with information, referrals and guidance for senior living, care, support and benefits. Provides community and professional education on senior topics. \n\nElderwerks 340 page Senior Resource Directory is designed to help older adults in Illinois stay home safely or transition successfully. The directory can be viewed at www.elderwerks.com/directory/index.html.','','http://www.elderwerks.com/directory/index.html.','help@elderwerks.org','',NULL,'','','','','','656','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(811,14134,'Temporary Financial Assistance * Veterans','','7404','The Veterans Assistance Commission of Champaign County provides temporary financial assistance to veterans and their families. Examples of assistance include mortgage or rent payments, utility payments, food/family essentials, and VA Claims. The VAC of Champaign County also offers advocacy, information and referral, location and retrieval of discharge documents, and other services for the veteran community.','','http://www.co.champaign.il.us/vac/vac.php','','','1077790582995406','By phone, walk-in, or appointment.','Honorably discharged veteran.','','','Photo ID, proof of income, proof of residency, and DD Form 214','657','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(812,14135,'Military Records * Veterans','','7404','The Veterans Assistance Commission of Champaign County provides temporary financial assistance to veterans and their families. Examples of assistance include mortgage or rent payments, utility payments, food/family essentials, and VA Claims. The VAC of Champaign County also offers advocacy, information and referral, location and retrieval of discharge documents, and other services for the veteran community.','','http://www.co.champaign.il.us/vac/vac.php','','',NULL,'By phone, walk-in, or appointment.','Honorably discharged veteran.','','','Photo ID, proof of income, proof of residency, and DD Form 214','658','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(813,14136,'Veteran Benefits Assistance','','7404','The Veterans Assistance Commission of Champaign County provides temporary financial assistance to veterans and their families. Examples of assistance include mortgage or rent payments, utility payments, food/family essentials, and VA Claims. The VAC of Champaign County also offers advocacy, information and referral, location and retrieval of discharge documents, and other services for the veteran community.','','http://www.co.champaign.il.us/vac/vac.php','','',NULL,'By phone, walk-in, or appointment.','Honorably discharged veteran.','','','Photo ID, proof of income, proof of residency, and DD Form 214','659','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(814,14146,'Scholarships','CSBG - Scholarship Program','7408','The Community Services Block Grant (CSBG) Scholarships are awarded to assist low-income persons to obtain post-secondary education as a means to increase self-sufficiency.','','http://www.ccrpc.org','','',NULL,'Applications can be downloaded from the website or picked up at the office.','- Be a resident of Champaign County.\r\n- Be income-eligible according to the current Federal Department of Health and Human Services\' Poverty Guidelines.\r\n- Have at least a 3.0 cumulative GPA (high school students) or 2.0 cumulative GPA (post-secondary students) out of a possible 4.0 scale.\r\n- Be enrolled in a post-secondary school in Illinois.\r\n- Be enrolled as a full-time student (12 or more semester hours - some exceptions do apply).\r\n- Students who have already completed a bachelor\'s degree are not eligible for this scholarship.','','CSBG scholarship application, IRS tax return, academic letter of recommendation, transcripts.','125% of the federal poverty level.','660','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(815,14479,'Full Cost Motor Vehicle Registration','Department of Motor Vehicles (DMV)','7225','The Driver Services Department issues licenses to more than 8.5 million Illinois drivers and more than 3 million photo identification cards to drivers and non-drivers at more than 130 locations. In addition, Drivers\' Services maintains driving records and takes administrative action against unsafe drivers.','','','','',NULL,'','','','','','661','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(816,21355,'Driver Licenses * Immigrants','Temporary Visitor Driver\'s License (TVDL)','7225','Undocumented immigrants living in Illinois may apply for a three-year temporary driver\'s license driver\'s license. Immigrants who can prove they have lived in Illinois for a year must walk-in for assistance in obtaining the special license. Applicants age 18-20 must  have completed a 6-hour adult driver education and training course. All applicants must pass vision, written, and driving tests and will be required to obtain auto insurance.','','http://www.cyberdriveillinois.com/departments/drivers/TVDL/home.html','','',NULL,'Walk-in.','Immigrants who can prove they have lived in Illinois for a year.','','Check the website for a list of required documents.','','662','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(817,14480,'Full Cost Motor Vehicle Registration','Department of Motor Vehicles (DMV)','7225','The Driver Services Department issues licenses to more than 8.5 million Illinois drivers and more than 3 million photo identification cards to drivers and non-drivers at more than 130 locations. In addition, Drivers\' Services maintains driving records and takes administrative action against unsafe drivers.','','','','',NULL,'','','','','','663','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(818,14659,'Small Business Development','Business Advisors\' Council (BAC)','7227','Champaign County Chamber of Commerce\'s Business Advisors\' Council (BAC) provides free business counseling to help start and grow a small business. Experienced counselors can help with one-on-one counseling regarding business basics, marketing, business planning, and financing your business. Hands-on workshops are offered regularly on topics including Starting a Small Business, Writing a Business Plan, and Financing a Small Business.\r\n\r\nCounselors are experienced and have access to numerous resources from which to gather business information necessary to help clients make good business decisions. Counseling is:\r\n- Confidential: Counselors abide by a code of ethics and honor confidentiality.\r\n- Fast: Ask questions 24/7; get answers in 48 hours.\r\n- Free: Offered free-of-charge, as a public service.\r\n- Convenient: Receive advice by e-mail or arrange a meeting with a counselor.','','https://www.champaigncounty.org/business-advisors-council','','',NULL,'By phone or e-mail. Business counseling available by appointment.','','','','','664','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(819,14660,'Volunteer Opportunities * Business Issues','','7227','Call for volunteer opportunities.','','','','',NULL,'','','','','','665','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(820,24247,'Chambers of Commerce','','7227','The Chamber and local development organizations continue working to provide greater opportunities for expansion and existing companies and attraction of new firms. Champaign County offers a variety of incentives such as tax increment financing districts and enterprise zone, low interest loans, subsidized employee training and assistance in site selection.','','http://www.champaigncounty.org','info@champaigncounty.org','',NULL,'','','','','','666','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(821,14472,'Packed Lunches/Dinners','Sack Lunch Program','7229','Each weekday, at least two dozen lunches are given out from the Emmanuel office door to those who would otherwise not have any food. Food is given on a first come, first served basis.','','','','',NULL,'Walk-in.','','','','','667','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(822,14598,'Senior Ride Programs','Faith In Action','7235','Faith in Action, an interfaith, volunteer-based program, provides free services to residents of Champaign County who are 55 years and older. Those services include transportation to medical appointments, dental appointments, pharmacies, and grocery stores. Other services provided by volunteers are friendly home visiting, reassurance phone calls, light housekeeping, and yard work.','','','','',NULL,'By phone.','Age 55 and older.','','','None.','668','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(823,14599,'Friendly Telephoning * Older Adults','Faith In Action','7235','Faith in Action, an interfaith, volunteer-based program, provides free services to residents of Champaign County who are 55 years and older. Those services include transportation to medical appointments, dental appointments, pharmacies, and grocery stores. Other services provided by volunteers are friendly home visiting, reassurance phone calls, light housekeeping, and yard work.','','','','',NULL,'By phone.','Age 55 and older.','','','None.','669','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(824,21313,'Meeting Space','','7255','Located in west Champaign, this multi-purpose recreation center provides educational, social, recreational, and fitness programs for preschool, youth, adults, and mature adults. The Hays Recreation Center is equipped with two activity rooms and is available to rent weekday evening and weekends for your next meeting, reception, reunion, or neighborhood social.','','','','',NULL,'By phone.','','','','','670','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(825,15202,'Food Pantries','','7259','Food pantry is available. Can be accessed once every 30 days. St. Vincent de Paul is a collaboration between Holy Cross and St. Matthew Church.','','','','','832990803111047','By appointment only.','','','Photo ID.','','671','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(826,14690,'Homeless Permanent Supportive Housing','Homestead Apartments Supportive Housing','7261','Permanent supportive housing for single homeless adults.','','http://www.homesteadcorp.org','homesteadcorp@gmail.com','','929094559121639','By phone, walk-in, or appointment.','Single homeless adult, with income below 50% area median family income.','','Proof of income and documentation of homelessness.','50% of area median family income for one person.','672','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(827,14773,'Low Income/Subsidized Rental Housing','Crystal View Townhomes','7261','70 units of mixed-income affordable rental housing on the site of the former Lakeside Terrace public housing complex in Urbana. Housing consists of 2, 3, and 4 bedroom units for low income families. The income mix will range from very low (30% to 50% of median income), to low (60% of median income), to moderate (80% of median income) income households. Many units will be set-aside for Section 8 program beneficiaries, clients in need of supportive housing, and households requiring accessibility features.','','http://www.homesteadcorp.org','homesteadcorp@gmail.com','','929094559121639','By phone.','','','','','673','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(828,14637,'Planning/Coordinating/Advisory Groups * Human/Social Services Issues','','7265','The Human Services Council of Champaign County is an association of over 60 public and not-for-profit organizations that seek to develop and improve human services through development of various community projects, exchange of information between organizations, community education concerning needs and programs, and encouragement of cooperation between organizations.','','https://www.facebook.com/HSCChampaignCounty/','','',NULL,'No phone number associated with this agency. For more information, see website, e-mail the council chair, or walk-in to the monthly meeting. Application for membership can be downloaded online.','','','','','674','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(829,14158,'Municipal Police','','7273','Champaign Police Department provides law enforcement and public safety to the residents of Champaign. They also provide crime prevention education and community outreach, including topics such as:\r\n- Personal safety.\r\n- Residential security.\r\n- Business security.\r\n- Neighborhood safety.\r\n- Retail theft prevention.\r\n- Police work.\r\n\r\nThe department also accepts participants for the Champaign County Citizen Police Academy, the Youth Police Academy, and Police 101 - the adult mock police academy.','','','','',NULL,'By phone.','','','','','675','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(830,15652,'Extreme Weather Shelters','','7273','The police department\'s lobby can be used by anyone who needs to get out of the extreme cold for a short period of time. No sleeping.','','','','',NULL,'','','','','','676','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(831,15152,'Support Groups * Breastfeeding Women','','7275','La Leche League Leaders are experienced mothers who have breastfed their own babies and who have been trained and accredited by La Leche League International to help mothers and mothers-to-be with all aspects of breastfeeding - which can include using breast pumps and bottles or supplementing with formula. They are available by phone or e-mail whenever you have breastfeeding questions or concerns. All breastfeeding mothers and mothers-to-be interested in breastfeeding are welcome to come to meetings or call one of the Leaders for breastfeeding help and/or meeting information. Babies and toddlers are always welcome at all meetings.','','','','',NULL,'By phone or walk-in.','','','','','677','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(832,17670,'Breastfeeding Support Programs','','7275','La Leche League Leaders are experienced mothers who have breastfed their own babies and who have been trained and accredited by La Leche League International to help mothers and mothers-to-be with all aspects of breastfeeding - which can include using breast pumps and bottles or supplementing with formula. They are available by phone or e-mail whenever you have breastfeeding questions or concerns. All breastfeeding mothers and mothers-to-be interested in breastfeeding are welcome to come to meetings or call one of the Leaders for breastfeeding help and/or meeting information. Babies and toddlers are always welcome at all meetings.','','','','',NULL,'By phone or walk-in.','','','','','678','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(833,14553,'Adult Basic Education','','7297','Helps qualified individuals build foundational, employability, and occupation skills especially with respect to improving reading, writing, and mathematics skills necessary to earn high school equivalency certificate. Classes use occupationally relevant instructional materials tailored to the individual\'s career interest and level of readiness.','','','','','789038541797078','New and returning students must schedule an appointment for registration and pre-enrollment advising. Phone 217-351-2580 for an appointment.','At least 16 years of age and officially withdrawn from school. Students under age 18 will need a letter from the school they last attended that includes their last date of enrollment (day, month, and year).','','','','679','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(834,14554,'GED/High School Equivalency Test Instruction','','7297','Helps qualified individuals build foundational, employability, and occupation skills especially with respect to improving reading, writing, and mathematics skills necessary to earn high school equivalency certificate. Classes use occupationally relevant instructional materials tailored to the individual\'s career interest and level of readiness.','','','','',NULL,'New and returning students must schedule an appointment for registration and pre-enrollment advising. Phone 217-351-2580 for an appointment.','At least 16 years of age and officially withdrawn from school. Students under age 18 will need a letter from the school they last attended that includes their last date of enrollment (day, month, and year).','','','','680','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(835,15163,'Tutoring Services * Adult Education','Project READ','7297','Project READ, a not-for-profit literacy service, provides free tutoring to adult learners seeking to improve their reading, writing, and/or English as a Second Language skill.\r\n \r\nTutors work with students in public locations, such as churches, libraries, and Adult Basic Education classrooms. Students need not be enrolled in Adult Basic Education classes to receive tutoring services, but must be age 17 or older and officially withdrawn from high school. Students are provided with all books and learning materials free of charge.','','','','',NULL,'By phone.','','','','','681','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(836,15164,'Volunteer Opportunities','Project READ','7297','Project READ, a not-for-profit literacy service, provides free tutoring to adult learners seeking to improve their reading, writing, and/or English as a Second Language skill.\r\n \r\nTutors work with students in public locations, such as churches, libraries, and Adult Basic Education classrooms. Students need not be enrolled in Adult Basic Education classes to receive tutoring services, but must be age 17 or older and officially withdrawn from high school. Students are provided with all books and learning materials free of charge.','','','','',NULL,'By phone.','','','','','682','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(837,22167,'Community Colleges','','7297','Parkland is a public two-year community college offering 120+ degree and certificate programs designed for career and job placement or for transfer to programs at four-year institutions. The college confers the Associate in Arts, Associate in Science, Associate in Fine Arts, Associate in Engineering Science, Associate in Applied Science, and Associate in General Studies degrees in an array of traditional and nontraditional disciplines.','','','','',NULL,'','','','','','683','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(838,14682,'General Counseling Services','','7299','Offers specialized outpatient therapeutic psychological services for adults, adolescents, and children. UIUC treats a variety of psychological and emotional disorders such as stress, anxiety, depression, and childhood trauma. Couples counseling, mindfulness-based cognitive therapy, and autism assessments are available. \r\n\r\nServices are provided by the following specialty clinics:\r\n- Autism Clinic.\r\n- Childhood Adversity and Resiliency Services (CARS) (for childhood trauma).\r\n- Mindfulness Training (for depression and anxiety disorders).\r\n- Neuropsych Clinic.\r\n- Stress and Anxiety Clinic.\r\n\r\nServices are only provided if they fall into these clinics as this is a facility that trains doctoral students. Each clinic is run by a different faculty member. Call for further information about what symptoms they treat.','','','','',NULL,'By phone for appointment.','','','','','684','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(839,21352,'Adolescent/Youth Counseling * Children Witnessing Violence','Childhood Adversity & Resiliency Services (CARS)','7299','Specialized counseling services for children 8-18 exposed to a traumatic event or living in adverse conditions. Services include:\r\n- Trauma-informed assessments.\r\n- Short-term therapy (Trauma-Focused CBT).\r\n- Family support for trauma-related behaviors.','','','','',NULL,'By phone for appointment.','','','','','685','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(840,14803,'Tutoring Services * Youth','The Reading Group','7301','The Reading Group is a not-for-profit educational learning center which specializes in serving children and adults who struggle with learning difficulties. In partnership with teachers, parents, and community leaders, The Reading Group works to overcome problems related to learning disabilities, dyslexia, and illiteracy. Staff includes educational specialists in reading, writing, early childhood development, and ESL (English as a Second Language). Initial evaluations and one-on-one instruction are available.','','','','',NULL,'By phone, walk-in, or appointment to schedule an evaluation.','','','Academic assessment available through The Reading Group.','','686','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(841,22352,'Tutoring Services * Adult Education','The Reading Group','7301','The Reading Group is a not-for-profit educational learning center which specializes in serving children and adults who struggle with learning difficulties. In partnership with teachers, parents, and community leaders, The Reading Group works to overcome problems related to learning disabilities, dyslexia, and illiteracy. Staff includes educational specialists in reading, writing, early childhood development, and ESL (English as a Second Language). Initial evaluations and one-on-one instruction are available.','','','','',NULL,'By phone, walk-in, or appointment to schedule an evaluation.','','','Academic assessment available through The Reading Group.','','687','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(842,14640,'Food Pantries','Restoration Emergency Food Pantry','7303','Provides a food pantry.','','','','','832990803111047','Walk-in.','','','Proof of residency.','','688','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(843,14676,'Low Cost School Supplies','','7309','School supplies will be available for purchase in the thrift store for a fraction of the retail cost.\r\n\r\nCurrently, Salt & Light will not be accepting new credit-earning members. However, individuals may sign up to be placed on a wait-list in order to become a credit-earning member. Members volunteer at Salt & Light and earn credit to purchase needed supplies. (No free supplies). New members will be added on a first-come-first serve basis. \r\n\r\nDonations can be dropped off at Salt & Light. Volunteers will also be needed for the event. For questions, or to learn how you can get involved, please contact Lisa Sheltra at lisa@saltandlightministry.org.','','','','',NULL,'Walk-in.','','','','','689','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(844,14678,'Volunteer Opportunities','','7309','Salt and Light needs help with the following on a regular basis:\r\n- Sorting clothes and hanging up clothes.\r\n- Emptying collection bins.\r\n- Restocking shelves and clothing.\r\n- Light, general cleaning.\r\n- Administrative tasks (mailings, reception).\r\n- Computer lab.','','','','',NULL,'By phone.','','','','','690','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(845,21275,'Thrift Shops','Salt and Light Thrift Store','7309','Clothing, household, and other items available at low cost. Items may be purchased with cash, credit, or debit. Alternatively, if an individual is unable to purchase items in the store for any reason, they can volunteer at Salt & Light, earning credit to spend in the thrift store and/or grocery store.','','','','',NULL,'By phone, walk-in.','','','','','691','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(846,22987,'Holiday Programs * Nonprofit Retail Stores','Christmas Shop','7309','For one week in December, the thrift store will be transformed into a Christmas Shop, complete with toys, decorations, gift wrap, refreshments, activities for kids, and other holiday items. All holiday items can be purchased with cash, credit, or earned credit. If an individual is unable to purchase items in the store, they can volunteer at Salt & Light, earning credit to spend in the thrift store and/or grocery store. Call for further information.','','','','',NULL,'Walk-in.','','','','','692','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(847,14680,'Food Pantries','','7317','Provides a food pantry only. Can be accessed once every two weeks. Food pantry is located in the parish office at St. Patrick\'s Church.','','','','','832990803111047','Walk-in.','Champaign County resident.','','Proof of residence (photo ID or piece of mail).','','693','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(848,15150,'Low Income/Subsidized Rental Housing * People With Disabilities/Health Conditions','Section 8 & Tax Credit programs','7323','Sunnycrest Manor is a residential rental community that offers seniors retirement living at an affordable price.','','','','','929094559121639','By phone, walk-in, or appointment. Separate agencies or current resident referrals are accepted.','Must be a person age 62 and older or under age 62 with a disability.','','Photo ID, birth certificate, proof of income (must be within 90 days), and Social Security card.','$30,240 per year for one person; $34,560 per year for two people.','694','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(849,21292,'Low Income/Subsidized Rental Housing * Older Adults','Section 8 & Tax Credit programs','7323','Sunnycrest Manor is a residential rental community that offers seniors retirement living at an affordable price.','','','','','929094559121639','By phone, walk-in, or appointment. Separate agencies or current resident referrals are accepted.','Must be a person age 62 and older or under age 62 with a disability.','','Photo ID, birth certificate, proof of income (must be within 90 days), and Social Security card.','$30,240 per year for one person; $34,560 per year for two people.','695','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(850,14805,'Higher Education Bridge Programs','','7325','The TRiO Upward Bound works to increase minority student enrollment at universities across the country by providing high school students with encouragement, support, and the academic requirements and skills necessary to compete at a major academic institution. Students receive counseling and assistance with college prep courses throughout the academic year and during the summer. Support services then assist students through their college experience through tutoring and workshops throughout the school year.','','','','','789038541797078','By phone.','','','','','696','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(851,14523,'Recreational Activities/Sports','','7329','The Urbana Park District provides a wide range of programs for all ages and ability levels. It provides sport/athletics, dance, fitness arts, culture, and environmental programs. There are 20 parks, 8 facilities, and numerous special events for all members of the community.','','','','',NULL,'Some programs require prior registration; call for more information.','','','','','697','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(852,22764,'Public Parks','','7329','The Urbana Park District provides a wide range of programs for all ages and ability levels. It provides sport/athletics, dance, fitness arts, culture, and environmental programs. There are 20 parks, 8 facilities, and numerous special events for all members of the community.','','','','',NULL,'Some programs require prior registration; call for more information.','','','','','698','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(853,29837,'Book/Magazine Donation Programs','','7339','UC Books to Prisoners is an Urbana Illinois based project providing books to Illinois inmates at no cost by mail as well as through two county jail libraries. Volunteers primarily interact with inmates by reading their letters, selecting books from a collection of donated materials, and shipping those books directly to inmates in response to their requests. Books to Prisoners also staffs the two lending libraries located in the Champaign, IL County jails. The organization can utilize those with skills managing volunteers, coordinating book donations, and fund raising, as well as many other education, outreach, and technical tasks.','','','','',NULL,'By phone or website. Book dropoff locations in the Urbana-Champaign area are listed on the website.','','','','','699','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(854,14457,'City Government Departments/Offices','','7341','The city\'s website can be helpful in locating and utilizing city services.','','http://urbanaillinois.us','','',NULL,'','','','','','700','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(855,14635,'Public Libraries','','7345','Urbana Free Library provides the following library services to residents of Urbana:\r\n- Books (including eBooks), audiobooks, movies, music, and periodicals.\r\n- Children and teen programming.\r\n- Computers with internet and word processing, fax machines, copiers, and other equipment.\r\n- Large print, audiobooks, computer stations, and home delivery for seniors.\r\n- Walkers and assistive technology for in-library use.\r\n- Cooling and Warming Center\r\n- Champaign County Historical Archives.','','','','',NULL,'','','','Photo ID and proof of residency.','','701','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(856,24098,'Extreme Weather Shelters','Warming/Cooling Center','7345','Individuals looking to get out of the heat in the summer and cold in the winter are welcome at the Urbana Free Library.','','','','',NULL,'','','','','','702','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(857,14463,'Municipal Police','','7347','Police department serving the residents of Urbana.','','','','',NULL,'','','','','','703','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(858,14609,'Special Education','','7351','The Special Education Department provides programs for special needs children (ages 3-21). A full range of special programs is available through the following programs and services:\r\n- Programs for Students with Intellectual Disabilities.\r\n- Programs for Students with Behavioral/Emotional Disorders.\r\n- Services for Students with Specific Learning Disabilities.\r\n- Early Childhood Education.\r\n- Services for Students with Speech Language Impairments.\r\n- Programs for Students with Multiple Disabilities.\r\n- Services for Students who are Hard of Hearing or Deaf.\r\n- Services for Students who are Visually Impaired.\r\n- Programs for Students with Physical Disabilities.\r\n- Home/Hospital Instruction.\r\n- School Social Work Services.\r\n- School Psychological Services.\r\n- Occupational Therapy.\r\n- Physical Therapy.\r\n- Cunningham Children\'s Home (On-Grounds Classes).\r\n- Prenatal Classes.\r\n- Wrap-Around Services.','','','','',NULL,'By phone.','','','','','704','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(860,14023,'Hospitals','','7378','A 413-bed regional care hospital that houses the area\'s only Level I Trauma Center as well as Level III perinatal services.','','','','',NULL,'By appointment with exception to the Emergency Department.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','705','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(861,14027,'Cancer Clinics','Carle Cancer Center and Mills Breast Cancer Institute','7378','Delivers comprehensive care through leading-edge technology and advanced research, as well as education and support. Offering clinical trials and multidisciplinary clinics for breast, prostate and head and neck cancers as well as stereotactic radiosurgery.','','','','',NULL,'Call for more information.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','706','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(862,14029,'Support Groups * Diabetes','','7378','Carle offers a number of support groups. To learn more about each group, including dates, time and location, please visit www.carle.org/supportgroups\r\n- Awake and Aware Support Group (Sleep Apnea), Urbana\r\n- Bariatric Support Group, Champaign\r\n- Better Breathers Support Group (Chronic Pulmonary Disease), Urbana and Danville\r\n- Brain Injury Support Group, Urbana\r\n- Cancer Caregivers Group, Urbana\r\n- Cancer Support Groups, Urbana and Danville\r\n- Cardiac Support Group, Urbana\r\n- Cardiomyopathy/LVAD Support Group, Urbana\r\n- Children\'s Cancer Support Group, Urbana\r\n- Diabetes Support Group, Danville and Champaign\r\n- Fibromyalgia Support Group, Champaign\r\n- Head and Neck Cancer Support Group, Urbana\r\n- Life After Loss Support Group (Grief support group), Champaign\r\n- NICU Sibling Support Group, Urbana\r\n- Ostomy Support Group, Urbana\r\n- Parkinson\'s Support Group, Urbana\r\n- Women\'s Room Cancer Support Group, Urbana','','','','',NULL,'Call for more information or to register.','','','','','707','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(863,30937,'Home Based Parenting Education','Healthy Beginnings - Nurse Family Partnership','7378','A Nurse Home Visiting service for expecting mothers to receive additional support throughout her pregnancy and during her child\'s first few years of life. The program exists to help mothers achieve their goals and maintain healthy families. Mothers receive one-on-one support and guidance in their own homes from their own free nurse.','','','','','789038541797078','By phone.','','','None.','','708','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(864,14024,'Urgent Care Centers','Convenient Care','7378','Medical staff sees both Carle and non-Carle patients without the need for an appointment for treatments for:\r\n- Muscle sprains.\r\n- Sports physicals.\r\n- Back and neck pain/body aches.\r\n- Minor cuts/infections.\r\n- Cold/flu like symptoms.','','http://www.carle.org/convenientcare','','',NULL,'Walk-in or by phone.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','709','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(865,21329,'General Medical Care','Primary/Speciality Care Services','7378','The following services are offered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','',NULL,'By appointment only.','','','Proof of income needed for the financial assistance 