ered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','','941516382466411','By appointment only.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','713','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(869,14039,'Medical Equipment/Supplies','Carle Medical Supply','7378','Carries a variety of rental medical equipment and supplies. Offers 24-hour emergency service, with free delivery, installation and maintenance of home rental equipment within 50 miles of each store. Products include:\r\n- Ambulatory aids.\r\n- Bandages and wound care.\r\n- Medical instruments.\r\n- Orthopedic products.\r\n- Aids for daily living.\r\n- Ostomy products.\r\n- Hosiery and medical leg wear.\r\n- Oxygen, respiratory and CPAP machines and accessories.\r\n- Wheelchairs and accessories.','','','','',NULL,'By appointment.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','714','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(870,14040,'Home Health Care','','7378','Health care that allows patients to recover or live with illness in the comfort of their own homes. By providing care, education, and support, workers help patients become independent in managing their care.','','','','','941516382466411','By phone.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','715','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(871,14041,'Hospice Care','','7378','The Hospice Team Provides:\r\n- Visits by nurses who are on call 24/7.\r\n- Management of pain and related symptoms.\r\n- Short-term inpatient care for symptom management.\r\n- Personal care.\r\n- Coordinated services with the patient’s personal physician.\r\n- Help in obtaining financial assistance or other community services.\r\n- Spiritual and emotional support.\r\n- Supportive care by trained volunteers.\r\n- Family counseling.\r\n- Instruction to caregivers on patient care.\r\n- Respite care, for up to 5 days, at a contracted facility.\r\n- Therapies and nutritional consultation.\r\n- Bereavement support for family members.','','','','',NULL,'By phone.','- Has a medical diagnosis that projects a limited life expectancy.\r\n- Agrees with family and primary physician that symptom management care is most appropriate.\r\n- Has a primary caregiver (someone other than Hospice staff available to the patient on a 24-hour basis).','','Financial Assistance Program: Proof of income.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','716','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(872,22727,'General Medical Care','Primary/Speciality Care Services','7378','The following services are offered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','',NULL,'By appointment only.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','717','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(873,22728,'Women\'s Health Centers','Primary/Speciality Care Services','7378','The following services are offered at this location.\r\n\r\nNorth Entrance (existing):\r\n- Allergy & Immunology.\r\n- Dermatology.\r\n- Dermatology (MOHS).\r\n- Developmental Pediatrics.\r\n- Gynecology.\r\n- Pediatrics.\r\n- Psychology.\r\n- Endocrinology.\r\n- Rheumatology.\r\n- Nutrition Services.\r\n- Patient Accounts.\r\n\r\nWest Entrance (new):\r\n- Family Medicine.\r\n- Adult Medicine.\r\n- Adult Medicine Residency.\r\n- Cardiac Rehabilitation.','','','','','941516382466411','By appointment only.','','','Proof of income needed for the financial assistance application.','Free or discounted care may be available for persons at or below 400% of the federal poverty level for Carle\'s various financial assistance programs.','718','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(874,14707,'Foster Home Placement','','7388','The Center for Youth & Family Solutions is the largest provider of Foster Care Services in Central Illinois. The Center provides licensing, training, and ongoing support to foster families who provide children with a safe haven during a time of crisis. Foster care services include:\r\n- Relative Foster Care.\r\n- Traditional Foster Care.\r\n- Specialized Foster Care.\r\n- Medically Complex.\r\n- Foster Parent Recruitment.\r\n- Adoption Conversions.','','','','',NULL,'Children are referred through DCFS. To become a foster parent, call for more information.','','','','','719','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(875,14049,'Advocacy * Abused Children','','7390','Champaign County Court Appointed Special Advocate (CASA) is a not-for-profit organization which recruits, trains, and monitors volunteers who advocate for the best interests of abused and neglected children. CASA volunteers work through the juvenile court system to facilitate prompt delivery of services and make independent recommendations to the court concerning the child’s well-being.','','','','','637158405241810','','Children must be involved in on open juvenile abuse and neglect case. Volunteers must be at least 21-years-old.','','','','720','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(876,14050,'Volunteer Opportunities','','7390','Champaign County Court Appointed Special Advocate (CASA) is a not-for-profit organization which recruits, trains, and monitors volunteers who advocate for the best interests of abused and neglected children. CASA volunteers work through the juvenile court system to facilitate prompt delivery of services and make independent recommendations to the court concerning the child’s well-being.','','','','',NULL,'','Children must be involved in on open juvenile abuse and neglect case. Volunteers must be at least 21-years-old.','','','','721','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(877,14051,'Dental Care','Dental Referral Program','7392','The Dental Referral Program (DRP) is a collaboration between Champaign County Health Care Consumers and area dentists to provide discounted dental care to low-income, uninsured adults in the Champaign-Urbana area.','','','','',NULL,'Call and ask for the Dental Referral Program.','- Have no dental insurance.\r\n- Have an income at or below 185% of the federal poverty level.\r\n- Be at least 18-years-old.','','Proof of income.','','722','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(878,14062,'Information and Referral * Health Care','Community Health Worker Services','7392','CCHCC receives hundreds of calls each month from Champaign County residents who need help navigating the health care system. Trained and experienced Community Health Worker (CHW) staff provide a range of services including information, referrals, assistance, advocacy, and case management. Two CHWs are bilingual in English and Spanish. CHWs are trained as Certified Application Counselors and work with consumers on a range of issues including:\r\n- Enrollment in free or affordable health insurance.\r\n- Access to free or affordable health care.\r\n- Medicaid and SNAP (food stamp) applications.\r\n- Access to free or affordable dental care.\r\n- Access to free or affordable eye exams and glasses.\r\n- Access to free or affordable prescriptions.\r\n- Dealing with medical bills and applying for hospital financial assistance.\r\n- Applications for SafeLink phones.','','','','','941516382466411','By phone (ask for the hotline), appointment, or e-mail.','','','','','723','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(879,14064,'Medical Care Expense Assistance * Medicare','Medicare 100/Plus Program','7392','The Medicare 100/Plus Program is a free program for Medicare beneficiaries to pre-qualify for, and receive, Medicare Part A and Part B discounts with OSF Heart of Mary, and at participating independent physician offices.','','','','',NULL,'By phone, appointment, or e-mail.','Must be a Medicare beneficiary and meet income guidelines.','','Photo ID, proof of income, Medicare card, and Social Security award letter.','','724','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(880,21390,'Affordable Care Act Insurance Information/Counseling','ACA Guidance / In Person Counseling','7392','Provides education and consumer assistance designed to facilitate enrollment of county residents in the Illinois Health Insurance Marketplace through the In-Person Counseling Program.\r\n\r\nAccess to health insurance through the Illinois Health Insurance Marketplace is one of the many changes in the health care and health insurance fields made possible by the Affordable Care Act (ACA). People in need of assistance due to language barriers, technology disadvantages, or a lack of understanding of health insurance can arrange to meet an In-Person Counselor to assist them.','','','','',NULL,'','','','','','725','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(881,23885,'Prescription Expense Assistance','','7392','CCHCC offers limited assistance with copays on medication and emergency prescriptions, and provide resources for additional programs that offer prescription assistance. CCHCC also assists with signing up for health insurance to help cover medications.','','','','',NULL,'By phone.','Must be in direct contact with CCHCC and willing to find long term solution for prescription needs, like signing up for health insurance or applying for a drug manufacturer\'s assistance program.','','','150% of the Federal Poverty level, which for one person is $18,090/year.','726','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(883,24594,'Support Groups * Alcohol Use Disorder','','74','A non-profit fellowship of men and women who share their experience, strength, and hope with each other so that they may solve their common problem and help others to recover from alcoholism.','','','','',NULL,'By phone or website.','Membership is open to anyone who wants to do something about his or her drinking problem.','','','','727','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(884,14150,'Weatherization Programs','Illinois Home Weatherization Assistance Program (IHWAP)','7408','The Weatherization program targets low-income residents with high energy bills for weatherization upgrades to make the home more energy efficient.','','http://www.ccrpc.org','','',NULL,'Call for qualifications and application procedures.','','','Proof of income, proof of residence, Social Security card, proof of home ownership, recent gas bill, and recent electricity bill.','150% of the federal poverty level.','728','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(885,14151,'Utility Assistance','LIHEAP','7408','COVID-19:\r\nAll LIHEAP programs are extended until June 30th 2020 or until funding is exhausted.  ______________________________________________________________________________________________________\r\n\r\nThe Low Income Home Energy Assistance Program (LIHEAP) provides energy assistance for eligible low income families in which a benefit is paid directly to the utility companies on behalf of eligible households, or directly to renters if the utility costs are included in their rent. \r\n\r\nSome LIHEAP applicants may qualify for the Percentage of Income Payment Plan (PIPP), where an eligible client pays a percentage of their income, receives a monthly benefit towards their utility bill, and receives a reduction in overdue payments for every on-time payment they make by the bill due date.\r\n\r\nIf the homeowner\'s furnace is not working or is dangerous or emitting carbon monoxide into the household, LIHEAP may be able to provide a furnace repair or replacement.\r\n\r\nOther assistance, such as weatherization and energy-related minor home repairs, may be provided. A household may also be able to receive assistance with the cost of gas for a propane tank depending on where they live and which vendor they use.','','http://www.ccrpc.org','','',NULL,'Call for qualifications, application procedures, current program schedule, and participating sites information.','October 1st - Seniors (60+) and people on disability.\r\nNovember 1st - Families with children 5 and under and disconnected households.\r\nDecember 1st - All other income eligible households.','','Need proof of household gross income for last 30 days, current energy bill, Social Security number for everyone in household, TANF medical card for anyone receiving benefits, and either proof of home ownership and insurance or rental agreement or receipt that shows the amount of rent.','Up to 150% of Federal Poverty Level. The benefit amount is based on the eligible household\'s last 30-days income, amount of utility bills, and type of heating source.','729','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(886,14153,'Developmental Assessment','Independent Service Coordination','7408','Pre-Admission Screening and Independent Service Coordination (PAS/ISC) program provides eligibility determination and service monitoring for persons with developmental disabilities who are receiving Medicaid-waivered services from the Illinois Department of Human Services - Division of Developmental Disabilities. Activities include: \r\n- Eligibility screening.\r\n- Assessment of individual needs and desires.\r\n- Case management for people with developmental disabilities.\r\n- Assistance in developing natural community supports.\r\n- Advocacy.\r\n- Information and referral. \r\n- Review of services received.\r\n- Ensure standards of quality services.\r\n- Crisis support.\r\n- Referral and linkage to generic and specialized community service providers offering a variety of services including respite, day programs, residential, education, vocational/employment services, counseling, and family support.\r\n- Enrollment on PUNS (Prioritization of Need for Services)\r\n- Champaign County only: Transition planning for clients nearing high school graduation.','','http://www.ccrpc.org','','','637158405241810','By phone or appointment.','Persons with intellectual or developmental disabilities.','','Proof of income and proof of developmental disability/psychological assessment.','','730','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(887,14154,'Medicare Information/Counseling','SHIP - Senior Health Insurance Program','7408','SHIP, Senior Health Insurance Program, is a free insurance counseling service sponsored by the Illinois Department of Financial and Professional Regulation, Division of Insurance, for Medicare beneficiaries and their caregivers. The Illinois Department of Insurance trains SHIP counselors to:\r\n- Answer questions about  Medicare, Medicare Supplement insurance, long-term care insurance, Medicare managed care plans (HMO, PPO & PFFS) and other health insurance.\r\n- Answer questions regarding prescription drug coverage through Medicare D and other sources.\r\n- Organize and assist in filing Medicare and Medicare Supplement claims.\r\n- Analyze Medicare Supplement and long-term care insurance policies.\r\n- Appeal claim denials.\r\n- Answer question about  Extra Help, a federal program to assist low-income seniors with the costs associated with Medicare D. Counselors will also assist with the completion of Extra Help applications.','','http://www.ccrpc.org','','',NULL,'By phone or appointment.','Age 65 and older.','','','','731','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(888,14155,'Information and Referral * Older Adults','Senior Solutions and Community Outreach','7408','CCRPC offers telephone consultations, private office visits, and individual home visits to provide information and assistance and connect seniors to a wide array of community programs and services.\r\n\r\nCertified Information and Referral Specialists (CIRS-A) provide: \r\n- Assessment to develop a personalized plan.\r\n- In-home or office appointments.\r\n- Help to navigate the path of Federal and State programs.\r\n- Reliable follow-up.\r\n\r\nCommunity Outreach programs include:\r\n- Educational presentations.\r\n- Printed information promoting awareness of resources and senior issues.','','http://www.ccrpc.org','','',NULL,'By phone or appointment.','Age 60 and older.','','','','732','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(889,14156,'Outreach Programs * Older Adults','Senior Solutions and Community Outreach','7408','CCRPC offers telephone consultations, private office visits, and individual home visits to provide information and assistance and connect seniors to a wide array of community programs and services.\r\n\r\nCertified Information and Referral Specialists (CIRS-A) provide: \r\n- Assessment to develop a personalized plan.\r\n- In-home or office appointments.\r\n- Help to navigate the path of Federal and State programs.\r\n- Reliable follow-up.\r\n\r\nCommunity Outreach programs include:\r\n- Educational presentations.\r\n- Printed information promoting awareness of resources and senior issues.','','http://www.ccrpc.org','','',NULL,'By phone or appointment.','Age 60 and older.','','','','733','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(890,14157,'General Benefits Assistance * Older Adults','Senior Solutions and Community Outreach','7408','CCRPC offers telephone consultations, private office visits, and individual home visits to provide information and assistance and connect seniors to a wide array of community programs and services.\r\n\r\nCertified Information and Referral Specialists (CIRS-A) provide: \r\n- Assessment to develop a personalized plan.\r\n- In-home or office appointments.\r\n- Help to navigate the path of Federal and State programs.\r\n- Reliable follow-up.\r\n\r\nCommunity Outreach programs include:\r\n- Educational presentations.\r\n- Printed information promoting awareness of resources and senior issues.','','http://www.ccrpc.org','','',NULL,'By phone or appointment.','Age 60 and older.','','','','734','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(891,14163,'Preschools','Head Start & Early Head Start','7408','Head Start is a federally-funded program that serves children from birth to age five and pregnant women, offering a school readiness program in addition to comprehensive services to children and their families who meet income guidelines.','','http://www.ccrpc.org','','',NULL,'Through application; walk-in.','','','Photo ID, birth certificate, proof of income, proof of residency, well child exam, and immunization records.','Generally 100% of the federal poverty level.','735','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(892,14164,'Home Based Parenting Education','Head Start & Early Head Start','7408','Head Start is a federally-funded program that serves children from birth to age five and pregnant women, offering a school readiness program in addition to comprehensive services to children and their families who meet income guidelines.','','http://www.ccrpc.org','','','789038541797078','Through application; walk-in.','','','Photo ID, birth certificate, proof of income, proof of residency, well child exam, and immunization records.','Generally 100% of the federal poverty level.','736','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(893,14215,'Rent Payment Assistance * COVID-19','Champaign County Rental Assistance Program','7408','COVID19:\r\nThose in need should call Champaign County Regional Planning Commission at 877-548-4205, 10am - 6pm Monday through Friday. They will screen for eligibility and connect individuals with Champaign Township or Cunningham Township for a one-time assistance payment. Help is open to all Champaign County residents.\r\nEligibility Requirements:\r\n- Lives in Champaign County;\r\n- No renters who have subsidized housing voucher;\r\n- Renters with earned income prior to Stay at Home order;\r\n- Renters who do not qualify for unemployment insurance;\r\n- Income up to 250% federal poverty level.\r\n\r\n-------------------------------------\r\nOriginal text pre-covid:\r\nThe Champaign County Rent Assistance Program is a partnership between Champaign County Regional Planning Commission, City of Champaign Township, and Cunningham Township. The Program may be able to provide up to $600 in rent assistance for households that have experienced a temporary financial hardship resulting in them being at risk for eviction.','','http://www.ccrpc.org','homeless-services@ccrpc.org','',NULL,'By phone, e-mail, or walk-in; call for walk-in location.','- Applicant must reside within Champaign County.\r\n- Applicant must have a verifiable source of recurring income.\r\n- Applicant\'s rent can NOT exceed half of their household monthly gross income, unless they receive a fixed income as their only source.\r\n- Applicant must have a verifiable, temporary, cause of hardship beyond their control.\r\n- Applicant household income must be at or under 200% of the federal poverty guideline.\r\n- Applicant has not received rent assistance from a program partner (Champaign County Regional Planning Commission, City of Champaign Township, nor Cunningham Township) in the past 2 years.','','- Completed application and pre-screener.\r\n- Photo ID for all adults in household.\r\n- Social Security Cards for head of household, or VISA/Immigration # for primary applicant.\r\n- Proof of all income for the last 30 days.\r\n- Current signed lease if facing eviction.\r\n- Proof of hardship, such as receipt for medical costs, homelessness verification, 5-day notice, etc.\r\n- Copy of eviction notice if facing eviction.\r\n- Documentation of how remainder will be paid.','','737','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(894,22060,'Child Development Classes','Head Start & Early Head Start','7408','Head Start is a federally-funded program that serves children from birth to age five and pregnant women, offering a school readiness program in addition to comprehensive services to children and their families who meet income guidelines.','','http://www.ccrpc.org','','',NULL,'Through application; walk-in.','','','Photo ID, birth certificate, proof of income, proof of residency, well child exam, and immunization records.','Generally 100% of the federal poverty level.','738','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(895,22089,'Expectant/New Parent Assistance','Head Start & Early Head Start','7408','Head Start is a federally-funded program that serves children from birth to age five and pregnant women, offering a school readiness program in addition to comprehensive services to children and their families who meet income guidelines.','','http://www.ccrpc.org','','',NULL,'Through application; walk-in.','','','Photo ID, birth certificate, proof of income, proof of residency, well child exam, and immunization records.','Generally 100% of the federal poverty level.','739','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(896,22585,'Homeless Shelter','Centralized Intake for Homeless','7408','***Due to the COVID-19/Coronavirus pandemic, the RPC is taking certain precautions to protect its employees and the clients they serve. With that said, the Centralized Intake for Homeless walk-in hours will be suspended until further notice.***\r\n-------------------------------------\r\n\r\nCentralized Intake for Homeless is the first point-of-contact for all people experiencing homelessness in Champaign County. Walk-In Assessments are provided for households experiencing homelessness that live in Champaign County. Clients must walk-in to one of the in-person locations.','','http://www.ccrpc.org','','',NULL,'Walk-in at listed locations. \n\nInfo on walk-in locations also provided on a phone message at 217-819-4117.','Anyone experiencing homelessness in Champaign County.','','Strongly encouraged to bring:\r\n- Verification of your homeless situation (for example, a letter from someone such as a case manager or friend stating where you are currently sleeping; it must include the date and their contact information).\r\n- Photo ID.\r\n- Social Security card(s).\r\n- Birth certificate of minor child(ren).\r\n- Disability verification (if applicable).','','740','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(897,31019,'Furnaces','LIHEAP','7408','COVID-19:\r\nAll LIHEAP programs are extended until June 30th 2020 or until funding is exhausted.  ______________________________________________________________________________________________________\r\n\r\nThe Low Income Home Energy Assistance Program (LIHEAP) provides energy assistance for eligible low income families in which a benefit is paid directly to the utility companies on behalf of eligible households, or directly to renters if the utility costs are included in their rent. \r\n\r\nSome LIHEAP applicants may qualify for the Percentage of Income Payment Plan (PIPP), where an eligible client pays a percentage of their income, receives a monthly benefit towards their utility bill, and receives a reduction in overdue payments for every on-time payment they make by the bill due date.\r\n\r\nIf the homeowner\'s furnace is not working or is dangerous or emitting carbon monoxide into the household, LIHEAP may be able to provide a furnace repair or replacement.\r\n\r\nOther assistance, such as weatherization and energy-related minor home repairs, may be provided. A household may also be able to receive assistance with the cost of gas for a propane tank depending on where they live and which vendor they use.','','http://www.ccrpc.org','','',NULL,'Call for qualifications, application procedures, current program schedule, and participating sites information.','October 1st - Seniors (60+) and people on disability.\r\nNovember 1st - Families with children 5 and under and disconnected households.\r\nDecember 1st - All other income eligible households.','','Need proof of household gross income for last 30 days, current energy bill, Social Security number for everyone in household, TANF medical card for anyone receiving benefits, and either proof of home ownership and insurance or rental agreement or receipt that shows the amount of rent.','Up to 150% of Federal Poverty Level. The benefit amount is based on the eligible household\'s last 30-days income, amount of utility bills, and type of heating source.','741','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(898,31622,'Rent Payment Assistance','Champaign County Rental Assistance Program','7408','COVID19:\r\nThose in need should call Champaign County Regional Planning Commission at 877-548-4205, 10am - 6pm Monday through Friday. They will screen for eligibility and connect individuals with Champaign Township or Cunningham Township for a one-time assistance payment. Help is open to all Champaign County residents.\r\nEligibility Requirements:\r\n- Lives in Champaign County;\r\n- No renters who have subsidized housing voucher;\r\n- Renters with earned income prior to Stay at Home order;\r\n- Renters who do not qualify for unemployment insurance;\r\n- Income up to 250% federal poverty level.\r\n\r\n-------------------------------------\r\nOriginal text pre-covid:\r\nThe Champaign County Rent Assistance Program is a partnership between Champaign County Regional Planning Commission, City of Champaign Township, and Cunningham Township. The Program may be able to provide up to $600 in rent assistance for households that have experienced a temporary financial hardship resulting in them being at risk for eviction.','','http://www.ccrpc.org','homeless-services@ccrpc.org','',NULL,'By phone, e-mail, or walk-in; call for walk-in location.','- Applicant must reside within Champaign County.\r\n- Applicant must have a verifiable source of recurring income.\r\n- Applicant\'s rent can NOT exceed half of their household monthly gross income, unless they receive a fixed income as their only source.\r\n- Applicant must have a verifiable, temporary, cause of hardship beyond their control.\r\n- Applicant household income must be at or under 200% of the federal poverty guideline.\r\n- Applicant has not received rent assistance from a program partner (Champaign County Regional Planning Commission, City of Champaign Township, nor Cunningham Township) in the past 2 years.','','- Completed application and pre-screener.\r\n- Photo ID for all adults in household.\r\n- Social Security Cards for head of household, or VISA/Immigration # for primary applicant.\r\n- Proof of all income for the last 30 days.\r\n- Current signed lease if facing eviction.\r\n- Proof of hardship, such as receipt for medical costs, homelessness verification, 5-day notice, etc.\r\n- Copy of eviction notice if facing eviction.\r\n- Documentation of how remainder will be paid.','','742','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(899,31655,'Utility Assistance * COVID-19','LIHEAP','7408','COVID-19:\r\nAll LIHEAP programs are extended until June 30th 2020 or until funding is exhausted.  ______________________________________________________________________________________________________\r\n\r\nThe Low Income Home Energy Assistance Program (LIHEAP) provides energy assistance for eligible low income families in which a benefit is paid directly to the utility companies on behalf of eligible households, or directly to renters if the utility costs are included in their rent. \r\n\r\nSome LIHEAP applicants may qualify for the Percentage of Income Payment Plan (PIPP), where an eligible client pays a percentage of their income, receives a monthly benefit towards their utility bill, and receives a reduction in overdue payments for every on-time payment they make by the bill due date.\r\n\r\nIf the homeowner\'s furnace is not working or is dangerous or emitting carbon monoxide into the household, LIHEAP may be able to provide a furnace repair or replacement.\r\n\r\nOther assistance, such as weatherization and energy-related minor home repairs, may be provided. A household may also be able to receive assistance with the cost of gas for a propane tank depending on where they live and which vendor they use.','','http://www.ccrpc.org','','',NULL,'Call for qualifications, application procedures, current program schedule, and participating sites information.','October 1st - Seniors (60+) and people on disability.\r\nNovember 1st - Families with children 5 and under and disconnected households.\r\nDecember 1st - All other income eligible households.','','Need proof of household gross income for last 30 days, current energy bill, Social Security number for everyone in household, TANF medical card for anyone receiving benefits, and either proof of home ownership and insurance or rental agreement or receipt that shows the amount of rent.','Up to 150% of Federal Poverty Level. The benefit amount is based on the eligible household\'s last 30-days income, amount of utility bills, and type of heating source.','743','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(900,21236,'Transitional Housing/Shelter * Homeless Families','C-U at Home Transitional Housing','7416','- Recovery House: Group home for single homeless men coming out of addiction treatment seeking a supportive group living environment. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months. \r\n- Family House: Transitional housing for a single parent or married couple with 1 or 2 children. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months.\r\n- Women\'s House: Transitional housing for single women. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months.','','https://www.cuathome.us/transitional-housing/','john@cuathome.us',NULL,'929094559121639','Phone for survey appointment (217) 888-0329','Age 18 or older.',NULL,'Photo id','Champaign County','1307452340129409,','','','','1341604895531701','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:24:07'),(901,14199,'General Assistance','General Assistance','7418','General Assistance provides Urbana Residents up to $300 monthly support for extremely low-income residents while they look for work, retrain, apply for disability, or seek TANF. Case management support available to families, if desired. General Assistance participants who are homeless receive intensive housing advocacy to access all available subsidized housing options. Live outside of the City of Urbana? Apply to your local township.','7419','https://www.cunninghamtownship.org','info@cunninghamtownship.org',NULL,'','By phone, website, email.','Any township resident (18 years or older). Ineligible for any other monetary forms of assistance.','None.','Application,  photo ID,  proof of current address or homelessness, proof of any income, SSA status, LINK card, Medicaid card. We can help obtain these.','City of Urbana only.','745,','','','1095144297357927','14020','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2020-12-19 06:02:57'),(902,30602,'Rent Payment Assistance','Rental Assistance','7418','COVID-19:\r\nDue to the COVID-19 pandemic, our office is currently closed to the public.  However, applications and all documents can be submitted in the mail slot in our office front door or emailed to info@cunninghamtownship.org at any time.  Applications will not be considered complete until all documents are submitted.  Those with questions can email our office, call 217-384-4144, or text 309-583-8816.  \r\n_______________________________________________________________________________________________________\r\n\r\nRental assistance supports low-income Urbana residents who are in the life-threatening circumstance of living without shelter or facing eviction with no options. Homeless Assistance can keep people from being evicted OR assist homeless residents with sufficient income to get into permanent housing by providing a grant to cover the deposit and/or first month\'s rent. Township can provide a up to $600 in payment to a landlord for permanent housing. This is a one-time assistance available to a household once in a 2-year period.\r\n\r\nFind out more and find an application online.','7419,1330522697621870','https://www.toi.org/township/champaign-county-cunningham-township/housing-assistance/','info@cunninghamtownship.org',NULL,'','By phone, website, email.','1. Applicant must reside within Champaign County.2. Applicant must have a verifiable source of recurring income.3. Applicant’s rent can NOT exceed half of their household monthly gross income, unless they receive a fixedincome as their only source.4. Applicant must have a verifiable, temporary, cause of hardship beyond their control.5. Applicant household income must be at or under 200% of the federal poverty guideline.6. Applicant has not received rent assistance from a program partner (Champaign County Regional PlanningCommission, City of Champaign Township, nor Cunningham Township) in the past 2 years.7. The program has a maximum assistance amount of $600 and requires proof of payment for any remainingbalance. Funds will not be immediately available, as applications must be reviewed and verified.',NULL,'Application, photo ID, proof of income, proof of address, proof of voucher (if applicable).','Applicants income must not exceed 200% of the federal poverty guideline.  Applicants must have earned gross income equal or greater than twice their monthly rent.  Applicants on a fixed income (SSI/SSDI/pension) must have a rent that is no more than 70% of their income.','745,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-28 09:45:44'),(903,14208,'Food Pantries','Emergency Food Pantry','7420','Emergency food pantry is available. Clients can visit the pantry once per month.','','','','','832990803111047','Walk-in.','','','Photo ID and proof of residency.','185% of the federal poverty level.','747','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(907,22474,'Free School Supplies','Back to School Day','7420','Back to School Day is an event that provides free school supplies for children grades K-8 in Rantoul. The event takes place at Bethany Park Christian Church, 1401 E. Grove Avenue, Rantoul.','','','','',NULL,'A referral form is required and can be picked up at the Community Service Center office.','','','Photo ID or proof of residency, such as utility bill for adults, or Medicaid card or school registration info for youth.','','748','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(908,14214,'Family Maintenance/Reunification','','7422','Provides programs to families involved in the child welfare system or in crisis that need encouragement while they change their lives. Services include:\r\n- Advocacy: Informing and assisting you in speaking for yourself or speaking on your behalf. Providing support and assistance in maneuvering through the various systems you may be involved with.\r\n- Mentoring: Assisting with development of short- and long-term life goals.\r\n- Mediation: Intervenes as a neutral party on your behalf to work through conflict that arises with service providers.\r\n- Counseling: Individual and family counseling.\r\n- Workshops: Hosts, sponsors, or co-sponsors workshops and groups that address parenting skills, life skills, working with child welfare and social service agencies in the community, and domestic violence.\r\n- Outreach: Provides services to families from the community and works in collaboration with other service providers.\r\n- 3rd Party Visits: Coordinate and supervise visits with clients whose children are in placement.\r\n- \"The Family Table\" Group Sessions: Group sessions address parenting skills, domestic violence, relationships, life skills, budgeting, short- and long-term goals.\r\n- Anger Management Group for teens to help them deal with anger issues and the consequences.','','','','',NULL,'DCFS clients and clients from other social service agencies should contact their case worker to request a referral to Family Advocacy in Champaign County. Community members can contact FACC directly to schedule an appointment.','','','','','749','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(909,31476,'General Medical Care','','7436','Medical services provided include:\r\n- Physical examinations (school and sport physicals).\r\n- Immunizations.\r\n- Treatment for acute and chronic medical conditions (asthma, diabetes, ADHD, etc.).\r\n- Reproductive health services.\r\n- Treatment for sports related injuries and sub-specialty referrals.\r\n- Individual and family dietary management.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','750','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(910,31477,'Family Counseling','','7436','Offers individual and family counseling, school-based counseling, case management, resources, and referrals.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','751','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(911,31478,'General Counseling Services','','7436','Offers individual and family counseling, school-based counseling, case management, resources, and referrals.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','752','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(912,14287,'Y Facilities','','7438','The Stephens Family YMCA gives youth and families in the community an opportunity to participate in programs such as:\r\n- Youth Sports.\r\n- Recreational Gymnastics.\r\n- Summer Camps.\r\n- Swimming Lessons.\r\n- After School programs.\r\n- Group exercise classes (land and water).\r\n\r\nThe programs are based not only on YMCA\'s mission but the four core values of caring, honesty, respect, and responsibility. The Stephens Family YMCA is also a facility for those with disabilities to have a place to participate in recreational programs and activities and is fully accessible.','','http://www.sf-ymca.net','','',NULL,'Walk-in.','','','Proof of income needed for those seeking financial assistance.','','753','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(913,14289,'Recreational Activities/Sports * Disabilities and Health Conditions','Larkin\'s Place','7438','The Stephens Family YMCA has created programming designed to support children at all developmental levels and their families. Larkin’s Place programming is for all who wish to achieve therapeutic goals, developmental goals, improve skills, and create social networks. Larkin’s Place programs seek to bring together typically developing children and those with disabilities to play and learn, create memories, skills, and bonds of friendship that will cross all barriers and last a lifetime.','','http://www.sf-ymca.net','','','968511154801619','Walk-in.','','','Proof of income needed for those seeking financial assistance.','','754','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(914,14290,'Extended Child Care','','7438','The Stephens Family YMCA gives youth and families in the community an opportunity to participate in programs such as:\r\n- Youth Sports.\r\n- Recreational Gymnastics.\r\n- Summer Camps.\r\n- Swimming Lessons.\r\n- After School programs.\r\n- Group exercise classes (land and water).\r\n\r\nThe programs are based not only on YMCA\'s mission but the four core values of caring, honesty, respect, and responsibility. The Stephens Family YMCA is also a facility for those with disabilities to have a place to participate in recreational programs and activities and is fully accessible.','','http://www.sf-ymca.net','','',NULL,'Walk-in.','','','Proof of income needed for those seeking financial assistance.','','755','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(915,14291,'Day Camps','','7438','The Stephens Family YMCA gives youth and families in the community an opportunity to participate in programs such as:\r\n- Youth Sports.\r\n- Recreational Gymnastics.\r\n- Summer Camps.\r\n- Swimming Lessons.\r\n- After School programs.\r\n- Group exercise classes (land and water).\r\n\r\nThe programs are based not only on YMCA\'s mission but the four core values of caring, honesty, respect, and responsibility. The Stephens Family YMCA is also a facility for those with disabilities to have a place to participate in recreational programs and activities and is fully accessible.','','http://www.sf-ymca.net','','',NULL,'Walk-in.','','','Proof of income needed for those seeking financial assistance.','','756','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(916,14292,'Food Pantries','','7440','Provides a week\'s amount of groceries during evening hours so that people who work during the day can access emergency food.','','','','','832990803111047','Walk-in.','','','Photo ID.','185% of the federal poverty level.','757','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(917,20036,'Food Pantries','','7440','Provides about a week\'s worth of food.','','','','','832990803111047','Walk-in.','Open to general public who meet income guidelines.','','Photo ID.','185% of federal poverty level.','758','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(918,31801,'Talklines/Warmlines * COVID-19','','7442','Now offering COVID-19 nasal swab tests.','','','','',NULL,'Phone for appointment.','Person must be having symptoms, be an established patient or willing to establish care. Additional criteria may apply and will be screened prior to scheduling the appointment.','','','','759','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(919,14299,'Dental Care','SmileHealthy','7442','The Dental Center is an affordable dental home for children and adults. Dental Center services include:\r\n- Extractions.\r\n- Restorations.\r\n- Cleanings.\r\n- Full Exams.\r\n- Dental Health Education.\r\n- Limited Urgent Care.','','','','',NULL,'Call for appointment.','','','Proof of income.','No maximum income limit. Discounts for up to 200% of the federal poverty level.','760','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(920,14300,'Dental Care * Children','SmileHealthy Mobile Clinic','7442','The SmileHealthy Mobile and Head Start Dental Clinic programs travel to dozens of sites around Champaign County to deliver dental care to the underserved in the community.','','','','',NULL,'Call for more information about clinic location schedule.','All children are eligible in Champaign County living outside of Champaign-Urbana city limits. Adults with Medicaid or uninsured only are served by the mobile clinic. For the Head Start program, children enrolled and their families are all eligible for the clinic.','','Proof of income.','','761','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(921,14301,'Dental Care','SmileHealthy Mobile Clinic','7442','The SmileHealthy Mobile and Head Start Dental Clinic programs travel to dozens of sites around Champaign County to deliver dental care to the underserved in the community.','','','','',NULL,'Call for more information about clinic location schedule.','All children are eligible in Champaign County living outside of Champaign-Urbana city limits. Adults with Medicaid or uninsured only are served by the mobile clinic. For the Head Start program, children enrolled and their families are all eligible for the clinic.','','Proof of income.','','762','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(922,22794,'Community Clinics','','7442','Frances Nelson Health Center is a primary care medical and mental health clinic dedicated to providing affordable and accessible high quality health care services to the medically underserved of greater Champaign County. Services include:\r\n- Prenatal care.\r\n- Well-child clinics.\r\n- Counseling.\r\n- Case management.\r\n- Dermatology.\r\n- Lab services.\r\n- Well-woman care.\r\n- Breast and Cervical Cancer screening.\r\n- Health education services.\r\n- Medication assistance program.\r\n- Mental health counseling and psychiatry.','','','','',NULL,'Call for appointment to establish care. Walk-in clinic also available.','','','Photo ID, proof of income, and insurance cards.','Discounts for up to 200% of the federal poverty level.  Full fee above 200% of federal poverty level.','763','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(923,22795,'General Medical Care','','7442','Frances Nelson Health Center is a primary care medical and mental health clinic dedicated to providing affordable and accessible high quality health care services to the medically underserved of greater Champaign County. Services include:\r\n- Prenatal care.\r\n- Well-child clinics.\r\n- Counseling.\r\n- Case management.\r\n- Dermatology.\r\n- Lab services.\r\n- Well-woman care.\r\n- Breast and Cervical Cancer screening.\r\n- Health education services.\r\n- Medication assistance program.\r\n- Mental health counseling and psychiatry.','','','','',NULL,'Call for appointment to establish care. Walk-in clinic also available.','','','Photo ID, proof of income, and insurance cards.','Discounts for up to 200% of the federal poverty level.  Full fee above 200% of federal poverty level.','764','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(924,14636,'Food Pantries','Vineyard Emergency Food Pantry','7447','Emergency food pantry service. Clients get a bag of non-perishable food and 2 choice items, bread, produce, and at least one frozen or canned meat item. Information on other pantries and places to get food will also be available. Clients can visit the pantry once per month. No ID or proof-of-income is required.','','http://urbana.thevineyardchurch.us','','','832990803111047','Walk-in. Clients will need to fill out a short form.','','','No documents required.','','765','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(925,14307,'Food Pantries','Stone Creek Food Pantry','7449','Food pantry provides fresh fruit, vegetables, bread, entrees, cereal, pasta, beans, soups, and snacks as well as some non-food necessities such as toothpaste, diapers, soap, etc. when available. Supply is dependent on what is donated to the pantry.','','','','','832990803111047','Walk-in.','Anyone in need.','','Photo ID.','','766','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(926,18685,'Personal/Grooming Supplies','Stone Creek Food Pantry','7449','Food pantry provides fresh fruit, vegetables, bread, entrees, cereal, pasta, beans, soups, and snacks as well as some non-food necessities such as toothpaste, diapers, soap, etc. when available. Supply is dependent on what is donated to the pantry.','','','','',NULL,'Walk-in.','Anyone in need.','','Photo ID.','','767','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(927,14311,'Boys/Girls Clubs','After School Program, Teen Program, and Summer Camp Program','7452','Offers a variety of recreational, educational, cultural, and social youth development programs for youth (6-18 years of age). Leadership and citizenship development are all a part of the club\'s objectives for participating boys and girls. \r\n\r\nPrograms site locations include: \r\n- 201 East Park Street, Champaign.  \r\n- Rantoul Pleasant Acres Elementary School (Also Serves Northview Elementary). \r\n- J.W. Eater Jr. High, Rantoul.','','','','',NULL,'Must fill out an application available online.','After School Program and Summer Camp: Ages 6-18.\r\nTeen Night and Teen Summer Program: Ages 12-18.','','','','768','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(928,22988,'Holiday Programs * Nonprofit Retail Stores','Children\'s Holiday Shop','7457','Children can do their holiday shopping for everyone on their list. All gifts are priced between $2 and $10. Children shop with the help of a community volunteer so their gifts are a surprise for family and friends. \r\n\r\nWhen the children are done picking out their gifts, they pay for them and wrap them in festively decorated bags. As they leave the shop, children are always full of pride with the items they have picked out on their own and an understanding that it is just as great to give as it is to receive.','','','','',NULL,'','','','','','769','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(929,1506,'Temporary Financial Assistance * Veterans','','746','Provides temporary financial assistance for basic needs (i.e., rent, utilities, food, health expenses, etc.) to veterans who have at least one minor child (17 years or younger) living in their home. Children 18-20 years old will also be considered if a current disability requires special schooling or indefinite in-home care, or they are enrolled in an approved high school and unmarried.','','http://www.illegion.org','','','1077790582995406','Call for more information or find the application form online.','Must be an honorably discharged veteran (provide DD214) and an American Legion member.','','','','770','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(930,14335,'Sweat Equity Programs','','7462','Champaign County Habitat for Humanity and ReStore is a ministry that provides the opportunity for people to purchase and own simple, quality, affordable homes. They build and sell simple, quality, affordable houses using an affordable mortgage program through volunteer labor and tax-deductible donations of money, land, and materials.','','','','',NULL,'By phone, walk-in, or appointment.','Families are selected based on their level of need, willingness to partner, and ability to repay the mortgage.','','','80% of area median income.','771','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(931,14337,'Household Goods * Discount Programs','Habitat ReStore','7462','The Habitat ReStore sells gently used furniture, appliances, electronics, household items, and home improvement supplies at low prices. The ReStore also assures that over 530 tons of materials never make it to a landfill each year. ReStore has everything from dishes to doors, couches to cookware, and antiques to appliances. All proceeds support Habitat of Champaign County.','','','','','911225335803318','','','','','','772','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(932,14338,'Household Goods Donation Programs','Habitat ReStore','7462','The Habitat ReStore sells gently used furniture, appliances, electronics, household items, and home improvement supplies at low prices. The ReStore also assures that over 530 tons of materials never make it to a landfill each year. ReStore has everything from dishes to doors, couches to cookware, and antiques to appliances. All proceeds support Habitat of Champaign County.','','','','','911225335803318','','','','','','773','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(933,19615,'Recycling','Habitat ReStore','7462','The Habitat ReStore sells gently used furniture, appliances, electronics, household items, and home improvement supplies at low prices. The ReStore also assures that over 530 tons of materials never make it to a landfill each year. ReStore has everything from dishes to doors, couches to cookware, and antiques to appliances. All proceeds support Habitat of Champaign County.','','','','',NULL,'','','','','','774','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(934,31109,'Housing Counseling','Home Buying 101','7462','Offers a free, six-part education program that provides an unbiased comprehensive overview of the home purchase process to help homebuyers make smart, informed decisions. Participants receive a detailed reference manual. A certificate of accomplishment will be awarded after the completion of a post workshop individual counseling session.','','','','','929094559121639','Call to register for workshops.','','','','','775','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(935,14349,'Mental Health Information/Education','','7464','Free 12-week class taught by trained NAMI members for family members and friends of those with mental illness. The Family to Family curriculum focuses on schizophrenia, bipolar disorder (manic depression), clinical depression, panic disorder and obsessive compulsive disorder (OCD). The course discusses the clinical treatment of these illnesses and teaches the knowledge and skills that family members need to cope more effectively. This is targeted for those 18 or older with mental illness. Classes are offered twice a year. \r\n\r\nNAMI Champaign County also provides monthly educational presentations and can provide an in-service for teachers and staff to help identify the symptoms of mental illness in children.','','','','','968511154801619','By phone.','','','','','776','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(936,14351,'Support Groups * Families/Friends of Mentally Ill','','7464','NAMI Family Support Groups are free, confidential, and safe groups of families helping other families who live with mental health challenges by utilizing their collective lived experiences and learned group wisdom.\n\n','','','','','637158405241810','Call or visit the website for more information.','','','','','777','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(937,14352,'Support Groups * Mental Illness/Emotional Disabilities','','7464','NAMI Family Support Groups are free, confidential, and safe groups of families helping other families who live with mental health challenges by utilizing their collective lived experiences and learned group wisdom.\n\n','','','','','637158405241810','Call or visit the website for more information.','','','','','778','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(938,15866,'Extreme Weather Shelters','','7466','The Salvation Army Red Shield Center on Market Street in Champaign serves as a daytime warming center M-F, 9:00 am - 4:00 pm.\r\nWhen requested by Champaign County Emergency Management Agency, a daytime warming center will be open Sat and Sun, 9:00 am - 4:00 pm, located at 502 N. Prospect.','','','','',NULL,'By phone, walk-in.','','','','','779','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(939,19277,'Thrift Shops','','7466','Salvation Army\'s Thrift Shop in Champaign is located at 2212 N. Market Street, 217-373-7825.','','','','',NULL,'','','','','','780','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(940,19289,'Holiday Programs','Toys for Tots','7466','Sign-up for holiday assistance starts the first of November each year. Toys for Tots, sponsored by Marine Corps Reserve, utilizes the local Salvation Army of Champaign County to distribute ALL of the toys that are collected throughout the year. Their program screens each applicant and checks with other organizations in the community to maximize the number of families helped during the holiday season.','','','','',NULL,'Walk-in. Please do NOT bring children to holiday sign ups.','Families with children 12 and younger.','','To apply for Holiday Assistance the following items must be provided:\r\n1. Picture ID - ID must show current address for ALL adults (18 & older) in household (must be a Champaign County resident).\r\n2. Medical/insurance cards listing children - If a medical card is not available, verification is needed for each child showing that child is at the current address/verifying guardianship or something from school, doctor\'s office, etc.\r\n3. Foster parents - must show placement agreement to prove residency of the child.\r\n4. Verification of income - 1) current check stubs for 30 days 2) SSI/SSDI award letters or proof of public aid listing cash assistance 3) unemployment verification 4) if not receiving cash assistance or unable to prove employment, you will need proof of what income is used to meet your monthly expenses.','','781','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(941,22423,'Case/Care Management * Families','Pathway of Hope','7466','Pathway of Hope is an approach to providing targeted services to families with a desire to take action to break the cycle of crisis and enable a path out of intergenerational poverty. It is rooted in a case management approach, focusing on client needs. The Salvation Army utilizes internal resources and community collaboration to align to the goals of each client served. This program does not provide financial assistance but will supply resources and community connections to assist families.','','','','',NULL,'Phone for appointment.','Families that have at least one child under the age of 18 and are ready to take action achieving personal goals. This program will also assist families who have children in DCFS care to help return them home (depending on case status).','','Photo ID, proof of residency, medical card or birth certificate of child(ren).','','782','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(942,22986,'Food Pantries','Canteen Run','7466','Canteen Run is a mobile food pantry that stops throughout downtown Champaign/Urbana with the sole purpose of offering food, drinks, blankets, shirts and underwear, and human kindness to those on the streets.','','http://www.cucanteenrun.org','cucanteenrun@gmail.com','','832990803111047','Scheduled stops are at these locations: Illinois Terminal, Westside Park, Catholic Worker House, Campus, and Urbana Library. May also phone Centralized Intake, 217-819-4117, for more information.','Anyone needing assistance.','','No documents needed.','No income guidelines.','783','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(943,23304,'At Risk/Homeless Housing Related Assistance Programs * Veterans','Supportive Services for Veteran Families (SSVF)','7466','Provides financial and support services to Veteran Families. The program is a housing stability-focused service delivery program that serves veteran families that are homeless or imminently at risk of being homeless. The goal is to stabilize these families in housing, while providing on-going support as needed to sustain independent living. Services may include:\r\n- Rental and utility deposits.\r\n- Limited rental and utility assistance.\r\n- Limited moving costs and emergency supplies.\r\n- Case management services.\r\n- Transportation assistance.\r\n- Information and referrals to community resources.\r\n- Assistance in obtaining VA benefits.\r\n- Assistance in obtaining and securing other public benefits.\r\n- Assistance in securing permanent housing.','','','','','929094559121639','Call the SSVF line at 217-278-9897.','Must be a veteran or spouse of a veteran. Housing status must be in one of the following categories:\r\n- Reside in housing and lack the ability to pay all bills.\r\n- Are currently homeless.\r\n- Has left permanent housing within the past 90 days to seek other housing that better meets the family\'s needs or preferences.','','Photo ID, Social Security card, proof of income, proof of residency, and DD214.','50% of area median income.','784','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(944,25049,'Rent Payment Assistance','Rent Assistance for Champaign County','7466','Rent payment assistance for past-due rent or rent due within 10 days.','','','','',NULL,'By phone for appointment.','- Champaign County resident.\r\n- Name must be on lease & be responsible for rent.\r\n- Behind on rent or due within 10 days.\r\n- Client has exhausted all other resources\r\n- Payment must guarantee an additional 30 days of housing.\r\n- Must have income to support rent after assistance.','','Proof of income, current lease, Photo ID, application.','','785','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(945,29718,'Holiday Programs * Thanksgiving Meals','Community Thanksgiving Dinner','7466','FREE Thanksgiving Dinner for everyone in the community sponsored by Lone Star Lodge #18, F&AM-PHA and Salvation Army:\r\n\r\nNov 22, 2018, 11:00 am - 2:00 pm, at the Salvation Army Center, 2212 N. Market Street, Champaign 61822.','','','','',NULL,'','','','','','786','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(946,31880,'Mobile Markets','Canteen Run','7466','Canteen Run is a mobile food pantry that stops throughout downtown Champaign/Urbana with the sole purpose of offering food, drinks, blankets, shirts and underwear, and human kindness to those on the streets.','','http://www.cucanteenrun.org','cucanteenrun@gmail.com','',NULL,'Scheduled stops are at these locations: Illinois Terminal, Westside Park, Catholic Worker House, Campus, and Urbana Library. May also phone Centralized Intake, 217-819-4117, for more information.','Anyone needing assistance.','','No documents needed.','No income guidelines.','787','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(947,14384,'Disease/Disability Information * Autism Spectrum Disorder','The Autism Program at University of Illinois','7468','TAP is a state-wide network of resources for Autism Spectrum Disorders in the State of Illinois. The Program\'s mission is to foster development of community networks that promote best practice in the diagnosis, treatment, and education of all children with Autism Spectrum Disorders. Locally, the site offers consultation, a resource room, new diagnosis orientation for families, social skill programs, play groups, training and technical assistance, and internship opportunities for students. The Resource Room has many books and DVDs that can be checked out but also has many free visual supports for use with people on the Autism Spectrum. TAP can also create customized visual supports such as schedules, social stories, and learning aids for free.','','','','',NULL,'Walk-in for Resource Room, otherwise by appointment.','','','','','788','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(948,14487,'Sheriff','','7511','The Champaign County Sheriff’s Office has three separate uniformed and sworn divisions - Law Enforcement, Court Security, and Corrections - each of which have different primary job duties.\r\n\r\nThe Champaign County Correction Center (jail) is located in the lower level of main Sheriff\'s Office. The Satellite Jail is located at 502 S. Lierman Street in Urbana.','','','','',NULL,'','','','','','789','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(949,16281,'County Correctional Facilities','','7511','The Champaign County Sheriff’s Office has three separate uniformed and sworn divisions - Law Enforcement, Court Security, and Corrections - each of which have different primary job duties.\r\n\r\nThe Champaign County Correction Center (jail) is located in the lower level of main Sheriff\'s Office. The Satellite Jail is located at 502 S. Lierman Street in Urbana.','','','','',NULL,'','','','','','790','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(950,16291,'County Correctional Facilities','','7511','The Champaign County Sheriff’s Office has three separate uniformed and sworn divisions - Law Enforcement, Court Security, and Corrections - each of which have different primary job duties.\r\n\r\nThe Champaign County Correction Center (jail) is located in the lower level of main Sheriff\'s Office. The Satellite Jail is located at 502 S. Lierman Street in Urbana.','','','','',NULL,'','','','','','791','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(952,14516,'Home Rehabilitation Programs','Emergency Grant Program','7537','Available to low income homeowners for repair of health or safety items. Emergency grant funds are available only if the repair is immediately needed to mitigate a hazardous condition which poses a threat to the health and safety of the occupant. This may include repair or replacement of defective mechanical, electrical or plumbing systems, building components, and surfaces. Maximum funding through the Emergency Grant Program is $8,000 per household.','','','','',NULL,'Must fill out an application.','- Must own and have lived in the home to be repaired for a minimum of one year. Trust Deeds and Contract Purchases are allowed.\r\n- Home must be within Urbana city limits.\r\n- Must have property insurance.\r\n- Household income may not exceed 50% of area median family income.','','','','792','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(953,14517,'Home Maintenance and Minor Repair Services * Older Adults','Senior Repair Service','7537','Provides minor home maintenance repairs to help seniors and persons with a disability maintain their property. Eligible households may receive up to $1,000 of repairs from a non-repayable grant. Typical projects funded through Senior Repair Service include repairs to furnaces, plumbing, porches, steps, ceilings, walls, and floors.','','','','',NULL,'Must fill out an application.','- Must own and live in the home to be repaired for a minimum of one year.\r\n- Property must be within Urbana city limits.\r\n- Must be 62 years of age or older. If you are a person with a disability, you may be any age. A person with a disability is someone who either receives disability payments or has a pending application for disability payments.\r\n- Household income may not exceed 50% of area median income.','','','','793','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(954,14518,'Home Rehabilitation Programs','Access Grant Program','7537','Helps eliminate physical barriers that keep a person with a disability from using his or her home. Eligible households may receive up to $5,000 of home improvements from a non-repayable grant. Typical projects funded through the Access Grant Program include ramp installation, bathroom modifications, and door widening. Access grants may be used to renovate single-family homes and duplex units. Complexes with five or more units are not eligible to participate.','','','','',NULL,'Must fill out an application.','Applicant may be a homeowner, renter, or trust deed recipient. The property must be within Urbana city limits.','','','','794','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(955,14540,'Building Condemnation/Demolition','Secondary Structure Program','7537','Available to low-income homeowners to demolish and remove unsafe garages, carports, sheds, and fences. For eligible households, the City of Urbana will contract with demolition contractors and provide a grant up to $5,000 on behalf of the homeowner.','','','','',NULL,'Must fill out an application.','- You must own and have lived in your home for a minimum of one year. \r\n- Your property must be single-family owner-occupied and must be within the CD Target Area. \r\n- The secondary structure must be structurally unsound and classified as “substandard, severely dilapidated.”','','','','795','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(956,31891,'Ramp Construction Services','Access Grant Program','7537','Helps eliminate physical barriers that keep a person with a disability from using his or her home. Eligible households may receive up to $5,000 of home improvements from a non-repayable grant. Typical projects funded through the Access Grant Program include ramp installation, bathroom modifications, and door widening. Access grants may be used to renovate single-family homes and duplex units. Complexes with five or more units are not eligible to participate.','','','','',NULL,'Must fill out an application.','Applicant may be a homeowner, renter, or trust deed recipient. The property must be within Urbana city limits.','','','','796','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(957,31892,'Bathroom Modification Services','Access Grant Program','7537','Helps eliminate physical barriers that keep a person with a disability from using his or her home. Eligible households may receive up to $5,000 of home improvements from a non-repayable grant. Typical projects funded through the Access Grant Program include ramp installation, bathroom modifications, and door widening. Access grants may be used to renovate single-family homes and duplex units. Complexes with five or more units are not eligible to participate.','','','','',NULL,'Must fill out an application.','Applicant may be a homeowner, renter, or trust deed recipient. The property must be within Urbana city limits.','','','','797','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(958,14587,'City Government Departments/Offices','','7551','The city\'s website can be helpful in locating and utilizing city services.','','http://www.village.rantoul.il.us','','',NULL,'','','','','','798','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(959,14588,'City Government Departments/Offices','','7553','The city\'s website can be helpful in locating and utilizing city services.','','http://www.mahomet.govoffice.com','','',NULL,'','','','','','799','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(960,14590,'County Government Departments/Offices','','7555','The county\'s website can be helpful in locating and utilizing county services.','','http://www.co.champaign.il.us','','',NULL,'','','','','','800','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(961,14591,'911 Services','9-1-1 Emergency Line','7559','METCAD answers emergency 9-1-1 calls for all of Champaign County. It provides direct dispatch service for law enforcement and fire agencies throughout Champaign County.','',NULL,NULL,NULL,'878986697513222',NULL,NULL,NULL,NULL,NULL,'801,','','','',NULL,'','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2020-12-17 11:34:02'),(962,14592,'Municipal Police','','7561','Police department serving the residents of Rantoul.','','','','',NULL,'','','','','','802','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(963,14593,'Municipal Police','','7563','Police department serving the residents of Mahomet.','','','','',NULL,'','','','','','803','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(964,14626,'General Counseling Services','','7573','Offers a range of services including individual counseling, domestic violence groups, groups for offenders, parenting services, custody evaluations, risk assessments, and adolescent services.','','','','',NULL,'By phone for appointment.','','','','','804','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(965,15137,'Domestic Violence Intervention Programs','CHANGE','7573','The State of Illinois approved, 26-week program is designed to confront the dynamics of domestic abuse. Perpetrators of abusive behavior meet in groups that are available throughout the week.','','','','',NULL,'By phone for appointment.','','','Proof of income.','','805','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(966,15139,'Spouse/Intimate Partner Abuse Counseling','Options','7573','A personal growth-oriented 24-week program offered to women whose lives have been impacted by domestic abuse. Group members learn about the nature of abuse as well as increase self-awareness and problem solving skills.','','','','',NULL,'By phone for appointment.','Experience, current or past, with abuse within a relationship.','','','','806','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(967,31920,'Automotive Repair and Maintenance','Auto Repair Assistance','7408','Provides eligible individuals assistance for repairs to their vehicle to obtain and/or maintain a work opportunity; also includes full time students to help maintain their ability to pursue education to support their career pathway.','','','rpccares@ccrpc.org','',NULL,'By email. Requests for assistance should be directed to: rpccares@ccrpc.org','','','Photo ID, proof of income, proof of residency, Social Security card. Applicant must also provide:\r\n- Valid driver\'s license.\r\n- Current/active vehicle registration.\r\n- Active insurance/insurance card.\r\n- NOTE: Vehicle must be year 2000 or newer.','At or below 200% of the Federal Poverty Level.','807','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(968,14165,'Comprehensive Job Assistance Centers','Workforce Development Services','7408','CCRPC operates the Local Workforce Area #17, which provides job search and placement assistance as well as financial assistance for low-income and dislocated workers for training to improve income and skills to obtain work.','','','','','970915508638448','By phone, walk-in, or appointment.','Depends on the program.','','Photo ID, birth certificate, proof of income, proof of residency, Social Security card, proof of education and/or unemployment, and basic skills test scores.','','808','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(969,14217,'Juvenile Diversion','Youth Assessment Center / Court Diversion Services','7408','The Youth Assessment Center focuses on diverting juvenile offenders or high risk youth from involvement in juvenile courts. This is done by taking referrals of youth involved in delinquent activity and providing an alternative to prosecution through case management. Case Managers screen juvenile offenders referred to the program to identify issues that may have influenced the offense. They link these youth to services to best address presenting issues.','','','','',NULL,'By phone, walk-in, or appointment.','Any youth who has committed a violation of the Illinois criminal code, school disciplinary code, or local ordinance within Champaign County is eligible for Court Diversion Services.','','','','809','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(970,14160,'Public Libraries','','7410','Champaign Public Library services include:\r\n- Books, eBooks music, movies, audiobooks, and magazines.\r\n- Free public computers with help available.\r\n- Meeting and study rooms.\r\n- Assistance in finding information on any subject by email, text message, phone, or in person.\r\n- Free educational and entertaining events for all ages.\r\n- Large print books, downloadable audiobooks, and a large screen magnifier for low vision patrons.\r\n- Free home delivery for Champaign residents who cannot visit the library for health reasons.','','','','',NULL,'','','','','','810','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(971,14161,'Public Libraries','','7410','Champaign Public Library services include:\r\n- Books, eBooks music, movies, audiobooks, and magazines.\r\n- Free public computers with help available.\r\n- Meeting and study rooms.\r\n- Assistance in finding information on any subject by email, text message, phone, or in person.\r\n- Free educational and entertaining events for all ages.\r\n- Large print books, downloadable audiobooks, and a large screen magnifier for low vision patrons.\r\n- Free home delivery for Champaign residents who cannot visit the library for health reasons.','','','','',NULL,'','','','','','811','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(972,15113,'Adult Day Programs','Circle of Friends Adult Day Center','7414','The Circle of Friends Adult Day Center is for adults over the age of 18 who need: \r\n- Socialization opportunities.\r\n- Assistance with daily living tasks.\r\n- Supervision.\r\n- Medical monitoring.\r\n- Memory treatment.','','','','','789038541797078','By phone or e-mail.','Must be age 18 years or older.','','','','812','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(973,14196,'Recovery Homes/Halfway Houses','C-U at Home Transitional Housing','7416','- Recovery House: Group home for single homeless men coming out of addiction treatment seeking a supportive group living environment. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months. \r\n- Family House: Transitional housing for a single parent or married couple with 1 or 2 children. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months.\r\n- Women\'s House: Transitional housing for single women. Must be employed/seeking employment. Can stay in transitional housing for 6-12 months.','','https://www.cuathome.us/transitional-housing/','steven@cuathome.us',NULL,'','Phone to make appointment for intake survey 217-888-0329','Age 18 or older.',NULL,'photo id','Champaign County','1307452340129409,','','','','1341604895531700','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:21:15'),(974,20056,'Homeless Drop In Centers','Phoenix Daytime Drop-In Center','7416','- Phoenix Daytime Drop-In Center: Community center, open to the public age 18 years or older. Access to laundry, shower, computers, phone, musical instruments, art supplies, games, puzzles, tables and chairs. \r\n- Mail pick-up and case management available\r\n- Transportation assistance to help someone without proper means get to detox, shelter, transitional housing, or nursing home facilities in another Illinois location.\r\n- Open additional hours during extreme weather (call 217-888-0329)','','https://www.cuathome.us/phoenix-drop-in-center/','russ@cuathome.us',NULL,'',NULL,'Age 18 or older.',NULL,NULL,NULL,'744,','','','','1341604895531699','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:15:53'),(975,20057,'Men\'s Emergency Shelter','C-U Men\'s Shelter','7416','C-U Men\'s Shelter is an emergency overnight shelter for men. The shelter is located at 504 N. Market St. in Champaign and is staffed by trained staff. Up to 48 men can be accommodated in a dorm-style setting with bunks. Bedding is provide and snacks are generally available. Hours are 8:30 pm to 7:30 pm., seven days/week, year round.','','https://www.cuathome.us/c-u-mens-shelter/','thomas@cuathome.us',NULL,'','Early intake for first-time stays are encouraged at the Phoenix Daytime Center (same location) Tuesday-Friday noon-5 pm.','Age 18 or older.',NULL,'Photo id','Champaign County','744,','','','','1341604895531694','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:05:06'),(976,20659,'Transportation Expense Assistance','Transportation Ministry','7416','Transportation Ministry: Transportation assistance to help someone without proper means get to detox, shelter, transitional housing, or nursing home facilities in another Illinois location.','','https://www.cuathome.us/transportation-ministry/','steven@cuathome.us',NULL,'1232587316936391','By phone (217) 888-0329','Age 18 or older.',NULL,'Photo id',NULL,'1307452340129409,','','','','1341604895531702','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:26:38'),(977,23900,'Family Counseling','','7422','Provides programs to families involved in the child welfare system or in crisis that need encouragement while they change their lives. Services include:\r\n- Advocacy: Informing and assisting you in speaking for yourself or speaking on your behalf. Providing support and assistance in maneuvering through the various systems you may be involved with.\r\n- Mentoring: Assisting with development of short- and long-term life goals.\r\n- Mediation: Intervenes as a neutral party on your behalf to work through conflict that arises with service providers.\r\n- Counseling: Individual and family counseling.\r\n- Workshops: Hosts, sponsors, or co-sponsors workshops and groups that address parenting skills, life skills, working with child welfare and social service agencies in the community, and domestic violence.\r\n- Outreach: Provides services to families from the community and works in collaboration with other service providers.\r\n- 3rd Party Visits: Coordinate and supervise visits with clients whose children are in placement.\r\n- \"The Family Table\" Group Sessions: Group sessions address parenting skills, domestic violence, relationships, life skills, budgeting, short- and long-term goals.\r\n- Anger Management Group for teens to help them deal with anger issues and the consequences.','','','','',NULL,'DCFS clients and clients from other social service agencies should contact their case worker to request a referral to Family Advocacy in Champaign County. Community members can contact FACC directly to schedule an appointment.','','','','','817','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(978,23901,'Parenting Skills Classes','','7422','Provides programs to families involved in the child welfare system or in crisis that need encouragement while they change their lives. Services include:\r\n- Advocacy: Informing and assisting you in speaking for yourself or speaking on your behalf. Providing support and assistance in maneuvering through the various systems you may be involved with.\r\n- Mentoring: Assisting with development of short- and long-term life goals.\r\n- Mediation: Intervenes as a neutral party on your behalf to work through conflict that arises with service providers.\r\n- Counseling: Individual and family counseling.\r\n- Workshops: Hosts, sponsors, or co-sponsors workshops and groups that address parenting skills, life skills, working with child welfare and social service agencies in the community, and domestic violence.\r\n- Outreach: Provides services to families from the community and works in collaboration with other service providers.\r\n- 3rd Party Visits: Coordinate and supervise visits with clients whose children are in placement.\r\n- \"The Family Table\" Group Sessions: Group sessions address parenting skills, domestic violence, relationships, life skills, budgeting, short- and long-term goals.\r\n- Anger Management Group for teens to help them deal with anger issues and the consequences.','','','','',NULL,'DCFS clients and clients from other social service agencies should contact their case worker to request a referral to Family Advocacy in Champaign County. Community members can contact FACC directly to schedule an appointment.','','','','','818','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(979,14258,'Case/Care Management * Teenage Parents','','7426','The GOALS Project is an acronym that stands for Going On Against Life\'s Struggles. The GOALS Project empowers teen parents (ages 13-21) to set and attain life goals despite the various obstacles they may face. Specifically, the Project aims to increase the high school graduation rate among teen parents in Central Illinois and to give teens parents the tools to become productive adults and successful parents. A 3-step approach for assisting parents in attaining their goals is used:\r\n1. The teens are taught how to acquire healthy relationships and parenting skills.\r\n2. Mentoring is provided to support and give guidance to the teens.\r\n3. Each teen is assisted with their educational and self-identified goals.\r\n\r\nBy working and achieving goals set in the program, moms earn GOALS Bucks and get to shop for the things they need for themselves and their children. All the moms are linked up with a mentor that meets with them outside of the GOALS workshop times.','','','','',NULL,'By phone or e-mail.','Must be a parent between the age of 13 and 21 and in school or working with aspirations and goals to do better and pursue more life goals.','','','','819','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(980,14262,'Youth Enrichment Programs','','7430','The Mahomet Area Youth Club (MAYC) provides low-cost out of school programs for ages 6-16 and after-school enrichment programming for Jr. High students in the Mahomet area. MAYC programs are guided by five core value areas: \r\n- Character and Citizenship.\r\n- Health and Life Skills.\r\n- Education and Leadership.\r\n- Creative Arts and Expression.\r\n- Sports and Recreation.','','','','',NULL,'By phone, email or online registration.','Youth ages 6-16 and their families.','','Registration form and proof of income for scholarships.','','820','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(981,14279,'Preschools * Special Preschools','Spectrum Early Childhood Program','7432','Spectrum is a preschool program for children (ages 3-5) who reside in rural Champaign County. The program serves children who have a variety of needs, including those who would benefit from a preschool experience before kindergarten in order to increase their academic readiness skills.','','','','',NULL,'By appointment for a free screening.','','','Photo ID, birth certificate, proof of income, proof of residency, physical and immunization records.','','821','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(982,14282,'Transition Services for Students with Disabilities','Transition/STEP','7432','Secondary Transitional Experience Program (STEP) is administered through the Rural Champaign County Special Education Cooperative. It is a partnership between local high schools and the Division of Rehabilitation Services. Staff is available at each school in Champaign County to assist students, parents, and employers with STEP. \r\n\r\nIn this program, employers, teachers, parents, and vocational coordinators work as a team to help the students become productive members of society. Students receive training in employability skills that increases job retention.','','','','',NULL,'By appointment.','','','Signed DRS Parental Consent form, current IEP or 504 plan (to verify eligibility based on the presence of a disability), and social security number.','','822','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(983,14283,'Student Health Programs','','7436','Medical services provided include:\r\n- Physical examinations (school and sport physicals).\r\n- Immunizations.\r\n- Treatment for acute and chronic medical conditions (asthma, diabetes, ADHD, etc.).\r\n- Reproductive health services.\r\n- Treatment for sports related injuries and sub-specialty referrals.\r\n- Individual and family dietary management.','','','','','941516382466411','By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','823','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(984,14284,'Immunizations','','7436','Medical services provided include:\r\n- Physical examinations (school and sport physicals).\r\n- Immunizations.\r\n- Treatment for acute and chronic medical conditions (asthma, diabetes, ADHD, etc.).\r\n- Reproductive health services.\r\n- Treatment for sports related injuries and sub-specialty referrals.\r\n- Individual and family dietary management.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','824','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(985,14285,'Dental Care','','7436','Provides dental services for children and adults, school dental exams and cleanings, and treatment for cavities and extractions on-site.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','825','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(986,14286,'Adolescent/Youth Counseling','','7436','Offers individual and family counseling, school-based counseling, case management, resources, and referrals.','','','','',NULL,'By phone for appointment.','','','Photo ID, proof of income, and immunization records.','','826','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(987,14293,'General Medical Care','','7442','Frances Nelson Health Center is a primary care medical and mental health clinic dedicated to providing affordable and accessible high quality health care services to the medically underserved of greater Champaign County. Services include:\r\n- Prenatal care.\r\n- Well-child clinics.\r\n- Counseling.\r\n- Case management.\r\n- Dermatology.\r\n- Lab services.\r\n- Well-woman care.\r\n- Breast and Cervical Cancer screening.\r\n- Health education services.\r\n- Medication assistance program.\r\n- Mental health counseling and psychiatry.','','','','',NULL,'Call for appointment to establish care. Walk-in clinic also available.','','','Photo ID, proof of income, and insurance cards.','Discounts for up to 200% of the federal poverty level.  Full fee above 200% of federal poverty level.','827','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(988,14294,'Cancer Detection * Breast Cancer * Cervical Cancer','','7442','Frances Nelson Health Center is a primary care medical and mental health clinic dedicated to providing affordable and accessible high quality health care services to the medically underserved of greater Champaign County. Services include:\r\n- Prenatal care.\r\n- Well-child clinics.\r\n- Counseling.\r\n- Case management.\r\n- Dermatology.\r\n- Lab services.\r\n- Well-woman care.\r\n- Breast and Cervical Canc