'','','835','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(996,14312,'Medication Disposal','','7454','The IEPA website contains a listing of medication disposal locations by county for the state of Illinois. These sites provide communities with a proper method of pharmaceutical disposal that effectively reduces the misuse and abuse of pharmaceuticals, as well as, ensures the quality of the water and wildlife for future generations. The disposal sites collect non-controlled, non-hazardous medications. This includes prescribed or over-the-counter vitamins/supplements, homeopathic remedies, creams, oils, ointments, and suppositories.\r\n\r\nControlled and/or illegal drugs may be accepted, depending on the site’s specific DEA regulations. Check with the local site disposal program beforehand.','','https://www2.illinois.gov/epa/Pages/default.aspx','','',NULL,'Walk-in.','','','','','836','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(997,14327,'Crisis Nurseries/Child Care','Safe Children','7457','Crisis Nursery creates an \"Island of Safety\" dedicated to the prevention of child abuse and neglect by providing 24-hour emergency care for children and support to strengthen families in crisis. Crisis Nursery\'s Safe Children services are available for families who are experiencing a crisis/emergency and no other resources are available to help. Services are voluntary, confidential, and offered at no cost to the parent. If needed, basic care items such as diapers, wipes, formula, and clothing may be available.\r\n\r\nCommon reasons for admission include: \r\n- Parental stress.\r\n- Domestic violence.\r\n- Homelessness. \r\n- Home structurally unsafe.\r\n- Mental health.\r\n- Substance abuse.\r\n- Court appearances.\r\n- Medical related reasons.\r\n- Public/support services. \r\n- Job/school related care.\r\n- Funerals.','7456','https://','srecord@crisisnursery.net',NULL,'','Crisis Nursery starts scheduling emergency childcare at 7 AM each day. Families should call the day they need care to receive services. Calling as close to 7 AM as possible makes it most likely that clients will receive services, as there are a limited number of spaces each day. However, care is provided based on client risk, so families shouldn\'t be deterred from calling later in the day if services are needed. Walk-in services are also considered based on need. The Crisis Care hotline is available 24/7 for families to call.','- Family must be experiencing a crisis and have no other resource available to care for the child.- Child must be ages birth through 6 and be in good health (no contagious conditions).- While child is in care, caregiver must remain in Champaign County, be reachable in case of an emergency, and provide another emergency contact.','Free','Photo ID for the caregiver.','No income guidelines.','1363,1364,','','','','14042','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-05-18 21:15:23'),(998,14328,'Home Based Parenting Education','Strong Families','7457','Crisis Nursery\'s Strong Families Program is open to families in Champaign County with children ages birth through six. Resources and services are available for families needing additional support, including families in crisis, struggling with postpartum depression, or dealing with situations such as homelessness, kinship care, parenting as a teen, and more. Services include:\r\n- Crisis counseling.\r\n- Home visits and parenting education.\r\n- Facilitated play groups (meet other families and learn about your child\'s development).\r\n- Parent support groups with childcare provided.\r\n- Parenting education classes.\r\n- Referrals for resources and follow-ups.','','','','','789038541797078','By phone.','Family must reside in Champaign County and have a child (aged from birth through 6-years-old).','','','No income guidelines.','838','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(999,14329,'Child Development Classes','Strong Families','7457','Crisis Nursery\'s Strong Families Program is open to families in Champaign County with children ages birth through six. Resources and services are available for families needing additional support, including families in crisis, struggling with postpartum depression, or dealing with situations such as homelessness, kinship care, parenting as a teen, and more. Services include:\r\n- Crisis counseling.\r\n- Home visits and parenting education.\r\n- Facilitated play groups (meet other families and learn about your child\'s development).\r\n- Parent support groups with childcare provided.\r\n- Parenting education classes.\r\n- Referrals for resources and follow-ups.','','','','',NULL,'By phone.','Family must reside in Champaign County and have a child (aged from birth through 6-years-old).','','','No income guidelines.','839','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1000,14330,'Support Groups * Parents of Infants/Toddlers','Strong Families','7457','Crisis Nursery\'s Strong Families Program is open to families in Champaign County with children ages birth through six. Resources and services are available for families needing additional support, including families in crisis, struggling with postpartum depression, or dealing with situations such as homelessness, kinship care, parenting as a teen, and more. Services include:\r\n- Crisis counseling.\r\n- Home visits and parenting education.\r\n- Facilitated play groups (meet other families and learn about your child\'s development).\r\n- Parent support groups with childcare provided.\r\n- Parenting education classes.\r\n- Referrals for resources and follow-ups.','','','','',NULL,'By phone.','Family must reside in Champaign County and have a child (aged from birth through 6-years-old).','','','No income guidelines.','840','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1001,20561,'Parent/Child Activity Groups','Strong Families','7457','Crisis Nursery\'s Strong Families Program is open to families in Champaign County with children ages birth through six. Resources and services are available for families needing additional support, including families in crisis, struggling with postpartum depression, or dealing with situations such as homelessness, kinship care, parenting as a teen, and more. Services include:\r\n- Crisis counseling.\r\n- Home visits and parenting education.\r\n- Facilitated play groups (meet other families and learn about your child\'s development).\r\n- Parent support groups with childcare provided.\r\n- Parenting education classes.\r\n- Referrals for resources and follow-ups.','','','','',NULL,'By phone.','Family must reside in Champaign County and have a child (aged from birth through 6-years-old).','','','No income guidelines.','841','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1002,20619,'Support Groups * Parents of Preschool Aged Children','Strong Families','7457','Crisis Nursery\'s Strong Families Program is open to families in Champaign County with children ages birth through six. Resources and services are available for families needing additional support, including families in crisis, struggling with postpartum depression, or dealing with situations such as homelessness, kinship care, parenting as a teen, and more. Services include:\r\n- Crisis counseling.\r\n- Home visits and parenting education.\r\n- Facilitated play groups (meet other families and learn about your child\'s development).\r\n- Parent support groups with childcare provided.\r\n- Parenting education classes.\r\n- Referrals for resources and follow-ups.','','','','',NULL,'By phone.','Family must reside in Champaign County and have a child (aged from birth through 6-years-old).','','','No income guidelines.','842','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1003,14353,'Advocacy * Mental Illness/Emotional Disabilities','','7464','An advocacy and non-profit organization for the education and support of the mentally ill, their families, and friends that is open to anyone with a personal or professional interest in mental illness. NAMI is affiliated with NAMI Illinois and the national organization NAMI.\r\n\r\nNAMI\'s purpose also includes:\r\n1) Educating consumers, their families, and the public in an effort to eliminate the stigma of mental illness through literature, newsletters, speakers, workshops, and conferences. With proper access to treatment, persons with neurobiological brain disorders can lead productive lives and work towards recovery.\r\n2) Advocacy in legislation and programs which will improve the lives of the mentally ill. \r\n3) Supporting research that focuses on the causes of mental illness and ways to improve treatment.','','','','','968511154801619','By phone.','','','','','843','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1004,14364,'Food Pantries','Salvation Army Food Pantry','7466','The Salvation Army Food Pantry provides food to low-income households throughout Champaign County. Food pantry may be visited once a month.','','','','','832990803111047','Walk-in.','Must be a resident of Champaign County and have proof of residency.','','Photo ID or proof of residency (bill with current address).','','844','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1005,14365,'Clothing * Clothing Vouchers','','7466','Clothing Vouchers Program provides clothing vouchers to Champaign County residents who have experienced a disaster (fire, flooding, etc.). Individuals must have a Red Cross referral and fire report.','','','','',NULL,'By phone.','','','Photo ID, disaster verification (American Red Cross referral, fire report, etc).','','845','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1006,14367,'Utility Assistance','Warm Neighbors Cool Friends','7466','Salvation Army of Champaign County is the administering agency for Ameren\'s Warm Neighbors Cool Friends. These funds provide help with payment of Ameren electric bills. WN/CF assistance begins in January. Cooling program runs from June through September. Heating program runs from October through May. Eligible clients can be helped once each heating/cooling season per calendar year.','','','','',NULL,'By appointment only.','1) Must be an Ameren Illinois customer living in Champaign County.\r\n2) Must be a senior or disabled or have a temporary, documentable crisis.\r\n3) Bill cannot be over $750.\r\n4) Must meet minimum and maximum income requirements.\r\n5) Must have active service in the home (cannot be shut off).\r\n6) Must make matching payment. Ameren will match payments up to $350.\r\n7) Income must be from an adult (cannot count child\'s disability as income for this program).','','Proof of residence, income, utility bill and documentation of a crisis if they are not someone with a disability or a senior (age 60 or older).','Income must fall between 150-300% of Federal Poverty Level. Some people may be over-income for this program. See bulletin board for income guidelines.','846','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1007,14368,'Ex-Offender Employment Programs','Employment and Training Program','7466','The Employment and Training Program works with men and women who have felony backgrounds, assisting them in securing and maintaining employment that will sustain their economic self-sufficiency. Services offered include:\r\n- Job readiness training.\r\n- Resume writing.\r\n- Mock interviews.','','','','',NULL,'By phone for appointment.','Men and women (18 years and older) with misdemeanors and felony backgrounds.','','Photo ID, proof of income, and proof of residency.','','847','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1008,14370,'Temporary Financial Assistance * Veterans','Supportive Services for Veteran Families (SSVF)','7466','Provides financial and support services to Veteran Families. The program is a housing stability-focused service delivery program that serves veteran families that are homeless or imminently at risk of being homeless. The goal is to stabilize these families in housing, while providing on-going support as needed to sustain independent living. Services may include:\r\n- Rental and utility deposits.\r\n- Limited rental and utility assistance.\r\n- Limited moving costs and emergency supplies.\r\n- Case management services.\r\n- Transportation assistance.\r\n- Information and referrals to community resources.\r\n- Assistance in obtaining VA benefits.\r\n- Assistance in obtaining and securing other public benefits.\r\n- Assistance in securing permanent housing.','','','','','1077790582995406','Call the SSVF line at 217-278-9897.','Must be a veteran or spouse of a veteran. Housing status must be in one of the following categories:\r\n- Reside in housing and lack the ability to pay all bills.\r\n- Are currently homeless.\r\n- Has left permanent housing within the past 90 days to seek other housing that better meets the family\'s needs or preferences.','','Photo ID, Social Security card, proof of income, proof of residency, and DD214.','50% of area median income.','848','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1009,14371,'Veteran Benefits Assistance','Supportive Services for Veteran Families (SSVF)','7466','Provides financial and support services to Veteran Families. The program is a housing stability-focused service delivery program that serves veteran families that are homeless or imminently at risk of being homeless. The goal is to stabilize these families in housing, while providing on-going support as needed to sustain independent living. Services may include:\r\n- Rental and utility deposits.\r\n- Limited rental and utility assistance.\r\n- Limited moving costs and emergency supplies.\r\n- Case management services.\r\n- Transportation assistance.\r\n- Information and referrals to community resources.\r\n- Assistance in obtaining VA benefits.\r\n- Assistance in obtaining and securing other public benefits.\r\n- Assistance in securing permanent housing.','','','','',NULL,'Call the SSVF line at 217-278-9897.','Must be a veteran or spouse of a veteran. Housing status must be in one of the following categories:\r\n- Reside in housing and lack the ability to pay all bills.\r\n- Are currently homeless.\r\n- Has left permanent housing within the past 90 days to seek other housing that better meets the family\'s needs or preferences.','','Photo ID, Social Security card, proof of income, proof of residency, and DD214.','50% of area median income.','849','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1010,14372,'Information and Referral * Veterans','Supportive Services for Veteran Families (SSVF)','7466','Provides financial and support services to Veteran Families. The program is a housing stability-focused service delivery program that serves veteran families that are homeless or imminently at risk of being homeless. The goal is to stabilize these families in housing, while providing on-going support as needed to sustain independent living. Services may include:\r\n- Rental and utility deposits.\r\n- Limited rental and utility assistance.\r\n- Limited moving costs and emergency supplies.\r\n- Case management services.\r\n- Transportation assistance.\r\n- Information and referrals to community resources.\r\n- Assistance in obtaining VA benefits.\r\n- Assistance in obtaining and securing other public benefits.\r\n- Assistance in securing permanent housing.','','','','',NULL,'Call the SSVF line at 217-278-9897.','Must be a veteran or spouse of a veteran. Housing status must be in one of the following categories:\r\n- Reside in housing and lack the ability to pay all bills.\r\n- Are currently homeless.\r\n- Has left permanent housing within the past 90 days to seek other housing that better meets the family\'s needs or preferences.','','Photo ID, Social Security card, proof of income, proof of residency, and DD214.','50% of area median income.','850','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1011,14373,'Utility Assistance','Illinois American Water H20 (Help to Others)','7466','H2O (Help to Others) is an emergency assistance program created by Illinois American Water and the Salvation Army. Provides supplemental funding to American Water customers who, because of a situation that was beyond their control, are having difficulties paying their bill. The program is designed to help customers before they get shut off.','','','','',NULL,'By appointment only.','- Bill must be at least $50. H20 will match payment up to $150. \r\n- Service must be active.\r\n- Household must have income.\r\n- Assistance available once per year and 3 times during a lifetime.\r\n- Program will only pay up to 50% of owed bill; will NOT put positive credit on account.','','Photo ID, proof of income, proof of residency, and current water bill.','','851','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1012,14375,'Utility Assistance * Older Adults','','7466','Utility assistance is available for seniors, who had an unforeseen crisis that placed them behind on their utility bill. Assistance depends on funding availability.','','','','',NULL,'By appointment only.','Seniors age 60 and older.','','Photo ID, proof of income, proof of residency, and unpaid bill.','150% of the federal poverty level.','852','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1013,14385,'Family Support Centers/Outreach * Autism Spectrum Disorder','The Autism Program at University of Illinois','7468','TAP is a state-wide network of resources for Autism Spectrum Disorders in the State of Illinois. The Program\'s mission is to foster development of community networks that promote best practice in the diagnosis, treatment, and education of all children with Autism Spectrum Disorders. Locally, the site offers consultation, a resource room, new diagnosis orientation for families, social skill programs, play groups, training and technical assistance, and internship opportunities for students. The Resource Room has many books and DVDs that can be checked out but also has many free visual supports for use with people on the Autism Spectrum. TAP can also create customized visual supports such as schedules, social stories, and learning aids for free.','','','','',NULL,'Walk-in for Resource Room, otherwise by appointment.','','','','','853','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1014,14386,'Landlord/Tenant Assistance','','7470','Provides information about tenants\' and landlords\' rights and responsibilities and help for tenants living in Champaign County who experience landlord problems or have questions.\r\n- Neglected property maintenance.\r\n- Disputes about damage deposit deductions.\r\n- Evictions.\r\n- Unlawful discrimination.\r\n- Roommate conflicts.\r\n- Violation of lease by landlord.\r\n- Information about subletting, utilities problems, parking issues and more.\r\n- Helpful forms, model leases, and checklists.\r\n- Your rights under state and local laws.\r\n- Have your lease reviewed before you sign it.\r\n- Check landlords\' complaint records.\r\n- Get help finding a place to rent.','','','','',NULL,'By phone or walk-in.','Serves all renters living in Champaign County.','','','','854','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1015,14421,'Local Bus Services','','7487','The Champaign-Urbana Mass Transit District\'s (MTD) is the public transportation provider for Champaign, Urbana, Savoy, and the University of Illinois. \r\n\r\nBus routes include:\r\n- Fixed Routes: Main bus routes that operate on a regular schedule. All fixed routes have buses equipped with wheelchair lifts.\r\n- Hopper Service: MTD has several routes that include \'Hopper\' Service - Green, Yellow, Gold, and Orange. While regular buses serve the entire route, \'Hopper\' buses only serve the portion of the route that experience the heaviest rider volume.','','','','',NULL,'For fixed route service, you need only to wait at a bus stop. To schedule ADA Paratransit trips or enroll, call 217-384-8188. To obtain an Annual or Monthly Pass, school tokens, DASH Cards, or Veteran Pass visit Illinois Terminal (45 E. University Ave). You may also purchase the Monthly and Annual Pass with the Token Transit app.','','','','','855','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1016,14451,'Disability Related Transportation','ADA Paratransit Service','7487','ADA Paratransit Service offers curb-to-curb transportation service for persons with disabilities who are unable to use fixed route services. ADA Paratransit service is provided by reservations only, and all reservations must be made at least one day prior to service. Eligible riders must submit an application and be registered prior to using this service.','','','','','1232587316936391','By phone to schedule ADA Paratransit trips or enroll.','','','','','856','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1017,14452,'Transportation Expense Assistance * Older Adults','Half-Fare Cab Program','7487','Provides discounted cab rides for seniors and people with disabilities. Must be registered for the DASH Card (card for free regular bus service) to receive the discounted cab rides. Contact MTD to learn which cab companies are part of the program.','','','','','1232587316936391','By phone for list of participating cab companies.','Age 65 and older, or disabled.','','','','857','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1018,14439,'Developmental Disabilities Day Habilitation Programs','','7492','Community Choices is a cooperative where people with developmental disabilities and their families support each other. The following 4 services are offered:\r\n- Community Living - Life skills training and assistance with living independently.\r\n- Customized Employment - Helping people with disabilities find jobs.\r\n- Social Opportunities - Social events and developing community connections.\r\n- Family Support - Monthly support group for families.','','','','','637158405241810','By phone.','Must be 18 and have a developmental disability.','','Community Choices may help obtaining required documents if clients do not have them. Documents include:\r\n- Photo ID.\r\n- Proof of Developmental Disability.\r\n- Proof of PUNS list status (from Champaign County Regional Planning Commission).','No income guidelines.','858','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1019,14440,'Support Groups * Families/Friends of People with Disabilities','','7492','Community Choices is a cooperative where people with developmental disabilities and their families support each other. The following 4 services are offered:\r\n- Community Living - Life skills training and assistance with living independently.\r\n- Customized Employment - Helping people with disabilities find jobs.\r\n- Social Opportunities - Social events and developing community connections.\r\n- Family Support - Monthly support group for families.','','','','',NULL,'By phone.','Must be 18 and have a developmental disability.','','Community Choices may help obtaining required documents if clients do not have them. Documents include:\r\n- Photo ID.\r\n- Proof of Developmental Disability.\r\n- Proof of PUNS list status (from Champaign County Regional Planning Commission).','No income guidelines.','859','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1020,14441,'Support Groups * Adults With Disabilities/Health Conditions','','7492','Community Choices is a cooperative where people with developmental disabilities and their families support each other. The following 4 services are offered:\r\n- Community Living - Life skills training and assistance with living independently.\r\n- Customized Employment - Helping people with disabilities find jobs.\r\n- Social Opportunities - Social events and developing community connections.\r\n- Family Support - Monthly support group for families.','','','','','878986697513222','By phone.','Must be 18 and have a developmental disability.','','Community Choices may help obtaining required documents if clients do not have them. Documents include:\r\n- Photo ID.\r\n- Proof of Developmental Disability.\r\n- Proof of PUNS list status (from Champaign County Regional Planning Commission).','No income guidelines.','860','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1021,14462,'Discrimination Assistance','','7498','The City of Urbana Human Relations Division investigates and resolves complaints of discrimination in housing, employment, public accommodations, and city services within the Urbana city limits.','','','','',NULL,'','','','','','861','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1023,14573,'Extended Child Care * Hispanic/Latino Community','','7545','Provides social support to Latinos in Champaign County. The Center provides interpreters, support groups, before and after school care, and a food pantry.','','','','',NULL,'By appointment or walk-in.','','','Photo ID.','','862','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1024,14574,'Language Interpretation * Hispanic/Latino Community','','7545','Provides social support to Latinos in Champaign County. The Center provides interpreters, support groups, before and after school care, and a food pantry.','','','','',NULL,'By appointment or walk-in.','','','Photo ID.','','863','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1025,14578,'Support Groups * Hispanic/Latino Community','','7545','Provides social support to Latinos in Champaign County. The Center provides interpreters, support groups, before and after school care, and a food pantry.','','','','',NULL,'By appointment or walk-in.','','','Photo ID.','','864','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1026,21699,'Food Pantries * Hispanic/Latino Community','','7545','Provides social support to Latinos in Champaign County. The Center provides interpreters, support groups, before and after school care, and a food pantry.','','','','','832990803111047','By appointment or walk-in.','','','Photo ID.','','865','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1027,14580,'Hospitals','','7549','OSF Heart of Mary Medical Center is a 210-bed comprehensive medical facility in the Champaign-Urbana community, offering a full scope of inpatient and outpatient services. OSF has the area\'s largest inpatient rehabilitation center, featuring facilities for physical, occupational and speech therapy. Also has Presence Orthopedic Services, the Presence Center for Healthy Aging, and the area\'s only Adult Behavioral Health Unit in a hospital setting.','','','','',NULL,'','','','','','866','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1028,14583,'Support Groups * Heart Disease','Powerful Hearts Club','7549','Powerful Hearts Club is a heart support group for patients and/or friends and family of patients who have experienced heart disease or have undergone a heart procedure. The support group allows participants to share their story with others, hear encouraging stories from fellow heart survivors, and enjoy heart healthy presentations by various health care providers.','','','','',NULL,'Call Brittney Cromwell, 217-337-2237, for more information.','','','','','867','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1029,14586,'Support Groups * Stroke * Brain Injuries','Stroke Support Group','7549','OSF\'s Stroke Support Group is open to stroke survivors and their families and provides emotional support in addition to education on strokes.','','','','',NULL,'For more information, please call 217-337-2202.','','','','','868','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1030,20065,'Psychiatric Inpatient Units','','7549','- Behavioral Health Unit is the area\'s only inpatient psychiatric unit. \r\n- 24 adults beds (ages 18 and older).\r\n- Treated disorders include Acute Depression, Bipolar/Mania, Psychosis, Schizophrenia.\r\n- Inpatient and outpatient electroconvulsive therapy (ECT) available.','','','','',NULL,'By phone. Behavioral Health Unit: 217-337-2130.','','','','','869','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1031,20066,'Psychiatric Disorder Counseling','','7549','- Behavioral Health Unit is the area\'s only inpatient psychiatric unit. \r\n- 24 adults beds (ages 18 and older).\r\n- Treated disorders include Acute Depression, Bipolar/Mania, Psychosis, Schizophrenia.\r\n- Inpatient and outpatient electroconvulsive therapy (ECT) available.','','','','',NULL,'By phone. Behavioral Health Unit: 217-337-2130.','','','','','870','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1032,31890,'Health Insurance Information/Counseling','Senior Health Insurance Program (SHIP)','7549','- Free expert knowledge about health insurance by trained volunteer counselors. Provides one-on-one help to seniors.\r\n- Does not sell or solicit insurance and is not an insurance plan.\r\n- SHIP counselors can answer questions about Medicare (all plans), Prescription Drug Coverage, Long-term Care Insurance, etc.','','','','','941516382466411','By phone for appointment.','','','','','871','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1033,15140,'Parenting Skills Classes','PEGs (Parent Education Groups)','7573','A 12-week parenting course focusing on the concepts of choice and accountability in parenting. Parents will develop an understanding of thinking patterns and identify vulnerabilities that set up unhelpful parent-child interactions.','','','','',NULL,'By phone for appointment.','','','','','872','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1034,15141,'Parenting Skills Classes * Domestic Violence Issues','Impact','7573','Impact is a 6-week program for parents focusing on the impact of domestic violence on children.','','','','',NULL,'By phone for appointment.','','','','','873','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1035,15143,'Adult Diversion','','7573','Responsible Choices: A 16-week program designed to accompany Illinois Drug Court programs. The curriculum incorporates fundamental Language Choice Therapy interventions providing individuals an opportunity to identify unhelpful thinking patterns contributing to drug and alcohol abuse/dependence patterns and replace them with responsible life skills.\r\n\r\nAlternatives: A 12-week group program for University of Illinois students involved in the disciplinary system.\r\n\r\nFun-Da-Mentals: An 18-week group course to help adolescents increase their decision-making skills by making connections between choices and consequences. Thinking patterns that drive choices are identified in a respectful and experiential group environment.\r\n\r\nThinking Skills: 16-week curriculum for general offenders.','','','','',NULL,'Responsible Choices: Referral from Champaign County Drug Court.\r\nAlternatives: Referral from University of Illinois.\r\nFun-Da-Mentals: Referral from Champaign County Probation.\r\nThinking Skills: Referral from Champaign County Probation.','','','','','874','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1036,15841,'Juvenile Diversion','','7573','Responsible Choices: A 16-week program designed to accompany Illinois Drug Court programs. The curriculum incorporates fundamental Language Choice Therapy interventions providing individuals an opportunity to identify unhelpful thinking patterns contributing to drug and alcohol abuse/dependence patterns and replace them with responsible life skills.\r\n\r\nAlternatives: A 12-week group program for University of Illinois students involved in the disciplinary system.\r\n\r\nFun-Da-Mentals: An 18-week group course to help adolescents increase their decision-making skills by making connections between choices and consequences. Thinking patterns that drive choices are identified in a respectful and experiential group environment.\r\n\r\nThinking Skills: 16-week curriculum for general offenders.','','','','',NULL,'Responsible Choices: Referral from Champaign County Drug Court.\r\nAlternatives: Referral from University of Illinois.\r\nFun-Da-Mentals: Referral from Champaign County Probation.\r\nThinking Skills: Referral from Champaign County Probation.','','','','','875','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1037,14681,'General Relief','','7579','Provides a monthly income for individuals to be used to pay for food, rent/shelter, and utilities.','','','','',NULL,'','Any township resident 18 years or older who is either a U.S. resident or legal alien. The General Assistance Program is primarily for those adults without minor children, without adequate income, and ineligible for any other monetary forms of assistance.','','','','876','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1038,14687,'General Relief','','7581','Provides a monthly income for individuals to be used to pay for food, rent/shelter, utilities, clothing, medical care, or other items considered essential.','','','','',NULL,'Call for an appointment.','Any township resident (18 years or older) who is either a U.S. resident or legal alien. The General Assistance Program is primarily for those adults without minor children, without adequate income, and ineligible for any other monetary forms of assistance.','','','','877','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1039,31558,'Supported Living Services for Adults With Disabilities','','7588','Eden Supportive Living offers an innovative approach to assisted living housing for physically disabled individuals (ages 22-64). By combining apartment-style housing with personal care and services, residents can live independently with dignity and privacy while avoiding the burden of maintaining a home. Residents can enjoy the freedom of a 24-hour support staff available for scheduled and unscheduled needs.','','','','',NULL,'By phone, online or walk-in.','','','Photo ID, proof of income, Social Security card/number, and copy of insurance (Medicaid).','','878','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1040,14782,'Property Tax Exemption Information','','7599','This exemption allows senior citizens who have a total household maximum income of less than $55,000 and meet certain other qualifications to elect to maintain the equalized assessed value (EAV) of their homes at the base year EAV and prevent any increase in that value due to inflation. Each year, applicants must file Form PTAX-340, Senior Citizens Assessment Freeze Homestead Exemption Application and Affidavit, with the chief county assessment office.','','http://www.co.champaign.il.us/ccao','Assessor@co.champaign.il.us','',NULL,'By phone.','To qualify for this exemption you must have owned or had a legal or equitable interest in the land on which a single-family residence is situated and used as your principal place of residence on January 1 of the current assessment year and January 1 of previous assessment year.','','','','879','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1041,14784,'Discrimination Assistance','','7601','The Office of Equity, Community and Human Rights serves as a link between the City Manager\'s Office and the community. Staff ensures equal opportunity and fair treatment for citizens through public information, education, and enforcement of the City\'s Human Rights Ordinance and Equal Opportunity and Purchasing Ordinance.\r\n\r\nThe City of Champaign Human Rights Ordinance was developed with the intent to secure an end to discrimination in the areas of Employment, Housing, Public Accommodation, and Credit on the basis of age, sex, race, color, creed, religion, education, physical or mental disability, marital status, national origin, political affiliation, sexual preference, family responsibilities, source of income, prior arrest, or conviction record.','','','','',NULL,'Complaints may be filed by either personal delivery or mail. If needed, the Community Relations Staff will provide assistance in drafting and filing the complaint. You may pick up a complaint form in the Community Relations Office or download a fillable PDF from champaignil.gov/discrimination-complaints. The complaint must be in writing and signed.','Anyone who believes they have been discriminated against may file a discrimination complaint. The charge of discrimination must be filed within 180 days of the alleged discriminatory act. The Community Relations Manager will investigate the charge after it has been filed and conclude it within the 180 day limit.','','','','880','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1042,14785,'Building Code Enforcement/Appeals','','7603','Neighborhood Code Compliance Division - Enforcement of property maintenance codes and coordination of efforts to achieve compliance with the City\'s blight and nuisance abatement programs.\r\n\r\nNeighborhood Coordination Division - Responsible for citizen education and outreach, efforts to solve neighborhood problems, organizing neighborhoods, and promoting neighborhood self-help programs to address community priorities.','','','','',NULL,'By phone.','','','','','881','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1043,14787,'Home Maintenance and Minor Repair Services','','7603','Neighborhood Programs Division - Developing and managing programs to address neighborhood needs, including rental and home ownership programs, neighborhood plan implementation, and public service activities. The Division administers a variety of Federal, State, and local funds to support these programs and activities such as the Emergency Repair Program and Home Accessibility Retrofit Program.','','','','',NULL,'By phone.','Eligibility is based on income and properties must be located within the city.','','','','882','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1044,14788,'Home Rehabilitation Programs','','7603','Neighborhood Programs Division - Developing and managing programs to address neighborhood needs, including rental and home ownership programs, neighborhood plan implementation, and public service activities. The Division administers a variety of Federal, State, and local funds to support these programs and activities such as the Emergency Repair Program and Home Accessibility Retrofit Program.','','','','',NULL,'By phone.','Eligibility is based on income and properties must be located within the city.','','','','883','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1045,1517,'Psychiatric Hospitals','','764','McFarland Mental Health Center is the State of Illinois\' Psychiatric Hospital serving the central Illinois region. The State\'s Psychiatric Hospitals are for adults who need publicly-funded inpatient psychiatric treatment. McFarland serves as crisis stabilization; turn around is usually around 15 days.','','http://www.dhs.state.il.us/page.aspx?item=61890','','',NULL,'No direct admittance. Must go through local emergency room for referral and medical clearance, or through court order. Phone numbers may be used for general information only.','','','','','884','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1046,14950,'Preschools','','7649','There are 10 classrooms in the Champaign Early Childhood Center. The classrooms are \"blended classes\" that serve children with and without disabilities. Children attend either a morning or afternoon session for 2 ½ hours. Average class size is 16 students per session. The program operates five days per week and follows the Unit #4 school calendar. There is no cost to families and door-to-door transportation is provided within the school district boundaries.  \r\n \r\nClassroom instruction is designed to target the Illinois Early Learning and Development Standards. The program provides instruction in large and small groups and provides opportunities for hands-on, active learning during a variety of center activities. Special education services are provided for children that qualify. Bilingual and English as a Second Language (ESL) services are also available.','','','','',NULL,'','','','Birth certificate, proof of income, proof of residency, immunization records, and a physical.','','885','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1047,14964,'Support Groups * Relationship Issues','','7651','Co-Dependents Anonymous is a fellowship of men and women whose common purpose is to develop healthy relationships. The only requirement for membership is a desire for healthy and loving relationships.','','','','',NULL,'By phone, website, or email.','','','','','886','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1050,15153,'Special Education','','7679','The mission of the Special Education Department is to meet the diverse needs of students with disabilities by providing individualized instruction and services that will result in measurable and meaningful student growth. Disability areas for special education include:\r\n- Multiple Disabilities.\r\n- Emotional Disability.\r\n- Specific Learning Disability.\r\n- Autism.\r\n- Hearing Impairment including Deafness.\r\n- Vision Impairment including Blindness.\r\n- Deaf/Blind.\r\n- Speech-Language Impairment.\r\n- Traumatic Brain Injury.\r\n- Other Health Impairment.\r\n- Orthopedic Impairment.\r\n- Developmental Delay.','','','','',NULL,'By phone.','Ages 3-21 with special needs.','','','','887','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1051,15334,'Holiday Programs * Thanksgiving Meals','','7731','Thanksgiving Dinner is open to all of the community who do not have a place to go and would like the company of others. No reservations are required to attend the dinner.','','','','',NULL,'Walk-in for dinner. Phone for volunteer info.','','','','','888','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1052,15336,'Volunteer Opportunities','','7731','Thanksgiving Dinner is open to all of the community who do not have a place to go and would like the company of others. No reservations are required to attend the dinner.','','','','',NULL,'Walk-in for dinner. Phone for volunteer info.','','','','','889','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1055,15867,'Developmental Disabilities Day Habilitation Programs','','7793','Swann Special Care Center is a long-term care facility for children and adults with developmental and intellectual disabilities. The Center also has a school and developmental training program.','','','','','637158405241810','By phone, walk-in, or appointment.','Must have a severe developmental or intellectual disability.','','Photo ID, birth certificate, proof of income, proof of residency, Social Security card, and immunization records.','','890','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1056,15868,'Group Residences for Adults with Disabilities','','7793','Swann Special Care Center is a long-term care facility for children and adults with developmental and intellectual disabilities. The Center also has a school and developmental training program.','','','','',NULL,'By phone, walk-in, or appointment.','Must have a severe developmental or intellectual disability.','','Photo ID, birth certificate, proof of income, proof of residency, Social Security card, and immunization records.','','891','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1057,15869,'Group Homes for Children and Youth with Disabilities','','7793','Swann Special Care Center is a long-term care facility for children and adults with developmental and intellectual disabilities. The Center also has a school and developmental training program.','','','','',NULL,'By phone, walk-in, or appointment.','Must have a severe developmental or intellectual disability.','','Photo ID, birth certificate, proof of income, proof of residency, Social Security card, and immunization records.','','892','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1060,24476,'Citizenship Education','','8081','Helps immigrants integrate into American society and prepares receiving communities to be welcoming and inclusive. This is accomplished through a combination of direct/referral services, collaborations with community partners, and strategies to connect and build cross-cultural understanding between immigrants and US-born residents. Immigrant services include:\r\n\r\n- La Línea Immigrant Helpline: Referrals to resources including healthcare, housing, immigration, legal assistance, education, employment issues, food & clothing assistance, childcare, and mental health. Also offers interpretation and translation services and limited case advocacy. \r\n\r\n- Legal Services: Offers monthly clinics for immigrants to receive free legal advice from a licensed attorney on DUIs, landlord/tenant problems, court summons, traffic tickets, DACA renewals and other legal issues. As a DOJ-recognized agency, accredited staff can provide immigration legal assistance for low-income and indigent persons.\r\n \r\n- COVID19 Immigrant Relief Fund: For those experiencing financial hardships related to the coronavirus outbreak, there may be time-sensitive monetary assistance to local immigrants for one-time expenses.','','https://docs.google.com/document/d/1Tz2Z-_HGrSmC5IMMqv8J71jQ_0Fq0WCpEODBsBTsqrs/edit','lalinea@universityymca.org','','789038541797078','Services are free and confidential. For assistance in trying to connect to local resources, legal, and financial issues, call the hepline or email the office.','','','','','893','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1061,31703,'General Legal Aid * Immigrants','','8081','Helps immigrants 