'','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1068,31158,'Crisis Intervention','Crisis Services','833','Crisis Services provides immediate 24-hour crisis intervention by trained crisis clinicians through face-to-face mental health assessments and answering the crisis line calls. The program adheres to recovery philosophies incorporating brief therapy to stabilize the individual\'s distress and determine the appropriate level of care.','','','','',NULL,'By phone or in person.','','','Photo ID and proof of income.','','901','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1069,17386,'Foster Home Licensing','','8418','Hope Meadows combines retirees and elders with neighbors of all ages who together comprise a neighborhood support structure facilitating foster care, foster grand-parenting, respite foster care, fictive and kinship care, adoption, and post-foster and post-adoption as well as extended family and aging in place assistance.','','','','',NULL,'Call for more information.','','','','','902','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1070,17387,'Foster Home Placement','','8418','Hope Meadows combines retirees and elders with neighbors of all ages who together comprise a neighborhood support structure facilitating foster care, foster grand-parenting, respite foster care, fictive and kinship care, adoption, and post-foster and post-adoption as well as extended family and aging in place assistance.','','','','',NULL,'Call for more information.','','','','','903','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1071,22107,'Adoption Services','','8418','Hope Meadows combines retirees and elders with neighbors of all ages who together comprise a neighborhood support structure facilitating foster care, foster grand-parenting, respite foster care, fictive and kinship care, adoption, and post-foster and post-adoption as well as extended family and aging in place assistance.','','','','',NULL,'Call for more information.','','','','','904','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1072,22108,'Independent Living Communities/Complexes','','8418','Hope Meadows combines retirees and elders with neighbors of all ages who together comprise a neighborhood support structure facilitating foster care, foster grand-parenting, respite foster care, fictive and kinship care, adoption, and post-foster and post-adoption as well as extended family and aging in place assistance.','','','','',NULL,'Call for more information.','','','','','905','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1073,22109,'Volunteer Opportunities','','8418','Hope Meadows combines retirees and elders with neighbors of all ages who together comprise a neighborhood support structure facilitating foster care, foster grand-parenting, respite foster care, fictive and kinship care, adoption, and post-foster and post-adoption as well as extended family and aging in place assistance.','','','','',NULL,'Call for more information.','','','','','906','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1074,18410,'Adult Probation','','8674','Provides services to the judiciary, community, and offenders. Using a community corrections approach, Probation and Court Services improves public safety by enforcing court orders while providing services to juvenile and adult offenders to aid in their rehabilitation.','','','','',NULL,'','','','','','907','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1075,18411,'Juvenile Probation','','8674','Provides services to the judiciary, community, and offenders. Using a community corrections approach, Probation and Court Services improves public safety by enforcing court orders while providing services to juvenile and adult offenders to aid in their rehabilitation.','','','','',NULL,'','','','','','908','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1076,31236,'Cancer Detection * Breast Cancer * Cervical Cancer','Illinois Breast & Cervical Cancer Program (IBCCP)','8879','Free health screenings are offered for women that are uninsured, underinsured, or have a deductible. Services include:\r\n- Clinical breast exam. \r\n- Pelvic exam.\r\n- PAP test.\r\n- HPV test. \r\n- Mammograms.','','http://www.dph.illinois.gov/topics-services/life-stages-populations/womens-health-services/ibccp','','',NULL,'By phone.','- Living in Illinois. \r\n- Without insurance.\r\n- 35 to 64 years old.\r\n- Younger symptomatic women or women with increased risk factors. \r\n- Women already diagnosed with cancer may also qualify for assistance with treatment.','','Photo ID. Proof of income.','','909','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1077,19065,'Assisted Living Facilities','','8914','Supportive living is housing for older adults who may need some help to maintain their independence. Residents live in private apartments that feature a kitchenette, spacious bathroom and emergency call system. Certified nurses assistants are on-duty 24/7 to provide help with medications, and personal assistance with such activities of daily living as bathing, grooming, dressing, and getting to and from the dining room and activities. Three meals a day, housekeeping and laundry are among the services included in the monthly fee.','','','','',NULL,'Call for more information.','Age 65 and older.','','','','910','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1078,19077,'Assisted Living Facilities','','8914','Supportive living is housing for older adults who may need some help to maintain thei