ial Security or Disability Benefits to be eligible. \r\n\r\nPiatt County\r\n- Walnut Grove Apartments.\r\n- 215A – 217C  W. Elm, Atwood, IL 61913.\r\n- Applicants must be on Social Security or Disability Benefits to be eligible.\r\n\r\nDouglas and Moultrie Counties\r\n- Surrey Lane Manor Apartments.\r\n- 805 E. Columbia, Arthur, IL 61911.\r\n \r\n\r\nDouglas County\r\n- Williamsburg Apartments.\r\n- 129 & 131 Street. Rt. 133, Arcola, IL 61910.','','http://www.ottorealestateinc.com/main.html','','','929094559121639','Must fill out an application for a credit check.','','','','','917','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1085,31260,'Crisis Nurseries/Child Care','','9180','Provides a chance for parents in crisis to get back on their feet before abuse and neglect occur. Parents experiencing a temporary crisis, such as homelessness, hospitalization, or domestic violence, can arrange for their children to stay with families of faith while they address the issues that led to their situation.','','','','',NULL,'By phone; self-referrals accepted. For more information, see the website.','Any child of a family in crisis.','','Proof of custody of the child(ren) needing to be placed.','','918','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1086,11363,'Family Violence Prevention','','92','The purpose of the Family Violence Coordinating Councils, at both the state and local/circuit level, is to establish a forum to improve the institutional, professional and community response to family violence including child abuse, domestic abuse, and elder abuse; to engage in education and prevention; the coordination of intervention and services for victims and perpetrators; and, to contribute to the improvement of the legal system and the administration of justice.','','','','',NULL,'By phone.','','','','','919','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1087,19788,'Nursing Facilities','Prairieview Lutheran Home','9214','Provides short-term and long-term nursing care, as well as in-patient and out-patient rehab therapy.','','','','',NULL,'By phone.','','','','','920','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1088,19789,'Nursing Facilities * Dementia','Faith Place Memory Care','9214','Provides nursing home for senior adults suffering from Alzheimer\'s Disease and dementia.','','','','',NULL,'By phone.','','','','','921','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1089,19790,'Independent Living Communities/Complexes','Luther Place/Prairie Haven','9214','Provides independent living facilities for seniors that are capable of mentally and physically caring for themselves. Also provides assisted living facilities for seniors.','','','','',NULL,'By phone.','Age 60 and older.','','','','922','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1090,21739,'Assisted Living Facilities','Luther Place/Prairie Haven','9214','Provides independent living facilities for seniors that are capable of mentally and physically caring for themselves. Also provides assisted living facilities for seniors.','','','','',NULL,'By phone.','Age 60 and older.','','','','923','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1091,20360,'Case/Care Management * Veterans','Homeless Veterans\' Reintegration Program (HVRP)','9356','The Homeless Veterans\' Reintegration Program (HVRP) is designed to expedite the reintegration of homeless veterans in the labor force. The program consists of job training and preparation, job placement assistance, case management, mental health counseling, and referral services.','','','','',NULL,'Contact the Peoria office.','Copy of DD214 (discharge papers).','','','','924','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1092,20361,'Information and Referral * Veterans','Homeless Veterans\' Reintegration Program (HVRP)','9356','The Homeless Veterans\' Reintegration Program (HVRP) is designed to expedite the reintegration of homeless veterans in the labor force. The program consists of job training and preparation, job placement assistance, case management, mental health counseling, and referral services.','','','','',NULL,'Contact the Peoria office.','Copy of DD214 (discharge papers).','','','','925','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1093,20362,'Veteran Employment Programs','Homeless Veterans\' Reintegration Program (HVRP)','9356','The Homeless Veterans\' Reintegration Program (HVRP) is designed to expedite the reintegration of homeless veterans in the labor force. The program consists of job training and preparation, job placement assistance, case management, mental health counseling, and referral services.','','','','',NULL,'Contact the Peoria office.','Copy of DD214 (discharge papers).','','','','926','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1094,20796,'Self Representation Assistance','Legal Self-Help Center','9622','The Legal Library and Self-Help Center exists to assist people who are not able to afford an attorney and those attempting to represent themselves in court proceedings. The online system can be used to get free legal forms and court procedure information through the Chicago-based Illinois Legal Aid Online. Computer terminals and printers are available for public access at the library. When staffing is available, there may be assistance to help navigate the website. Any Internet-equipped computer can also access legal aid online.','','http://champaign.illinoislegalaid.org','','',NULL,'Walk-in.','','','','','927','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1099,1745,'In Home Assistance * Older Adults','Community Care Program (CCU)','977','The Community Care Program (CCP) is designed to prevent or delay nursing home placement by linking older persons to services and assistance within the community. In-home, community-based support services include:\r\n- Case Management.\r\n- Home Care Aides provide assistance with household tasks, including cleaning, laundry, meal preparation, escort, errands, and shopping.\r\n- Chore assistance and personal care tasks such as dressing, bathing, and grooming. They also assist clients by teaching them how to plan meals and follow special diets. \r\n- Aides remind clients to take medication and, when necessary, act as a personal escort. \r\n- Adult Day Services provide respite to family members or other caregivers who might otherwise be unable to handle the burden of care by providing care and supervision for clients in a group setting outside the home. Day Service staff is allowed to dispense medication and complete some medical tasks.','','','','',NULL,'By phone.','Individuals age 60 and older.','','','','928','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1100,11161,'Adult Day Programs','Community Care Program (CCU)','977','The Community Care Program (CCP) is designed to prevent or delay nursing home placement by linking older persons to services and assistance within the community. In-home, community-based support services include:\r\n- Case Management.\r\n- Home Care Aides provide assistance with household tasks, including cleaning, laundry, meal preparation, escort, errands, and shopping.\r\n- Chore assistance and personal care tasks such as dressing, bathing, and grooming. They also assist clients by teaching them how to plan meals and follow special diets. \r\n- Aides remind clients to take medication and, when necessary, act as a personal escort. \r\n- Adult Day Services provide respite to family members or other caregivers who might otherwise be unable to handle the burden of care by providing care and supervision for clients in a group setting outside the home. Day Service staff is allowed to dispense medication and complete some medical tasks.','','','','','789038541797078','By phone.','Individuals age 60 and older.','','','','929','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1101,23147,'Case/Care Management * Older Adults','Community Care Program (CCU)','977','The Community Care Program (CCP) is designed to prevent or delay nursing home placement by linking older persons to services and assistance within the community. In-home, community-based support services include:\r\n- Case Management.\r\n- Home Care Aides provide assistance with household tasks, including cleaning, laundry, meal preparation, escort, errands, and shopping.\r\n- Chore assistance and personal care tasks such as dressing, bathing, and grooming. They also assist clients by teaching them how to plan meals and follow special diets. \r\n- Aides remind clients to take medication and, when necessary, act as a personal escort. \r\n- Adult Day Services provide respite to family members or other caregivers who might otherwise be unable to handle the burden of care by providing care and supervision for clients in a group setting outside the home. Day Service staff is allowed to dispense medication and complete some medical tasks.','','','','',NULL,'By phone.','Individuals age 60 and older.','','','','930','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1102,15154,'Advocacy * Abused Children','','7681','The Children\'s Advocacy Center is dedicated to serving the best interests of abused and neglected children.\r\n1) A safe and comfortable environment for the child and family to feel at ease while talking about the abuse during the investigation process.\r\n2) Linkage and coordination between police investigators, child welfare workers, prosecutors, and treatment providers so that the number of victim interviews can be reduced.\r\n3) An interdisciplinary review process for decision-making, problem-solving, and information sharing. The network will monitor all cases of sexual abuse victims under 18 years of age in Champaign County.\r\n4) A comprehensive tracking system shared by all appropriate agencies for those children who have been sexually abused.\r\n5) Specialized training for professionals involved with victims and families in child sexual abuse cases.\r\n6) Education and prevention in dealing with issues of sexual abuse.','','','','','637158405241810','Referrals through DCFS and law enforcement only.','','','','','931','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1103,15155,'Child Abuse Medical Evaluations','','7681','The Children\'s Advocacy Center is dedicated to serving the best interests of abused and neglected children.\r\n1) A safe and comfortable environment for the child and family to feel at ease while talking about the abuse during the investigation process.\r\n2) Linkage and coordination between police investigators, child welfare workers, prosecutors, and treatment providers so that the number of victim interviews can be reduced.\r\n3) An interdisciplinary review process for decision-making, problem-solving, and information sharing. The network will monitor all cases of sexual abuse victims under 18 years of age in Champaign County.\r\n4) A comprehensive tracking system shared by all appropriate agencies for those children who have been sexually abused.\r\n5) Specialized training for professionals involved with victims and families in child sexual abuse cases.\r\n6) Education and prevention in dealing with issues of sexual abuse.','','','','',NULL,'Referrals through DCFS and law enforcement only.','','','','','932','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1104,15156,'Child Sexual Abuse Counseling','','7681','Counseling is available for children who have been victims of child abuse. Call for additional information.','','','','',NULL,'','','','','','933','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1105,15157,'Recreational Activities/Sports','','7683','The Champaign Park District provides parks services and recreational programs to residents of all ages, including Sholem Aquatic Center, Leonhard Recreation Center, and Eddie Albert Community Garden.','','','','',NULL,'See current brochure or go to the website for more information on parks and programs.','','','','','934','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1106,15166,'Preschools','Urbana Early Childhood School','7686','The Urbana School District #116 Early Childhood Program provides a learning program for eligible preschool children. The Early Childhood classroom provides services for children (ages 3-5). Children attend school 2½ hours daily. Morning and afternoon sessions are available and school busses transport children to and from school.\r\n\r\nAll classes have 15 students each with one teacher and one assistant teacher forming the core teaching team. In addition, an occupational therapist, speech therapist, social worker, parent coordinator, and physical therapist work with the classroom team.','','','','',NULL,'By appointment for screening.','Children enrolled in Early Childhood Education at Urbana Early Childhood School have been identified through a screening and assessment process as needing either Special Education Services or Preschool Readiness Experience. Children enrolled at UECS who are not eligible for Special Education Services must meet the Illinois criteria for at-risk families.','','Birth certificate, proof of residency, proof of income, and immunization records.','','935','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1107,15194,'Women\'s Emergency Shelter','C-U at Austin\'s Place','7416','C-U at Austin\'s Place is an emergency overnight shelter for women. The shelter is located at 504 N. Market St. in Champaign and is staffed by trained staff. Up to 14 women can be accommodated in 7 rooms. Bedding is provide, and showers are available. There is a lounge area with a refrigerator where snacks are available. Hours are 8:30 pm to 7:30 pm., seven days/week, year round.','','https://www.cuathome.us/austins-place-womens-shelter/','jeniffer@cuatome.us',NULL,'','Early intake for first-time stays are encouraged at our Phoenix Daytime Center, 70 E. Washington St. (same location; different entrance), Tuesday-Friday noon-5 pm.','This shelter is for single women only, 18 years or older. Space is available for up to 14 women each night. Women need to be ambulatory (no physical assistance needed).',NULL,'Photo ID.',NULL,'1307452340129408,','','','','1341604895531698','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','2021-06-17 02:08:26'),(1109,15186,'Therapeutic Camps','','7695','Illini Lodge 17 sends children and adults with disabilities to winter and summer camps at Camp Timber Pointe in Normal.','','https://www.timberpointeoutdoorcenter.com/','','',NULL,'Applications for this program go directly through Timber Pointe. Call 309-365-8021 for more information.','','','','','938','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1110,15340,'Holiday Programs * Christmas Meals','','7695','FOP provides holiday baskets to be delivered shortly before Christmas. Each food basket includes a turkey for eligible clients.','','','','',NULL,'By phone.','','','','','939','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1111,1544,'Alcohol/Drug Impaired Driving Prevention * Students','','792','Illinois SADD is a peer leadership organization dedicated to preventing destructive behavior among young people, particularly underage drinking, impaired and distracted driving, teen violence, teen depression and suicide.','','http://www.ilsadd.org','','',NULL,'By phone or website.','','','','','940','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1112,16221,'Support Groups * Diabetes','','7938','Support groups for:\r\n- Diabetes.\r\n- Caregiver Support.\r\n- Breastfeeding.\r\n- Mandated Court Ordered Counseling for Substance Abuse and DUI\'s in Douglas County.','','','','',NULL,'Call for more information and to verify meeting time.','','','','','941','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1113,23528,'Support Groups * Breastfeeding Women','','7938','Support groups for:\r\n- Diabetes.\r\n- Caregiver Support.\r\n- Breastfeeding.\r\n- Mandated Court Ordered Counseling for Substance Abuse and DUI\'s in Douglas County.','','','','',NULL,'Call for more information and to verify meeting time.','','','','','942','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1114,23529,'Support Groups * Caregivers','','7938','Support groups for:\r\n- Diabetes.\r\n- Caregiver Support.\r\n- Breastfeeding.\r\n- Mandated Court Ordered Counseling for Substance Abuse and DUI\'s in Douglas County.','','','','',NULL,'Call for more information and to verify meeting time.','','','','','943','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1115,16206,'Functional Needs Registries','','7940','It is the intent of this program to offer guidance and direction to public safety workers in responding to and assisting those people with special needs or disabilities or both with whom they will have contact in the performance of their duties and responsibilities. Information provided is confidential, maintained in a database, and provided to emergency responders and public safety workers prior to contact.','','','','',NULL,'Contact local law enforcement to inquire about registering.','Persons with special needs, disabilities, or both.','','','','944','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1116,1565,'Specialized Telecommunications Equipment','','807','ITAC\'s purpose is to provide telecommunications access to people who are deaf, hard of hearing, late deafened, speech-disabled, or deaf-blind. They accomplish this by providing the Illinois Relay Service and issuing equipment that ranges from amplified telephones to Braille phones for eligible users. ITAC programs are funded by a charge on all local phone lines in Illinois. Offers the following services:\r\n1) Voucher Program - The user owns and is responsible for upkeep of the equipment. Participants in good standing are eligible for a new voucher every four years. ITAC\'s vouchered equipment includes amplified telephones and TTYs.\r\n2) Loan Program - ITAC owns and provides normal upkeep of the equipment. The Loan program covers repair and exchange services under circumstances of normal wear and tear. Any damage to equipment deemed to be “user abuse” is charged back to the user. ITAC\'s loaned equipment includes CapTel, TTY with LVD, and Braille phone.\r\n3) Illinois Relay Program - ITAC provides telecommunications relay service (TRS) in Illinois under a contract with Sprint. Illinois Relay is a free service, available 24 hours a day, seven days a week. Dial 7-1-1 to reach Illinois Relay.','','http://www.itactty.org','','',NULL,'Call for further information or see the web site for the location of \"Selection Centers\" where applicants can try out the different phones/TTY\'s to help decide what equipment will work best for them.','There are application requirements. Applicants must:\r\n- Be a legal resident of the State of Illinois.\r\n- Have working phone service in the home.\r\n- Have application signed by medical professional stating that applicant is unable to use a standard phone.','','','There are no age or income restrictions to qualify for the programs.','945','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1117,16456,'Information and Referral * Immigrants','','8081','Helps immigrants integrate into American society and prepares receiving communities to be welcoming and inclusive. This is accomplished through a combination of direct/referral services, collaborations with community partners, and strategies to connect and build cross-cultural understanding between immigrants and US-born residents. Immigrant services include:\r\n\r\n- La Línea Immigrant Helpline: Referrals to resources including healthcare, housing, immigration, legal assistance, education, employment issues, food & clothing assistance, childcare, and mental health. Also offers interpretation and translation services and limited case advocacy. \r\n\r\n- Legal Services: Offers monthly clinics for immigrants to receive free legal advice from a licensed attorney on DUIs, landlord/tenant problems, court summons, traffic tickets, DACA renewals and other legal issues. As a DOJ-recognized agency, accredited staff can provide immigration legal assistance for low-income and indigent persons.\r\n \r\n- COVID19 Immigrant Relief Fund: For those experiencing financial hardships related to the coronavirus outbreak, there may be time-sensitive monetary assistance to local immigrants for one-time expenses.','','https://docs.google.com/document/d/1Tz2Z-_HGrSmC5IMMqv8J71jQ_0Fq0WCpEODBsBTsqrs/edit','lalinea@universityymca.org','',NULL,'Services are free and confidential. For assistance in trying to connect to local resources, legal, and financial issues, call the hepline or email the office.','','','','','946','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1118,16458,'Language Interpretation','','8081','Helps immigrants integrate into American society and prepares receiving communities to be welcoming and inclusive. This is accomplished through a combination of direct/referral services, collaborations with community partners, and strategies to connect and build cross-cultural understanding between immigrants and US-born residents. Immigrant services include:\r\n\r\n- La Línea Immigrant Helpline: Referrals to resources including healthcare, housing, immigration, legal assistance, education, employment issues, food & clothing assistance, childcare, and mental health. Also offers interpretation and translation services and limited case advocacy. \r\n\r\n- Legal Services: Offers monthly clinics for immigrants to receive free legal advice from a licensed attorney on DUIs, landlord/tenant problems, court summons, traffic tickets, DACA renewals and other legal issues. As a DOJ-recognized agency, accredited staff can provide immigration legal assistance for low-income and indigent persons.\r\n \r\n- COVID19 Immigrant Relief Fund: For those experiencing financial hardships related to the coronavirus outbreak, there may be time-sensitive monetary assistance to local immigrants for one-time expenses.','','https://docs.google.com/document/d/1Tz2Z-_HGrSmC5IMMqv8J71jQ_0Fq0WCpEODBsBTsqrs/edit','lalinea@universityymca.org','',NULL,'Services are free and confidential. For assistance in trying to connect to local resources, legal, and financial issues, call the hepline or email the office.','','','','','947','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1119,31132,'Adolescent/Youth Counseling','Mental Health Services','833','Provides assessment and time-limited therapy for children, adolescents, adults, and families with problems associated with emotional and/or behavioral challenges.','','http://www.rosecrance.org','','',NULL,'By phone.','Services are available for all ages except for children under the age of 5. For children\'s services, parent/caregiver must be willing/able to attend sessions with their child.','','Proof of income and insurance card including Medicaid.','','948','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1120,31156,'Crisis Intervention','Crisis Services','833','Crisis Services provides immediate 24-hour crisis intervention by trained crisis clinicians through face-to-face mental health assessments and answering the crisis line calls. The program adheres to recovery philosophies incorporating brief therapy to stabilize the individual\'s distress and determine the appropriate level of care.','','','','',NULL,'By phone or in person.','','','Photo ID and proof of income.','','949','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1121,31131,'Case/Care Management * Chronic/Severe Mental Illness','Community Support Program','833','Provides community-based case management and community support services to adults with psychiatric disorders to improve their self-sufficiency and ability to live independently in the community. Services are based upon building on the individual\'s strengths while utilizing recovery principles to attain optimal role functioning. Specific services also include medication monitoring, counseling, representative payee services, and family education.','','','','','968511154801619','Assessment is completed by appointment at 801 N. Walnut Street, Champaign.\n\n','Must have Medicaid and meet medical necessity as determined by a full mental health evaluation.','','Photo ID, proof of income and Medicaid card.','','950','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1122,31134,'Substance Use Disorder Treatment Programs','Substance Abuse Outpatient Services','833','Various programs, from Intensive Outpatient Programs to continuing care, are offered to adolescents and adults.','','','','',NULL,'By phone.','','','','','951','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1123,31137,'Psychological Assessment','Mental Health Services','833','Provides assessment and time-limited therapy for children, adolescents, adults, and families with problems associated with emotional and/or behavioral challenges.','','','','',NULL,'By phone.','Services are available for all ages except for children under the age of 5. For children\'s services, parent/caregiver must be willing/able to attend sessions with their child.','','Proof of income and insurance card including Medicaid.','','952','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1124,31138,'General Assessment for Substance Use Disorders','Substance Abuse Outpatient Services','833','Various programs, from Intensive Outpatient Programs to continuing care, are offered to adolescents and adults.','','','','',NULL,'By phone.','','','','','953','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1125,31157,'Crisis Intervention','Crisis Services','833','Crisis Services provides immediate 24-hour crisis intervention by trained crisis clinicians through face-to-face mental health assessments and answering the crisis line calls. The program adheres to recovery philosophies incorporating brief therapy to stabilize the individual\'s distress and determine the appropriate level of care.','','','','',NULL,'By phone or in person.','','','Photo ID and proof of income.','','954','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1126,31139,'Recovery Homes/Halfway Houses','','833','Offers a continuum of evidence-based treatment for substance use disorder:\r\n- Residential treatment.\r\n- Medically monitored detoxification.\r\n- Recovery living apartments.\r\n- Alumni support, including 12-step meetings.\r\n- Recovery community alternative activities.\r\n- Outpatient counseling services.\r\n- Community engagement opportunities.','','','','',NULL,'By phone.','','','','','955','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1127,18414,'Public Defender','','8677','The Champaign County Public Defender\'s Office provides legal services for indigent persons when appointed by the Court. The Public Defender may be appointed in criminal, traffic, juvenile, abuse/neglect, mental health commitment hearings, and contempt matters.','','','','',NULL,'','','','','','956','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1128,18420,'Food Pantries','','8685','Food Pantry available the 2nd Wednesday each month, 5:00 pm - 6:30 pm.','','','','','832990803111047','Walk-in.','','','','','957','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1129,18431,'Food Pantries','','8696','Provides food and clothing to people in need. Distribution is held on the third Saturday each month from 9:00 am - 11:30 am. A second distribution for those who cannot make the Saturday time is held the Thursday following the Saturday distribution (either the 3rd or 4th Thursday depending on the month), from 6:00 pm - 7:00 pm. Emergency food is sometimes available.','','','','','832990803111047','Walk-in. With any quesitons, or for emergency food, contact numbers in order listed.','','','Photo ID, proof of income, proof of residency, Social Security card/number or medical cards for each person in household.','Up to 150% of the Federal Poverty Level.','958','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1130,18432,'Clothing','','8696','Provides food and clothing to people in need. Distribution is held on the third Saturday each month from 9:00 am - 11:30 am. A second distribution for those who cannot make the Saturday time is held the Thursday following the Saturday distribution (either the 3rd or 4th Thursday depending on the month), from 6:00 pm - 7:00 pm. Emergency food is sometimes available.','','','','',NULL,'Walk-in. With any quesitons, or for emergency food, contact numbers in order listed.','','','Photo ID, proof of income, proof of residency, Social Security card/number or medical cards for each person in household.','Up to 150% of the Federal Poverty Level.','959','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1131,18467,'Cell Phones','Lifeline Program','8715','Access Wireless provides mobile phone service to income-eligible residents as part of the government-funded Lifeline Assistance program. In order to participate, persons must meet certain eligibility requirements set by each state where the service is to be provided. These requirements are based on a person’s participation in state or federal support programs or by meeting the poverty level guidelines. By law, the Lifeline Program is only available for one phone per household.','','','','',NULL,'Apply by phone or website.','You qualify for Access Wireless in Illinois if you meet the income guidlines or participate in one of the following assistance programs:\r\n- Medical Assistance Program (Medicaid).\r\n- Food Stamps/SNAP (Supplemental Nutrition Assistance Program).\r\n- Supplemental Security Income (SSI).\r\n- Federal Public Housing Assistance (Section 8).\r\n- Veterans Pension or Survivors Benefit Programs.\r\n- Tribal Specific Programs.','','Photo ID, proof of income or assistance program participation.','135% of the federal poverty level.','960','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1133,137,'Assistive Technology Equipment Loan','','88','The IATP provides information and referral on assistive technology devices and services. Through their toll-free information and assistance line, they offer information about IATP programs, device, and vendor information. Additional services include:\r\n- Demonstration Center: Guided tours are offered of 9-room demonstration center filled with assistive devices. Showcase areas feature a kitchen, bathroom, office, and more.\r\n- Device Loan Program: Free device loans for a period of 5 weeks. There are over 1,000 devices in inventory providing potential assistive technology users the opportunity to \"try out\" equipment before a purchase.\r\n- Cash Loan Program: People with disabilities can borrow money at a low interest rate with flexible criteria and extended terms to purchase assistive technology for home or vehicle modifications.\r\n- Telework Loan Program: Provides low interest loans to people with disabilities for home-based employment. Loans can be used to purchase equipment, services, and home modifications.\r\n- AT Classifieds: Recycling program for assistive technology. On-line database provides listing of pre-owned assistive technology available for sale and donation. Also, DRS Reutilization is a web-based listing of devices that have been collected from DRS field offices and made available to VR counselors for their customers.\r\n- Evaluation: Fee for service evaluations and trainings designed to maximize independence at home, school, and/or work for any Illinois resident with a disability.\r\n- Homeownership: The Homeownership Coalition helps people with disabilities and the families they live with purchase their own homes. The Coalition serves the following counties in Illinois: Sangamon, Logan, Menard, Christian, Montgomery, and Macoupin.\r\n- Training: IATP offers training workshops at no charge. Some examples of the informational programs offered are: Getting to Know Assistive Technology, Funding for Assistive Technology and Aging and Technology - A Way to Stay Independent.','','http://www.iltech.org','IATP@iltech.org','',NULL,'Services available by phone, walk-in, appointment, or email.','IATP serves all people with disabilities regardless of age or income, family members, service providers, educators, state agencies, private industry, and other interested individuals.','','','','961','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1134,16190,'Assistive Technology Information','','88','The IATP provides information and referral on assistive technology devices and services. Through their toll-free information and assistance line, they offer information about IATP programs, device, and vendor information. Additional services include:\r\n- Demonstration Center: Guided tours are offered of 9-room demonstration center filled with assistive devices. Showcase areas feature a kitchen, bathroom, office, and more.\r\n- Device Loan Program: Free device loans for a period of 5 weeks. There are over 1,000 devices in inventory providing potential assistive technology users the opportunity to \"try out\" equipment before a purchase.\r\n- Cash Loan Program: People with disabilities can borrow money at a low interest rate with flexible criteria and extended terms to purchase assistive technology for home or vehicle modifications.\r\n- Telework Loan Program: Provides low interest loans to people with disabilities for home-based employment. Loans can be used to purchase equipment, services, and home modifications.\r\n- AT Classifieds: Recycling program for assistive technology. On-line database provides listing of pre-owned assistive technology available for sale and donation. Also, DRS Reutilization is a web-based listing of devices that have been collected from DRS field offices and made available to VR counselors for their customers.\r\n- Evaluation: Fee for service evaluations and trainings designed to maximize independence at home, school, and/or work for any Illinois resident with a disability.\r\n- Homeownership: The Homeownership Coalition helps people with disabilities and the families they live with purchase their own homes. The Coalition serves the following counties in Illinois: Sangamon, Logan, Menard, Christian, Montgomery, and Macoupin.\r\n- Training: IATP offers training workshops at no charge. Some examples of the informational programs offered are: Getting to Know Assistive Technology, Funding for Assistive Technology and Aging and Technology - A Way to Stay Independent.','','http://www.iltech.org','IATP@iltech.org','',NULL,'Services available by phone, walk-in, appointment, or email.','IATP serves all people with disabilities regardless of age or income, family members, service providers, educators, state agencies, private industry, and other interested individuals.','','','','962','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1135,19233,'Group Residences for Adults with Disabilities','Community Integrated Living Arrangements (CILA)','9006','CTF Illinois has 32 community homes and serves over 200 people residentially within our CILA program. Each of the homes are adapted and personalized to meet each resident\'s style, as well as their physical and emotional needs. Individuals will share their home with 2 to 7 peers and they will take an active role in all activities within their home.','','','','',NULL,'By phone, walk-in, or appointment.','Must have a developmental disability and need 24-hour support.','','','','963','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1136,19427,'Hospice Care','','9084','Transitions Hospice provides end-of-life care for patients whose life expectancy is 6 months or less. Services include:\r\n- Nursing care.\r\n- Social work and counseling.\r\n- Chaplain support.\r\n- Trained volunteers. \r\n- Physician support.\r\n- Palliative care evaluations.\r\n- Senior placement assistance.','','','','',NULL,'By phone.','','','','','964','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1137,19452,'General Medical Care * Migrants * Seasonal Workers','','9093','Community Health Partnership of Illinois (CHP) provides primary health care to more than 7,000 Latino migrant and seasonal farmworkers. CHP provides medical care through a network of contracted physicians and practitioners. CHP contracts with local pharmacies and hospitals for prescription medicines and diagnostic services. The five health clinics programs provided by CHP are:\r\n- Primary health care.\r\n- Oral health care.\r\n- Cancer prevention and reproductive health.\r\n- Agriculture health and safety.\r\n- HIV prevention.\r\n- Community outreach and health promotion.','','','','',NULL,'Call for more information.','Serves migrant farmworkers and their families.','','','','965','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1138,23886,'Dental Care * Migrants * Seasonal Workers','','9093','Offers comprehensive dental care.','','','','',NULL,'By phone.','Farmworkers and their families.','','','','966','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1139,19506,'Home Health Care','','9122','Presence Home Care provides the following home health services:\r\n- Anodyne Therapy.\r\n- Home Health Aides.\r\n- Infusion Therapy.\r\n- Medical Social Services.\r\n- Physical, Occupational, and Speech Therapy.\r\n- Skilled nursing care services for cardiac conditions, COPD, diabetes, pain management, and wound care.\r\n- Disease Management Programs, which include Heart Failure, Respiratory, Stroke and Diabetes.','','','','','941516382466411','By phone.','','','','','967','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1140,19508,'Hospice Care','','9122','Presence Hospice provides family centered end-of-life care that focuses on comfort and support to patients and their families.  The hospice team brings specialized care to the home, nursing home, assisted living facility, or in the hospital. The Transitions Program provides support to individuals and their families during the last year of life, including emotional support and respite care. Presence Hospice also provides bereavement support.','','','','',NULL,'Call for more information.','','','','','968','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1141,19509,'Bereavement Counseling','','9122','Presence Hospice provides family centered end-of-life care that focuses on comfort and support to patients and their families.  The hospice team brings specialized care to the home, nursing home, assisted living facility, or in the hospital. The Transitions Program provides support to individuals and their families during the last year of life, including emotional support and respite care. Presence Hospice also provides bereavement support.','','','','',NULL,'Call for more information.','','','','','969','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1142,19632,'Landlord/Tenant Assistance','Tenants in Foreclosure Intervention Project (TFIP)','9160','- TFIP serves to inform tenants about their rights to remain in their rental property after the landlord\'s ownership is foreclosed.\r\n- Offers a free helpline that renters can call to learn the status of their building and discuss their options.','','','','',NULL,'By phone, website.','Those in rental units impacted by foreclosure.','','','','970','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1143,20363,'Homeless Permanent Supportive Housing * Veterans','General Wayne A. Downing Home for Veterans','9356','The Goodwill General Wayne A. Downing Home for Veterans provides permanent supportive housing to male veterans. Goodwill provides and coordinates all services including treatment for post-traumatic stress syndrome, substance abuse, stress, anxiety and psychological counseling, budgeting, clothing, legal assistance, food, telephones, transportation, entitlement benefits, medical care, job training, education, and job placement services.','','','','','929094559121639','Call 309-676-5541 for more information.','Male veterans over 18 years of age who have received an honorable discharge from U.S. military service, have a diagnosed disability, and are at risk of being homeless.','','','','971','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1144,13,'Better Business Bureaus','','936','The BBB is a private, non-profit organization that provides services and programs to assist consumers and businesses. The focus of a Bureau\'s activities is on marketplace concerns, such as honest advertising and selling practices. Most BBB services are provided without charge to the public, including:\r\n1) Provides information about a company, particularly whether or not there are unanswered or unsettled complaints, or other problems.\r\n2) Provides information about charities and other organizations that are seeking donations.\r\n3) Helps resolve a buyer/seller complaint against a company, including mediation and arbitration services in many instances.\r\n4) Disseminates accurate consumer information so wise buying decisions can be made.','','http://www.bbb.org/central-illinois','','',NULL,'BBB offers its national and local consumer services online, by phone, and in person.','','','','','972','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1145,20077,'Recordings for the Blind and Dyslexic','Illinois Radio Reader','9368','Illinois Radio Reader is a reading service for the reading disabled. IRR broadcasts daily readings of local newspapers, magazines, books and other periodicals, 24/7/365, \r\n\r\nReception of the programming is provided through a special receiver that is free or on-line. Local volunteers provide the reading services and are always welcome to inquire about openings. The recording venue is totally accessible.','','http://www.will.illinois.edu/illinoisradioreader','spegal@illinois.edu','',NULL,'By phone or email.','For anyone who needs this type of service.','','Verification of vision impairment.','','973','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1146,20081,'Volunteer Opportunities','Illinois Radio Reader','9368','Illinois Radio Reader is a reading service for the reading disabled. IRR broadcasts daily readings of local newspapers, magazines, books and other periodicals, 24/7/365, \r\n\r\nReception of the programming is provided through a special receiver that is free or on-line. Local volunteers provide the reading services and are always welcome to inquire about openings. The recording venue is totally accessible.','','http://www.will.illinois.edu/illinoisradioreader','spegal@illinois.edu','',NULL,'By phone or email.','For anyone who needs this type of service.','','Verification of vision impairment.','','974','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1147,20111,'Computer Distribution Programs','','9394','COVID-19:\r\n2 Months of Free High-Speed Internet from Comcast.\r\n\r\nInternet Essentials from Comcast brings you affordable, high-speed Internet. We want to make it easier for low-income households to get connected so they can more easily work from home, access educational resources, and stay in contact with friends and family. You may be eligible for 2 months of free Internet Essentials service. Available for new Internet Essentials customers only. Apply by June 30, 2020.\r\n---------------------------------------------\r\n\r\nComcast Internet Essentials offers reduced-cost Internet service to certain vulnerable individuals.The monthly price applies to a single outlet and basic modem.\r\n\r\nParticipants have the option to purchase an Internet ready computer for the reduced price of $149.99 + tax. All computers come with the software and hardware needed to get connected to the Internet.','','','','',NULL,'Apply online or call to request an application. Comcast will mail or email an application if requested.','To enroll, applicants must:\r\n- Have at least one child eligible to participate in the National School Lunch Program. OR\r\n- Receive HUD housing assistance. OR\r\n- Be enrolled in an eligible 2-year Community College AND receive a Pell Grant.\r\n--Currently Danville and Galesburg have coverage within 2-1-1 service area.\r\n- Be located where Comcast offers Internet service.\r\n- Have not subscribed to Comcast Internet service within the last 90 days.\r\n- Do not have outstanding Comcast debt.','','','','975','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1148,31867,'Internet Service Payment Assistance * COVID-19','','9394','COVID-19:\r\n2 Months of Free High-Speed Internet from Comcast.\r\n\r\nInternet Essentials from Comcast brings you affordable, high-speed Internet. We want to make it easier for low-income households to get connected so they can more easily work from home, access educational resources, and stay in contact with friends and family. You may be eligible for 2 months of free Internet Essentials service. Available for new Internet Essentials customers only. Apply by June 30, 2020.\r\n---------------------------------------------\r\n\r\nComcast Internet Essentials offers reduced-cost Internet service to certain vulnerable individuals.The monthly price applies to a single outlet and basic modem.\r\n\r\nParticipants have the option to purchase an Internet ready computer for the reduced price of $149.99 + tax. All computers come with the software and hardware needed to get connected to the Internet.','','','','',NULL,'Apply online or call to request an application. Comcast will mail or email an application if requested.','To enroll, applicants must:\r\n- Have at least one child eligible to participate in the National School Lunch Program. OR\r\n- Receive HUD housing assistance. OR\r\n- Be enrolled in an eligible 2-year Community College AND receive a Pell Grant.\r\n--Currently Danville and Galesburg have coverage within 2-1-1 service area.\r\n- Be located where Comcast offers Internet service.\r\n- Have not subscribed to Comcast Internet service within the last 90 days.\r\n- Do not have outstanding Comcast debt.','','','','976','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1149,506,'Pediatrics * Specialized Treatment and Prevention','','949','UIC - DSCC offers care coordination, benefits management, and financial assistance when eligible for the diagnosis and treatment of children from birth to age 21 with eligible special health care needs. Special health care needs include chronic disabling conditions such as heart defects, orthopedic conditions, cerebral palsy, hearing impairments, neurological disorders, urinary system problems, some eye impairments, certain inborn errors of metabolism, hemophilia, cystic fibrosis, and some craniofacial conditions such as cleft lip/palate.','','http://dscc.uic.edu','','',NULL,'Accepted from anyone with parental permission or from parents themselves.','DSCC serves Illinois children up to age 21 who have, or are suspected of having a chronic condition in one of the following categories: blood disorders, cardiovascular impairments, craniofacial & external body impairments, eye impairments, gastrointestinal impairments, hearing impairments, inborn errors of metabolism, nervous system impairments, orthopedic impairments, pulmonary impairments and urogenital impairments.','','Application is available online and specifies what documentation is needed. If financial assistance is needed/requested, proof of income is required.','If requesting financial assistance, families must be at or below 325% of federal poverty limit.','977','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1150,24520,'Hospice Care','','9497','Harbor Light Hospice provides services to terminally ill patients and their families. With a focus on comfort rather than curative care, Harbor Light Hospice emphasizes relief of physical symptoms and emotional support. Care provided includes:\r\n- Pain and symptom control.\r\n- Spiritual support as needed.\r\n- Bereavement support for families and friends.\r\n- Emotional support.\r\n- 24 hour on call, 7 days a week availability.','','','','',NULL,'Call for more information.','','','','','978','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1152,23148,'Activities of Daily Living Assessment','Community Care Program (CCU)','977','The Community Care Program (CCP) is designed to prevent or delay nursing home placement by linking older persons to services and assistance within the community. In-home, community-based support services include:\r\n- Case Management.\r\n- Home Care Aides provide assistance with household tasks, including cleaning, laundry, meal preparation, escort, errands, and shopping.\r\n- Chore assistance and personal care tasks such as dressing, bathing, and grooming. They also assist clients by teaching them how to plan meals and follow special diets. \r\n- Aides remind clients to take medication and, when necessary, act as a personal escort. \r\n- Adult Day Services provide respite to family members or other caregivers who might otherwise be unable to handle the burden of care by providing care and supervision for clients in a group setting outside the home. Day Service staff is allowed to dispense medication and complete some medical tasks.','','','','',NULL,'By phone.','Individuals age 60 and older.','','','','979','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1153,1710,'Comprehensive Job Assistance Centers * Migrants * Seasonal Workers','','98','IMC provides a wide range of employment and training services for Illinois’ farmworkers through the National Farmworker Jobs Program (NFJP). The NFJP provides supportive services to help economically disadvantaged farmworker families while they are working in agriculture and offers employment and training services to assist enrolled farmworkers to acquire new occupational skills that lead to stable jobs.','','','','','970915508638448','By phone, walk-in, appointment, or referral.','','','Applicants must have Photo ID, Birth Certificate, Social Security cards, proof of income, and marriage certificate (if applicable). Also must have work authorization documents and, if male born after 1/1/1960, must meet Selective Service Registration requirements. Call for more information.','100% of federal poverty level.','980','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1155,13919,'Veteran Benefits Assistance','','985','Veteran Service Officers, or VSOs, are fellow veterans and experts on federal, state, and local veteran resources. These VSOs provide free assistance to veterans and their dependents and survivors. They help to apply for federal and state benefits as well as provide resources related to the following: \r\n- Compensation and pension.\r\n- Health care.\r\n- Education and training.\r\n- Employment.\r\n- Burial and survivor.\r\n- Housing.\r\n- Permits.\r\n- Transportation.\r\n- Military records.','','','','',NULL,'By phone or walk-in.','','','DD214 discharge papers and/or service and medical papers in some cases.','','981','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1156,21673,'Food Pantries','','9949','Food pantry is available.','','','','','832990803111047','Walk-in during distribution hours.','Resident of area served. Those seeking food who reside outside the pantry\'s service area will be given food one time, but then will be directed to their local pantries.','','Photo ID to show residency within service area.','','982','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1157,21695,'Food Banks/Food Distribution Warehouses','','9959','EIF exists to alleviate hunger in eastern Illinois by providing a reliable source of food for the hungry through cooperation with a network of food pantries and agencies. The Foodbank accepts donated and discounted food from a variety of sources and distributes it to 220 emergency food programs, such as food pantries, soup kitchens and shelters.','','http://www.eifoodbank.org','','','832990803111047','By phone.','Distributes to agencies only, not individuals.','','','','983','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1158,21696,'Mobile Markets','FoodMobile','9959','A foodmobile is a one-time, free food distribution for low-income individuals, families, and seniors living in counties where there is a need for additional pantry service. Must bring sturdy boxes, carts/wagons or bags to carry food home in.\r\n\r\nLocations are updated frequently and on the website, http://www.eifoodbank.org/help/mobile.html.','','http://www.eifoodbank.org/help/mobile.html','','',NULL,'Walk-in during scheduled distribution times.','Foodmobile does not ask for personal identification of any kind. You must self-attest to meeting the income guidelines by signature at the giveaway. Maximum monthly income for a household of 4 is $3,970.','','Foodmobile volunteers do not ask for personal identification of any kind. Individuals must self-attest to meeting the income guidelines by signature at the giveaway.','','984','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1159,21697,'Directory/Resource List Publication * Food Pantries','','9959','EIF exists to alleviate hunger in eastern Illinois by providing a reliable source of food for the hungry through cooperation with a network of food pantries and agencies. The Foodbank accepts donated and discounted food from a variety of sources and distributes it to 220 emergency food programs, such as food pantries, soup kitchens and shelters.','','','','','878986697513222','By phone.','Distributes to agencies only, not individuals.','','','','985','','','','','','','',NULL,NULL,NULL,NULL,NULL,NULL,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(1168,32001,'Vocational (Work) Options',NULL,'10396','Provides employment counseling, financial literacy, and job coaching services to individuals with an identified disability. Strengths-based and individualized to the interests and preferences of participants. Provides assistance in all aspects of employment; from learning soft skills, to applying for jobs and interviewing. Once hired, provides job-coaching services in coordination with their employer. Provides a variety of skills training certifications at no cost while enrolled in our program.','',NULL,'cch@cunninghamhome.org','Verified','',NULL,NULL,NULL,NULL,NULL,'1354,','','','','10397',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-07 23:28:47','2021-04-07 23:28:47'),(1173,32002,'information and referral * directory * human crisis','Champaign County Resources','14014','Champaign County Resources provides information about human services and service providers. Provides tools for increasing access to information (multilingual and smartphone friendly), fostering accountability of service’s information, and open presence of communities of users. This service is a research collaboration between Champaign County (Illinois) Mental Health Board (CCMHB) and Developmental Disabilities Board (CCDDB), Community Data Clinic at iSchool and NCSA, Cunningham Township Supervisor’s Office, PATH Crisis Center 2-1-1, United Way of Champaign County.','1','https://champaigncountyresources.communitydataclinic.com','ChampaignCountyResources@gmail.com','Verified','789038541797078','Email t